INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(212669, 'koKR', '친구여, 음... 몹시 지쳐 보이는군요. 혹시 제가 도와드릴 일이 있을까요?', '친구여, 음... 몹시 지쳐 보이는군요. 혹시 제가 도와드릴 일이 있을까요?', 39653),
(212629, 'koKR', '당신에겐 이게 더 적합할 것 같군요.', '', 39653),
(212622, 'koKR', '제가 기꺼이 적절한 대체 용품을 제공해 드리죠. 보답으로 제 작은 부탁 하나만 들어주시면 됩니다.', '', 39653),
(212620, 'koKR', '세상에, 그 신분증은 대체 어디서 구하셨죠?\n\n이런 말씀 드리기 조금 뭣하지만, 사기를 당하신 것 같군요, 친구여.', '', 39653),
(212619, 'koKR', '안녕하세요, 친구여. 제 도움이 필요하신가요?', '', 39653),
(212617, 'koKR', '', '정말 다행히도, 힘이 안정된 것 같습니다.\n\n<무슨 말을 할지 결정하는 것처럼 잠시 당신을 살피는 샨드리스>\n\n감사합니다, $r.', 39653),
(212607, 'koKR', '', '키리안의 미래는 우리 모두의 손에 달려있습니다. 새로운 헌신의 사원으로, 누구나 자신의 여정에 대해 발언할 수 있는 새로운 길을 만들기 위해 노력할 것입니다.', 39653),
(212606, 'koKR', '이탈자와 키리안이 다시 진정한 화합의 길을 걸을 수 있도록 제 모든 것을 바쳐 돕겠습니다.', '', 39653),
(212600, 'koKR', '보안 인가는, 크흠, 받으셨지 않나요. 뭘 우물쭈물하고 계십니까?', '', 39653),
(212596, 'koKR', '아주 좋습니다! 지금의 변장을... 바꾸어 드리죠. 아마 누군가는 속여넘길 수 있을 겁니다.', '', 39653),
(212594, 'koKR', '필멸자가 타자베쉬에? 별일이 다 있군요...\n\n전 페타지드입니다. 페 중개단은 현상금 사냥으로 유명하죠. 전 그중에서도 최고로 통하고요.\n\n최근 취득한 물품을 이곳으로 보냈는데, 조 중개단 말로는 세관에 묶여 있다더군요. 분명 갈취하려는 속셈입니다. 어쩌면 우리가 서로 도울 수 있을 것 같군요.\n\n미리 경고드리는데, 쉬운 일은 아닐 겁니다.', '', 39653),
(212592, 'koKR', '타자베쉬에 오신 것을 환영합니다, 여행자여. 미지의 시장에 입장을 원하시는 분들은 모두 보안 검색을 통과해야 합니다.', '', 39653),
(212591, 'koKR', '간수의 성소에 공격을 강행해야만 한다.', '', 39653),
(212589, 'koKR', '나는 이제 치유의 길에 올랐다네. 이 사후의 삶을 받을 자격이 있는 과거를 살았지. 과거로부터 얻은 교훈을 최대한 많이 새기어 나아가겠네.', '', 39653),
(212586, 'koKR', '', '준비되면 얘기하도록. 엘리시안 요새까지 데려다 주겠다.', 39653),
(212580, 'koKR', '', '시카는 일이 좋아요. 정리, 일정 조율, 자원 재고 점검까지... 전체적으로 잘 흘러가게 하는 거죠!\n\n친구들은 \"시카는 너무 바빠서 탈이야\"라고 하지만, 시카는 항상 괜찮다고, 너무 좋다고 답하곤 했어요!\n\n근데 이젠 알 것 같아요. 친구들이 시카를 레벤드레스에서 열리는 연회에 보내줬거든요! 그리고 코르시아에서 만난 말드락시 친구가 휴식의 중요성을 알려줬죠.\n\n옛날의 시카는 너무 도맡으려고만 했어요. 이젠 맡기는 법을 배우고 있답니다! 친구들의 도움을 받고, 다른 청지기들에게 시카처럼 일하는 법을 알려줄 거예요! 그럼 우리 모두 쉴 수 있겠죠. 일보단 삶이 더 중요한 법이니까요!', 39653),
(212579, 'koKR', '', '대장간에서 숨 돌릴 틈이 없을 정도예요! 코르시아로 진격하면서 일감이 넘쳐나게 됐답니다. 그곳에서 활약하는 키리안들에게 장비를 챙겨줘야 하니까요.\n\n게다가 이탈자가 됐던 열망자들의 귀환도 준비해야 할뿐더러, 길에서 치르게 될 새로운 시련에 필요한 용품들도 만들어야 합니다.\n\n당연한 얘기지만 일감이 많아지면 더 혼란스러워지기 마련이죠. 그래도 청지기와 열망자들이 힘닿는 데까지 도와주곤 있지만요. 어쩌면 새로운 열망자들이 다시 한번 쏟아져 들어오는 날이 올지도 모르겠습니다... 뭐, 할 일은 지금도 차고 넘치지만 말이에요.', 39653),
(212577, 'koKR', '제가 타락할 때 나락 방랑자님도 계셨던 걸로 기억합니다.\n\n당신의 잘못도, 우서의 잘못도, 하물며 에리디아의 잘못도 아닙니다. 사실 제 잘못도 아니지요.\n\n자고로 영원한 길은 있을 수 없습니다. 순전히 전통이라는 이유로, 지금까지 항상 이래왔다는 핑계로 어느 한 방식을 고집하는 존재들은 너무나 흔합니다. 전임자들이 왜 처음에 그렇게 행동했는지 이유를 알아보려는 마음은 눈곱만큼도 없죠.\n\n전 제가 정당하다는 생각에 행동했습니다. 그런데 진실을 깨닫고 동료들이 나락살이로 뒤틀리는 모습을 보면서 어떤 공포를 느꼈을지 한번 상상해 보세요. 당신 덕택에 최대한 사람을 구할 수 있었지만, 여기 도착해서는 아무것도 변하지 않은 줄 알았습니다.\n\n친구분들과 함께 노력해 주셔서 감사합니다. 아직 갈 길이 멀지만, 헌신의 사도로서 최대한 힘을 보태겠습니다.', '', 39653),
(212574, 'koKR', '저는 제 영혼결속자가 자랑스럽습니다. 높은 지위에 올라 아드레스테스 님을 도와 키리안의 새로운 시대를 여는 역할을 맡았잖습니까. 대의를 향한 헌신이 인물의 형상을 갖춘다면 그게 바로 클레이아일 거예요.\n\n전 필요한 곳에 도움을 줄 생각입니다. 새로 건립되는 사원에 처음으로 귀의해서 헌신의 수행사제가 될 겁니다. 잘하면 니콜론과 함께 이탈자와 키리안의 대화를 앞당겨 완전한 통합을 이뤄내는 데 일조할 수도 있겠죠.\n\n제 이야기가 끝나려면 아직은 한참 먼 것 같은 기분이 듭니다. 길이 어디로 이끌어줄지 기대되네요.', '', 39653),
(212573, 'koKR', '솔직히 말씀드리자면 제가 어쩌다 이 중대한 순간의 일부가 되었는지 잘 모르겠습니다. 일개 열망자에 지나지 않는걸요! 정화와 시련을 극복하지 못해 끙끙대고 있는 건 여전해서 승천은 아직도 먼 이야기일 뿐이죠.\n\n첫 영혼결속자가 승천해버려 모든 교류가 끊어진 상태였던 클레이아에게 도움의 손길을 내민 것도 꽤 오래전의 일이랍니다. 정신을 차려보니 서로 가까워져 영혼결속을 맺고, 어떤 시련이든 함께 임하는 사이가 되어 있었죠! 우리가 어떤 일을 마주하고 또 무슨 파장을 일으킬지 누군들 알기나 했을까요?\n\n그동안 정말 영광이었습니다, $n 님.', '', 39653),
(212572, 'koKR', '', '제 영혼을 나락에서 불러오셨지요. 모두가 레벤드레스는 제가 있을 곳이 아니라고 하지만, 지금은 떠날 수 없습니다.\n\n저는 집정관님이 깨어나시거나 다른 심판이 내려질 때까지 기다려야만 합니다. 그래서 지금은 기다리며 힘이 닿는 대로 도와드리려 합니다. \n\n나락은 어둠 그 자체였지만, 제게 이젠 희망이 있어요. 감사합니다.', 39653),
(212571, 'koKR', '미지의 것을 대비할 수는 없지. 우리는 변화에 받아들일 준비를 하고, 서로가 받아들일 수 있도록 도와야만 한다. 주위에 있는 사람들을 믿는다면, 우리가 감당할 수 없는 미래는 없을 거다.', '', 39653),
(212570, 'koKR', '', '우리는 전례없는 일을 마주하고 있습니다. 우리가 이 변화를 이끌 준비가 되었다고 생각하시나요?', 39653),
(212569, 'koKR', '먼 옛날, 나는 열망자에서 출발해 충성의 사도에 올랐다. 그 이후로 억겁의 세월 동안 감시자로서 집정관님을 섬겼고, 자리에 계시지 않을 땐 그분의 목소리로서 역할을 다했다.\n\n그 긴 시간 동안 승천의 보루는 변하지 않았지.\n\n과거에는 길을 걷는 키리안이 난관에 봉착하면 사원으로 보내 더 훈련에 정진하게 하거나 심판관께 보내 다른 사후 세계에서 다시 살아가게 하곤 했다. 이탈자는 초창기만 해도 이상한 점이 없었어. 그런데 어느 순간 날개가 어둠에 물들더니 세가 불어나더구나.\n\n너와 네 친구들 덕분에 우리의 맹목적인 방식이 잘못됐다는 걸 알 수 있었다. 한발 더 나아가 연민을 되찾고 새로운 길을 개척하는 단초를 제공해 줬지.\n\n이제 난 이 새로운 길을 이끌며, 힘을 모아 보다 강인하고 건전한 승천의 보루를 이룩할 것이다.', '', 39653),
(212568, 'koKR', '', '처음 말드락서스에 왔을 땐 우울함의 연속이었습니다. 키리안 동포가 고문당하는 광경을 지켜봐야 했으며, 탈레스가 눈을 잃는 것도 봐야 했습니다. 피조물의 의회에서 무슨 목적으로 절 살려뒀는지는 모르겠지만, 굳이 알고 싶지도 않습니다.\n\n그렇게 하루하루 전 망가져 갔습니다. 탈레스, 청지기들과 대화를 나누고 원군이 나타나길 기도하면서 한 줌의 위안을 얻곤 했지요. 나락 방랑자님이 나타나 구해주셨을 땐 사실상 포기한 상태였습니다. 이 감사한 마음은 영원히 잊지 않겠습니다.\n\n선택받은 자의 의회는 자신들이 다르다는 걸 증명해 보였습니다. 관용을 엿볼 수 있었지요. 우리의 하얀 날개가 참전하고, 연인과 해후를 나눈 후에도 이곳에 남아 우리를 포용해준 이들을 도와야겠다는 생각이 들었습니다. \n\n한데 그런 그들도 이젠 다시 정상 궤도에 올랐으니 이렇게 돌아온 것이죠. 귀향해서 기쁠 따름입니다.', 39653),
(212567, 'koKR', '열망자 시절, 아르테메데와 나는 빠르게 남매나 다름없는 유대를 맺었다. 우리의 영혼결속은 명백한 운명이었고 함께할 때면 늘 강력한 힘을 발휘했지.\n\n그러다 누이와 떨어져 지내게 되었고, 킨시아가 내 마음을 사로잡았다. 몰래 빠져나가 같이 령의 흐름을 보며 감상에 젖거나 서로의 품에서 아늑한 순간을 보냈지.\n\n그녀가 자취를 감추면서 혹시 최악의 사태가 일어난 건 아닌가 두려움에 떨었다. 그때 아르테메데가 나서서 킨시아와 그녀의 힘을 믿으라고 다독여줬지. 말드락서스 임무에서 재회한 순간... 우린 단걸음에 달려가 서로를 껴안았다. 그리고 등을 맞대고 전투의 현장에 뛰어들었지.', '', 39653),
(212565, 'koKR', '당신이 키리안으로부터 많은 가르침을 얻었듯, 키리안 역시 당신에게서 많은 가르침을 얻었습니다.\n\n승천의 길에서 당신에게 여러 번 패배하면서 저도 배울 수 있었습니다. 교훈을 가슴에 새기고 길을 걸으시길.', '', 39653),
(212561, 'koKR', '', '준비되셨습니까, 나락 방랑자님? 신중하고 빠르게 움직여야 합니다.', 39653),
(212560, 'koKR', '', '여섯 번째 나무의 꼭대기에는 햇빛을 피해 숨은 불꽃이 잠자고 있노라.', 39653),
(212559, 'koKR', '', '희망. 배신. 희생. 겉모습은 바뀌지만, 이야기는 바뀌지 않는다.', 39653),
(212558, 'koKR', '', '일곱 번째는 여섯 번째가 애지중지하는 물건을 탐하노라. 버팀목은 흔들리고, 만물은 소멸하리라.', 39653),
(212557, 'koKR', '', '목소리가 몇 개나 들려? 그중에 진짜는 몇 가지나 될까?', 39653),
(212556, 'koKR', '', '비밀의 도시. 거짓의 역사.', 39653),
(212552, 'koKR', '내가 가진 힘으로 몽환숲을 돕는 일이라면 언제나 환영일세. 밤 전사를 찾아 나서는 일은 정말 멋진 도전이었다네!\n\n이제 티란데의 일이 마무리되었으니, 그다음 사냥이 기대되는군. 야생 사냥단에게 간수를 추적하라는 명령이 있어도 놀랍지는 않을 테지만 말일세. 간수는 우리 여왕님을 해치고 어둠땅을 위협했다네. 우리 모두 그자의 파멸을 고대하고 있지.', '', 39653),
(212550, 'koKR', '자네를 만나 반가웠다네, $n. 세나리우스의 축복이 끝까지 함께하여 기쁘고, 우리 동포가 어둠땅을 도우러 왔다니 정말 자랑스럽군.\n\n내 이야기는 익히 들어 알고 있겠지만, 그건 모두 내 필멸의 삶에서의 이야기라네. 그 이후로도 많은 모험이 있었지!\n\n<웃음을 터뜨리는 훌른>\n\n늙은 모험가를 즐겁게 해주지 않겠나, 젊은 모험가여? 자네의 모험에 대해 이야기해주게!', '', 39653),
(212547, 'koKR', '제자여, 우린 함께 위대한 것을 만들 것이오. 어둠땅이 지금까지 보지 못한, 아주 기가 막힌 작품과 개선을 말이오! ', '', 39653),
(212546, 'koKR', '', '저는 여왕님의 뜻이라면 어디든 간답니다. 여왕님의 숙적, 간수가 아직 모두에게 고통을 안겨주고 있어요. 제가 간수에게 말썽을 일으킬 수 없는 상황이라면, 당신이 대신 일으켜 주리라 믿어 의심치 않아요! \n\n<미소짓는 문베리>\n\n저는 당신이 나타났을 때부터 특별하다는 걸 알았어요, $n 님. 하지만 제가 예상했던 것보다 더 많은 일을 해내셨다는 말씀을 꼭 드려야겠어요! 깜짝 놀랐지만, 정말 마음에 쏙 드는 반전이군요!\n\n그동안 우리를 위해 해주신 모든 일과, 앞으로 해주실 모든 일에 감사해요. 언젠간 저도 이 은혜에 보답할 수 있기를.', 39653),
(212545, 'koKR', '<기대감으로 가득 찬 히포코스의 눈빛에서 결의가 전해집니다. 가까이 다가가자 히포코스가 미소를 짓더니 기쁨이 담긴 콧노래를 흥얼거립니다.>', '', 39653),
(212544, 'koKR', '이 승천의 보루에서 가늠이 안 될 만큼 오랜 시간을 일했다오. 승천의 보루를 지키겠다는 일념 아래 셀 수 없이 많은 발전과 혁신을 창안했고, 전부 원활하게 돌아가도록 만들었지! 하지만 천하의 수석 제련장인이라도 발상의 우물이 바닥을 드러낼 때도 있다오.\n\n코르시아에서 보낸 시간은 굉장했소! 같은 장인들을 만나 공동의 목표를 위해 협업했으니 말이오. 온갖 경이로운 작품을 만든 것도 모자라 가고일을 복원하기도 했지! 많은 걸 배운 것도 모자라 영감이 넘쳐날 지경이오.\n\n앞으로도 계속 협업에 힘쓸 작정이오! 그리고 히포코스를 새 도제로 들였다오. 말드락서스에서의 경험과 공예를 향한 열정을 버무리면 분명 걸작을 만들어낼 테지... 물론 내 도움을 받아야겠지만.\n\n게다가 히포코스는 말을 참 잘 들어준다오. 떠들기 좋아하는 나랑 잘 맞지.', '', 39653),
(212539, 'koKR', '희한하게도... 좋은 기분이 들었습니다.\n\n그분의 존재감 속에서 늘상 느꼈던 평화를, 어둠의 신에게 맞설 때 베풀어 주셨던 잔잔한 차분함을 다시 한번 떠올릴 수 있었습니다. 처절하기 이를 데 없던 최후의 전투에서 다른 용사들과 어깨를 나란히 하고, 엘룬의 힘으로 동료를 치유하면서 어둠의 하수인들을 말살하던 기억이 수면 위로 떠올랐지요. 저 하늘의 별들은 제 부름에 응했고, 동포의 목숨을 수없이도 앗아간 악을 불태워버리는 그분의 힘은 참으로 아름다웠습니다. 엘룬의 빛으로 세계를 정화할 때면 암울한 만족감을 느끼곤 했죠.\n\n무엇보다... 절 향한 그분의 사랑과, 어둠의 힘을 달라는 제 요구에 그분이 느꼈던 씁쓸한 슬픔을 돌아볼 수 있었습니다.\n\n제가 이곳에 와서 치유될 거란 걸 아셨나 봅니다.\n\n고맙습니다, $n. 덕분에 끝맺음을 할 수 있었습니다.', '', 39653),
(212535, 'koKR', '', '확답하기 어렵구나, $n.\n\n예전의 나는 꿈에만 결속되어 있었다. 지금은 완전히 이해하지 못하는 힘에 의해 이 영역에도 연결되어 있지.\n\n겨울 여왕은 날 구하기 위해 자신의 정수를 내어주었다. 내 최선을 다해 그 사려에 보답할 것이야. 하나 언제쯤 아제로스에 있는 가족의 품으로 돌아갈 수 있을지 의문이 피어오르는 것은 어쩔 수 없구나... 그런 상봉이 실제로 가능하다는 전제하에 말이다.\n\n<당신에게 미소를 지어 보이는 이세라>\n\n그래도 네 덕분에 희망을 얻었다. 몽환숲을 복원하고, 분노에 삼켜질 뻔했던 내 소중한 티란데를 구원할 수 있었던 건 모두 네 공로나 다름없단다.\n\n어떤 미래가 다가올지는 불분명하다. 하물며 간수는 우리에게 소중한 모든 것을 위협하고 있지. 그러나 어떤 위기가 닥치든, 네가 용감하게 맞설 거라는 걸 안다.', 39653),
(212523, 'koKR', '', '겨울 여왕 폐하와 자매분 같은 오랜 존재들의 의중을 이해하려고 애쓸 생각은 없어. 다만, 길고 고통스러운 세월을 보냈을 거란 점은 분명하지.\n\n여왕 폐하는 강인한 분이시니 분명 필요한 것을 찾아내고 마실 거다.\n\n티란데를 구했지만 균형은 여전히 어긋난 상태 그대로야. 지킬 수 있는 것들을 구해내려면 계속 싸워야 해.\n\n그게 우리의 맹세다.', 39653),
(212522, 'koKR', '겨울 여왕님과 다른 사람들이 티란데를 구하지 못할 거란 의심은 한순간도 안 했어요.\n\n티르낙스를 비롯한 밤 전사들은 생전에도 많은 걸 내어주었는데, 이곳에 와서도 정말 많은 걸 베풀어 주는군요. 어둠땅 어디에서 활동하느냐에 상관없이 말이에요.\n\n저들의 용기에 감명받았어요!', '', 39653),
(212520, 'koKR', '', '그 어마어마한 힘이 폭주를 일으켰으니 그분을 구하는 건 불가능할 줄 알았어요! 게다가 겨울 여왕님의 그런 모습은... 생전 처음 봐요!\n\n그래도 정말 오래간만에 우리 모두 진정한 희망을 품을 수 있게 됐네요. 몽환숲을 위한 희망을 말이죠.\n\n아라론... 데라윈, 코렌스가... 살아서 이 순간을 봤더라면 얼마나 좋았을까요.', 39653),
(212516, 'koKR', '나락 방랑자님이 도와주셔서 몽환숲의 수많은 영혼을 지킬 수 있었어요. 계속 아름다운 꿈을 꾸겠지요.', '', 39653),
(212515, 'koKR', '', '우린 상실을 견뎌냈고, 단결을 이뤄내 그 어느 때보다 강해졌어.', 39653),
(212514, 'koKR', '', '전 야생 사냥단의 일원으로 싸우면서 숲의 모든 이를 지켜낼 거예요. \n\n언젠가 몽환숲이 완전히 회복되는 날이 오면 좋겠어요.', 39653),
(212513, 'koKR', '난 사슬로 구속되어 있었네. 끝없는 고통에 시달리고 또 시달렸지.\n\n그러던 중 어떤 아제로스의 용사에게 도움을 받아 가까스로 탈출한 게야.\n\n그 저주받은 장소는... 존재 자체가 고문일세. 그토록 짙은 고독함과 절망을 느껴보긴 처음이었어.', '', 39653),
(212512, 'koKR', '', '간수의 하수인들이 제 인지력을 엉망으로 만들었습니다. 아군과 적을 구분하기란 불가능에 가까웠죠.\n\n다른 나락 방랑자가 나타나 어둠의 탑에서 탈출할 수 있도록 도와줬으니 다행일 망정입니다. \n\n이젠 안두인을 더 끔찍한 운명에서 구해야 해요.', 39653),
(212489, 'koKR', '참으로 오래간만에 말드락서스의 살아 움직이는 전경을 눈에 담는구나. 주민들은 혼돈에 빠져 있지만 땅은 예전 모습을 고스란히 간직하고 있군.', '', 39653),
(212476, 'koKR', '암호는?', '', 39653),
(212447, 'koKR', '', '순수의 손으로서 나는 봉사하는 삶을 살았다. 열망자들이 과거의 삶을 정화하고 기억을 놓아줄 수 있도록 이끌어 주었지.\n\n이젠 그것도 옛말이지만 말이다.\n\n이제는 그 어느 때보다 이탈자를 잘 이해한다고 자부한다. 리소니아의 배신과 광기로의 타락이 매일같이 나를 괴롭히고 있지. 지금도 고개를 돌리면... 내 영혼결속자의 모습이 보이고, 내 이름을 부르는 목소리가 들린다.\n\n과거의 나였다면 이 기억을 정화했을 것이다. 내 마음을 누르는 번뇌를 지워버렸겠지. 하나 리소니아의 존재는 내 가장 소중한 기억에도 자리하고 있다. 그러니 내 일부를 잃지 않으면서 그녀를 잊는 게 가능하겠느냐?\n\n나는 절대 리소니아를 잊지 못할 것이다. 지금은 그녀와의 추억이 고통스럽지만, 이 감정을 정면으로 마주하려고 한다. 모두가 그렇듯 이 새로운 힘을 위해 노력할 것이니라.', 39653),
(212446, 'koKR', '승천의 보루에 도착했을 땐 내가 당한 일들만 생각하는 데 여념이 없었다. 씁쓸함, 고통, 복수심에 사로잡혀 용서받지 못할 과오를 저질렀지. 이제는 내 행동이 잘못되었음을 안다. 되돌릴 수 있다면 되돌리고 싶구나. 그래도 내 행동의 결과를 짊어지고 살아가야겠지. 더 끔찍한 것은 아서스도 그 결과를 이고 가야 한다는 거다.\n\n그런 만행을 자행한 나 자신을 용서할 수 있을지 모르겠군.\n\n하지만 키리안은 용서를 베풀고 있고, 이탈자 역시 불화를 뒤로하려고 하고 있다. 감정의 골은 아물고 있어. 그리고 이렇게 일궈낸 통합은 새로운 시대를 불러오겠지. 나도 네 덕분에 치유의 길에 오를 수 있었다. 얼마나 고통스럽든 굴하지 않고 끝을 볼 생각이다.\n\n다시 한번 빛을 찾을 수 있게 해준 너의 은혜에 영원히 감사하마.', '', 39653),
(212445, 'koKR', '그 심정 이해하오, 에리디아. 그래도 치유의 순간은 찾아오기 마련이라오. 언젠가는 마음도 아물겠지. 단지 시간이 필요할 뿐이오... 우리 둘 다.', '', 39653),
(212444, 'koKR', '', '경사스러운 일이건만, 정작 난 하루도 거르지 않고 리소니아를 떠올리게 되는군... 마치 내 일부가 영원히 떨어져 나간 것 같아.', 39653),
(212443, 'koKR', '지혜는 단순히 모든 상황에서 올바른 행동을 할 줄 아는 것만을 의미하지 않는다. 도구이면서도 나눌 수 있고, 받을 수도 있지. \n\n나락 방랑자, 당신은 행동으로 지혜를 보여주는 데서 그치지 않고 수많은 사람과 나누었다. 그 결과 승천의 보루는 융성해졌지. \n\n마찬가지로 우리를 보고 배운 바가 있기를 빈다. 훗날 승천의 보루에서 배운 교훈이 앞길을 이끄는 횃불이 되기를 빌지.', '', 39653),
(212442, 'koKR', '감사합니다, 나락 방랑자님. 당신이 없었더라면 전 말드락서스에서 빠져나오지 못했을 겁니다.\n\n고통스러운 시간이었지만 포기하지 않았어요. 어느 정도는 나락 방랑자님께서 본보기를 보여주신 덕이죠. 우리를 저버리지 않으셨잖습니까. 당신의 굳건한 결의가 제 결의의 원동력이 되었습니다.\n\n비록 말은 못 하지만 히포코스도 같은 심정일 거예요. 녀석과 저는 유대를 맺고 있거든요. 앞으로도 서로의 눈과 목소리가 되어줄 생각입니다.', '', 39653),
(212441, 'koKR', '네가 말드락서스에서 용기를 보여준 것은 사실이니라. 더불어 영민함과 지혜를 십분 발휘하여 시련에서 살아남는 면모를 보여주기도 했지. 네가 경험을 통해 무슨 교훈을 얻었는지 용장께서 듣고 싶어 하실 거다.', '', 39653),
(212440, 'koKR', '비록 시력은 잃었지만, 다른 감각이 저를 이끌어 줍니다. 말드락서스에서의 경험은 우리 모두에게 유익했지요.', '', 39653),
(212437, 'koKR', '수석 제련장인께서는 나락 방랑자님을 진심으로 존경하십니다. 자리에 안 계실 때 최선을 다해 승천의 보루를 지키겠습니다.', '', 39653),
(212436, 'koKR', '오랜 시간 끝에 승천하게 되어 얼마나 기쁜지 모르겠습니다. 말로는 표현을 다 못 할 거예요. 키리안과... 이탈자 모두 서서히 회복되고 있습니다.\n\n서로의 행동을 쉽사리 잊지 않을 사람들도 있겠지만, 우리 모두 용서하는 마음을 품고 있다고 믿습니다.', '', 39653),
(212435, 'koKR', '아, 오늘의 주인공 아니십니까! 나락 방랑자님이 없었으면 저희는 여전히 열망자로 남아 있었을 겁니다.\n\n베풀어주신 은혜를 절대 잊지 않겠습니다. 감사합니다.', '', 39653),
(212431, 'koKR', '', '우리를 위해 시간을 아끼지 않고 헌신하는 자네의 모습에 진심으로 감격했네, 나락 방랑자. 키리안이 그렇게 헌신하는 건 당연한 것이지만, 필멸자는 얘기가 다르지. 자네는 우리 모두의 영광이야.', 39653),
(212430, 'koKR', '펠라고스, 당신의 연민 어린 마음은 우리 중 누구보다 깊을 겁니다. 고맙습니다.', '', 39653),
(212429, 'koKR', '무슨 일이 있었든 간에 돌아와서 기쁠 따름입니다, 니콜론.', '', 39653),
(212428, 'koKR', '', '다시 시도해 보세요.', 39653),
(212427, 'koKR', '', '흥미롭네요! 장치를 조정해 목적지 좌표를 변경했습니다.', 39653),
(212424, 'koKR', '', '방어 설비 증축은 순조롭게 진행되고 있어. 나락살이가 빨리 공격해줬으면 싶을 정도야. 검술 연습을 해야 하거든.', 39653),
(212423, 'koKR', '', '말드락서스는 코르시아 핵심 지점에 첩자 몇몇을 심어두고 나락살이의 동향을 살피고 있어. 원래대로라면 이 지역에서 활동하는 동료가 진작에 돌아왔어야 했는데... 좀 걱정되는군.', 39653),
(212422, 'koKR', '이곳 야생동물은 정말 매력적이에요! 생태계에 거대한 변화가 생겼는데도 놀라우리만치 잘 견뎌내고 있단 말이죠! 다만 식생은 상황이 그리 녹록지 않아 보여요.', '', 39653),
(212421, 'koKR', '', '현재로서는 조사를 완료할 수 없습니다. 적대적인 생명체로 인해 실패할 확률이 95%에 이릅니다. 수호자가 필요합니다.', 39653),
(212420, 'koKR', '', '제가 군정관님의 최측근이 될 줄은 꿈에도 몰랐어요. 지금 우리하고 아드레스테스 님을 한번 보세요! 친구가 큰 영예를 누리는 모습을 지켜보고, 한발 더 나아가 억겁에 걸쳐 함께 일하게 되다니... 이런 영광이 또 있을까요.', 39653),
(212419, 'koKR', '', '이탈자가 우리 품으로 돌아왔고, 곧 새로운 길이 열릴 거예요. 전 아드레스테스 님과 함께 새로운 사원을 세우고, 교리를 발전시켜 우리 키리안 동포들이 관계와 신뢰를 다시 구축하고 사고방식을 바꿀 수 있도록 인도할 겁니다...\n\n친구여... 가슴이 북받쳐 오르네요.\n\n가뭄 때문에 아주 오랜 시간을, 지나치게 긴 세월을 열망자로 지냈어요. 하지만 당신을 만나면서 그 모든 순간이 희미해졌죠. 우린 승천자와 열망자를 통틀어 그 어떤 키리안도 해내지 못한 일을 해냈어요. 용장과 대결을 펼쳤잖아요! 게다가 나락에서 몇 번씩이나 탈출했고요! 어디 그뿐일까, 다른 영역과 연을 맺기도 했죠.\n\n정말 제가 손이 될 자격이 있을까요? 과연 싸움을 멈출 수 있을지 의문이 들기도 해요. 지금까지 오랜 시간을 싸워왔는데. \n\n곁에 함께하는 친구들을 봐서라도 최선을 다해야겠지요. 우리가 힘을 합치면 분명 성공할 겁니다.', 39653),
(212417, 'koKR', '', '열망자를 굽어살피고 계도하는 데 헌신한 지 참으로 오랜 세월이 흘렀구나. 처음부터 나 혼자는 아니었다... 하나 가뭄이 잦아들지 않으면서 동료들이 필요한 다른 장소들이 생겨났고, 결국 나 혼자 남은 것이지.\n\n내겐 열망자들의 훈련을 속행하라는 명령이 내려왔다. 가뭄이 종식되는 그날까지 때를 기다리라고 했지. 단 한 명의 예외도 없이 모든 영혼이 나락으로 보내지고 있으며, 어둠땅이 망가졌다는 사실을 알려서도 안 됐다. 말해줘도 괜찮은 부분까진 얘기해 줬지만... 어디까지나 난 혼자였고, 평정심을 다스려야 했지.\n\n승천의 길의 일부가 되어 처음으로 노고를 인정받은 데다, 이젠 승천의 보루의 새로운 군정관이 되었으니... 이보다 거룩한 명예가 어디 있겠느냐.\n\n고맙다, 나락 방랑자여. 좋은 첫인상을 심어주지 못해 미안하구나.', 39653),
(212414, 'koKR', '', '나누어줄 비밀이 참으로 많은데, 시간이 너무나도 부족하구나.', 39653),
(212413, 'koKR', '', '령 용천 탐색을 시작할 준비가 되면 사령관의 탁자를 사용하세요. 나머지 조율은 제가 다 해결하죠.', 39653),
(212412, 'koKR', '령 용천 탐색을 시작할 준비가 되면 사령관의 탁자를 사용하십시오. 나머지 준비는 제가 다 해결하겠습니다.', '령 용천 탐색을 시작할 준비가 되면 사령관의 탁자를 사용하십시오. 나머지 준비는 제가 다 해결하겠습니다.', 39653),
(212411, 'koKR', '령 용천 탐색을 시작할 준비가 되면 사령관의 탁자를 사용하세요. 나머지는 제가 다 해결하죠.', '령 용천 탐색을 시작할 준비가 되면 사령관의 탁자를 사용하세요. 나머지는 제가 다 해결하죠.', 39653),
(212410, 'koKR', '', '령 용천 탐색을 시작할 준비가 되면 사령관의 탁자를 사용하세요. 나머지는 제가 다 해결하죠.', 39653),
(212404, 'koKR', '', '붉은마루 산맥에서 클레이아를 처음 만났을 때, 너희 둘은 어딘가 다르다는 걸 직감적으로 알았다. 클레이아는 작금의 상황에 만족하지 않았지. 집정관님과 길을 향한 충심이 그 아이의 행동을 이끌었지만, 그러면서도 언제나 더 나아지려고 했어.\n\n네가 함께해준 덕분에 클레이아는 벤 하웰의 영혼이 나락으로 보내지는 걸 보고도 타락하지 않았다. 그저 인내하는 선에서 그치지 않고 연민이 살아 있는 미래로 나아갈 길을 닦는 데 힘을 보탰지. 클레이아의 헌신은 찬란하게 빛나고 있다. 손의 자리에 올라서도 계속 빛날 테지.', 39653),
(212400, 'koKR', '%s|1이;가; 으르렁대며 반응하더니 나락으로 뛰어듭니다.', '', 39653),
(212399, 'koKR', '나락 방랑자를 연옥의 요새에 계신 드라카 남작님께 데려다주거라!', '나락 방랑자를 연옥의 요새에 계신 드라카 남작님께 데려다주거라!', 39653),
(212398, 'koKR', '%s|1이;가; 낑낑대며 반응하더니 나락으로 뛰어듭니다.', '', 39653),
(212397, 'koKR', '나락 방랑자를 나락의 구렁에 계신 레나탈 왕자님께 데려다주거라!', '나락 방랑자를 나락의 구렁에 계신 레나탈 왕자님께 데려다주거라!', 39653),
(212386, 'koKR', '이토록 뻔할 데가.', '', 39653),
(212385, 'koKR', '비명을 질러라!', '', 39653),
(212380, 'koKR', '나락 방랑자라... 실로 흥미로운 전환점이로군.\n\n따라오시오.', '', 39653),
(212378, 'koKR', '잘했다, 내 충직한 종이여. 난 다시 일어서리라.', '', 39653),
(212376, 'koKR', '솔직히 놀라운 감상은 전혀 안 드는군.', '', 39653),
(212375, 'koKR', '그 허영심으로 모든 걸 잃으리라.', '', 39653),
(212374, 'koKR', '뭐, 인상적이긴 하구나. 어쨌든, 내 너희 존재를 소멸시킬 날을 손꼽아 기다리마.', '', 39653),
(212373, 'koKR', '후식이 얼굴을 타고 흘러내리자 대영주 데나트리우스의 환영이 킬킬댑니다.', '', 39653),
(212363, 'koKR', '이런 무지몽매한 양반을 봤나. 저건 스프리건이에요! 누가 좋다고 저 성가신 녀석들을 사겠어요. 도망치기 전에 도시 바깥으로 내쫓아 버리세요!', '', 39653),
(212361, 'koKR', '그대가 함께해서 다행이오, 나락 방랑자.', '', 39653),
(212349, 'koKR', '조바알에 맞서려면 성약의 단이 단결해야 한다.', '', 39653),
(212347, 'koKR', '네 노고가 있었기에 성약의 단들이 신성한 사명을 다시 떠올릴 수 있었다. 새로이 만들어진 인장을 이용하면 태초의 존재의 땅으로 통하는 열쇠를 벼려내 조바알을 뒤쫓을 수 있다.\n\n시작할 준비는 되었느냐, 필멸자여?', '', 39653),
(212342, 'koKR', '난 전장을 누비는 실바나스 윈드러너를 봐왔네. 늘 강력한 무용을 떨쳤지.\n\n하지만 그런 힘을 다루는 모습은 처음 봤어.', '', 39653),
(212341, 'koKR', '', '실바나스의 능력을 잘 안다고 생각했습니다. 우리 힘으로 그 여자를 저지하고 안두인을 구출할 수 있을 거라 여겼죠.\n\n하지만, 처음부터 끝까지 주도권은 간수에게 있었어요.', 39653),
(212339, 'koKR', '경비병들은 우리와 대화할 마음이 눈곱만큼도 없나 봅니다. 어쩌면 이 방법이...', '', 39653),
(212324, 'koKR', '', '조시메와 칼라는 견고한 유대에 비해 의사소통이 부족하기 이를 데 없더군. 나는 조시메에게 칼라에게 시킬 행동을 포착한 다음 그 행동을 단어와 결부하는 방법을 가르칠 거다.\n\n그리고 렌티오스는 칼라에게 조시메와 대화하는 법을 가르쳐 날개를 뻗거나 놀고 싶을 때를 표현할 수 있게 할 거다. 그리하면 둘이 상호 존중에 기반을 둔 탄탄한 관계를 구축하는 데 보탬이 되겠지.', 39653),
(212323, 'koKR', '녀석의 고집을 어리석음으로 착각하지 않도록 유의하시오. 그 친구의 본능을 믿어야 한다오, $p...', '', 39653),
(212322, 'koKR', '', '이 아이를 홀대하는 날에는... 녀석이 직접 널 처리하고... 내게로 돌아오게 될 거다.', 39653),
(212321, 'koKR', '가서 책무를 다하시길, $p 님. 나락 방랑자님과 아퀼론이 영원히 함께하길 기원합니다.', '가서 책무를 다하시길, $p 님. 나락 방랑자님과 아퀼론이 영원히 함께하길 기원합니다.', 39653),
(212320, 'koKR', '', '우선 단어를 가르쳐야 아이가 알아듣지 않겠느냐, 조시메. 그전까진 칼라도 네가 뭘 시키는 게 아니라 짖는다고 생각할 거다.', 39653),
(212319, 'koKR', '', '칼라! 앉아! 멈춰! 내려와!', 39653),
(212316, 'koKR', '확인했습니다. 하지만 경계를 늦추지 마시고 그 어떤 소란도 일으키지 마십시오!', '', 39653),
(212314, 'koKR', '멈추십시오! 적합한 신원이 확인되어야만 지나갈 수 있습니다.', '멈추십시오! 적합한 신원이 확인되어야만 지나갈 수 있습니다.', 39653),
(212308, 'koKR', '<스타니코스가 휘둥그레진 눈으로 당신을 바라봅니다. 그가 기쁨과 두려움으로 몸을 떠는 것이 보일 정도입니다.>\n\n저기... 가, 감사합니다. 나락 방랑자님은 선하세요. 제 영웅이세요.', '', 39653),
(212307, 'koKR', '', '날아라, 굼벵아! 훨훨 날아라! 그... 턱을 타고 흐르는 바람을 느껴봐!', 39653),
(212306, 'koKR', '굼벵이 날개를 기를 때까지 우리가 보살폈어요. 지금은 비행에 익숙해지도록 보살피고 있죠!', '', 39653),
(212299, 'koKR', '<잘못 놓인 것으로 보이는 벤티르 고서>', '', 39653),
(212297, 'koKR', '저 앞의 길거리는 위험해요. 제게 빚진 겁니다... 때가 되면 알 거예요.', '저 앞의 길거리는 위험해요. 제게 빚진 겁니다... 때가 되면 알 거예요.', 39653),
(212296, 'koKR', '이봐요, 당신. 첫인상이 꽤 강렬하던데... 그 인상을 심어줄 상대를 잘못 골랐어요.', '이봐요, 당신. 첫인상이 꽤 강렬하던데... 그 인상을 심어줄 상대를 잘못 골랐어요.', 39653),
(212295, 'koKR', '', '뭐, 염려할 만한 내용은 분명 없겠지만 말이에요...', 39653),
(212294, 'koKR', '', '받은 게 있으니, 베레인의 기록에서 당신과 나눈 대화에 관한 내용이 있으면 알려드리겠습니다.', 39653),
(212293, 'koKR', '', '베 중개단은 계속 절 쫓을 요원을 파견할 겁니다. 그렇긴 해도 베레인을 제거한 덕분에 많은 시간을 벌었어요.', 39653),
(212291, 'koKR', '', '대단히 큰 신세를 졌습니다. 베레인 때문에... 한동안 골머리를 앓았거든요.', 39653),
(212289, 'koKR', '안 돼! 마차가! 내가 실패하다니...', '', 39653),
(212287, 'koKR', '이 유물은 아직 회수하지 않았습니다.', '유실된 유물 - 고라크 발톱 우상', 39653),
(212285, 'koKR', '코르시아에서 령 배달 왔수다!', '', 39653),
(212284, 'koKR', '도와줘서 고마워. 이제 그만 세상을 구하러 가던 길이나 가보셔.', '', 39653),
(212283, 'koKR', '대신 도착할 때 되면 마시던 령은 내려놓아야 해... 내가 승객한테 령 주는 거 왕자님은 질색하시거든. 알았지?', '', 39653),
(212282, 'koKR', '당신이 있어서 못된 녀석들을 헤치고 나올 수 있었어. 령이라도 한 모금 마셔. 그럴 자격 있으니까!', '', 39653),
(212281, 'koKR', '왕자님과 군대는 나락에서 가장 먼 끝자락에 있어. 아무 문제 없이 령을 전달할 수 있다고 말씀드렸지.', '', 39653),
(212280, 'koKR', '이 유물은 아직 회수하지 않았습니다.', '유실된 유물 - 랭 가문의 나무 조각품', 39653),
(212279, 'koKR', '그래도 진담이었을 경우를 대비해 령을 더 챙겨왔어... 물론 농담이었겠지만. 안 그래?', '', 39653),
(212278, 'koKR', '말하는 게 아주 웃기지? 하하!', '', 39653),
(212277, 'koKR', '이번에 령을 안 갖고 오면 나를 두 쪽으로 갈라버리겠다고 엄포를 놨거든.', '', 39653),
(212276, 'koKR', '도착할 때쯤에 에메니가 야영지에 있을는지...', '', 39653),
(212271, 'koKR', '습격을 거들고 싶으면 올라타셔. 아니면 뭐 나중에 보든지.', '', 39653),
(212270, 'koKR', '장난은 여기까지. 도착할 때까지 안 멈출 거야!', '', 39653),
(212269, 'koKR', '저것 좀 봐!', '', 39653),
(212268, 'koKR', '심지핥기가 다리를 막고 있는 거대한 피조물을 가리킵니다.', '', 39653),
(212267, 'koKR', '음, 이번에는 바퀴 고장보다 훨씬 끔찍한데...', '', 39653),
(212266, 'koKR', '아, 이런.', '', 39653),
(212265, 'koKR', '아무튼 내가 하고 싶은 말은...', '', 39653),
(212264, 'koKR', '그리고 자기가 뭔데 마음에 안 드는 사람을 멋대로 가두고 호들갑이야? 내가 로렌트 그 양반 싫다고 감옥에 처넣으려고 드는 거 본 적 있어? 아니잖아.', '', 39653),
(212263, 'koKR', '둥둥 떠다니는 불빛은 마음에 든다 이거야. 그런데 길이 무슨 바퀴를 부수려고 작정하고 만든 것 같잖아!', '', 39653),
(212262, 'koKR', '이놈의 나락은 내가 태어난 진흙 웅덩이보다 훨씬 끔찍하군. 이 장소를 만든 게 간수라면... 사람들 심정에 공감이 가. 그런 녀석은 사라져야 해!', '', 39653),
(212261, 'koKR', '됐다! 바퀴 네 개 모두 수리 완료했어. 이제 출발할 일만 남았군. 다들 올라타!', '', 39653),
(212260, 'koKR', '바위머리 녀석이 또다시 마차를 깔고 앉았나 보군! 그러다 망가진다고 신신당부를 했건만...', '', 39653),
(212259, 'koKR', '또 바퀴가 망가졌잖아?!', '', 39653),
(212258, 'koKR', '이런 일은 두 번 다시 없을 거야. 말도 안 되는 일이지!', '', 39653),
(212257, 'koKR', '재수가 아주 옴 붙었어.', '', 39653),
(212256, 'koKR', '마차 바퀴가 그냥 맥없이 망가지다니. 이게 말이나 돼?', '', 39653),
(212255, 'koKR', '자, 요 녀석들아. 냉큼 이곳을 벗어나자!', '', 39653),
(212254, 'koKR', '됐다! 바퀴 다 고쳤어. 다들 올라타셔!', '', 39653),
(212253, 'koKR', '바퀴 고칠 동안 망 보고 있어. 알았지?', '', 39653),
(212252, 'koKR', '잠깐 기다려봐! 마차 바퀴 한쪽에 금이 갔어...', '', 39653),
(212251, 'koKR', '가서 시간 좀 생기면 바위머리 보고 하늘 높이 던져달라고 부탁할 거야. 저 탑에 손이 닿는지 확인해보고 싶거든. 하하!', '', 39653),
(212250, 'koKR', '레나탈 왕자님은 나락의 구렁 공격에 아낌없이 쏟아붓고 계셔. 령, 허드레꾼, 차... 거기 없는 게 없어.', '', 39653),
(212249, 'koKR', '그래도 뭐, 강령군주는 착한 양반들이야. 부탁을 받았으니 들어줘야지. 아무 문제 없다 이 말씀.', '', 39653),
(212248, 'koKR', '말드락시 작자들이 대체 왜 나보고 령을 그 먼 곳까지 옮기라고 하는지 모르겠단 말이야... 아니, 하늘에 자기들 죽음의 요새까지 띄워놓고서는!', '', 39653),
(212247, 'koKR', '웬 덩치 큰 피조물이랑 싸움이 붙었다나. 우리까지 덩달아 밟히지나 않으면 좋겠네!', '', 39653),
(212246, 'koKR', '우리 테오타르 나리가 그 거대한 가열로 바깥에서 키리안하고 용무를 보고 계셔.', '', 39653),
(212245, 'koKR', '그 호화찬란한 주문인가 뭔가를 유지하려면 이 령이 필요한 모양이야.', '', 39653),
(212244, 'koKR', '페어리 그 양반들이 시련지에 퍼지고 있는 으스스한 어둠을 조사하고 있더란 말이지.', '', 39653),
(212243, 'koKR', '무기는 챙겨왔길 바라... 험난한 여정이 될 거거든.', '', 39653),
(212242, 'koKR', '전부 단단하게 고정했어. 그럼 나락으로 출발해 보실까!', '', 39653),
(212234, 'koKR', '거래가 우리 둘 모두에게 부귀영화를 선사하길 빌지요.', '', 39653),
(212231, 'koKR', '이 유물은 아직 회수하지 않았습니다.', '유실된 유물 - 그림자 절단도', 39653),
(212230, 'koKR', '이 유물은 아직 회수하지 않았습니다.', '유실된 유물 - 자아성찰의 반지', 39653),
(212229, 'koKR', '이 유물은 아직 회수하지 않았습니다.', '유실된 유물 - 수수께끼의 해독 장치', 39653),
(212228, 'koKR', '이 유물은 아직 회수하지 않았습니다.', '유실된 유물 - 족쇄의 책: 고통받는 마술사', 39653),
(212227, 'koKR', '이 유물은 아직 회수하지 않았습니다.', '유실된 유물 - 암울한 징조의 방첨탑', 39653),
(212226, 'koKR', '이 유물은 아직 회수하지 않았습니다.', '유실된 유물 - 영생의 조각상', 39653),
(212224, 'koKR', '이 유물은 아직 회수하지 않았습니다.', '유실된 유물 - 수상쩍은 토양 자루', 39653),
(212223, 'koKR', '이 유물은 아직 회수하지 않았습니다.', '유실된 유물 - 죽음의 로아의 북', 39653),
(212222, 'koKR', '이 유물은 아직 회수하지 않았습니다.', '유실된 유물 - 이해의 암호', 39653),
(212221, 'koKR', '이 유물은 아직 회수하지 않았습니다.', '유실된 유물 - 불안정한 폭발성 보주', 39653),
(212220, 'koKR', '이 유물은 아직 회수하지 않았습니다.', '유실된 유물 - 황천별', 39653),
(212219, 'koKR', '이 유물은 아직 회수하지 않았습니다.', '유실된 유물 - 변신수의 복면', 39653),
(212218, 'koKR', '이 유물은 아직 회수하지 않았습니다.', '유실된 유물 - 신성한 의지의 보루방패', 39653),
(212217, 'koKR', '이 유물은 아직 회수하지 않았습니다.', '유실된 유물 - 룬 석판', 39653),
(212216, 'koKR', '이 유물은 아직 회수하지 않았습니다.', '유실된 유물 - 노래하는 강철 주괴', 39653),
(212215, 'koKR', '이 유물은 아직 회수하지 않았습니다.', '유실된 유물 - 천공의 어둠땅 해도', 39653),
(212214, 'koKR', '이 유물은 아직 회수하지 않았습니다.', '유실된 유물 - 족쇄의 책: 미치광이 마녀', 39653),
(212213, 'koKR', '', '나락이 코르시아를 복속시키면서 해당 영역에 대한 지식의 폭을 넓히고 새로운 정보를 습득할 기회의 장이 열렸습니다.\n\n당연히 약간의 위험이 수반되긴 하지만, 비밀은 값비싸고 찾아보기 어려운 재화랍니다.\n\n이곳에서 알아내는 비밀은 그 가치를 헤아릴 수 없을 정도예요.', 39653),
(212211, 'koKR', '이 유물은 아직 회수하지 않았습니다.', '유실된 유물 - 영원한 학자의 부적', 39653),
(212209, 'koKR', '간수가 불멸의 도시를 장악하게 둘 순 없어!', '', 39653),
(212201, 'koKR', '', '그렇군요. 안타깝네요. 여유가 생기면 제게 오시길.', 39653),
(212200, 'koKR', '', '건망증이라... 흥미롭군요.\n\n<기록지를 집어넣는 베레인>\n\n자, 그래서 베나리는 어디 있습니까? 그 친구가 강력한 유물을 요청했거든요. 구하느라 등골이 휘는 줄 알았습니다.', 39653),
(212199, 'koKR', '', '망상 증세라... 흥미롭군요.\n\n<기록지를 집어넣는 베레인>\n\n자, 그래서 베나리는 어디 있습니까? 그 친구가 강력한 유물을 요청했거든요. 구하느라 등골이 휘는 줄 알았습니다.', 39653),
(212198, 'koKR', '', '내 의구심과 달리 캘타스와 남작은 서로를 잘 보완해주는 것 같더구나. \n\n네 개입이 작용한 까닭인지, 두 사람의 순수한 의사인지는 모르겠다만... 캘타스가 영혼의 번뇌를 좀 더 내려놓는 결과로 이어졌으니 아무래도 상관없다. \n\n캘타스에게서 상당한 가능성과 힘이 보이는군그래.', 39653),
(212197, 'koKR', '', '기만인지, 아니면 광기인지... 흥미롭군요.\n\n<기록지를 집어넣는 베레인>\n\n자, 그래서 베나리는 어디 있습니까? 그 친구가 강력한 유물을 요청했거든요. 구하느라 등골이 휘는 줄 알았습니다.', 39653),
(212174, 'koKR', '', '<퉁명스러운 어조로 목소리를 높이는 베레인>\n\n이 이상 속일 생각은 안 하는 게 좋을 겁니다, 나락 방랑자님.\n\n질문에 대답이나 하세요.\n\n베나리. 그 작자 어디 있습니까?', 39653),
(212173, 'koKR', '', '운이 좋았다라... 흥미롭군요.\n\n<기록지를 집어넣는 베레인>\n\n자, 그래서 베나리는 어디 있습니까? 그 친구가 강력한 유물을 요청했거든요. 구하느라 등골이 휘는 줄 알았습니다.', 39653),
(212172, 'koKR', '', '자, 그럼 가장 중요한 질문... 대체 어떻게 절 다시 찾아내신 겁니까?', 39653),
(212171, 'koKR', '', '알겠습니다. 두 번째 질문으로 넘어가죠.\n\n코르시아에서 간수가 이루고자 하는 목적이 무엇이라 생각하십니까?', 39653),
(212170, 'koKR', '', '코르시아에 대한 지식을 나눠 주시겠다는 감사한 마음뿐입니다.\n\n그럼 첫 번째 질문. \n\n그 기이한 땅이 품고 있는 예상을 뛰어넘는 미지의 비밀 속에서 살아남는 데 어려움을 겪고 계십니까?', 39653),
(212168, 'koKR', '', '이렇게 만나 뵈어 대단히 기쁩니다, 나락 방랑자님.\n\n이전에 문의했던 사항에 더해 몇 가지 질문을 더 여쭤보고 싶습니다.\n\n모든 질문에 답해주시면 그에 상응하는 보상을 드리지요.', 39653),
(212162, 'koKR', '', '이곳은 아주 훌륭한 기회의 장이랍니다. 어디를 살펴봐야 하는지 알기만 하면 말이죠.', 39653),
(212145, 'koKR', '조바알이 전투는 이겼을지언정 전쟁은 이길 수 없을 것이다. 우리가 같은 목적 아래 하나가 되었으니, 함께라면 승리를 쟁취할 수 있을 것이다.', '', 39653),
(212144, 'koKR', '성약의 단들에 각각의 인장을 이곳 코르시아로 가져와 줄 것을 요청했다. 우리 승리의 열쇠가 그들... 그리고 너에게 달렸다, 나락 방랑자여.', '', 39653),
(212143, 'koKR', '키레스티아는 우리 중 가장 확고부동한 이였지. 그런 집정관이 새로운 길을 기꺼이 받아들이다니, 키리안을 위해 얼마나 헌신하는지 알 수 있는 대목이구나.', '', 39653),
(212142, 'koKR', '슬픔과 이해를 통해 나이트 페이의 인장이 다시 태어났도다. 아마도 그들의 유대 관계 역시 마찬가지겠지.', '', 39653),
(212140, 'koKR', '겨울 여왕은 삶의 영역에서 그의 역할을 하는 이와 맺어져있지. 그 둘이 바로 위대한 순환, 그 균형의 체현일 터.', '', 39653),
(212138, 'koKR', '하나 경계를 늦추면 안 된다, 나락 방랑자여. 나스레짐의 귀환은 우리 모두에게 좋지 않은 징조이니.', '', 39653),
(212136, 'koKR', '레나탈이 메달을 다시 손에 넣었으니, 벤티르가 새로운 인장을 벼려낼 수 있겠군. 그것으로 데나트리우스가 조바알에게 내어 준 인장을 대신할 수 있을 터.', '', 39653),
(212135, 'koKR', '우리의 공통된 목적 아래 내 강령군주의 새로운 인장을 벼려내겠다. 그리고 필요한 일이 생길 때까지 이를 드라카에게 맡기겠다.', '', 39653),
(212134, 'koKR', '바이라즈는 그 배반의 죗값을 치렀다. 이로써 말드락서스의 의회가 또 다시 하나가 되었구나.', '', 39653),
(212131, 'koKR', '어쩌면 네가 있을 곳이 여기일지도 모르지. 영원히.', '', 39653),
(212122, 'koKR', '<드러스트의 손에서 만들어진 게 분명한 우상입니다. 트로스 그 자체의 부정한 마법이 넘치도록 깃들어 있습니다. 어떤 경위로 코르시아까지 흘러들어 왔는지, 여기 있다는 걸 드러스트가 알고는 있는지 알 길이 없습니다.\n\n지금껏 접한 드러스트를 생각해 보면 우상을 너무 오래 살펴보지 않는 게 최선일 것입니다.>', '', 39653),
(212121, 'koKR', '<본래는 깊이, 선명하게 만들어졌으나 지금은 닳고 닳은 조각품입니다. 어느 화려한 사원에서 있었던 낯선 사건을 묘사한 것으로 보입니다. 양식을 보면 판다렌의 그것을 연상시키지만, 당신이 아는 한 이런 사원은 존재하지 않습니다.\n\n까마득히 먼 옛날 무너진 건물을 표현한 걸까요... 아니면 아직 지어지지 않은 건물인 걸까요?>', '', 39653),
(212120, 'koKR', '<처음 보면 수수하게 생긴 검입니다. 하지만 가끔 칼날이 빛을 머금는 순간이 있는데, 그 광휘에 일시적으로 눈이 보이지 않을 정도입니다.\n\n검의 힘이 두렵기라도 한 것처럼 그림자가 검으로부터 살금살금 물러나는 모습을 보이기도 합니다. 특히 칼날에 베인 것 같은 형상을 취한 그림자가 눈길을 끕니다.\n\n다른 건 몰라도 어둠을 공격하는 데는 따라올 무기가 없을 것입니다.>', '', 39653),
(212119, 'koKR', '<언뜻 보기엔 별 볼 일 없는 물건처럼 보이지만, 비스듬한 각도에서 반지의 보석을 보면 흡사 사막의 신기루처럼 반지의 복제가 일렁이며 나타납니다.\n\n정말 이름 그대로의 기능을 가진 반지라니 의외입니다.>', '', 39653),
(212118, 'koKR', '<중개자가 만든 것처럼 보이지만, 그보다 초월적인 복잡성을 자랑하는 장치입니다. 로쉬르의 설명에 따르면, 이 장치의 본래 용도는 주어진 구절의 \"진의를 분간\"하는 것이라고 합니다. \n\n누가 만들었는지는 불분명하지만, 제대로 활용할 줄 아는 사람을 만나면 헤아릴 수 없는 가치를 발휘할 것입니다.>', '', 39653),
(212117, 'koKR', '<이 책을 처음 발견했을 당시만 해도 안에서 들려오는 작은 목소리의 어조는 비교적 차분한 편이었습니다. 한데 책장 한 장을 제외하고 복원해둔 지금에 와서는 당신에게 고함을 질러댑니다.\n\n한 마디 한 마디 내지를 때마다 고서가 부스럭거립니다.>\n\n나를 풀어주러 온 건가? 어떻게든 내보내다오!\n\n하늘빛 책장을 한 장만 더 찾으면 된다... \n\n명심해라. 진홍빛 책장에는 손도 대선 안 되느니라. 다른 책은 열어보지도 말거라. 거짓말로 널 현혹하려 할 것이다! 분명히 경고했다!', '', 39653),
(212116, 'koKR', '<이 기괴한 토템 주변에 있으면 달콤한 거짓말과 광기를 자아내는 진실을 웅얼대는 목소리가 들립니다. 아니, 달콤한 진실과 광기를 자아내는 거짓말인 걸까요? 전부 진실일 수도 있고... 반대로 거짓일지도 모를 일입니다.\n\n혼탁한 어둠이 시야를 가리자 당신은 재빨리 토템으로부터 멀어집니다.>', '', 39653),
(212115, 'koKR', '<조각상이 얼마나 오래됐는지 헤아리긴 어렵지만, 어째서인지 상상 이상으로 유구한 역사가 깃든 물건이란 생각이 듭니다. 영겁의 세월 동안 어떤 사건들을 목격해왔을지 알 수가 없습니다.\n\n로쉬르는 조각상의 속삭임을 믿어선 안 된다고 경고했습니다. 이 물건이 나누어주는 지혜는 기만으로 포장되어 있다고 말이죠.>', '', 39653),
(212114, 'koKR', '<자루에 검은색에 가까운 짙은 갈색의 흙이 들어 있습니다. 냄새를 맡아보면 땅과 봄의 기운이 담긴 그윽한 향이 납니다.\n\n로쉬르가 설명하길 이 토양에 심은 씨앗은 어떤 종류가 됐든 주변 환경에 상관없이 무럭무럭 자라난다고 합니다. 시간만 주어진다면 코르시아의 녹음까지 다시 살려낼 수 있을지도 모릅니다.>', '', 39653),
(212113, 'koKR', '<팽팽하게 펼쳐진 북 표면에 노골적인 미소를 짓고 있는 브원삼디의 얼굴이 그려져 있습니다. 그런데 시야 바깥에 두고 있으면 브원삼디의 얼굴이 수시로 윙크를 날리는 것 같은 기분이 지워지지 않습니다.\n\n북을 만지면 차가운 촉감이 전해집니다. 또한, 두드리면 자욱한 안개에 파묻힌 듯한 소리가 들리며, 희미해질 때 낮게 울리는 웃음소리가 미묘하게 들립니다.>', '', 39653),
(212112, 'koKR', '<돌에 제각기 다른 언어로 여러 문단이 새겨져 있습니다. 새겨진 글은 이제 읽을 수 있는 상태가 되었지만, 당신이 알아볼 만한 언어는 사실상 전무합니다. 다만 묘하게 낯익은 글귀가 있긴 합니다. \n\n골똘히 바라보면 단어 한두 개쯤은 알아볼 수 있을지도 모릅니다...\n\n...아니면 지끈거리는 두통에 시달릴지도 모를 일이죠.>', '', 39653),
(212111, 'koKR', '<보주 안에 깃든 엄청난 폭발성 마력이 공명음을 내고 있습니다. 당신으로서는 마법을 담아내는 물리적 구조를 알아보기 어렵습니다.\n\n이 유물은 억겁의 세월 동안 보관소에 안치되어 있었습니다. 진정 불안정하여 언제 터질지 모르는 물건이었다면 기록관들이 안전한 보관을 위해 조처를 했을 것입니다.\n\n그 조처가 지금까지 온전히 유지되고 있길 빌어야겠지요.>', '', 39653),
(212110, 'koKR', '<지도를 아무리 면밀하게 살펴봐도 이해가 안 됩니다. 마법으로 생성된 중계지의 투영체가 끊임없이 소용돌이치고 있고, 그 안에는 수없이 많은 사후 세계가 존재하는데 어떻게 된 것이 구분 자체가 불가능할 지경입니다.\n\n아무래도 어둠땅의 지리는 필멸자의 이해를 초월하는 것 같습니다.>', '', 39653),
(212109, 'koKR', '<가까이 접근하자 주괴에서 스산한 합창을 연상시키는 선율이 들려옵니다. 어쩌다 한 번씩 격렬한 불협화음이 흐름을 어그러뜨리지만 않았어도 최면 효과를 자아내는 선율이라고 평하기에 모자람이 없었을 것입니다.\n\n그래도 일단... 주괴의 노래에 가사는 없으니 다행입니다.>', '', 39653),
(212108, 'koKR', '<자체적으로 보충되는 엄청난 양의 마력으로 진동하는 장치입니다. 기록관의 수중에 있는 한 아직 회수하지 못한 유물들을 찾아낼 때까지 끌림의 지팡이에 충분한 원동력을 공급해줄 것입니다.\n\n다만 어떻게 꾸준히 동력을 만들어낼 수 있는지는 수수께끼로 남아 있습니다.>', '', 39653),
(212107, 'koKR', '<신도레이제 가면처럼 생겼지만... 생소한 마법으로 변형되어 있습니다. 부여된 마법의 수준만 놓고 보면 최고로 우수한 비전술사의 작품보다 훨씬 정교하고 변화무쌍합니다.\n\n이 환영이 무엇을 숨기고 있는지는 추측의 영역에 머무를 뿐입니다.>', '', 39653),
(212106, 'koKR', '<예언용 석판 하나하나의 표면에 난해한 룬이 세밀하게 새겨져 있습니다. 기록관의 기록에는 숙련된 룬술사는 질문을 한 후, 석판을 던져 떨어진 형태를 보고 해답을 얻을 수 있다고 나와 있습니다.\n\n석판에 그 어떤 예언의 힘도 담겨 있지 않을 가능성도 존재하긴 합니다만, 정말 그랬다면 애초에 보관소에 소장될 일도 없었을 것입니다.>', '', 39653),
(212093, 'koKR', '하나 분명히 말씀드릴 수 있는 건, 제 중개단 구성원이라고 해서 다 공격적이고 텃세를 부리는 방식으로 물품을 취득하는 건 아니라는 겁니다.\n\n코르시아는 우리 모두에게 기회의 장이에요. \n\n저는 나락 방랑자님과 서로 득이 되는 협력 관계를 구축하고 싶습니다. 진심이에요.', '', 39653),
(212071, 'koKR', '<일견 실체가 없는 것처럼 보이지만, 딱딱한 촉감이 느껴지는 방패입니다. 표면 곳곳의 가느다란 균열을 보면 매우 험하게 사용되었음을 알 수 있습니다. 균열이 수선되어 있진 않지만 일종의 마법으로 봉합된 상태입니다.\n\n로쉬르는 보루방패가 사용자의 영혼을 원동력 삼아 회복한다고 얘기했습니다. 한때 방패를 다뤘던 자들의 의지가 깃들어 있을지도 모릅니다.\n\n도대체 어떤 과정을 거쳐야 이런 물품이 만들어지는지 짐작조차 하기 어렵습니다.>', '', 39653),
(212068, 'koKR', '', '칠흑의 기사단은 망각 따위 두려워 않는다.', 39653),
(212066, 'koKR', '행운은 야심가의 편이죠.', '', 39653),
(212064, 'koKR', '주변 지역에서 안식을 찾지 못한 강령술사 시체를 찾아 시체 더미로 가져와 주세요.\n\n시체가 충분히 모이면 의식을 거행해 영구적으로 파괴할 겁니다.', '', 39653),
(212063, 'koKR', '다소 퉁명하게 답하더라도 용서해 주시기 바랍니다, 나락 방랑자님. 당장 다른 데 신경 쓸 틈이 없어서 그렇습니다.\n\n말드락시 지원군이 도착 못 할지도 모르니 제 힘으로 의식을 완료할 준비를 해야 합니다... 한데 해낼 수 있을지 장담하기 어려운 상황입니다.', '', 39653),
(212062, 'koKR', '자고로 전사는 전장에서 희열을 얻지만, 강령술사는 전장 그 자체를 보물로 여기기 마련입니다.\n\n남겨진 망자들은 부름을 받고 다시 일어나 전투로 돌아가기만을 갈망하고 있지요.\n\n근래 들어 이 지역의 나락살이 강령술사가 그네들의 쓰러진 아군을 부활시키고 있습니다.\n\n신데인 후작님과 같은 리치라면 죽은 나락살이를 우리 편으로 만드는 조화를 선보이셨을 거예요.\n\n그렇지만 오늘은 그런 식으로 병력을 조달 못 하게 막는 선에서 만족하려고 합니다.\n\n의식으로 불태울 시체를 모아주시겠습니까?', '', 39653),
(212061, 'koKR', '그러는 날엔 당신까지 저 더미에 던져버릴 줄 알아요, 찌꺼기! 제 지시를 기다리세요.', '', 39653),
(212060, 'koKR', '이 정도면 충분할 거야. 지금 불붙일래!', '이 정도면 충분할 거야. 지금 불붙일래!', 39653),
(212059, 'koKR', '%s|1이;가; 작은 소리로 투덜댑니다.', '%s|1이;가; 작은 소리로 투덜댑니다.', 39653),
(212058, 'koKR', '의식이 곧 완성됩니다! 어서 시체를 옮기세요, 루릭!', '', 39653),
(212057, 'koKR', '너는 내가 불에 잘 타는 체질이 아니니까 질투하는 거잖아!', '너는 내가 불에 잘 타는 체질이 아니니까 질투하는 거잖아!', 39653),
(212056, 'koKR', '다른 훨씬 우수한 무기가 존재하는 건 알고 있지? 그렇지?', '다른 훨씬 우수한 무기가 존재하는 건 알고 있지? 그렇지?', 39653),
(212055, 'koKR', '어떻게 깜빡하겠나, 찌꺼기? 자네가 시시때때로 떠들어대는데...', '어떻게 깜빡하겠나, 찌꺼기? 자네가 시시때때로 떠들어대는데...', 39653),
(212054, 'koKR', '횃불도 더 챙겨야 해! 횃불 까먹지 마!', '횃불도 더 챙겨야 해! 횃불 까먹지 마!', 39653),
(212053, 'koKR', '야영지로 돌아가서 다음 명령을 기다립시다. 의식용 보급품도 보충해야 해요.', '', 39653),
(212052, 'koKR', '이만큼 했으면 당분간 이 지역에 증원되는 나락살이의 수가 위축되겠죠.', '', 39653),
(212051, 'koKR', '다른 유형의 관심이 존재하긴 하나?', '다른 유형의 관심이 존재하긴 하나?', 39653),
(212050, 'koKR', '그게 아니라... 우리 의식이 불필요한 관심을 끌어버린 것 같습니다.', '', 39653),
(212049, 'koKR', '%s|1이;가; 하늘을 올려다봅니다.', '', 39653),
(212048, 'koKR', '...웅웅대는 소리도 의식의 일부인가?', '...웅웅대는 소리도 의식의 일부인가?', 39653),
(212047, 'koKR', '드디어! 불타라! 싹 다 불타버려라!', '드디어! 불타라! 싹 다 불타버려라!', 39653),
(212046, 'koKR', '지금입니다, 찌꺼기! 의식을 마무리하세요!', '', 39653),
(212045, 'koKR', '시체는 이미 주변에 잔뜩 널려 있습니다. 굳이 나가서 만들어 오실 필요는 없어요.', '', 39653),
(212044, 'koKR', '나도 시체 수집을 돕겠네, 나락 방랑자.', '나도 시체 수집을 돕겠네, 나락 방랑자.', 39653),
(212043, 'koKR', '시체를 모아 주시면 제가 파괴하겠습니다. 다시는 부활할 일이 없도록.', '', 39653),
(212042, 'koKR', '저도 나름 강령술사라고 자부하기에 이 나락살이 시체가 위협이 된다는 것쯤은 인지하고 있습니다...', '', 39653),
(212029, 'koKR', '<가슴갑옷 아래의 상처로 손을 가져가는 우서>\n\n아서스가 나를 쓰러뜨렸을 때, 서리한이 내 영혼을 산산조각냈지. 하지만 내 영혼이 고귀함과 무자비함으로 나뉘어 조각난 게 아니었다.\n\n그건 마치, 내 의식의 일부분이 그대로 얼어붙은 채, 나머지 영혼으로만 앞으로 나아가는 듯 했지.\n\n그 잃어버린 조각을 되찾으니... 정말이지 내가 내린 수많은 선택을 돌아보게 되는군.', '', 39653),
(212017, 'koKR', '', '안두인... 빛에 맹세컨대 안두인을 간수에게 잃지 않을 겁니다.', 39653),
(212016, 'koKR', '필멸자의 영혼이 어둠땅에서 어떤 운명을 맞는지 목격하고... 어머니를 직접 만나 뵈면서... 지금껏 내가 내린 결정을 돌아볼 수 있었다네.', '', 39653),
(211981, 'koKR', '', '친구들은 이제 안전해요. 물약을 더 만들어야겠어요!', 39653);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(211980, 'koKR', '', '숨어다니지 말고 포포에게 덤벼라, 파랗고 덩치 큰 악당아!', 39653),
(211979, 'koKR', '', '제가 막을게요. 다시는 친구들 못 해치게.', 39653),
(211978, 'koKR', '', '저 앞에 날뛰는 포식자가 있습니다. 도저히 막을 수가 없어요!', 39653),
(211977, 'koKR', '', '친구에게 줄 물약 다 줄게요. 누가 이랬어요?', 39653),
(211976, 'koKR', '', '저도 최선을 다하고 있어요, 포포. 그런데 부대에 극심한 사상자가 너무 많아요.', 39653),
(211975, 'koKR', '', '메릴리스는 안 다쳤는데, 다른 도움이 필요한 사람이 많아요...', 39653),
(211974, 'koKR', '', '그다음에는 야영지로 돌아와서 무용담을 주고받으면 되겠네요. 전 이제 메릴리스를 도우러 갈게요!', 39653),
(211973, 'koKR', '물약 덕분에 힘이 샘솟는군요. 적군 백 명이 몰려와도 이 위치를 사수할 겁니다!', '', 39653),
(211972, 'koKR', '절묘한 순간에 왔네요, 포포. 경계를 서는 것도 지쳐가던 참이었거든요.', '', 39653),
(211971, 'koKR', '', '데오스 다쳤어요? 물약 가져왔어요!', 39653),
(211970, 'koKR', '', '전 상처를 낫게하고 보호하는 물약을 만들 줄 알아요. 이걸 친구들에게 줄 거예요!', 39653),
(211969, 'koKR', '', '둘 다 크고 강하지만, 크고 강한 사람도 도움은 필요한 법이죠. 제가 도울 거예요!', 39653),
(211968, 'koKR', '', '전 메릴리스하고 데오스랑 같이 왔어요. 승천의 보루에서 함께 수련했죠.', 39653),
(211963, 'koKR', '', '조심하세요, 나락 방랑자님! 나락살이가 사방에 깔렸어요!\n\n전 키리안이 도와주러 올 때까지 기다리려고요.\n\n키리안은 포포를 잊어버리지 않으니까요.', 39653),
(211962, 'koKR', '', '반가워요, $p 님!\n\n친구들에게 보급품을 가져가던 도중에 나락살이 녀석들이 공격을 해왔어요.\n\n잔뜩 해치웠는데도 끝없이 몰려오는 거 있죠.\n\n같이 가주실래요? 보급품 전달하러 가요!', 39653),
(211949, 'koKR', '간수가 코르시아를 나락으로 낚아채는 과정에서 얼마나 많은 비밀이 유실됐을지 궁금하군.\n\n놈의 악행이 한도 끝도 없는 피해를 초래하고 있다.', '', 39653),
(211948, 'koKR', '저 밑에는 우리로 가는 길에 먹어 치울 보급품이 많아.', '', 39653),
(211947, 'koKR', '게걸충은 밑으로 치우는 게 좋겠는데, 대장...', '', 39653),
(211943, 'koKR', '야생룡이 여전히 저항하는군요. 나락 방랑자님, 녀석의 신뢰를 얻으셔야 합니다.', '', 39653),
(211942, 'koKR', '', '지저분한 발굽으로 실컷 돌아다니세요. 전 여기 위에 있을 테니...', 39653),
(211941, 'koKR', '단결이 필요한 시점입니다. 우린 함께 사냥하고, 함께 걸어야 해요.', '단결이 필요한 시점입니다. 우린 함께 사냥하고, 함께 걸어야 해요.', 39653),
(211940, 'koKR', '', '순전히 카라스 당신이 타면 안되니 저까지 타면 안 된다는 게 아직도 이해가 안 돼요.', 39653),
(211939, 'koKR', '사냥은 끝났습니다. 야생룡을 야영지로 데려가지요.', '', 39653),
(211938, 'koKR', '집중하세요! 곧 사냥이 시작될 겁니다.', '', 39653),
(211937, 'koKR', '', '전 몽환숲에 계신 겨울 여왕님의 귀에 들릴 정도로 북을 두드릴게요!', 39653),
(211936, 'koKR', '', '야생룡이 음악에 반응하고 있어요. 좀 더 크게 연주해 보세요!', 39653),
(211923, 'koKR', '여왕님이 축복이 함께하길 빕니다, $p 님.\n\n잠시 시간 괜찮으실는지요? 야영지에서 탈출한 야생룡을 추적해야 하는데, 나락 방랑자님께서 도와주시면 큰 보탬이 될 것 같습니다.\n\n근처에서 매혹의 북을 두드려 이쪽 절벽으로 유인하는 걸 도와주시면 됩니다. 다만 각오는 해두셔야 합니다.\n\n길들인 야생룡이 아니거든요.', '', 39653),
(211921, 'koKR', '반갑습니다, 나락 방랑자님. 사냥은 잘 풀리고 있으신지요.\n\n저희 사냥은 나이트 페이 지원군을 기다리느라 다소 지체되게 생겼습니다.', '', 39653),
(211919, 'koKR', '이봐요, $p 님. 이쪽입니다!', '', 39653),
(211918, 'koKR', '와아아아아아!', '', 39653),
(211917, 'koKR', '', '감사합니다. 저희가 있어야 할 곳을 알려 주십시오.', 39653),
(211916, 'koKR', '일어나라, 관문파괴자여! 다시 한번 헌신의 부름에 응하라!', '', 39653),
(211915, 'koKR', '으아아아! 나락 방랑자! 저 거대한 수정 괴물 좀 어떻게 해봐!', '', 39653),
(211914, 'koKR', '', '물려고 한 적 없어. 그래도 끌을 좀 더 신중하게 다루는 편이 좋을 거다...', 39653),
(211913, 'koKR', '방금 나 물려고 한 거 같은데!', '', 39653),
(211912, 'koKR', '', '진정해라, 돌형제... 아직 작업 중이니...', 39653),
(211911, 'koKR', '똑바로 집중이나 해라, 흠뻑아. 조각을 만들면 령을 집중하마.', '', 39653),
(211910, 'koKR', '제가 뭐랬습니까. 나락살이 놈들이 질색할 거라고 했잖아요...', '', 39653),
(211909, 'koKR', '살육이 내게 순수한 환희를 안겨주는구나. 눈앞의 모든 자를 학살하거라!', '', 39653),
(211907, 'koKR', '용광로와 모루에서 나의 진노가 태어났나니, 적 모두에게 나의 경멸을 선사하리라!', '', 39653),
(211906, 'koKR', '나락살이가 쓰러지니 다시 한번 복수의 향취가 풍기는구나!', '', 39653),
(211905, 'koKR', '걱정 마, 카샤아. 령을 넉넉히 가져왔으니 힘을 복원하면 돼.', '', 39653),
(211904, 'koKR', '', '이 돌형제는 평범한 허드레꾼 연장으로는 안 될 것 같습니다.', 39653),
(211903, 'koKR', '다들 따라오십쇼!', '', 39653),
(211895, 'koKR', '', '말가니스를 구금하고 외부인이 출입하지 못하도록 지배의 요새를 봉쇄할 것이니라. 그러니 당분간 얼씬도 안 하는 게 좋을 거다. \n\n병력을 코르시아에 파견하는 것은 변함이 없지만, 말가니스에게서 최대한 많은 정보를 캐내는 것도 대단히 중요한 일이지. 한데 레나탈의 방식은... 내 방식에 비하면... 유약한 면이 있어.\n\n내 볼일을 끝내는 대로 레나탈에게 말가니스를 돌려줄 것이다. 그때 가서 자기 신념대로 공포의 군주를 속죄시키든 말든 알아서 하라지. 어쨌든 내 용무가 우선이다.', 39653),
(211892, 'koKR', '저리 가, 나락 방랑자.\n\n우린 돌장인께서 직접 내린 중요한 임무를 수행하러 온 거야.\n\n벤티르만의 일이란 얘기지. 알아들어?', '', 39653),
(211891, 'koKR', '만나서 반가워, 나락 방랑자!\n\n우린 돌숨결 덩치 양반들 회수하러 왔어.\n\n문제는 안 들키고 처리하기엔 돌아다니는 나락살이 녀석들이 너무 많다는 거야.\n\n도와줄 시간 없어?', '', 39653),
(211889, 'koKR', '물론이지. 다만 시간도 시간이거니와... 적합한 후보자가 필요하다.\n\n확실히 후보자란 표현이 정확하겠어. 역사상 새로운 수확자가 취임한 전례는 없다. 언제나 데나트리우스가 지명하는 방식이었지. 자리에 내정된 자는 수십 년도 전부터 길들여져 왔었다.\n\n조만간 영혼과 벤티르를 살펴 적합한 기술과 통찰력을 가진 이를 솎아낼 것이다. 우리와 같은 가치관을 따르며, 그것을 뒷받침할 만한 힘을 가진 자로. 당장 괜찮은 인물 몇 명이 머릿속에 떠오르는군.\n\n일례로 젊은 캘타스를 들 수 있지. 참회가 더 진행된 상태였다면 후보로 여겼을진대...', '', 39653),
(211885, 'koKR', '', '전장과 대장정이 바뀌었을 뿐, 달라진 것은 하나도 없네.', 39653),
(211884, 'koKR', '할 일은 태산인데 시간은 얼마 없구나. 우리가 장악한 지역의 방비를 보완하고, 데나트리우스가 빼돌린 령 비축분에서 남은 것들을 안전히 보관해야 한다. 더불어 레벤드레스 전역에서 지지 세력을 결집해야겠지.\n\n이곳에서 어떤 승전보를 올리든 심판관이 돌아와 영혼을 사후 세계로 보내기 전까지 어둠땅은 결코 완전한 모습을 되찾지 못할 것이야.\n\n일단은 간수와의 전쟁에 주력하는 게 좋겠지. 남은 자원을 징발해 보태도록 하마.', '', 39653),
(211883, 'koKR', '코르시아에서의 대장정은 유난히 힘겹군. 그러니 받을 수 있는 도움은 모두 받아야 하네.', '', 39653),
(211881, 'koKR', '', '뼈가 닳아서 그런지 피곤하구려.', 39653),
(211879, 'koKR', '무릎 조심하시길.', '', 39653),
(211876, 'koKR', '레벤드레스에서 시간을 보내서 그런지 풍경이 바뀌니 즐겁군. 이토록 칙칙한 땅조차 말이지.', '', 39653),
(211871, 'koKR', '당분간은. \n\n메달의 힘을 하나로 모아 왕관에 주입할 당시, 그 누구도 왕관을 혼자 오랫동안 착용하지 못하도록 안전장치를 같이 엮어두었다. \n\n그리고 메달의 보유 여부를 떠나 다른 수확자가 마음만 먹으면 왕관에서 자신의 힘을 되찾아갈 수 있도록 해놨지. 그걸 가능케 하는 고대의 진언을 일러두었거든. \n\n다 같이 힘을 모아 벼린 물건인 만큼, 협력하는 동안에만 강력한 힘을 발휘할 수 있는 물건인 셈이다.', '', 39653),
(211870, 'koKR', '걱정 마시오! 최고의 제작자인 수석 제련장인이 도우러 왔으니.', '', 39653),
(211867, 'koKR', '난 우리 동포들이 정당한 명분을 통해 돌아오길 기도했다.$b$b그들이 레벤드레스에서 그치지 않고 어둠땅과 모든 현실을 배반할 줄은 전혀 몰랐어.', '', 39653),
(211864, 'koKR', '', '친절은 중요한 덕목일세. 하물며... 아니, 특히 이런 시기에는 더더욱 중요하지.', 39653),
(211863, 'koKR', '현명한 사람이 되려면 지식, 환경, 명료한 사고방식을 갖추어야 한다.', '', 39653),
(211858, 'koKR', '', '나락의 재가 숲 구석구석으로 퍼져나가는구나.', 39653),
(211857, 'koKR', '', '야생 사냥단은 극복하리라.', 39653),
(211852, 'koKR', '', '처음 밤 전사로 거듭났을 때, 제 목숨 하나를 불사르는 한이 있더라도 칼도레이의 한을 갚겠다는 생각이 기저에 깔려 있었습니다. 엘룬의 온전한 분노를 담아내는 그릇이 그러한 운명을 맞는 것은 흔한 일이었으니까요.\n\n여신의 힘은 지금도 절 타고 흐릅니다. 단지 이 몸을 찢어발길 위협을 끼치지 않게 되었을 뿐. 앞으로 이 힘을 어떻게 다룰지는 장담 못 하겠지만... 종족의 안녕을 위해서만 써야 한다는 것은 잘 압니다.', 39653),
(211813, 'koKR', '', '당신이라면 멜리와 둘도 없는 친구가 될 거라 믿어 의심치 않아요!', 39653),
(211812, 'koKR', '', '아, 정말 다행이다. 멜리가 돌아왔군요! \n\n도움에 감사드려요, $p 님.', 39653),
(211774, 'koKR', '', '아주 좋은 질문이에요, 나락 방랑자님! \n\n코르시아에 계실 때 겸사겸사 그 아이도 찾아주실 수 있을는지요? 찾으면 제발 제게로 데려와 주세요.', 39653),
(211772, 'koKR', '', '전 멜리를 기수를 태우고 용감무쌍하게 미지로 돌진할 수 있는 훌륭한 군마로 키우고 있어요! \n\n그런데 천성이 호기심 덩어리라서 고민이에요. 자기 멋대로 옆길로 새버릴 때가 있거든요. 집중하게 해야 하는데 말이죠!', 39653),
(211704, 'koKR', '', '내 동포는 먹잇감이었네. 착취의 대상이었지. 그래서 엘룬께 복수를 청했고, 양날의 검을 하사받았네.\n\n나는 밤을 주름잡는 공포의 대상이 되었지. 도시를 안전하게 지켜낼 수 있었어. 한동안은.\n\n하지만 그런 힘은 필멸자를 위한 것이 아닐세. 양날의 검이란 양면으로 베어든다는 의미지.\n\n말드락서스에 와서는 나 자신을 완벽하게 갈고 닦았네.', 39653),
(211702, 'koKR', '', '종국에 이르러 종족에 위협이 될 존재가 단 하나 남더구나. 바로 나였다.\n\n결국에는 나도 종족을 보호하려고 했던 친우에게 최후를 맞았다.\n\n레벤드레스에 도착해... 아주 오랜 시간을 성찰한 끝에서야 내 분노의 깊이와 죄악의 무게를 깨달았지. 이 경험을 밑거름 삼아 분노에 삼켜진 타인을 돕는 방법을 터득했느니라.', 39653),
(211701, 'koKR', '', '나는 엘룬의 검은 선물을 받아들인 후, 처음에는 상실감으로, 그다음에는 승리로 분노의 허기를 달랬다. 내 동포를 보호했지. 우리를 해하려는 자들의 목숨을 앗았고, 그 동맹을 다음 표적으로 삼기도 했다. 이어서 우리의 적을 막지 않았거나 뜻을 같이한 이들을 처단했지. 여기서 한발 더 나아가 내 기준에 빠르게 행동하지 않은 자들을 없앴다. 그야말로 꼬리에 꼬리를 물었지...\n\n나는 세상의 여러 집단을 지워버리며 오로지 폐허만을 남겼다. 우리에게 해악을 끼칠 만한 존재를 안 남기면 당할 일이 없을 거란 논리에서였지.', 39653),
(211699, 'koKR', '', '보면 모르겠느냐? 아니면 이리 돕겠다고 나서지도 않았겠지.\n\n<한쪽 눈썹을 추켜세우는 돌장인>\n \n내가 어쩌다 레벤드레스에 당도했는지 궁금한가 보군?', 39653),
(211695, 'koKR', '', '저는 이 숲에서 경이로운 사건을 숱하게 목도했습니다. 하지만 민도의 몸을 빌린 여신님의 목소리를 듣고 나니, 그 일들이 하잘것없게 느껴지는군요.', 39653),
(211693, 'koKR', '', '참... 푸른 곳이로군.', 39653),
(211689, 'koKR', '하늘에서 감사한 마음이 담긴 울음소리가 들려옵니다.', '', 39653),
(211620, 'koKR', '호기가 공포로 바뀌었으니, 놈들도 공격할 생각은 멈출 것이야... 당분간은.', '', 39653),
(211619, 'koKR', '헬가드 요새 밖에 적군이 응집해있구나. 저들이 공격에 나서기 전에 수를 줄여놓거라.', '', 39653),
(211618, 'koKR', '', '어떤 대가를 치르더라도.', 39653),
(211591, 'koKR', '', '<온화한 미소를 지어 보이는 이세라>', 39653),
(211578, 'koKR', '', '그래, 준비는 다 된 거요, 아직인 거요?', 39653),
(211577, 'koKR', '', '학살은 계속된다!', 39653),
(211572, 'koKR', '', '변화의 바람이 부는군요.', 39653),
(211569, 'koKR', '안녕하세요. 이 차원문을 이용하고 싶으십니까?', '안녕하세요. 이 차원문을 이용하고 싶으십니까?', 39653),
(211567, 'koKR', '멋집니다! 타자베쉬 각지에는 제 바로 뒤에 있는 것과 같은 차원문이 여기저기 설치되어 있습니다. 더불어 차원문마다 장치의 유지보수와 승인된 사용자 명부를 담당하는 타자베쉬 차원문 연결망 협회의 대리인이 배정되어 있죠. 간단히 대리인에게 말씀하시면 해당 지점의 사용을 허가해줄 거예요.\n\n시범으로 이 차원문에 대한 접근 권한을 부여해 드렸습니다. 타자베쉬에서 재밌고 즐겁게 머무르다 가시길!', '멋집니다!\n타자베쉬 각지에는 제 바로 뒤에 있는 것과 같은 차원문이 여기저기 설치되어 있습니다. 더불어 차원문마다 장치의 유지보수와 승인된 사용자 명부를 담당하는 타자베쉬 차원문 연결망 협회의 대리인이 배정되어 있죠. 그냥 대리인에게 말씀하시면 해당 지점의 사용을 허가해줄 거예요. 차원문 해제를 완료했으면 발을 내디뎌 요청한 도착 지점으로 가면 된답니다! 이 얼마나 근사한 장치입니까?', 39653),
(211566, 'koKR', '', '제 호의를 약점으로 착각하셨나 보군요.', 39653),
(211565, 'koKR', '', '살펴 가세요.', 39653),
