(211553, 'koKR', '아, 안녕하십니까! 여간 소란이 아니네요. 물론 당신은 아무 상관 없으리라 믿겠습니다. 타자베쉬 차원문 연결망에 대해 자세히 설명해 드릴까요?', '아, 안녕하십니까! 여간 소란스러운 게 아니군요. 그렇죠? 물론 당신은 아무 상관 없으리라 믿겠습니다. 타자베쉬 차원문 연결망에 대해 자세히 설명해 드릴까요?', 39653),
(211551, 'koKR', '*타리사가 당신을 빤히 응시합니다.*', '*타리사가 당신을 빤히 응시합니다.*', 39653),
(211550, 'koKR', '', '너희가 쫓는 힘이... 뭔지도 모르나 보군...', 39653),
