(211548, 'koKR', '', '겨울 여왕께서 우리 종족의 영혼에겐 사명이 있다 하셨지요. 그게 무슨 의미입니까?', 39653),
(211547, 'koKR', '', '그분의 것이자 나의 것이란다.', 39653),
(211546, 'koKR', '', '너무나도 청아하면서... 슬픔이 담겨 있는 목소리였습니다. 눈물은...', 39653),
(211545, 'koKR', '', '나 역시 모든 순간 동안 함께 있었지만, 의식은 몸 밖에 있었지. 너와 같은 시점에서 보았단다.', 39653),
(211544, 'koKR', '', '오늘 목격한 광경은... 좀처럼 믿기지가 않습니다.', 39653),
