(211542, 'koKR', '', '어머니... 십니까?', 39653),
(211541, 'koKR', '오리보스가 내 손 안에 있다.', '', 39653),
(211539, 'koKR', '', '계절은 변하며 잎새는 집니다.', 39653),
(211534, 'koKR', '', '새로운 인장이 우리 성약의 단의 미래를 실현하리라.', 39653),
(211533, 'koKR', '', '순환은 재생되었고, 죽음과 삶은 다시금 조화를 이루었으니.', 39653),
(211532, 'koKR', '', '우리의 마음도 그러할 겁니다.', 39653),
