(211530, 'koKR', '', '끈기와 연대를 통해 우리 숲으로 희망이 돌아왔도다.', 39653),
(211529, 'koKR', '', '하나 힘을 합쳐 극악무도한 어둠으로부터 터전을 지켜냈노라.', 39653),
(211523, 'koKR', '귀찮게 좀 하지 말아요.', '', 39653),
(211522, 'koKR', '당신하고 놀 시간 없어요.', '', 39653),
(211521, 'koKR', '영원한 햇살이 당신에게 비추기를.', '', 39653),
(211520, 'koKR', '평화로운 여행 되세요.', '', 39653),
(211519, 'koKR', '바람이 길을 안내해 줄 거예요.', '', 39653),
(211518, 'koKR', '만나서 반가워요.', '', 39653),
(211508, 'koKR', '', '티란데를 구하기에 너무 늦지 않았기를.', 39653),
(211502, 'koKR', '다른 신병들이 $p 님이 나락에서 보여주신 영웅적인 면모에 대해 입이 닳도록 얘기하더군요.\n\n고트라의 폭발이 코르시아에서도 보일 정도였다고 합니다.\n\n그 광경을 놓쳐 안타까울 노릇입니다.\n\n<당신에게 경례하는 신병>\n\n혹시 나락 방랑자님께 필요할 수도 있으니, 당분간 이 거울을 유지하도록 하겠습니다.', '다른 신병들이 $p 님이 나락에서 보여주신 영웅적인 면모에 대해 입이 닳도록 얘기하더군요.\n\n고트라의 폭발이 코르시아에서도 보일 정도였다고 합니다.\n\n그 광경을 놓쳐 안타까울 노릇입니다.\n\n<당신에게 경례하는 신병>\n\n혹시 나락 방랑자님께 필요할 수도 있으니, 당분간 이 거울을 유지하도록 하겠습니다.', 39653),
(211501, 'koKR', '$p 님, 레나탈 왕자님께서 간수에 대항하는 최전선에 지원을 요청하셨습니다.\n\n죄악의 몰락지 군대가 나락에 거점을 마련한 뒤, 적의 심부에 있는 방어 시설을 습격할 준비를 하고 있습니다.\n\n가능한 한 빨리 거울을 통과해 왕자님께 보고하시길.', '$p 님, 레나탈 왕자님께서 간수에 대항하는 최전선에 지원을 요청하셨습니다.\n\n죄악의 몰락지 군대가 나락에 거점을 마련한 뒤, 적의 심부에 있는 방어 시설을 습격할 준비를 하고 있습니다.\n\n가능한 한 빨리 거울을 통과해 레나탈 왕자님께 보고하시길.', 39653),
(211500, 'koKR', '일단은 코르시아로 돌아가는 게 좋겠군. 시초자에게 간수가 어떤 음모를 획책하고 있는지 들을 수 있기를... 그를 저지하기 위해 어떤 일을 해야 하는지도.', '', 39653),
(211498, 'koKR', '기사단을 시켜 실바나스를 오리보스에 구금하겠다. 의식을 되찾는 대로 심문을 시작하지.', '', 39653),
(211497, 'koKR', '', '맞아요. 실바나스가 쓰러지기 전 무언가를 얘기했는데, 제대로 알아들을 수 없었죠.', 39653),
(211496, 'koKR', '저자라면 알지도 모르오.', '', 39653),
(211495, 'koKR', '', '저주받을 간수 같으니! 녀석이 안두인을 붙잡고 있어요. 어디로 향했든 반드시 찾아낼 겁니다!', 39653),
(211494, 'koKR', '그의 힘... 그 인장마저 처음부터 자기 것이었던 것처럼.', '', 39653),
(211493, 'koKR', '간수가 심판관을 처치하려 온 건 줄 알았건만, 그자가 심판관의 정수를 흡수해버렸소.', '', 39653),
(211492, 'koKR', '간수가 사라졌다. 더군다나 어디로 이어지는지 모를 저 관문은 닫혀버렸어.', '', 39653),
(211489, 'koKR', '동지들이여, 마음 단단히 먹도록!', '', 39653),
(211487, 'koKR', '카곰을 데려가시길. 동족을 추적하는 데 일가견이 있죠. 위협을 색출하는 데에도 도움이 될 거예요!', '카곰을 데려가시길. 동족을 추적하는 데 일가견이 있죠. 위협을 색출하는 데에도 도움이 될 거예요!', 39653),
(211485, 'koKR', '웬 덩치 큰 파편가죽이 마구간에 있는 동물을 잡아먹고 있어요. 동물들을 보호해야 해요.\n\n이 야수를 추적해 제거하는 데 힘을 빌려주셨으면 합니다!', '웬 덩치 큰 파편가죽이 마구간에 있는 동물을 잡아먹고 있어요. 동물들을 보호해야 해요.\n\n이 야수를 추적해 제거하는 데 힘을 빌려주셨으면 합니다!', 39653),
(211479, 'koKR', '', '우리가 구해 줄게요, 안두인.', 39653),
(211478, 'koKR', '저항해야 한다! 간수에게 굴복해선 안 돼!', '', 39653),
(211473, 'koKR', '이 이상 안주해서는 안 된다. 이젠 행동에 나서야 한다.', '', 39653),
(211471, 'koKR', '우서 님과 전 아드레스테스 님을 돕겠습니다. 다른 분들은 굳건하시길!', '', 39653),
(211468, 'koKR', '', '흥. \"비밀의 수호자\" 납셨군.', 39653),
(211465, 'koKR', '', '놈이 성공했군요. 심판관이 쓰러지고 있어요...', 39653),
(211464, 'koKR', '안 돼! 간수가 심판관을 파괴하려 한다!', '', 39653),
(211463, 'koKR', '심판관의 방어가 약해지고 있네! 손 쓸 수 있을 때 간수를 막아야 하네!', '', 39653),
(211462, 'koKR', '제이나, 차원문을 열어다오!', '', 39653),
(211461, 'koKR', '아니, 우리가 네놈을 막을 것이다!', '', 39653),
(211460, 'koKR', '발버둥 쳐 봐야 소용없다.', '', 39653),
(211459, 'koKR', '이번엔 네가 질 것이다, 실바나스!', '', 39653),
(211458, 'koKR', '네 전쟁은 여기까지다, 밴시!', '', 39653),
(211457, 'koKR', '운명필경사가... 납치당하다니. 목적의 길이 어두운 곳에 있을 그를 위로해 주길 바라야겠소.', '', 39653),
(211456, 'koKR', '', '꼭 이래야만 하나?! 항복해라!', 39653),
(211455, 'koKR', '', '실바나스! 안두인을 돌려줘!', 39653),
(211454, 'koKR', '사울팽을 위하여! 호드를 위하여!', '', 39653),
(211453, 'koKR', '포기해라, 실바나스!', '', 39653),
(211452, 'koKR', '', '적이 너무 많아요!', 39653),
(211450, 'koKR', '이 괴물들은 끝이 없는 건가?!', '', 39653),
(211449, 'koKR', '셀 수 없이 많은 놈들이로군!', '', 39653),
(211439, 'koKR', '<고트라의 시체를 보며 수긍하듯 고개를 끄덕이는 장군>\n\n레나탈 왕자님이 처음 이 계획을 입안하셨을 땐 확신이 없었네. 하지만 이제는 그 안에 담긴 혜안을 알겠네.\n\n수많은 돌숨결이 희생되었을 이 전투에서 빛을 섬세히 조작해 단 한 명의 사상자만 나왔다니.\n\n흥미롭군...', '', 39653),
(211438, 'koKR', '오늘의 승리는 단순히 레벤드레스나 몽환숲의 전유물이 아니다. 어둠땅의 안녕을 소망하는 자 모두가 승리의 기쁨을 함께 만끽하는 것이다.\n\n싸움이 끝나는 그날까지 멈추지 않으리라.', '', 39653),
(211437, 'koKR', '', '<불타오르는 고트라의 시체를 훑어보고는 미소를 짓는 대신 문베리>\n\n이래서 제가 레나탈 왕자의 방식을 좋아한다니까요... 언제 또 하면 좋겠네요.', 39653),
(211436, 'koKR', '', '<계속 무기로 공격을 받아치면서 얘기하는 나지아>\n\n동쪽 측면에 자원이든 시간이든 굳이 낭비할 필요 없어. 내가 어련히 잘 사수할 테니, 너나 다른 사람들은 주된 목표에 집중하기나 해.\n\n달리 내가 필요한 곳이 생기면 전갈이나 보내. 당연하지만 내가 떠난 이 자리는 연대 하나를 통째로 배치해야 채울 수 있을 거야.\n\n<미소를 지어 보인 후 다시 나락살이를 상대하는 데 몰두하는 나지아>', 39653),
(211434, 'koKR', '', '<니야가 머리를 긁어주자 게걸충이 행복에 겨워 몸을 꾸물댑니다.>\n\n솔직히 인정해야겠어요. 위험한 천성만 제어할 수 있으면 이 꼬마 친구들도 제법 귀여운 면이 눈에 들어온단 말이죠.\n\n걱정 마세요. 제가 잘 간수할 테니.', 39653),
(211433, 'koKR', '', '<나긋하게 속삭이는 대신 문베리>\n\n레나탈 왕자에겐 비밀인데, 실은 우리 중에 마법을 누가 더 잘 다루나 점수를 매기고 있어요.\n\n적 처치 수는 왕자가 더 높아요. 하지만 일격에 쓰러뜨린 적 수는 제가 최고 기록을 보유하고 있죠!\n\n아, 덤으로 주문을 쓸 때마다 고약한 미소를 곁들이고 있어요. 나락살이 녀석들 열 좀 받으라고요!\n\n<키득대는 대신 문베리>', 39653),
(211431, 'koKR', '아. 나락에 온 걸 환영하네, $p!\n\n자네가 함께해서 정말 기쁠 따름일세.\n\n아니지, 이래서야 우리 친구와 입장이 뒤바뀐 꼴이로군.\n\n나야말로 자네 전문인 영역에 발을 들인 일개 손님에 지나지 않으니 말일세.\n\n<당신에게 정중하게 인사하더니 조용한 목소리로 묻는 테오타르>\n\n여기는 원래 이렇게... 투박한 곳인가? 영역 사방을 살펴봤지만 의자를 단 하나조차 못 봤네.', '', 39653),
(211430, 'koKR', '영광스럽게도 레나탈 왕자님께 나락으로 출병하는 병력을 지원해 달라는 요청을 받았다.\n\n뭐, 테멜은 요즘 다른 칭호가 더 마음에 드는 모양이지만...\n\n<짜증스러운 눈빛으로 테멜을 흘겨보는 묘지지기 카시르>\n\n...비록 흔친 않음에도 \"연회의 전령\"으로서 기여할 순 있겠지.\n\n하지만 테멜 같은 훌륭한 죄악의 전령이라면 우리의 적이 쌓아 올린 수많은 죄업을 이용할 수 있을 터.', '', 39653),
(211429, 'koKR', '', '짙은 어둠이 드리운 이 나락의 심연 속에서 적에게 포위된 이 순간에도 우리의 책무를 잊어선 안 된다.\n\n벤티르는 파괴의 인도자가 아니다. 외려, 파괴를 피할 수 있는 모든 방도를 절박하게 모색하는 존재들이지.\n\n이 나락에 떨어져 마땅한 영혼들이 있는 건 나도 안다. 내 손으로 수없이 많이 보내봤기에 잘 알지.\n\n하나, 간수는 자신의 정당한 권리 바깥에 있는 영혼들까지 취했다. 부당한 오명을 쓴 영혼을 모두 구원하는 그 날까지 우린 쉬어선 안 돼.\n\n레벤드레스의 소명은 한순간도 쉬운 적이 없었다. 그러나 그 중요성은 불변하지.\n\n이제는 너도 이 사실을 깨달았으리라 믿는다.', 39653),
(211428, 'koKR', '우린 힘닿는 데까지 모든 영혼을 구할 겁니다.\n\n누구나 기회를 받을 자격은 있습니다. 제가 규탄자님께 기회를 받은 것처럼요.', '', 39653),
(211427, 'koKR', '우리가 지금 운용하는 병력은 내가 평소에 지휘하던 체계와 다소 차이가 있다네.\n\n돌숨결이 더 많았으면 마음이라도 편하련만, 어쩔 수 없지. 아쉬운 대로 헤쳐나가는 수밖에 더 있겠나.\n\n레벤드레스는 굳건히 버틸 걸세.', '', 39653),
(211426, 'koKR', '', '아, 음. 안녕하세요?\n\n제가 도울 일이라도 있나요? 아니지, 절 이미 돕는 중이셨던가요?\n\n죄송해요. 지금 정신이 살짝 없는지라.', 39653),
(211425, 'koKR', '<밑에 있는 허드레꾼 투사에게 응원을 보내는 렌들>\n\n혼쭐을 내줘, 흠송곳니! 넌 내 영웅이야!', '', 39653),
(211424, 'koKR', '흠송곳니가 금방 돌아와서 박살을 내버릴 겁니다!', '', 39653),
(211423, 'koKR', '앉아서 음료나 한잔하시죠, $p 님. 시간이야 넉넉하니까요.', '', 39653),
(211415, 'koKR', '저는 한창 혈기왕성한 시기에 이 상자를 만들었습니다. 상자의 힘을 빌려 아무 해악을 받지 않고 이 전당을 여행하려고 했지요.\n\n넘치는 교만함에 못 이겨, 이 장소에서 자신의 가치를 입증하는 자만이 안에 담긴 경이를 다룰 수 있도록 했죠. \n\n내가 그 가치를 보여주지 못할 거란 생각은 하지도 않고 말입니다...', '저는 한창 혈기왕성한 시기에 이 상자를 만들었습니다. 상자의 힘을 빌려 아무 해악을 받지 않고 이 전당을 여행하려고 했지요.\n\n넘치는 교만함에 못 이겨, 이 장소에서 자신의 가치를 입증하는 자만이 안에 담긴 경이를 다룰 수 있도록 했죠. \n\n내가 그 가치를 보여주지 못할 거란 생각은 하지도 않고 말입니다...', 39653),
(211389, 'koKR', '', '우리와 함께 서거라, 아드레스테스. 성약의 단의 인장을 다시 벼릴 것이니.', 39653),
(211388, 'koKR', '', '키리안와 이탈자의 화합 속에 탄생하리라.', 39653),
(211387, 'koKR', '반갑습니다, 나락 방랑자님. 제가 도울 일이라도 있을까요?', '', 39653),
(211386, 'koKR', '', '아드레스테스, 앞으로 나오너라.', 39653),
(211385, 'koKR', '', '새로운 사원을 세운 일은 그보다도 더 오래되었다.', 39653),
(211383, 'koKR', '우리의 사명은 변한 적 없지. 우리는 영겁의 시간동안 수많은 현실에서 주인님의 명령을 비밀리에 수행했다.', '', 39653),
(211377, 'koKR', '', '진실이 담긴 말이었지만, 나는 귀담아 듣지 않았다.', 39653),
(211376, 'koKR', '', '앞으로 모든 키리안에게 선택지를 주노라. 이제 기억을 간직해도 되며, 전처럼 놓아주어도 좋다.', 39653),
(211375, 'koKR', '', '클레이아, 너는 헌신의 손으로서 그를 섬겨라.', 39653),
(211374, 'koKR', '', '너만큼 이 영예를 누릴 자격이 있는 자는 없노라.', 39653),
(211369, 'koKR', '', '오딘 님께 경고를 전하러 갈 준비는 되었나? 하늘보루의 영광이 우릴 기다린다!', 39653),
(211367, 'koKR', '', '투자의 결실을 볼 때만큼 바람직한 상황이 없죠.', 39653),
(211357, 'koKR', '', '막고, 돌리고, 쳐내고, 피하고, 회전, 찌르기...', 39653),
(211356, 'koKR', '추방당한 자는 우리의 가장 소중한 보물을 노리고 있소... 우주 만물을 말살하는 한이 있어도 쟁취하려 들 거요.', '', 39653),
(211355, 'koKR', '아, 무례를 용서하시오. 난 비밀의 수호자 탈갈란이오.', '', 39653),
(211349, 'koKR', '', '나도 돕도록 하지. 대신 알아둬라... 엘룬의 분노는 쉽사리 가라앉힐 수 없다는 걸.', 39653),
(211337, 'koKR', '', '네 역할을 훌륭히 해냈다, 나락 방랑자. 따라와라.', 39653),
(211336, 'koKR', '', '신속히 공격해라, 자매들이여! 오딘을 위하여!', 39653),
(211334, 'koKR', '|Hitem:186686|h|cFFFFFFFF[창백한 점술의 뼈]|r|h를 던져 자신의 미래를 점칩니다...', '|Hitem:186686|h|cFFFFFFFF[창백한 점술의 뼈]|r|h를 던져 자신의 미래를 점칩니다...', 39653),
(211331, 'koKR', '', '관객분들은 들을 만큼 들었습니다.', 39653),
(211330, 'koKR', '더 신나는 걸로!', '', 39653),
(211329, 'koKR', '', '다음 악단 들여보내!', 39653),
(211328, 'koKR', '다음 공연 시작해!', '', 39653),
(211327, 'koKR', '이미 너무 늦었을지도 모른다.', '', 39653),
(211310, 'koKR', '', '이곳에선 더 할 수 있는 일이 없다. 오리보스로 돌아가거라, 필멸자여. 오늘 건넨 네 도움은 나이테에 기억될 것이다.', 39653),
(211285, 'koKR', '덤벼라, 우서. 그러면 빠른 죽음을 선사해주마.', '', 39653),
(211284, 'koKR', '', '다시 한번 해 볼게요. 그런데, 음... 뭐가 나와도 놀라시면 안 돼요. 아셨죠?', 39653),
(211282, 'koKR', '', '망가진 삶과 죽음의 순환을 두 눈으로 똑똑히 확인하고도, 결함뿐인 체계를 다시 구축하려는 우리를 막으려 들다니. 이 얼마나 애통한 일인가.', 39653),
(211274, 'koKR', '', '간수가 나락을 벗어나려는 걸까요... 아니면 다른 뭔가를 꾸미는 걸까요?', 39653),
(211271, 'koKR', '', '시간이 없습니다! 오리보스가 나락에 감싸이고 있어요!', 39653),
(211270, 'koKR', '스랄 혼자서는 오래 버티기 어려울 거다. 어서 그에게 가야 해!', '', 39653),
(211267, 'koKR', '실바나스가 우리 머리를 노리는군! 어서 저지해라!', '', 39653),
(211266, 'koKR', '', '고통의 소리를 들어봐라!', 39653),
(211265, 'koKR', '맙소사! 놈이 나락을 확장해 오리보스를 집어삼키려 한다!', '', 39653),
(211264, 'koKR', '여세를 몰아라! 반드시 간수를 막아야 한다.', '', 39653),
(211262, 'koKR', '', '어둠이 널 거두리라!', 39653),
(211261, 'koKR', '스랄, 전방을 부탁한다. 용사들이여, 우린 제독을 돕는다!', '', 39653),
(211259, 'koKR', '밴시가 우리 머리를 조준한다!', '', 39653),
(211258, 'koKR', '', '흔적도 없이 사라져라!', 39653),
(211252, 'koKR', '가치 있는 승리로다. 조바알이 가진 그 어떤 무기로도 너희를 이길 수 없음을 증명했구나.', '', 39653),
(211250, 'koKR', '령은 승자의 차지가 되는 법. 힘을 손에 넣어라, 나락 방랑자들이여.', '', 39653),
(211249, 'koKR', '잘 싸웠다. 이제 그 힘을 너희 것으로 만들어 보여라.', '', 39653),
(211248, 'koKR', '야수의 힘을 취해라. 나아가 위험을 극복하는 데 필요할 테니.', '', 39653),
(211247, 'koKR', '괴물을 처단했군. 이제 그 힘을 너희 것으로 만들어 보아라.', '', 39653),
(211246, 'koKR', '보다 무자비한 나락살이가 가까이 있다. 준비하거라.', '', 39653),
(211245, 'koKR', '나락의 사악한 마법이 여기 모여드는군. 뿌리를 뽑아 버려라.', '', 39653),
(211244, 'koKR', '조심하거라. 간수의 강력한 종복과 가까워지고 있으니.', '', 39653),
(211243, 'koKR', '주위에 거대한 악이 도사리는군. 서둘러 몰아내거라.', '', 39653),
(211240, 'koKR', '', '여왕 폐하! 도와주세요!', 39653),
(211238, 'koKR', '고맙다, 나락 방랑자! 이제 사냥을 시작해 보실까?', '', 39653),
(211237, 'koKR', '이봐, 너. 허리 똑바로 안 펴? 자세 교정이 필요한 친구로군.\n\n이거 결례를 범했군. 가끔 직업병에 못 이겨 말이 헛나갈 때가 있어. 실은 여기 존재들하고 마찰을 빚었는데, 내 둘도 없는 장비를 빼앗기고 말았지 뭐야.\n\n이따위 사슬로는 내 자세조차 바로잡지 못해. 혹시 날 도와줄 순 없겠나?', '', 39653),
(211235, 'koKR', '어서 요리 접시를 찾으러 가자. 재수 없는 멍청이 녀석들은 흠씬 두들겨 패줄 거야.', '', 39653),
(211234, 'koKR', '어이! \n\n당신 누구야?\n\n나? 요리 접시 잃어버렸다고 여기로 내던져진 놈이지.\n\n근데 누명을 쓴 것 같긴 해. 접시로 원반 던지기 놀이 하는 멍청이 녀석들을 근처에서 봤거든.', '', 39653),
(211232, 'koKR', '따라다니면서 가능한 한 도와줄게. 대신 뼈를 찾아봐 줘. 평범한 뼈는 안 돼. 난 어느 정도 급이 맞는 뼈가 필요하거든.', '', 39653),
(211231, 'koKR', '환장하겠군!\n\n토르가스트에 갇힌 것만으로도 끔찍한데, 엎친 데 덮친 격으로 야수 놈들이 뼈를 빼앗아갔어!\n\n뼈를 되찾는 것 좀 도와줘. 아니면 적당한 대체품을 찾거나.', '', 39653),
(211230, 'koKR', '', '장담컨대 주변 마귀 중에 아뮬렛을 가진 자가 있을 거다.', 39653),
(211228, 'koKR', '', '당신은 여기 한심한 패배자들과 다르군요.\n\n저는 자연스럽게 성장할 방법을 찾아 이곳에 왔습니다. 가장 강력한 적에게 도전해 단판에 승부를 내려는 요량이었죠.\n\n첫 전투를 치르고 난 뒤, 놈들이 머릿수만 믿고 달려들어서는 제 장비와 식량을 몰수하고 이렇게 구속해 버렸습니다.\n\n사슬에 묶여서야 어떻게 성장하란 말입니까? 육체 단련조차 제대로 못 하는 판에!\n\n여기 놈들은 진정한 전사가 된다는 게 무슨 의미인지 모릅니다.', 39653),
(211226, 'koKR', '', '사라진 동력원 탐색을 시작합니다.', 39653),
(211225, 'koKR', '', '개체 소진. \n\n동력원이 존재하지 않습니다.\n\n전투 역량 감소.\n\n지원을 요청합니다.', 39653),
(211223, 'koKR', '', '다시 움직일 수 있게 되니 좋군요. 슬슬 몸을 풀어보실까요.', 39653),
(211222, 'koKR', '', '반갑다, 나락 방랑자여.\n\n내가 어리석었다. 혼자서도 해낼 수 있으리란 착각을 하다니.\n\n나는 내 휘하 열망자의 기억이 담겨 있는 아뮬렛을 찾고 있다. 그 친구가 도둑맞은 물건을 찾으려다 이 함정에 빠지게 되었지 뭔가.\n\n날 도와줄 수 있겠나?', 39653),
(211220, 'koKR', '엘라가 계속 전진하라는 듯 당신에게 옹알대는 소리를 냅니다.', '', 39653),
(211219, 'koKR', '<괴로워하는 것처럼 보이는 생명체>', '', 39653),
(211217, 'koKR', '자유다! 친구를 찾아야 하네.', '', 39653),
(211216, 'koKR', '바람에 떠밀려 이렇게 됐네. \n\n친구가 잡혀갔지.\n\n도와주지 않겠나?', '', 39653),
(211204, 'koKR', '계속 까불면 가루로 만들어 주지.', '계속 까불면 가루로 만들어 주지.', 39653),
(211202, 'koKR', '또다시 귀찮게 하지 마.', '또다시 귀찮게 하지 마.', 39653),
(211201, 'koKR', '다 끝냈나?', '다 끝냈나?', 39653),
(211198, 'koKR', '어서 가 봐.', '어서 가 봐.', 39653),
(211197, 'koKR', '시덥잖은 일은 아니겠지?', '시덥잖은 일은 아니겠지?', 39653),
(211195, 'koKR', '무슨 일이지?', '무슨 일이지?', 39653),
(211194, 'koKR', '꾸물대지 마.', '꾸물대지 마.', 39653),
(211188, 'koKR', '아, 어서 오세요. 타자베쉬로 통하는 길이 다시 열린 걸 아십니까?\n\n신중한 처신이 필요한 곳이죠. 외지인을 그리 달가워하진 않거든요. 뭐, 거래할 물건이 아주 많긴 합니다만. \n\n값비싼 물건하며, 반짝이는 귀금속도 있죠.\n\n제가 그곳 상품 몇 개를 취득했답니다. 보석벌레를 본 적 있으십니까? 가죽에 보석이 자라나는데, 체내에서 발산되는 빛으로 번쩍이죠. 하지만 생명이 다하면 빛은 희미해지고 금이 가버립니다. \n\n극도로 희귀하고 진귀한 생물이에요.\n\n제가 바라는 것은 나락 방랑자님의 세계에서 최고로 진귀하고 감성적인 상품입니다. 마침 몇 가지 눈여겨보는 게 있지요...', '', 39653),
(211184, 'koKR', '고통은 영원하리니!', '', 39653),
(211183, 'koKR', '운명이 펼쳐진다! 일천 개의 실타래가 풀리고 뜯어진다!', '', 39653),
(211182, 'koKR', '아, 보인다! 모든 것이 눈 앞에 드러나는구나!', '', 39653),
(211181, 'koKR', '나의 새로운 작품을 목도하고 절망해라!', '', 39653),
(211180, 'koKR', '너희의 고통은 영원하리라!', '', 39653),
(211179, 'koKR', '얼마나 고통을 견딜 수 있는지 시험해 보지!', '', 39653),
(211177, 'koKR', '파멸이 기다린다!', '', 39653);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(211176, 'koKR', '수집할 절규가 늘었군.', '', 39653),
(211175, 'koKR', '나의 힘은 무한하다!', '', 39653),
(211174, 'koKR', '죽음이 엄습한다!', '', 39653),
(211173, 'koKR', '난... 절대... 갇히지 않아...', '', 39653),
(211172, 'koKR', '너희 목숨을 거두는 건 나다!', '', 39653),
(211171, 'koKR', '이제 나락의 구렁은 우리 것이다. 어둠땅을 위하여!', '', 39653),
(211167, 'koKR', '괜찮소. 나락으로부터 코르시아를 지키는 일 따윈 미뤄도 괜찮은가 보군.', '', 39653),
(211166, 'koKR', '몸조심하길.', '', 39653),
(211165, 'koKR', '목적의 길과 함께하기를.', '', 39653),
(211164, 'koKR', '배움엔 끝이 없다네.', '', 39653),
(211163, 'koKR', '어떤 소식을 가져왔나?', '', 39653),
(211162, 'koKR', '할 일이 많다네.', '', 39653),
(211161, 'koKR', '그대가 기억이 나는군.', '', 39653),
(211160, 'koKR', '', '[DNT] I have studied five thousand four hundred and seventeen ways to dismember your kind.', 39653),
(211159, 'koKR', '', '비밀을 지킵니다. 언제나요.', 39653),
(211156, 'koKR', '', '목적을 따르시길.', 39653),
(211155, 'koKR', '', '당신과 함께합니다.', 39653),
(211154, 'koKR', '', '뭘 도와드릴까요?', 39653),
(211153, 'koKR', '', '비밀을 알려주세요.', 39653),
(211152, 'koKR', '', '반갑습니다, 나락 방랑자여.', 39653),
(211148, 'koKR', '|TInterface\\ICONS\\INV_BrokerMount_Light.BLP:20|t 조펙스가 $n|1을;를; |cFFFF0404|Hspell:348006|h[억제장]|h|r에 가둡니다!', '|TInterface\\ICONS\\INV_BrokerMount_Light.BLP:20|t 조펙스가 $n|1을;를; |cFFFF0404|Hspell:348006|h[억제장]|h|r에 가둡니다!', 39653),
(211144, 'koKR', '절대 용서받지 못할 자들에게도... 연민을 가져야한다는 걸 당신에게 배웠습니다.', '', 39653),
(211143, 'koKR', '당신의 도움이 필요합니다. 보시다시피 업무가 워낙 과중해서 말이죠.', '', 39653),
(211142, 'koKR', '', '방금 뭐라고 하셨죠, 나락 방랑자님?', 39653),
(211141, 'koKR', '아직 멀었나요?', '', 39653),
(211124, 'koKR', '너희 영혼은 얼어붙은 황무지에서 부패하리라!', '', 39653),
(211121, 'koKR', '누구도 내 힘을 거역할 순 없다!', '', 39653),
(211120, 'koKR', '차디찬 바람이 너희의 최후를 울부짖는구나!', '', 39653),
(211116, 'koKR', '우리 곁을 떠난 충직한 기록관들이 이토록 많은 건 정말 비극입니다.', '', 39653),
(211115, 'koKR', '', '시간이 흐르면 이해될 거예요.', 39653),
(211114, 'koKR', '', '그들은 뜻대로 목적의 길을 섬겼고, 지혜를 남겨주었죠.', 39653),
(211113, 'koKR', '', '눈이 취약해졌다!', 39653),
(211112, 'koKR', '', '작은 눈들이 눈을 보호하고 있다, 나락 방랑자. 내 창을 사용해 끌어 내리고... 파괴해 버려라!', 39653),
(211111, 'koKR', '', '오딘 님의 눈이 저리도 부정한 존재로 뒤틀렸다니... 어서 저 흉물을 처단해라!', 39653),
(211106, 'koKR', '', '이 자가 룬조각사란 말이오?! 별 볼 일 없어 보이는데.', 39653),
(211103, 'koKR', '메달, 레벤드레스, 왕자와 놈의 대의까지... 전부 근시안적인 발상의 소산이다.\n\n데나트리우스 대영주께서는 먼 옛날부터 이 현실을 그려오셨다.', '', 39653),
(211102, 'koKR', '협조하면서 이목을 끌지 않는 편이 좋겠습니다.', '', 39653),
(211101, 'koKR', '', '네 영혼은 곧 간수님께 결속되리라.', 39653),
(211100, 'koKR', '우리 모두... 죄수일 뿐...', '우리 모두... 죄수일 뿐...', 39653),
(211099, 'koKR', '너는... 사슬에 묶여... 썩으리라...', '너는... 사슬에 묶여... 썩으리라...', 39653),
(211097, 'koKR', '안에 담긴 힘이 탈출을 위해 압박을 가하자 수수께끼 상자의 구조 자체가 비틀어집니다.', '안에 담긴 힘이 탈출을 위해 압박을 가하자 수수께끼 상자의 구조 자체가 비틀어집니다.', 39653),
(211094, 'koKR', '어서 시작해라. 서둘러야 할 거야!', '어서 시작해라. 서둘러야 할 거야!', 39653),
(211093, 'koKR', '거기 너! 늦었잖아. 얼른 령을 추출해야 한다. 돌장인께선 지금 바쁘시지.', '거기 너! 늦었잖아. 얼른 령을 추출해야 한다. 돌장인께선 지금 바쁘시지.', 39653),
(211092, 'koKR', '어, 그렇죠! 그럼 가보겠습니다!', '', 39653),
(211084, 'koKR', '나락이... 모두를... 삼키리...', '나락이... 모두를... 삼키리...', 39653),
(211082, 'koKR', '알겠소. 수호자의 안식처로 통하는 길을 열도록 하지. 언젠가 이곳에 돌아올 수 있기를...', '', 39653),
(211081, 'koKR', '', '인장보다 중요한 건 없소. 우리를 내보내 주시오!', 39653),
(211077, 'koKR', '이곳에 있는 방대한 지식을 그냥 두고 갈 순 없소!', '', 39653),
(211076, 'koKR', '가져가라. 얼른.', '가져가라. 얼른.', 39653),
(211075, 'koKR', '돌숨결 경비병이 어깨를 으쓱합니다.', '돌숨결 경비병이 어깨를 으쓱합니다.', 39653),
(211074, 'koKR', '돌장인께서 안전한 장소에 두라고 하셨습니다. 괜히 그분의 노여움을 사고 싶은 건 아니겠죠?', '', 39653),
(211073, 'koKR', '뭐 하는 짓이냐, 진흙살이?', '뭐 하는 짓이냐, 진흙살이?', 39653),
(211072, 'koKR', '', '이런 걸 그냥 내버려 둔다고요?', 39653),
(211068, 'koKR', '그 교훈을 가슴 깊이 새겨라, 우서. 과거는 바꿀 수 없지만, 미래는 새로 써 나갈 수 있으니.', '', 39653),
(211064, 'koKR', '', '뭐, 어머니의 죽음은 고리타분한 소재죠.', 39653),
(211063, 'koKR', '재능을 타고나셨는데요, 날개 아가씨?', '', 39653),
(211062, 'koKR', '벌써 끝냈다고? 대단한데!', '벌써 끝냈다고? 대단한데!', 39653),
(211061, 'koKR', '', '진전이 있었네요! 유익한 상담이었어요.', 39653),
(211060, 'koKR', '', '그건... 그래, 맞아.', 39653),
(211059, 'koKR', '', '당신 역시 다른 수많은 어머니의 죽음을 초래했나요?', 39653),
(211058, 'koKR', '', '아, 아마도? 나는... 그냥... 아아악!', 39653),
(211057, 'koKR', '', '그 상실감 때문에 살육을 일삼는 인생을 살게 된 건가요?', 39653),
(211056, 'koKR', '좋아, 바로 그겁니다!', '', 39653),
(211055, 'koKR', '', '난 고통 속에서 자랐어. 철저히 혼자였다고!', 39653),
(211054, 'koKR', '', '어머니를 여읜 상실감에 분노했나요?', 39653),
(211053, 'koKR', '세상에, 통했군요? 계속하세요!', '', 39653),
(211052, 'koKR', '', '멋진 분이셨는데, 내 눈앞에서 살해당하셨어!', 39653),
(211051, 'koKR', '', '어머니에 대해 말씀해 보세요.', 39653),
(211050, 'koKR', '', '알겠어요!', 39653),
(211049, 'koKR', '자, 그럼 한 번 더 시도해 보죠.', '', 39653),
(211044, 'koKR', '', '아! 어쩐지 이상하더라.', 39653),
(211043, 'koKR', '당신이 아니라, 저들의 분노죠.', '', 39653),
(211042, 'koKR', '', '분노라! 까부는 스프리건! 숲을 망치는 욕심쟁이 드러스트! 환경을 파괴하는 게걸충!', 39653),
(211041, 'koKR', '어, 틀렸어요. 여긴 격노와 관련된 곳입니다. 분노 말이죠!', '', 39653),
(211040, 'koKR', '', '닥쳐라!', 39653),
(211039, 'koKR', '', '무슨 악행을 저질렀는지 당장 말해요!', 39653),
(211038, 'koKR', '음, 송곳니들은 저들이 레벤드레스로 온 이유를 마주하게 하더군요.', '', 39653),
(211035, 'koKR', '', '음, 이건 어떻게 하는거죠?', 39653),
(211033, 'koKR', '', '아, 음. 안녕하세요.\n\n공포의 군주의 위협을 최대한 빨리 없애 주세요. 이렇게 부탁드릴게요. 데나트리우스의 배반 이후로 파괴가 일어나도 감당할 수 있도록 저희 나름대로 대비했지만, 분노의 수확자의 사냥이 길어지면 길어질수록 감당하기 어려운 결과가 나타나고 말 거예요.\n\n참, 나루와 다시 얘기하게 되거든 이 말씀을 좀 전해주시겠어요? 자의로 우리의 영역에 오랫동안 머무르면 자신의 죄악석이 실체화될 수도 있다고 말이에요. 물론 다른 세계의 존재가 나타나는 것도 드문 일이긴 하지만, 죄악석이 실체화된다면 과거의 행동이 약점으로 작용될 수 있으니 잘 숨겨야 할 거예요.', 39653),
(211032, 'koKR', '', '처음 본 순간부터 알았지. 이 내가 듀로탄의 눈을 못 알아보겠느냐?', 39653),
(211031, 'koKR', '알고... 계셨습니까?', '', 39653),
(211030, 'koKR', '', '잘 싸워줬다... 고엘. 따라와라. 얘기를 나눠보자꾸나.', 39653),
(211029, 'koKR', '잠깐! 저기 겁에 질린 자가 돌장인을 본 모양인데요.', '', 39653),
(211028, 'koKR', '', '나뭇가지의 친구여, 잘 지내거라.', 39653),
(211027, 'koKR', '아! 갈 때가 됐군요.', '', 39653),
(211026, 'koKR', '나무를 위하여!', '', 39653),
(211025, 'koKR', '', '숲의 색깔을 꿰뚫어보면 그 속에 잠재된 힘을 발견하리.', 39653),
(211024, 'koKR', '', '우리는 몽환숲이 부르는 노래의 선율이다.', 39653),
(211023, 'koKR', '나무로 가세요, 나무로! 나무는 안전할 거예요.', '', 39653),
(211022, 'koKR', '', '시간 낭비할 때가 아니에요.', 39653),
(211021, 'koKR', '올라가서 안쪽입니다. 쥐어짜일 영혼들이 끌려가서... 처리를 거치는 곳이죠.', '', 39653),
(211019, 'koKR', '', '농담도 못하나요, 뭐. 아무튼 어디로 가면 되죠?', 39653),
(211018, 'koKR', '어... 저 작자 걱정은 안 해도 되겠죠?', '', 39653),
(211017, 'koKR', '쓸모없는 멍텅구리가. 조만간 배신한 것을 후회하게 될 것이다.', '', 39653),
(211016, 'koKR', '', '집정관님을 위하여!', 39653),
(211002, 'koKR', '', '이제 이 부품들만 연결하면...', 39653),
(211000, 'koKR', '', '흥! 솜씨가 형편없군!', 39653),
(210999, 'koKR', '', '이놈의 전도체는 조잡하기 짝이 없군!', 39653),
(210996, 'koKR', '그러면 저들이 당신 동료가 있는 곳을 알려주겠군요. 정말 송곳니를 빼닮은 생각입니다.', '', 39653),
(210995, 'koKR', '', '자! 이제 저 상냥한 경비병에게 이 물건들을 얼마나 쉽게 구했는지 말하면 돼요.', 39653),
(210993, 'koKR', '이 무슨... 말도 안 되는 일이! 놈이 달아났으면 돌장인께서 절 돌무더기로 만들어 버리셨을 겁니다. 고맙습니다!', '이 무슨... 말도 안 되는 일이! 놈이 달아났으면 돌장인께서 날 돌무더기로 만들어 버리셨을 거다. 고맙군!', 39653),
(210969, 'koKR', '', '임무에 집중하게. 얘기는 나중에.', 39653),
(210968, 'koKR', '드라카 님, 알려드릴 게 있습니다. 저는...', '', 39653),
(210965, 'koKR', '', '명심해. 먼저 창을 맞혀 하늘에서 끌어 내려야 해. 이게 우리의 사냥 방식이야.', 39653),
(210955, 'koKR', '이런, 아서스...', '', 39653),
(210951, 'koKR', '', '하하! 설마요. 장난을 좀 치려는 것 뿐이에요.', 39653),
(210950, 'koKR', '저 작자의 탈출을 돕는다고요?', '', 39653),
(210949, 'koKR', '', '좋아요, 도착했군요.', 39653),
(210940, 'koKR', '', '그럼 야생 사냥단이 나락살이를 몰아내고 그 여자에게 집중할 시간을 벌 수 있겠죠. 이걸로 충분해야 할 텐데...', 39653),
(210939, 'koKR', '', '몇몇 나이트 페이들이 겨울 여왕님의 대역으로 미끼가 되겠다고 나섰어요. 뿔뿔이 흩어져서 밴시를 혼란에 빠뜨릴 거예요.', 39653),
(210938, 'koKR', '', '실바나스 윈드러너가 나락살이의 공격을 진두지휘하고 있어요! 인장을 빼앗겨선 안 돼요!', 39653),
(210937, 'koKR', '', '네 업적이 오딘 님의 봉밀주 대전당에 울려 퍼질 것이다. 너의 굳건한 용기를 모두가 알게 되겠지!', 39653),
(210936, 'koKR', '', '너의 모든 노고에 감사를 표하마.', 39653),
(210935, 'koKR', '', '오딘께서 기뻐하실 거다. 네 동맹도 마찬가지겠지. 눈이 사라지며 간수에게로 더 용맹히 진격할 수 있을 테니.', 39653),
(210934, 'koKR', '', '헬리아는 계속 모략을 꾸미겠지만, 적어도 눈은 사용하지 못할 테지.', 39653),
(210933, 'koKR', '', '뭐, 상관없지. 우린 힘을 합쳐 강대한 적과 싸웠고, 자매들의 복수를 끝냈다!', 39653),
(210932, 'koKR', '', '나락 방랑자, 널 만난 게 행운인지 운명인지 모르겠군.', 39653),
(210931, 'koKR', '아니, 안 된다.', '아니, 안 된다.', 39653),
(210930, 'koKR', '공포의 군주 포로 때문에 바쁜 거 안 보이나? 가서 도움 될 만한 일이나 찾아봐.', '공포의 군주 포로 때문에 바쁜 거 안 보이나? 가서 도움 될 만한 일이나 찾아봐.', 39653),
(210929, 'koKR', '', '마치 나락 방랑자님 곁에서 모험하는 기분이 듭니다... 위험을 감수할 필요 없이 말이죠.', 39653),
(210926, 'koKR', '', '칼도레이가 다시 이어야 할 순환이지. 더는 과거를 바라보지 말자꾸나. 지금은 미래를 받아들일 시간이니.', 39653),
(210925, 'koKR', '', '겨울 여왕님도 어려운 결정을 내리셔야 합니다. 그분과 엘룬 님은 영원한 순환으로 맺어져 계십니다. 삶과 죽음의 순환 말입니다.', 39653),
(210924, 'koKR', '', '딸아, 우리는 신들의 진의를 영원히 알지 못할 지도 모르지. 하지만 나는 엘룬께서 자매를 돕기 위해 선택을 내리셨다고 믿는다. 슬픔을 안기려는 게 아니라.', 39653),
(210923, 'koKR', '', '하지만 저는 몽환숲, 그리고 이 곳에서 우리의 의무와 목적에 대해 무지했습니다. 적어도, 나락을 상대로 말입니다.', 39653),
(210922, 'koKR', '', '텔드랏실이 불탔을 때, 왜 여신께서 중재하지 않으셨는지 이해하지 못했습니다. 그 많은 목숨을 왜 스러지게 두셨는지요. ', 39653),
(210921, 'koKR', '', '나는 엘룬의 목소리가 들리고 나서야 내 분노에 가려져 있던 슬픔을 알아챘다. 그 슬픔은 가슴 깊이 새겨진 배신감과 뒤섞여 있었지.', 39653),
(210920, 'koKR', '', '어둠해안에서의 일 이후로 내면에서 확산하는 엘룬의 분노가 절절히 느껴지더구나. 맞설 수 없는 파도에 삼켜지는 줄로만 알았지.', 39653),
(210919, 'koKR', '', '나아지시는 것 같아 기쁩니다, 민도. 영원히 잃게 될까 봐 두려웠습니다.', 39653),
(210918, 'koKR', '', '그러한 미덕은 헌신의 용장에게 힘이 되어줄 것이다.', 39653),
(210902, 'koKR', '아, 우서. 마침내 행차하셨군.', '', 39653),
(210901, 'koKR', '우서 님! 잠시 시간 되십니까?', '', 39653),
(210900, 'koKR', '로데론을 위해 해야 할 일을 할 뿐이오.', '', 39653),
(210899, 'koKR', '빛의 축복이 함께하길.', '', 39653),
(210898, 'koKR', '참으로 상서로운 날일세.', '', 39653),
(210897, 'koKR', '믿음은 이미 무너지고 있었습니다. 제가 진실을 받아들이도록 도우셨을 뿐입니다.', '', 39653),
(210896, 'koKR', '니콜론, 자네를 탈선하게 만들어서 미안하네. 나만 아니었다면 이탈자에 합류할 일도 없었겠지.', '', 39653),
(210894, 'koKR', '다시 하나가 되자! 충성심이 아닌, 헌신으로! 승천의 보루의 새로운 길이 펼쳐지리라!', '', 39653),
(210893, 'koKR', '누구에게도 기억의 희생을 강요하지 않겠다. 모든 키리안이 너희들의 결정을 존중할 것이다.', '', 39653),
(210892, 'koKR', '너희들의 고난을 들었고, 괴로움도 알았노라. 충성을 요구하는 것이 아닌 선택지를 제시하려 한다.', '', 39653),
(210891, 'koKR', '키리안 동포들이여, 그대들에게 연민을 전하고자 한다.', '', 39653),
(210890, 'koKR', '나락을 직접 보고 나니... 그런 고통을 받아 마땅한 영혼이 있는지 잘 모르겠습니다.', '', 39653),
(210889, 'koKR', '그건 모를 일이네. 내가 결정할 일이 아니었네. 데보스가 인도한 어둠의 길을 걸었으니.', '', 39653),
(210888, 'koKR', '심판관님 모르게 말입니까? 그럼... 참회의 여지가 있었다는 말씀이세요?', '', 39653),
(210887, 'koKR', '그가 숨을 멎는 순간 데보스와 내가 영혼을 취해... 나락으로 던져버렸네.', '', 39653),
(210886, 'koKR', '분부대로 하겠습니다.', '', 39653),
(210885, 'koKR', '나락살이! 저들의 고통을 먹어치워라!', '', 39653),
(210884, 'koKR', '명령을 따르겠습니다, 주인님!', '', 39653),
(210883, 'koKR', '나락살이! 고통의 힘을 보여줘라!', '', 39653),
(210882, 'koKR', '', '오늘은 그렇겠지요. 하지만 언젠가는 그럴 날이 올 겁니다. 때가 되어 함께 거래할 수 있길 바라죠.', 39653),
(210881, 'koKR', '그 말대로 살펴볼 이론은 무한하고... 해야 할 발견이 수만 개이긴 하오만... 아니! 생각하지 않겠소. 그만 떠나시오, 중개자! 그대에게서 필요한 건 하나도 없으니.', '', 39653),
(210880, 'koKR', '', '지성과 호기심 때문에 코르시아에 배속된 것 아니었던가요? 친구, 당신의 \"목적의 길\"은 지식을 꽁꽁 숨기는 게 아니라 그걸 활용할 이들과 공유하는 겁니다.', 39653),
(210879, 'koKR', '그런 날이 오지 않겠소. 목적의 길이 뜻한다면야.', '', 39653),
(210878, 'koKR', '', '태초의 존재의 영역을 직접 보고 싶지 않으신가요?', 39653),
(210877, 'koKR', '듣기로는 그대가 누구보다 필요한 게 많다던데. 이 대화도 내게 제레스 모티스에 대해 캐묻기 위한 구실에 지나지 않잖소?', '', 39653),
(210876, 'koKR', '', '제가 심각하게 잘못 알려진 모양이군요! 전 도움이 필요한 이들에게 좋은 친구이자, 이로운 친구가 될 수 있답니다. 누구든 뭔가 필요한 건 있기 마련이고요.', 39653),
(210875, 'koKR', '친구? 신출귀몰한 베나리에게 친구란 없잖소.', '', 39653),
(210874, 'koKR', '', '반갑습니다, 친구.', 39653),
(210872, 'koKR', '포식자들도 목적을 섬깁니다. 그들이 차지한 령을 되찾아 끌림의 지팡이를 강화할 겁니다. ', '', 39653),
(210871, 'koKR', '아니. 다른 방법이 있지.', '', 39653),
(210869, 'koKR', '날 쓰러뜨린다면 내 인장은 영원히 자취를 감추게 될 것이야!', '', 39653),
(210868, 'koKR', '하지만 그러기는커녕 악의만이 더 커졌구나.', '', 39653),
(210867, 'koKR', '죄를 회개하지 않을까 희망했지.', '', 39653),
(210866, 'koKR', '네가 나락에서 지고의 세월을 보내면 변화하리라 믿었던 시절이 있었다.', '', 39653),
(210865, 'koKR', '우서, 실례되는 질문이지만... 아서스는 결국 어떻게 되었습니까?', '', 39653),
(210864, 'koKR', '', '준비되면 종 앞에서 만나요. 행운을 빌어요, 친구들.', 39653),
(210861, 'koKR', '이건 시작에 불과하다, 클레이아. 찬란한 미래가 우릴 기다린다.', '', 39653),
(210856, 'koKR', '', '이탈자와 키리안이 힘을 합쳐 싸우게 되다니!', 39653),
(210853, 'koKR', '', 'DNT?!', 39653),
(210852, 'koKR', '저희가 돕겠습니다. 동료들을 모아 청지기의 쉼터에서 합류하겠습니다.', '', 39653),
(210849, 'koKR', '사원을 되찾아야 할 뿐 아니라 남은 이탈자들에게 우리의 대의에 함께해줄 것을 간청해야만 한다.', '', 39653),
(210848, 'koKR', '죽음이 너희 세계의 영혼을 찾아가고 있도다, 필멸자여. 하나 우리가 힘을 합치면 구할 수 있다.', '', 39653),
(210847, 'koKR', '여세를 몰아 간수의 병력을 계속 압박하거라. 열쇠가 준비되면 다시 부르겠다.', '', 39653),
(210846, 'koKR', '네 개의 인장은 성약의 단의 새로운 희망을 상징한다. 그것들을 사용해 열쇠를 벼릴 것이니라... 다만 심판관의 인장을 대신할 무언가를 찾아야겠군.', '', 39653),
(210845, 'koKR', '조바알은 매장터에 보관되어 있는 비밀을 노릴 거다. 그가 원하는 지식을 손에 넣는 날에는 네가 아는 모든 것이 사라질 것이야.', '', 39653),
(210844, 'koKR', '그의 다음 행보는 어떨 것 같소?', '', 39653),
(210843, 'koKR', '그가 단념하지 않고 계속 힘을 되찾으리란 사실을 인지하지 못한 내 불찰이니라... 그 음모를 끝까지 간파했어야 했거늘.', '', 39653),
(210842, 'koKR', '우린 조바알의 령을 사용해 감정에 흔들리지 않고 공명정대한 새 심판관을 창조했다.', '', 39653),
(210841, 'koKR', '그런 그릇을 어디에 보관하는지 환영에서 보았다. 하나 그걸 회수하는 일은 무척 위험할 것이다. 간수는 보물을 삼엄하게 지키는 자이니.', '', 39653),
(210840, 'koKR', '그 죄를 묻기 위해 우리는... 우리 형제의 힘을 박탈하고 나락에 구속했다. 그의 육체에 지배의 룬을 새겨 넣은 장본인, 그게 바로 나다.', '', 39653),
(210839, 'koKR', '한의 검이 우서의 영혼을 일부 도려냈습니다. 그 파편 없이는 영원히 회복하지 못할 겁니다.', '', 39653),
(210838, 'koKR', '과거 조바알은 우리 중에서 심판관의 역할을 수행했었다. 그러나 태초의 존재의 뜻을 거역하고 우주의 균형을 무너뜨리기 위해 획책을 다했지.', '', 39653),
(210837, 'koKR', '시초자여, 우리가 심판관의 방에서 본 광경은... 그것은 필멸자의 이해를 초월하는 것이었소.', '', 39653),
(210836, 'koKR', '네 성약의 단이 하나가 되었도다. 새로운 희망이 떠오르는구나.', '', 39653),
(210835, 'koKR', '', '레벤드레스에서 겸허한 마음으로 단결과 사명을 바칩니다.', 39653),
(210834, 'koKR', '', '시초자시여, 말드락서스의 힘을 바치겠나이다.', 39653),
(210833, 'koKR', '', '겨울 여왕께서 몽환숲의 의연함을 보내셨어요.', 39653),
(210832, 'koKR', '대의를 위해 승천의 보루의 헌신을 바칩니다.', '', 39653),
(210831, 'koKR', '어둠땅의 성약의 단이여, 앞으로 나오라.', '', 39653),
(210826, 'koKR', '', '지금 와서도 켈투자드의 음모에 놀아나게 되다니. 또 무슨 수작을 부려 놨을는지.', 39653),
(210824, 'koKR', '앞으로 나와라!', '', 39653),
(210823, 'koKR', '빛이... 아서스... 내가 무슨 짓을 저지른 거지?', '', 39653),
(210822, 'koKR', '우리가 곁에 있습니다, 우서. 좌절하지 마세요.', '', 39653),
(210819, 'koKR', '', '쓰러지게 두지 않을 겁니다, 우서!', 39653),
(210818, 'koKR', '', '나의 사냥꾼이여, 정말로 잘해주었다. 몽환숲의 모든 이가 네게 감사를 표하노라.', 39653),
(210817, 'koKR', '', '나의 사냥꾼이여, 정말로 잘해주었다. 몽환숲의 모든 이가 네게 감사를 표하노라.', 39653),
(210816, 'koKR', '', '필멸자여, 너의 모든 노고에 감사를 표하노라.', 39653),
(210814, 'koKR', '', '가뭄과 희생에 몽환숲은 고통받아왔다.', 39653),
(210798, 'koKR', '오딘께서 뿔피리를 만들라고 하셨다지? 저 탁자에 특별한 재료가 있을 거다.', '', 39653),
(210797, 'koKR', '', '저도 느껴집니다. 안두인이 기지를 발휘했군요! 우리에게 뭘 보여주고 싶었기에...', 39653),
(210796, 'koKR', '나침반에 기억이 깃들어 있군.', '', 39653),
(210795, 'koKR', '물론이다, 제이나.', '', 39653),
(210794, 'koKR', '', '볼바르, 나침반을 살펴볼 수 있도록 도와주시겠어요?', 39653),
(210793, 'koKR', '', '그 이상일 거예요. 나침반에서 마법이 느껴져요. 안두인이 빛을 이용해 전언을 남긴 걸지도 몰라요.', 39653),
(210792, 'koKR', '간수의 힘에 완전히 지배당하진 않았다는 의미인가?', '', 39653),
(210791, 'koKR', '', '안두인이 이걸 실수로 흘렸을 리 없어요. 분명 우리가 찾아내길 바랐을 겁니다.', 39653),
(210790, 'koKR', '', '나침반이에요. 아버지에게 선물로 받은 것이죠. 바리안이 항상 지니고 있었어요... 부서진 해변에서 군단과 싸우기 전까지는.', 39653),
(210789, 'koKR', '제이나, 안두인이 뭘 남긴 것이오?', '', 39653),
(210788, 'koKR', '내가 먼 옛날부터 염려하던 날이 와버리고 말았구나.', '', 39653),
(210787, 'koKR', '', '간수는 사라졌습니다. 게다가 안두인도 함께 데려갔죠.', 39653),
(210786, 'koKR', '그녀를, 두 명 모두 저지하려고 했소. 하나 실패했소.', '', 39653),
(210784, 'koKR', '동료들이 오는구나, 필멸자여.', '', 39653),
(210783, 'koKR', '', '가자. 네 삶에 대해 더 알고 싶구나. 전부 다.', 39653),
(210782, 'koKR', '감사합니다... 어머니. 자랑스러운 아들이 되겠습니다.', '', 39653),
(210781, 'koKR', '', '이토록 먼 길을 헤쳐온 걸 보니 기쁘구나. 앞으로도 한참을 더 나아가야 할 것이야.', 39653),
(210780, 'koKR', '', '나도 한때는 죽음이 끝이라 생각했다. 하나 말드락서스의 전사로 거듭난 지금은 시작에 불과했다는 걸 알지.', 39653),
(210779, 'koKR', '', '그렇다면 가르침을 주마. 어미와 자식 사이가 아닌, 비슷한 처지에 있는 영혼으로서 해주는 말이다. 과거의 너를 기억하되, 현재의 너에게 긍지를 갖거라.', 39653),
(210778, 'koKR', '저는... 잘 모르겠습니다. 파란만장한 삶을 살아왔습니다. 다음에는 어디로 이어질지 저도 모릅니다.', '', 39653),
(210777, 'koKR', '', '그건 예전의 너지. 지금의 넌 누구지?', 39653),
(210776, 'koKR', '한때 호드의 대족장이었고, 대지 고리회의 주술사였으며...', '', 39653),
(210775, 'koKR', '', '내가 숨졌을 때 넌 갓난아이였지. 말해다오. 어떤 사람으로 성장했느냐?', 39653),
(210774, 'koKR', '', '이 힘을 남용하는 날에는 내가 왜 레벤드레스로 보내졌는지 깨닫게 해주지.', 39653),
(210773, 'koKR', '', '내가 이 메달을 이양하는 이유는 어둠땅에서 공포의 군주를 자유롭게 박멸하기 위함이니라.', 39653),
(210772, 'koKR', '', '지금 당장... 네놈들의 역병을 정화하겠다!', 39653),
(210770, 'koKR', '', '겨울 여왕이 조용히 귀를 기울입니다.', 39653),
(210769, 'koKR', '', '그럼 기대에 부응하도록 부단히 노력해야겠구나. 나뭇가지 위에서 우리를 지켜봐 주렴, 아스타리. 엘룬 아도레.', 39653),
(210768, 'koKR', '', '밤 전사가 되었든, 대여사제가 되었든, 저는 티란데 님이 이끌어 나갈 칼도레이를 믿습니다.', 39653),
(210767, 'koKR', '', '초승달이 보름달로 차오르고, 어둠이 빛 속으로 사라지듯이요.', 39653),
(210766, 'koKR', '', '많은 이들은 응징을 열망하지만, 우리에게 가장 필요한 것은 재생이라는 사실이 이제 보입니다.', 39653),
(210765, 'koKR', '', '고맙구나. 하지만... 그 직전까지 갔지. 복수의 업화에 삼켜져 발치에 쌓인 재를 보지 못했어.', 39653),
(210764, 'koKR', '', '대여사제님! 나락의 심연에서도... 존재가 느껴졌었습니다. 저희를 저버리지 않으실 줄 알았어요.', 39653),
(210758, 'koKR', '내 전당은 $n 널 환영할 것이다.', '', 39653),
(210757, 'koKR', '', '티란데의 힘이 너무 강해요! 자기 자신은 물론 숲까지 파괴할지도 몰라요!', 39653),
(210756, 'koKR', '', '내 숲에서... 자매의 힘이 느껴지다니? 자초지종을 알아야겠다!', 39653),
(210755, 'koKR', '', '아쉬 로크 일리사르! 탄대!', 39653),
(210754, 'koKR', '', '이거 진짜 큰일인데요!', 39653),
(210752, 'koKR', '안 돼! 엘룬의 힘을 더 끌어들이고 있습니다!', '', 39653),
(210751, 'koKR', '', '이거 큰일인데요!', 39653),
(210749, 'koKR', '', '힘이 강해지고 있네. 티란데를 잠식하고 있어!', 39653),
(210748, 'koKR', '', '나락 방랑자여, 도와주십시오!', 39653),
(210747, 'koKR', '', '밤 전사의 분노가 우릴 파멸시킬 거다! 격리해야 해!', 39653),
(210746, 'koKR', '', '듣지 않는 것 같아요!', 39653),
(210745, 'koKR', '', '아샬 트우리다스!', 39653),
(210744, 'koKR', '', '티란데, 분노에 자신을 잃어선 안 된다!', 39653),
(210743, 'koKR', '', '아누 도리니 아쉬카!', 39653),
(210742, 'koKR', '', '민도, 제발! 진정하셔야 합니다!', 39653),
(210741, 'koKR', '샨드리스, 놓치지 마십시오!', '', 39653),
(210740, 'koKR', '', '엘룬이시여! 아라마 쉬날라 파시마 네멜리아 보라나!', 39653),
(210739, 'koKR', '', '이토록 매서운 분노를 품은 필멸자는 극히 드물거늘.', 39653),
(210738, 'koKR', '자, 시작합시다.', '', 39653),
(210737, 'koKR', '', '준비는 끝났다, 티르낙스.', 39653);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(210736, 'koKR', '', '너의 최후를 노래하겠다!', 39653),
(210735, 'koKR', '', '운명은 피할 수 없다!', 39653),
(210729, 'koKR', '멈추세요. 이 입구는 시민과 등록된 고객만이 이용할 수 있습니다.', '멈추세요. 이 입구는 시민과 등록된 고객만이 이용할 수 있습니다.', 39653),
(210722, 'koKR', '', '좀 괜찮지만 여전히 왜곡이 발생하는군요. 더 낮은 고도에 설치해 보세요.', 39653),
(210720, 'koKR', '', '아! 신호가 들어옵니다. 감도가 무척 불량하군요. 새 중계 지점을 찾아보시죠.', 39653),
(210718, 'koKR', '', '고맙습니다, 우서 경. 잠깐 얘기 좀 나눌 수 있을까요? 들려드리고 싶은 게 정말 많거든요...', 39653),
(210717, 'koKR', '나도 마찬가지네. 그 사랑을 품고 나아가게, 제이나. 힘든 시기에 힘을 빌려줄 걸세.', '', 39653),
(210716, 'koKR', '', '전 그를 사랑했어요.', 39653),
(210715, 'koKR', '기억은 거울과도 같네. 우리 자신의 일부를 보여주지. 때로는 잊고 싶은 모습일 때도 있네. 그렇지만 우린 어떤 교훈을 갖고 나아가고 뒤에 남겨둘지 선택할 수 있네.', '', 39653),
(210714, 'koKR', '', '과거는 묻어 두려고 했지요. 그런데 안두인이 겪고 있는 고초를 보니... 그 고통스러운 기억이 다시 밀려들더군요.', 39653),
(210713, 'koKR', '기억하네. 자네도 여전히 그를 생각하지 않나? 오랜 세월이 흘렀음에도 말일세.', '', 39653),
(210712, 'koKR', '', '스트라솔름이었죠. 학살 이후에.', 39653),
(210711, 'koKR', '하마터면 못 알아볼 뻔했네. 우리가 마지막으로 대화했을 때가...', '', 39653),
(210710, 'koKR', '', '우서 경? 우서 경이시군요! 어... 키리안이시네요?! 하긴, 잘 어울리십니다.', 39653),
(210709, 'koKR', '빛이시여! 자네는 제이나 프라우드무어 아닌가?', '', 39653),
(210706, 'koKR', '', '목표 생명체 주변에서 은밀한 장소를 찾아보세요... 공공연히 눈에 띄는 곳은 안 됩니다.', 39653),
(210694, 'koKR', '앞으로라... 그렇죠. 할 일이 너무나 많군요. 감사합니다, 어머니.', '', 39653),
(210693, 'koKR', '', '선택지를 제시한 것이지, 대신 선택해준 게 아니지 않느냐. 한탄하겠다면야 말리진 않겠지만, 그의 결정은 네가 이고 갈 짐이 아니다. 가로쉬의 길은 끝났고, 네 길은 앞으로 펼쳐져 있다.', 39653),
(210692, 'koKR', '그 길로 인도한 것은 접니다.', '', 39653),
(210691, 'koKR', '', '네 아버지가 하던 말이 있다. 늑대는 주인의 부름을 받으면, 응할지 그를 물어 버릴지 결정한다고. 잘못은 없다. 자연의 순리가 작용했을 뿐이야. 아들아, 가로쉬는 스스로 길을 선택한 거다.', 39653),
(210690, 'koKR', '제가 그를 나그란드에서 데려왔습니다. 제가 대족장의 자리에 앉혔습니다. 하지만 가로쉬가 절 가장 필요로 할 때 실책을 범하게 내버려 두었죠. 결국 제 손으로 그의 목숨을 거뒀습니다.', '', 39653),
(210689, 'koKR', '', '운명은 모두의 앞에 길을 놓지. 그의 뜻일진대 어찌 네가 자책하느냐?', 39653),
(210688, 'koKR', '예. 그롬마쉬 헬스크림의 아들 가로쉬에 대해 말씀드렸지요. 전 가로쉬가 자신의 아버지처럼 어둠에 삼켜지지 않길 바랐습니다. 하지만... 그가 초래한 파멸은 제 탓입니다.', '', 39653),
(210687, 'koKR', '', '고엘, 인생 이야기는 잘 들었다. 한데 마음을 괴롭히는 기억이 있는 모양이로구나.', 39653),
(210686, 'koKR', '', '아, 좋아요! 투영 장치가 유용하게 쓰이는군요! 자, 당신의 순간이동 시도에 관해서는...', 39653),
(210685, 'koKR', '', '경계를 철저히.', 39653),
(210684, 'koKR', '', '나락에서 왕자님을 구해주신 분이군요. 잊지 않겠습니다.', 39653),
(210683, 'koKR', '', '왕자님을 보호해야 합니다.', 39653),
(210682, 'koKR', '', '사방이 첩자로 가득합니다. 경계하십시오.', 39653),
(210676, 'koKR', '규탄자, 네 말이... 옳을지도 모르겠군. 할 일이 생긴 듯하네.', '', 39653),
(210675, 'koKR', '', '다른 모든 죄는 참회하되... 그 일에 한해선 스스로를 용서하거라.', 39653),
(210674, 'koKR', '', '너는 생전에 수많은 죄를 범했다, 캘타스 선스트라이더. 하나 왕국의 몰락은 네 죄가 아니다.', 39653),
(210673, 'koKR', '', '그럼 네가 찾는 것은 복수가 아니라 구원 아니겠느냐.', 39653),
(210672, 'koKR', '', '저는 적 못지않게 아군도 주시합니다.', 39653),
(210670, 'koKR', '난... 실버문이 몰락할 때 그 자리에 없었다. 반드시 있어야 하는 시기에 자리를 비웠지. 그 이후로 실패는 나를 쫓아다니며 괴롭혔다.', '', 39653),
(210669, 'koKR', '', '요지는 네 응징이 백성을 위한 게 아니라는 거다. 너 자신만을 위한 거지.', 39653),
(210668, 'koKR', '', '주인님께 이 목숨을.', 39653),
(210667, 'koKR', '아니... 나는 그저...', '', 39653),
(210666, 'koKR', '', '그렇다고 한들 무엇이 달라졌겠느냐? 네 백성의 운명이 바뀌기라도 했을까?', 39653),
(210665, 'koKR', '켈투자드가 소멸했다니. 그럴 리 없어! 신도레이의 복수는 내가 쟁취했어야 했거늘!', '', 39653),
(210664, 'koKR', '', '이는 새로운 길의 상징이 될 것이다.', 39653),
(210663, 'koKR', '', '다섯 개의 사원, 다섯 명의 용장.', 39653),
(210662, 'koKR', '', '넌 고난의 시기 속에서 인내심과 연민을 체현하였다.', 39653),
(210661, 'koKR', '', '마지막으로 용장이 임명된 이후로 아득한 세월이 흘렀다.', 39653),
(210649, 'koKR', '', '덕분에 꽤 쏠쏠한 이익을 거뒀군요.', 39653),
(210636, 'koKR', '왕자였던 시절은 끝난 지 오래다. 내가 견뎌낸 수많은 변화 중 하나지.', '', 39653),
(210635, 'koKR', '', '그래, 이런 곳에서 속죄를 하고 있었다 이거군. 잘 어울리는구나, 작은 왕자여.', 39653),
(210631, 'koKR', '아니, 클레이아. 이건 혼자 극복해야만 해.', '', 39653),
(210629, 'koKR', '', '저만 믿으세요, 나락 방랑자님!', 39653),
(210628, 'koKR', '그렇지만 걱정은 마십시오! 눈에 띄지 않고 당신과 함께 이동할 수 있으니. 수송선에서 뵙지요.', '', 39653),
(210627, 'koKR', '지금이 이 말씀을 드리기 적절한 시점인 것 같군요. 사실 전 타자베쉬에서 환영받지 못한답니다.', '', 39653),
(210626, 'koKR', '아무래도 실력 행사가 필요하겠군요. 나락 방랑자님의 활약을 보게 되다니!', '', 39653),
(210624, 'koKR', '말가니스, 우리가 적대할 필요는 없다. 함께 레벤드레스를 구원하고 너희의 추방을 끝내도록 하자.', '', 39653),
(210621, 'koKR', '', '지금 그건 후회인가? 너답지 않군.', 39653),
(210620, 'koKR', '내가 이 악마들과 한편이었다니...', '', 39653),
(210619, 'koKR', '', '그분께서 죽을 수 있는 몸이며, 실제로도 죽었다고 생각하는군. 양쪽 모두 아닐지도 모르지.', 39653),
(210618, 'koKR', '일리단이었다면 매우 즐겼을 작업이군. 과연 어떤 운명을 맞이했으려나?', '', 39653),
(210614, 'koKR', '', '추방당한 자를 막을 순 없다!', 39653),
(210609, 'koKR', '도망칠 곳은 없다!', '', 39653),
(210606, 'koKR', '널 박살 내주마!', '', 39653),
(210604, 'koKR', '문제 될 건 없습니다. 다른 계획을 따르면 되죠.', '', 39653),
(210603, 'koKR', '그렇다면야, 절차를 따르죠. 따라오세요, 나락 방랑자님.', '', 39653),
(210602, 'koKR', '모든 비시민권자는 세관 검색을 통과해야 합니다!', '', 39653),
(210601, 'koKR', '저 안에서 해결해야 할 중요한 문제가 있어서 그런데, 딱 우리만 예외로 해 주는 건 어떻겠습니까?', '', 39653),
(210600, 'koKR', '모든 비시민권자는 세관 검색을 통과해야 합니다.', '', 39653),
(210599, 'koKR', '나락 방랑자님! 여기 이 친구들이 입을 꾹 다물고만 있지 뭡니까. 당신은 좋은 수가 있을 것 같은데요. ', '', 39653),
(210595, 'koKR', '타자베쉬는 쉬이 가기 힘든 도시랍니다. 하지만 야시장의 누군가는 분명 우리 여정에 도움을 줄 수 있을 거예요.', '', 39653),
(210593, 'koKR', '고맙습니다, 필멸자님. 우리 사이의 일은 비밀입니다, 아시겠죠?', '', 39653),
(210591, 'koKR', '제가 개입하길 바라는 건 아니시겠죠.', '', 39653),
(210590, 'koKR', '모두 진정하세요. 행패 부릴 생각은 접는 게 좋을겁니다!', '', 39653),
(210587, 'koKR', '조 중개단을 기만한 죄, 목숨으로 갚아라!', '', 39653),
(210579, 'koKR', '알 중개단을 후원해주어 고마워요.', '', 39653),
(210578, 'koKR', '모험에 행운이 따르길 빕니다.', '', 39653),
(210577, 'koKR', '살펴 가세요, 친구여.', '', 39653),
(210576, 'koKR', '필요한 게 있으면 말씀만 하시길.', '', 39653),
(210575, 'koKR', '절 믿으세요. 전 전문가입니다.', '', 39653),
(210574, 'koKR', '무얼 찾으시든 제겐 길이 있습니다.', '', 39653),
(210573, 'koKR', '안내가 필요하신가요?', '', 39653),
(210572, 'koKR', '당신이 바라는 건 제가 원하는 바이기도 합니다.', '', 39653),
(210571, 'koKR', '', '너희 돌숨결 놈들은 우리 모두를 찾지 못해. 우린 어디에나 있으니!', 39653),
(210570, 'koKR', '', '네 녀석을 처리하는 건 내 분노만으로도 충분하다.', 39653),
(210569, 'koKR', '', '메달 없는 수확자라. 지금의 네 분노는 과거의 그림자에 불과하다.', 39653),
(210565, 'koKR', '내 감옥이... 너희를 구속하리라!', '', 39653),
(210564, 'koKR', '이것이... 자유인가!', '', 39653),
(210563, 'koKR', '너희 손으로... 그분을 섬겨라!', '', 39653),
(210562, 'koKR', '족쇄가... 부서진다!', '', 39653),
(210561, 'koKR', '내 왕관의... 무게를 견뎌 보거라!', '', 39653),
(210560, 'koKR', '드디어... 안식을...', '', 39653),
(210557, 'koKR', '고리가 부서지다니!', '', 39653),
(210556, 'koKR', '저 무한함이 보이느냐?!', '', 39653),
(210555, 'koKR', '열쇠가 돌아가면 신들은 쓰러지리라!', '', 39653),
(210554, 'koKR', '물레가 너희의 파멸을 엮어내는구나!', '', 39653),
(210551, 'koKR', '위대한 합일이 임박했어!', '', 39653),
(210550, 'koKR', '운명의 실타래는 풀렸다!', '', 39653),
(210549, 'koKR', '영원은 그 자체를 삼킬지니!', '', 39653),
(210548, 'koKR', '무한을 들여다보아라!', '', 39653),
(210547, 'koKR', '이제 알겠느냐?!', '', 39653),
(210546, 'koKR', '그가 알아버렸어... 알아버렸다고... 나 때문에...', '', 39653),
(210545, 'koKR', '드디어... 고요해졌어...', '', 39653),
(210544, 'koKR', '', '참, 고통 없이 보내주도록. 내 감사의 표시이니.', 39653),
(210543, 'koKR', '', '나락 방랑자를 해치워라.', 39653),
(210542, 'koKR', '모두 모였다! 문이 열린다!', '', 39653),
(210541, 'koKR', '', '그건 토르가스트에 도착한 다음 그분께 직접 여쭤봐라. 네놈을 애타게 기다리고 계시니.', 39653),
(210540, 'koKR', '대체 몇 명이란 말이냐? 추방당한 자가 우리 사이에 첩자를 몇 명이나 심은 것이야?', '', 39653),
(210539, 'koKR', '', '네가 제공한 엄청난 도움들 모두 고마워, 필멸자.', 39653),
(210538, 'koKR', '', '우리는 끝끝내 찾아냈지.', 39653),
(210537, 'koKR', '안 돼! 놈들이 날 찾아냈어!', '', 39653),
(210533, 'koKR', '', '아무도 살려두지 마라!', 39653),
(210532, 'koKR', '', '모두 위치로!', 39653),
(210528, 'koKR', '', '니콜론, 우리와 함께해 주세요. 우리가 다시 뭉칠 방법을 찾아야만 합니다.', 39653),
(210527, 'koKR', '이젠 나도 그 사실을 안다. 진심으로 사과하마. 오늘 난 우서에게 많은 것을 배웠다. 승천의 보루는 새로운 길을 따라야만 하지.', '', 39653),
(210522, 'koKR', '흠. 고서 표지에 발톱 자국을 보게.', '', 39653),
(210521, 'koKR', '우리 사냥감은 산과 독을 애용하는 모양이구먼...', '', 39653),
(210520, 'koKR', '책에 거미줄이 엉겨 붙어 있는데...', '', 39653),
(210518, 'koKR', '', '난 고정 장치를 만들테니 가서 차원석을 찾아라. 목적의 길이 우리를 인도하길.', 39653),
(210517, 'koKR', '', '살아서 우리의 승리를 목격하진 못할 테니 유감을 표하지. 하나 여기서 최후를 맞겠다면, 좋다. 와서 맞이하거라!', 39653),
(210516, 'koKR', '', '화살을 잃었다고 탄식하는 궁수가 있더냐, 대영주?', 39653),
(210515, 'koKR', '널 지켜줄 발키르는 이제 없다, 실바나스. 너는 여기서 죽는다. 그리고 이것이 마지막 죽음이 될 것이다.', '', 39653),
(210514, 'koKR', '', '우리 성약의 단 병사들이 이 결속으로 나락을 벗어날 수 있을 거다. 바로 그대처럼.', 39653),
(210513, 'koKR', '', '이곳 오리보스에 그대의 령과 연결되는 고정 장치를 만들겠다. 두 번째 차원석을 활성화하면 그 장치와 이어질 것이야.', 39653),
(210512, 'koKR', '', '아제로스의 용사들 아니신가. 마침내 왕림하셨군.', 39653),
(210509, 'koKR', '켈투자드는 간수에게 가장 충직한 수하 중 하나였다. 내가 놈의 남아 있는 힘을 뒤틀어 관문을 열어 보겠다. 그 주인에게 바로 갈 수 있는 길이 나올 테지.', '', 39653),
(210508, 'koKR', '기사단! 방을 확보해라!', '', 39653),
(210505, 'koKR', '선택이... 잘못됐군.', '', 39653),
(210504, 'koKR', '모습을 드러낼 마음이 없나보군.', '', 39653),
(210503, 'koKR', '나조차 알아차리지 못했을 걸세.', '', 39653),
(210502, 'koKR', '또 덫이 있네.', '', 39653),
(210501, 'koKR', '역시 덫이 있군. 조심하게.', '', 39653),
(210500, 'koKR', '마침내 낙스라마스에서 겪은 수모를 갚아줄 때가 되었도다! 네놈들 모두 이 켈투자드 앞에 무릎을 꿇게 될 것이야!', '', 39653),
(210499, 'koKR', '나의 진정한 저의를 숨기는 데 너무나 오랜 시간을 보냈다. 거짓된 주인을 섬기는 척 행세를 해야 했지. 그동안 아제로스의 종말을 부추긴 장본인이 바로 나다!', '', 39653),
(210498, 'koKR', '죽음의 승리가 코앞으로 다가온 지금 이렇게 대면하다니, 실로 적절하기 이를 데 없구나.', '', 39653),
(210497, 'koKR', '제가 말한 건 그게 아니잖아요!', '', 39653),
(210496, 'koKR', '대체 왜 그런 거예요?!', '', 39653),
(210495, 'koKR', '그가 내 정신을 찢어갔어... 남은 것은 어둠뿐...', '', 39653),
(210494, 'koKR', '고리 속에 고리 속에 또 고리... 숨어 있잖아...', '', 39653),
(210493, 'koKR', '머리를 때리면 언제나 해결되죠!', '', 39653),
(210492, 'koKR', '작동 지침이 없어요! 일단 한번 쳐 보세요!', '', 39653),
(210491, 'koKR', '지렛대를 써요, 나락 방랑자님!', '', 39653),
(210490, 'koKR', '아무 지렛대나 당겨 봐요!', '', 39653),
(210489, 'koKR', '단추! 빨리, 단추 눌러요!', '', 39653),
(210488, 'koKR', '단추를 눌러 보세요!', '', 39653),
(210487, 'koKR', '밀수업자한테서 도면을 좀 얻어냈어요. 어디 보자...', '', 39653),
(210486, 'koKR', '하늘도 날 수 있네?!', '', 39653),
(210484, 'koKR', '해골 으깬다!', '', 39653),
(210483, 'koKR', '뼈를 부숴주마!', '', 39653),
(210482, 'koKR', '돌연변이가 매장터 암호 획득을 시도합니다. 수호자, 돌연변이를 박멸하십시오.', '', 39653),
(210481, 'koKR', '전부 파괴해라! 필멸자들이 찾지 못하게 단서를 남기지 마라!', '', 39653),
(210480, 'koKR', '간수가 또 뭘 찾는 거지?', '', 39653),
(210479, 'koKR', '이 장치로 다른 영역을 나락으로 끌어오나 보군. 코르시아에 한 것처럼.', '', 39653),
(210478, 'koKR', '정상에 거의 다 왔다. 경계를 늦추지 마라.', '', 39653),
(210476, 'koKR', '', '운명필경사 로탈이 나락에 출현한 두 번째 차원석을 감지했다만, 정확한 위치는 모른다고 하더구나.', 39653),
(210475, 'koKR', '어둠땅에 너희의 비명이 울려 퍼질 것이다!', '', 39653),
(210474, 'koKR', '', '그대의 령은 첫 번째 차원석을 깨웠다. 그리고 몇몇 동료를 무사히 구출하기도 했지.', 39653),
(210473, 'koKR', '너희를 위한 영원한 고통의 장을 만들고자 심혈을 기울였지. 이 수고를 알아준다면 더할 나위 없겠어.', '', 39653),
(210472, 'koKR', '환영한다, 존귀하신 손님들이여.', '', 39653),
(210471, 'koKR', '당장 풀어라, 벌레 녀석. 진정한 분노를 보여줄 테니!', '', 39653),
(210470, 'koKR', '네 분노는 아주 격렬하구나, 헬스크림. 그 분노만으로도 영원히 영혼 제련실을 가동할 수 있겠어!', '', 39653),
(210469, 'koKR', '이 영혼들을 해방해다오, 용사들이여. 적의 가장 주요한 자원을 끊어내는 거다.', '', 39653),
(210460, 'koKR', '간수의 제련실을 강화하는 데 쓰이는 령이 바로 이 층에서 수확되고 있었군.', '', 39653),
(210443, 'koKR', '칠흑의 기사단! 차원문을 확보해라!', '', 39653),
(210440, 'koKR', '', '명을 따르겠습니다!', 39653),
(210439, 'koKR', '', '발키르! 너희는 내게 종속되어 있다는 걸 잊지 마라! 적들을 쓰러뜨려라!', 39653),
(210438, 'koKR', '', '폴드라곤. 옥좌를 잃은 몰락한 왕께서 몸소 납시었군. 저항의 대가를 치르게 해주마!', 39653),
(210437, 'koKR', '우리가 널 막을 것이다, 실바나스!', '', 39653),
(210436, 'koKR', '', '어리석기는. 이기지도 못할 싸움을 거는구나.', 39653),
(210435, 'koKR', '우리 세계를 지키기 위해 싸우세나!', '', 39653),
(210434, 'koKR', '', '빛이 우리와 함께하길!', 39653),
(210433, 'koKR', '아제로스를 위하여!', '', 39653),
(210432, 'koKR', '적의 주 병력은 우리가 유인하겠다! 용사들이여, 간수의 계획을 저지할 방법을 찾아라!', '', 39653),
(210429, 'koKR', '나는 예언을 익히 알고 있소. 그대가 진정 나락 방랑자라면 내가 모를 수 없다오.', '', 39653),
(210428, 'koKR', '모두 준비해라! 지배의 성소가 우리를 기다린다.', '', 39653),
(210427, 'koKR', '간수가 우리에게 모든 분노를 쏟아낼 것이오. 흔들려선 안 되겠소.', '', 39653),
(210426, 'koKR', '', '대지공포의 정수는 아직 주인과 이어져 있습니다. 이 연결을 이용하면 위쪽의 요새로 통하는 길을 열 수 있을 거예요.', 39653),
(210425, 'koKR', '', '물론이죠, 대영주.', 39653),
(210424, 'koKR', '프라우드무어 여군주, 실력을 발휘해 주면 좋겠군.', '', 39653),
(210423, 'koKR', '지역을 확보해라! 주변 방비를 강화해야 한다!', '', 39653),
(210422, 'koKR', '저 야수들을 처치해라! 대지공포에 맞서려면 놈들의 힘이 필요하다.', '', 39653),
(210420, 'koKR', '대지공포가 길을 막고 있군. 용사들이여, 간수의 애완동물에게 최후를 안겨줄 때가 왔다.', '', 39653),
(210419, 'koKR', '', '어둠이 널 기다린다!', 39653),
(210418, 'koKR', '간수의 성소가 우리 위에 드리우고 있소. 어떻게 돌파하면 좋겠소?', '', 39653),
(210417, 'koKR', '', '내가 아는 마법이로군...', 39653),
(210416, 'koKR', '칠흑의 기사단이여, 이 위치를 사수해라!', '', 39653),
(210415, 'koKR', '과연... 그대는 진정 나락 방랑자가 맞구려! 령이 그 어느 때보다도 강해졌군. 우리 코르시아의 주민들은 그대를 따르리다.', '', 39653),
(210414, 'koKR', '', '당장 나락 방랑자님을 풀어주시죠. 큰코다치기 싫으면!', 39653),
(210413, 'koKR', '두루마리에는 진정한 나락 방랑자가 힘을 부여받아야 한다 했소. 계속해야만 하오.', '', 39653),
(210412, 'koKR', '', '터무니없는 조사는 그만두시죠... 당신네를 도울 유일한 사람을 죽일 셈인가요!', 39653),
(210411, 'koKR', '하지만 앞으로 닥쳐올 일에 대비되어 있을지는 두고 봐야겠지.', '', 39653),
(210410, 'koKR', '', '진정한 악단의 격돌이 되겠군요.', 39653),
(210409, 'koKR', '아 그렇군... 남다른 세계혼과 유대를 맺고 있구려. 예언대로군!', '', 39653),
(210408, 'koKR', '내 지식은 거의 순수 학문의 영역에 머무른다오. 자세한 건 그대의 령을 살펴야 하오. 가만히 있으시오.', '', 39653),
(210407, 'koKR', '저 부정한 흉물은 뭐지?', '', 39653),
(210403, 'koKR', '그 지렛대 말고요!', '', 39653),
(210402, 'koKR', '', '너희 삶은 여기서 끝이다!', 39653),
(210401, 'koKR', '', '죽음이 널 기다린다!', 39653),
(210399, 'koKR', '필멸성이란 개념을 이토록 신중하게 헤아려보긴 처음입니다.', '', 39653),
(210392, 'koKR', '', '이 요새에 발을 들이긴 억겁의 세월만이로군요. 세월의 풍파와 가뭄을 직격으로 맞았나 봅니다.\n\n주변을 경계하십시오, 나락 방랑자님. 이 순간에도 왕자님은 위협을 받고 있습니다. 집중해야 합니다.', 39653),
(210391, 'koKR', '너와 놀아주는 것도 끝이다, 실바나스!', '', 39653),
(210390, 'koKR', '이 힘은 네가 다룰 만한 것이 아니다!', '', 39653),
(210387, 'koKR', '놈이 앞서는군. 영웅들이여, 내게로!', '', 39653),
(210386, 'koKR', '내 방어가 흔들리고 있소!', '', 39653),
(210383, 'koKR', '신세를 졌소, 대영주.', '', 39653),
(210382, 'koKR', '피바람을 불러일으키자!', '', 39653),
(210381, 'koKR', '너는 왜 말드락서스로 보내진거지? 죄가 가볍지는 않았을 텐데.', '', 39653),
(210379, 'koKR', '작별이다, 탈이나라. 우리가 돌아올 때까지 칠흑의 기사단이 오리보스를 지킬 것이야.', '', 39653),
(210378, 'koKR', '', '잘 가거라, 볼바르 폴드라곤. 목적의 길이 그대를 인도하길.', 39653),
(210375, 'koKR', '영웅들이여, 내게 오게! 제이나와 합류해야 하네!', '', 39653),
(210374, 'koKR', '지금 공격하시오!', '', 39653),
(210373, 'koKR', '이쪽으로 오게, 용사들이여! 제이나를 도와야 하네!', '', 39653),
(210372, 'koKR', '', '뭘 꾸물대지?', 39653),
(210371, 'koKR', '길을 열었네! 어서 가게! 실바나스를 저지하게!', '', 39653),
(210370, 'koKR', '', '됐어요! 서두르세요!', 39653),
(210369, 'koKR', '', '조금만 더 버텨 주세요. 차원문이 거의 다 열렸어요!', 39653),
(210368, 'koKR', '', '무언가가 제 마법을 방해하고 있어요. 어디까지 온 거죠?', 39653),
(210367, 'koKR', '', '고마워요, 볼바르.', 39653),
(210366, 'koKR', '', '영웅들이여! 도움이 필요합니다!', 39653),
(210359, 'koKR', '', '서둘러요! 스랄을 도와야 해요!', 39653),
(210358, 'koKR', '', '용사들이여, 서두르세요! 실바나스를 막아야 합니다!', 39653),
(210354, 'koKR', '', '죽음의 힘이 내 손안에 있다!', 39653),
(210352, 'koKR', '', '어둠이 다가온다!', 39653),
(210351, 'koKR', '', '어둠이 두렵느냐?', 39653),
(210350, 'koKR', '', '내 비명을 듣고 절망하라!', 39653),
(210349, 'koKR', '', '밴시 여왕의 부름을 들어라!', 39653),
(210346, 'koKR', '', '후회하게 해 주마. 너희 모두 후회하게 해 주마!', 39653),
(210344, 'koKR', '', '내 너의 왕좌는 무너뜨렸으니, 이번엔 너를 부숴 주겠다!', 39653),
(210342, 'koKR', '', '내 분노를 맛보아라! ', 39653),
(210339, 'koKR', '', '내 화살은 빗나가지 않는다.', 39653),
(210338, 'koKR', '', '이제 희망 따윈 없다!', 39653),
(210337, 'koKR', '두려운 비밀의 힘은 마음먹기에 달렸습니다.', '', 39653),
(210336, 'koKR', '', '무엇도 나의 분노를 피할 순 없다!', 39653),
(210332, 'koKR', '', '지혜를 좇되, 갈망해서는 안 됩니다.', 39653),
(210329, 'koKR', '', '넌 내게 맞설 자격이 없다!', 39653),
(210328, 'koKR', '', '과거가 너희를 옥죄리라!', 39653),
(210327, 'koKR', '', '내 공격은 빗나가지 않지!', 39653),
(210326, 'koKR', '', '숨을 끊어 주마!', 39653),
(210324, 'koKR', '', '자비란 없다!', 39653),
(210323, 'koKR', '', '굴레는 부서질 것이다. 그리고 마침내 정의가 구현될 것이다.', 39653),
(210322, 'koKR', '', '늘 나약하기 짝이 없었지!', 39653),
(210321, 'koKR', '', '나락의 양분이 되어라!', 39653),
(210320, 'koKR', '', '쓰러져라, 영웅이여!', 39653),
(210319, 'koKR', '', '잘 알았다. 죽음을 원한다 이거군!', 39653),
(210318, 'koKR', '새로 보는 얼굴이 아주 많은걸.', '', 39653),
(210317, 'koKR', '대장이 거울 세 개만 더 닦으면 중급 거울닦이로 승급시켜 준댔어. 사람이 목표가 있으면 좋지.', '', 39653),
(210315, 'koKR', '그, 주인이 덫에서 빠져나오지 못하는 거 확실해? 저기 반짝이는 양반에게 무슨 악감정이 있는 건 아닌데 여긴 대영주의 앞마당이나 다름없잖아. 예전에도 그랬고 말이지.', '', 39653),
(210310, 'koKR', '저기, 음... 나락 방랑자인지 높으신 나리인지, 아무튼. 혹시 내가 이 일 계속 안 해도 되게 주변에 얘기할 만한 사람 없어? \n\n그러니까 부탁 좀 들어달라, 이 말이지.\n\n내가 \"생존 중독증\"이란 질환을 달고 사는데, 이 일은 정확히 반대 작용만 일으켜서 그래.', '', 39653),
(210309, 'koKR', '끝수렁보다 더 신경을 곤두서게 하는 장소를 꼽으라면 바로 여기 아닐까 싶군.', '', 39653),
(210308, 'koKR', '충전 소진. 용해 진행 중.', '', 39653),
(210307, 'koKR', '연결망 형성. 수호자를 강화합니다.', '', 39653),
(210302, 'koKR', '난 명령을 따르는 애완동물이 아니다. 이 사실을 명심하도록.', '', 39653),
(210300, 'koKR', '', '파수기를 물질화합니다.', 39653),
(210299, 'koKR', '', '해체 개시.', 39653);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(210298, 'koKR', '', '분해 전개.', 39653),
(210297, 'koKR', '', '섬멸... 실시.', 39653),
(210296, 'koKR', '', '핵... 소진...', 39653),
(210295, 'koKR', '', '암호 방어 완료. 휴면 상태로 전환합니다.', 39653),
(210292, 'koKR', '', '암호를... 사수합니다.', 39653),
(210291, 'koKR', '이 장난도 지긋지긋하구나! 맹공을 시작하지!', '', 39653),
(210290, 'koKR', '저주받은 자의 군대여! 저것들을 없애라!', '', 39653),
(210289, 'koKR', '나는 영원하다!', '', 39653),
(210288, 'koKR', '몇 번이고 다시 돌아오리라!', '', 39653),
(210286, 'koKR', '나는 절대 지지 않는다!', '', 39653),
(210283, 'koKR', '싸늘한 공포 속에서 절규해라!', '', 39653),
(210277, 'koKR', '차가운 어둠 앞에 굴복하라!', '', 39653),
(210276, 'koKR', '네 몸속에 흐르는 피를 얼려주마!', '', 39653),
(210275, 'koKR', '얼어붙은 황무지의 하수인들아, 일어나라!', '', 39653),
(210274, 'koKR', '', '목적의 길을 위하여!', 39653),
(210273, 'koKR', '로세나라, 안 돼요! 우린 당신이 필요해요!', '', 39653),
(210272, 'koKR', '', '그리고... 기록관 로세나라. 어두운 시기에 저의 지혜가 길을 인도하길 염원합니다. 코르시아에 다시 여명이 떠오르도록.', 39653),
(210270, 'koKR', '', '기록관 로마!', 39653),
(210269, 'koKR', '', '기록관 로키엘!', 39653),
(210268, 'koKR', '', '기록관 로루다!', 39653),
(210267, 'koKR', '', '기록관 로제마!', 39653),
(210265, 'koKR', '어둠이 손짓한다!', '', 39653),
(210264, 'koKR', '심연을 알려주마!', '', 39653),
(210262, 'koKR', '얼음과 서리만이 너희를 반길 것이다!', '', 39653),
(210261, 'koKR', '얼어붙어 깨져라!', '', 39653),
(210260, 'koKR', '', '고대의 기록관들이시여! 끌림의 지팡이에 그대들의 지식을 모두 내려주소서! 그대들의 메아리는 잊힐지라도, 희생은 결단코 잊히지 않을 것입니다!', 39653),
(210259, 'koKR', '', '끌림의 지팡이는 령을 원동력으로, 지혜의 인도를 받아 보관소에서 소장했던 모든 유물로 주인을 인도할 것입니다. 그렇게 우리의 신성한 목적의 길은 계속되겠지요.', 39653),
(210258, 'koKR', '추위가 너희를 조각내리라!', '', 39653),
(210257, 'koKR', '뼛속까지 파고드는 한기가 느껴지느냐?', '', 39653),
(210255, 'koKR', '잠깐! 멈춰라! 내가 상상을 초월하는 힘을 주겠다!', '', 39653),
(210254, 'koKR', '네놈들을 나락에서도 가장 어두컴컴한 구덩이에 던져넣어 주마!', '', 39653),
(210253, 'koKR', '내 성물함이!', '', 39653),
(210252, 'koKR', '죽음은 나의 영역이니라!', '', 39653),
(210251, 'koKR', '죽음을 다루는 내 권능은 절대적이다!', '', 39653),
(210250, 'koKR', '죽음은 나의 힘을 강하게 만들 뿐!', '', 39653),
(210249, 'koKR', '네놈들의 힘으론 날 꺾지 못한다!', '', 39653),
(210248, 'koKR', '날 해치우겠다고? 이 몸이 죽음의 지배자이거늘!', '', 39653),
(210247, 'koKR', '정말 이긴 줄 알았느냐? 무지몽매한 천치들!', '', 39653),
(210246, 'koKR', '아니야! 말도 안 돼! 죽음은... 내 명을 따른단... 말이다!', '', 39653),
(210245, 'koKR', '어리석은 놈들. 리치는 죽일 수 있는 존재가 아니다.', '', 39653),
(210242, 'koKR', '내 일에 훼방을 놓는 것도 이제 끝이다!', '', 39653),
(210237, 'koKR', '즐겁게 머무르시길.', '', 39653),
(210236, 'koKR', '분명 누군가에게서 얻을 수 있을 겁니다.', '', 39653),
(210235, 'koKR', '밀수품을... 전부... 내놓아라...', '', 39653),
(210233, 'koKR', '소 중개단의 소레아가 위험한 유물을 손에 넣으려 하고 있습니다. 그 작자를 막으면 우리 모두에게 이득이 될 거예요.', '', 39653),
(210232, 'koKR', '저는 알달릴, 소박한 유물 수집가죠. 당신께 좋은 기회를 하나 드리려고 왔답니다.', '', 39653),
(210231, 'koKR', '아, 오셨군요!', '', 39653),
(210230, 'koKR', '이봐! 그건 소 중개단 재산이야!', '', 39653),
(210229, 'koKR', '', '그럼요, 친구.', 39653),
(210228, 'koKR', '', '눈앞의 책무를 완수하고 나면 영광에 관한 이야기를 함께 나눠보는 것도 괜찮겠군.', 39653),
(210227, 'koKR', '흥미롭군. 시간만 충분했다면 더 깊은 대화를 나눴을 텐데.', '', 39653),
(210224, 'koKR', '', '나도 마찬가지다. 오딘께서 장막 너머를 엿보셨을 때, 필멸자의 영혼을 영원한 안식처로 인도하는 날개 달린 존재를 봤다고 하셨지.', 39653),
(210223, 'koKR', '', '기묘하게도... 당신이 친숙하게만 느껴져요.', 39653),
(210221, 'koKR', '말드락시 병력의 맹활약을 기대하겠다, 남작이여.', '', 39653),
(210220, 'koKR', '', '바이라즈는 비열한 배신자일세. 놈을 처단하고 크렉서스 후작님의 복수를 할 것이야.', 39653),
(210219, 'koKR', '간수의 눈을 몰아내다니... 잘됐군. 게다가 데스모테론에 대한 귀중한 정보까지 모아올 줄이야. 다만 헬리아와 바이라즈에 대한 소식이 마음에 걸리는구나.', '', 39653),
(210218, 'koKR', '소규모 중개단에게서 얻을 이익은 거의 없습니다. 알 중개단과 소 중개단이 왜 싸우는지는 몰라도, 우리가 관여할 일은 아니죠.', '', 39653),
(210216, 'koKR', '', '알달릴과 함께 움직이는 모양이시더군요. 경고 하나 해드리죠. 친구는 신중히 골라야 합니다. 적은 더더욱 그렇고요.', 39653),
(210215, 'koKR', '간단한 문제였는걸요. 답례로 자이 중개단의 서명만 좀 요청드립니다.', '', 39653),
(210214, 'koKR', '', '이 야수면 완벽하겠어.', 39653),
(210213, 'koKR', '', '유인책이 필요한데. 이빨이 날카로운 녀석으로 말이야.', 39653),
(210212, 'koKR', '흔적을 읽는 덴 자신있지만, 고서는 문외한일세. 어디 사냥감에 대해 알아보세나.', '', 39653),
(210211, 'koKR', '타 중개단은 남들 일에 간섭하는 걸 피하고 있습니다. 사업을 보호하기 위해서죠. 이해하시리라 믿습니다.', '', 39653),
(210210, 'koKR', '', '성약의 단들이 용기를 내어 몽환숲을 지켰건만, 조바알은 기어코 원하는 것을 손에 넣고 말았다.', 39653),
(210208, 'koKR', '', '안두인! 안 돼!', 39653),
(210205, 'koKR', '나도 네가 자랑스럽다, 아들아.', '', 39653),
(210204, 'koKR', '제게 소중한 것을 지키라고 가르쳐 주셨잖습니까. 그 유산을 이어받아 자랑스럽습니다.', '', 39653),
(210202, 'koKR', '운명의 선택은 달랐던 것 같구나. 다리온, 나는 너에게 이런 유산을 물려주고 싶지 않았다.', '', 39653),
(210201, 'koKR', '', '내 분노는 모든 것을 파괴한다!', 39653),
(210200, 'koKR', '당시 다른 이들을 이끌 네 번째 기사가 필요했습니다. 티리온이 가장 적합해 보였죠.', '', 39653),
(210199, 'koKR', '', '죽음이 널 쫓는다!', 39653),
(210198, 'koKR', '그에게 말했었죠. 은빛 성기사단만이 칠흑의 기사단을 이끌 수 있다고.', '', 39653),
(210197, 'koKR', '한데 너는 그런 그를 언데드로 되살리려 했지. 왜 쉬어 마땅한 이의 영면을 방해했느냐?', '', 39653),
(210196, 'koKR', '', '박살 내주마!', 39653),
(210195, 'koKR', '맞습니다. 리치 왕과의 결전에서 서리한을 산산이 조각내 버렸죠.', '', 39653),
(210194, 'koKR', '내가 사라지고 티리온 폴드링이 파멸의 인도자를 물려받았단 말이지? 그 이상의 적임자는 없을 것 같구나.', '', 39653),
(210193, 'koKR', '', '이제 끝을 내야겠구나.', 39653),
(210192, 'koKR', '', '상대조차 안 되는군!', 39653),
(210191, 'koKR', '', '아뇨... 훨씬 위험한 존재가 다가오네요.', 39653),
(210190, 'koKR', '', '문베리 님이 감지한 존재가 저자인가요?', 39653),
(210188, 'koKR', '', '내 방패는 굳건하다!', 39653),
(210187, 'koKR', '', '내 칼날 앞에 쓰러져라!', 39653),
(210186, 'koKR', '', '공격하라, 자매들이여!', 39653),
(210185, 'koKR', '', '발키르! 전부 해치워 버려라!', 39653),
(210184, 'koKR', '', '네놈들은 우리보다 한 수 아래다!', 39653),
(210183, 'koKR', '', '한심하군!', 39653),
(210182, 'koKR', '', '하찮구나!', 39653),
(210181, 'koKR', '여왕님과 숲을 위하여!', '', 39653),
(210180, 'koKR', '', '하찮은 페이 놈들! 너희는 이미 패배했다!', 39653),
(210179, 'koKR', '', '우린... 만물을... 재창조할 것이다...', 39653),
(210178, 'koKR', '', '너희 죽음은 대의를 위한 것이니라.', 39653),
(210176, 'koKR', '', '내 노래를 듣고 절망하라!', 39653),
(210175, 'koKR', '', '새겨듣거라, 필멸자여!', 39653),
(210173, 'koKR', '', '내 노래는... 영원히... 울려퍼지리라...', 39653),
(210172, 'koKR', '기록관의 메아리를 불러보겠습니다.', '', 39653),
(210171, 'koKR', '이 기록관님에 관한 이야기를 들은 적 있습니다.', '', 39653),
(210170, 'koKR', '잠시만 기다려 주십시오.', '', 39653),
(210169, 'koKR', '제가 하겠습니다.', '', 39653),
(210164, 'koKR', '', '내 발치에서 죽어라!', 39653),
(210163, 'koKR', '', '자, 덤벼 보아라!', 39653),
(210162, 'koKR', '', '자매들 곁으로... 가노라...', 39653),
(210161, 'koKR', '', '자매들이여, 힘을 다오!', 39653),
(210159, 'koKR', '', '눈이 제 주인의 곁으로 도망치는군.', 39653),
(210158, 'koKR', '', '적이 달아난다. 쫓아가라, 자매들이여!', 39653),
(210157, 'koKR', '', '격노뿔피리의 부름이 들린다, 나락 방랑자! 눈의 시선이 우리에게로 쏠릴 거다. 영광스러운 전투를 준비해라!', 39653),
(210156, 'koKR', '책무를 저버리지 마라.', '', 39653),
(210155, 'koKR', '곧 전쟁이 일어날 거다.', '', 39653),
(210154, 'koKR', '우리의 적은 멈추지 않는다.', '', 39653),
(210153, 'koKR', '전투가 임박했노라.', '', 39653),
(210152, 'koKR', '성약의 단은 하나가 되어야 한다.', '', 39653),
(210151, 'koKR', '우린 어둠땅의 구원을 위해 싸운다.', '', 39653),
(210150, 'koKR', '우리가 실패하면 만물이 무로 돌아갈 것이야.', '', 39653),
(210149, 'koKR', '흔들리면 안 되느니라.', '', 39653),
(210148, 'koKR', '운명이 널 이곳으로 이끌었구나.', '', 39653),
(210147, 'koKR', '우린 함께 승리할 것이다.', '', 39653),
(210146, 'koKR', '아, 나락 방랑자로군.', '', 39653),
(210145, 'koKR', '말하라, 필멸자여.', '', 39653),
(210144, 'koKR', '진정한 힘을 똑똑히 보아라!', '', 39653),
(210143, 'koKR', '내게 맞설 준비가 안되었구나!', '', 39653),
(210142, 'koKR', '네가 맞이할 파멸을 보아라!', '', 39653),
(210140, 'koKR', '저들에게 파멸을 보여주어라!', '', 39653),
(210139, 'koKR', '네 족쇄를 보아라!', '', 39653),
(210138, 'koKR', '너의 최후를 지켜봐 주마!', '', 39653),
(210137, 'koKR', '나는 절대 패배하지 않는다!', '', 39653),
(210136, 'koKR', '심연에 떨어져버려라!', '', 39653),
(210134, 'koKR', '내 분노가 폭발한다!', '', 39653),
(210133, 'koKR', '보아라. 너의 종말이 다가왔도다!', '', 39653),
(210132, 'koKR', '파멸을 맞이하게 해주지!', '', 39653),
(210128, 'koKR', '한 번 뜬 눈은... 도로 감기지 않는 법...', '', 39653),
(210125, 'koKR', '눈길조차 주기 아깝구나!', '', 39653),
(210124, 'koKR', '눈 밖에 나버렸구나!', '', 39653),
(210123, 'koKR', '눈에 뵈는 게 없어졌군!', '', 39653),
(210122, 'koKR', '내 시야에서 벗어날 순 없다!', '', 39653),
(210121, 'koKR', '', '마음 단단히 먹으세요! 저 거대한 관문 너머 끔찍한 어둠이 느껴져요!', 39653),
(210120, 'koKR', '나락 방랑자님! 절 지금 당장 풀어 주세요.\n\n이 지역의 마귀가 제게 대단히 중요한 물건을 가져갔습니다. 그걸 되찾는 데 도움이 필요합니다.\n\n절 도와주시겠습니까? 보상은 당연히 드릴게요.', '나락 방랑자님! 절 지금 당장 풀어 주세요.\n\n이 지역의 마귀가 제게 대단히 중요한 물건을 가져갔습니다. 그걸 되찾는 데 도움이 필요합니다.\n\n절 도와주시겠습니까? 보상은 당연히 드릴게요.', 39653),
(210119, 'koKR', '나락살이가 마지막 공격을 위해 결집했소! 전군, 내게로!', '', 39653),
(210109, 'koKR', '비명이 부족해. 작품을 더 다듬어야겠군.', '', 39653),
(210105, 'koKR', '너희의 고통의 절규로 이 전당을 가득 채우리라!', '', 39653),
(210103, 'koKR', '너희라면 내 방의 희생양으로 완벽하겠어.', '', 39653),
(210102, 'koKR', '파멸한 자의 고뇌를 들어라!', '', 39653),
(210101, 'koKR', '고통받는 자를 잘 보아라!', '', 39653),
(210100, 'koKR', '학살의 바닥에 잘 왔다!', '', 39653),
(210098, 'koKR', '가시 가득한 죽음이 널 쫓아가리라!', '', 39653),
(210097, 'koKR', '장치를 해방하라!', '', 39653),
(210086, 'koKR', '조심히 나아가.', '', 39653),
(210085, 'koKR', '발 조심해.', '', 39653),
(210081, 'koKR', '저 너머에는... 어떤 고통이...', '', 39653),
(210080, 'koKR', '고대의 기록관에게서 어떤 비밀을 알게 될까요?', '', 39653),
(210079, 'koKR', '너희 고통은 이제 시작일 뿐이다.', '', 39653),
(210078, 'koKR', '내 함정에 제대로 걸려들었군.', '', 39653),
(210076, 'koKR', '깔끔하게 처리됐군.', '', 39653),
(210075, 'koKR', '이 영혼만큼은 훔쳐 가지 못하리라!', '이 영혼만큼은 훔쳐 가지 못하리라!', 39653),
(210074, 'koKR', '우리가 하나를 구하면 놈들은 훨씬 더 많이 가져가는군!', '우리가 하나를 구하면 놈들은 훨씬 더 많이 가져가는군!', 39653),
(210073, 'koKR', '뒤는 저희에게 맡기십시오! 그런데 놈들이 야생씨앗을 빼앗아가는 속도가 구해내는 속도보다 빠릅니다!', '뒤는 저희에게 맡기십시오! 그런데 놈들이 야생씨앗을 빼앗아가는 속도가 구해내는 속도보다 빠릅니다!', 39653),
(210072, 'koKR', '방어 준비!', '', 39653),
(210071, 'koKR', '훌륭한 사냥이었습니다! 이건 저희가 확보할 테니, 가서 더 찾아보십시오!', '훌륭한 사냥이었습니다! 이건 저희가 확보할 테니, 가서 더 찾아보십시오!', 39653),
(210070, 'koKR', '너희 비명은 영원토록 울려 퍼질 것이다!', '', 39653),
(210068, 'koKR', '', '오딘께서 찾으신다, $n|1이여;여;.', 39653),
(210066, 'koKR', '왔군. 시작하려면 도전의 뿔피리를 불거라.', '', 39653),
(210065, 'koKR', '', '영광스러운 오딘 님의 전당을 다시 볼 날이 올는지 확신할 수 없었다, 나락 방랑자여. 가엾은 자매들...', 39653),
(210059, 'koKR', '입 다물어! 명령에 의문을 품는 행위 자체가 선동이다!', '입 다물어! 명령에 의문을 품는 행위 자체가 선동이다!', 39653),
(210058, 'koKR', '난 바이라즈 님이 선택받은 자의 의회의 후작이 되길 바라는 마음에서 지지했어. 하지만 나락이 아니라 말드락서스의 통제권을 놓고 싸워야 하는 것 아닌가?', '난 바이라즈 님이 선택받은 자의 의회의 후작이 되길 바라는 마음에서 지지했어. 하지만 나락이 아니라 말드락서스의 통제권을 놓고 싸워야 하는 것 아닌가?', 39653),
(210057, 'koKR', '신체 저장고. 궁금증이 지나쳤다더군.', '신체 저장고. 궁금증이 지나쳤다더군.', 39653),
(210056, 'koKR', '재발령? 왜? 어디로?', '재발령? 왜? 어디로?', 39653),
(210055, 'koKR', '대장님... 재발령 나셨잖아.', '대장님... 재발령 나셨잖아.', 39653),
(210054, 'koKR', '오늘 순찰 감독은 티칸 대장께서 하기로 되어 있지 않았나?', '오늘 순찰 감독은 티칸 대장께서 하기로 되어 있지 않았나?', 39653),
(210053, 'koKR', '차라리 그분이 상대하는 게 낫지!', '차라리 그분이 상대하는 게 낫지!', 39653),
(210052, 'koKR', '바이라즈 님이 그 바다 마녀하고 보내는 시간이 엄청나게 많은 것 같아.', '바이라즈 님이 그 바다 마녀하고 보내는 시간이 엄청나게 많은 것 같아.', 39653),
(210051, 'koKR', '크렉서스가 살려달라고 애걸복걸했다더군. 하찮은 겁쟁이 같으니!', '크렉서스가 살려달라고 애걸복걸했다더군. 하찮은 겁쟁이 같으니!', 39653),
(210050, 'koKR', '바이라즈 님이 크렉서스를 쳐부수는 모습을 못 본 게 한이야. 웅장한 전투였겠지!', '바이라즈 님이 크렉서스를 쳐부수는 모습을 못 본 게 한이야. 웅장한 전투였겠지!', 39653),
(210049, 'koKR', '그렇지. 근데 나락까지 와야 손에 넣을 수 있단 얘기는 없었어!', '그렇지. 근데 나락까지 와야 손에 넣을 수 있단 얘기는 없었어!', 39653),
(210048, 'koKR', '그래? 결국 둘 다 베풀어 주셨잖아.', '그래? 결국 둘 다 베풀어 주셨잖아.', 39653),
(210047, 'koKR', '난 바이라즈 님이 혼돈과 힘을 약속하셔서 그분 편에 섰단 말이지.', '난 바이라즈 님이 혼돈과 힘을 약속하셔서 그분 편에 섰단 말이지.', 39653),
(210046, 'koKR', '하라는 대로 해. 바이라즈 님께 의문을 표했다간 어떻게 되는지 알잖아.', '하라는 대로 해. 바이라즈 님께 의문을 표했다간 어떻게 되는지 알잖아.', 39653),
(210045, 'koKR', '이번에 바이라즈 님이 내리신 명령 들었나? 헬가드 요새는 출입 금지라더군. 거기서 무슨 일이 벌어지고 있는 건지.', '이번에 바이라즈 님이 내리신 명령 들었나? 헬가드 요새는 출입 금지라더군. 거기서 무슨 일이 벌어지고 있는 건지.', 39653),
(210044, 'koKR', '', '오셨군요! 제 자루가 너무 무겁진 않았죠? 따라오세요. 할 일이 많습니다.', 39653),
(210042, 'koKR', '', '탁 트여있으면서도... 염탐꾼들에게 잘 노출되지 않는 곳이 필요합니다.', 39653),
(210038, 'koKR', '', '자, 꽉 붙잡아라!', 39653),
(210037, 'koKR', '', '스키야! 쫓아내라.', 39653),
(210036, 'koKR', '', '잿더미를 집어삼킨 기분이 들길.', 39653),
(210035, 'koKR', '', '이 전언을 주인에게 전해라, 작은 새야.', 39653),
(210033, 'koKR', '', '안힐드는 곧 자매들과 합류할 거다.', 39653),
(210032, 'koKR', '', '곧 의식이 끝난다...', 39653),
(210031, 'koKR', '', '나 또한 용납치 않겠다!', 39653),
(210030, 'koKR', '', '순진하기는. 오딘의 흠결은 보이지도 않나보군.', 39653),
(210028, 'koKR', '', '텅 빈 영혼의 공허한 겁박이로군.', 39653),
(210027, 'koKR', '', '순순히 인장을 내놓지 않으면 야생씨앗을 없애 버리겠다.', 39653),
(210026, 'koKR', '그저 복종하면 됐을 것을...', '', 39653),
(210025, 'koKR', '그 메달과 네 영역은 가져도 좋다. 대영주님의 야망 앞에서는 먼지에 불과하니.', '', 39653),
(210024, 'koKR', '군단, 스컬지, 아르거스... 이 놀이의 모든 말들은 네놈들 손을 벗어났다. 이 놀이도 이제 끝에 다다랐지.', '', 39653),
(210023, 'koKR', '네가 그 하찮은 메달에 집중하고 있던 동안, 우리는 진정한 보상을 쟁취했지. 대영주님의 정수가 깃든 레모르니아다.', '', 39653),
(210022, 'koKR', '애초에 추방당한 적도 없었다, 순진한 얼간이 같으니. 전부 주인님의 계획이었을 뿐!', '', 39653),
(210019, 'koKR', '탈줄. 그대의 유산은 잊히지 않을 것이오.', '', 39653),
(210018, 'koKR', '참 암울한 시기오.', '', 39653),
(210017, 'koKR', '', '탈갈란 님의 참전은 현명한 결정입니까?', 39653),
(210016, 'koKR', '이쪽으로, 친구여.', '', 39653),
(210015, 'koKR', '운명의 실타래는 모두를 놀라게 한다오.', '', 39653),
(210014, 'koKR', '탈갈란 님? 나락 방랑자님의 환영은 봤지만, 당신은 없었는데...', '', 39653),
(210013, 'koKR', '무사한 걸 보니 기쁘오, 친구여!', '', 39653),
(210012, 'koKR', '', '야생씨앗을 빼앗고 있어요! 나락 방랑자님, 반드시 막아야 해요!', 39653),
(209980, 'koKR', '이해하지 못한 지식은 아무 뜻도 없습니다.', '', 39653),
(209979, 'koKR', '', '기억되는 역사보다 잊힌 역사가 더 많습니다.', 39653),
(209978, 'koKR', '', '안 돼! 마지막 미끼로 나서주셨는데...', 39653),
(209977, 'koKR', '<툴툴대면서 몸서리치는 훌른>', '', 39653),
(209974, 'koKR', '', '헬가드 요새로 진격하라! 제레크리스의 엄호가 함께한다!', 39653),
(209972, 'koKR', '', '서두르시죠. 할 얘기가 산더미랍니다.', 39653),
(209971, 'koKR', '', '이 정도면 되겠군요. 자, 나락 방랑자님. 령을 조금 주입해 장치를 활성화해 주시겠어요?', 39653),
(209967, 'koKR', '', '당신이 어떤 위험에 처해 있는지 전혀 모르고 계시군요.', 39653),
(209966, 'koKR', '', '운명필경사님을 찾아야만 해요.', 39653),
(209965, 'koKR', '', '일분일초를 다투는 상황입니다.', 39653),
(209964, 'koKR', '', '우리에겐 할 일이 있습니다.', 39653),
(209963, 'koKR', '', '우린 서로 도울 수 있습니다.', 39653),
(209962, 'koKR', '', '무슨 일이시죠, 필멸자님?', 39653),
(209961, 'koKR', '', '가엾은 코르시아. 이토록 큰 재앙에 시달리다니.', 39653),
(209959, 'koKR', '그렇네. 늘 그럴지도.', '', 39653),
(209958, 'koKR', '', '그 상처... 아직도 통증이 있나요?', 39653),
(209955, 'koKR', '나락 방랑자, 내 채비를 마치는 대로 도움을 요청하겠다. 운명이 우리 모두를 살피길.', '', 39653),
(209954, 'koKR', '대영주, 오리보스에 있는 동맹에 전갈을 보내라. 무슨 수를 써서든 심판관의 인장을 지켜야 한다.', '', 39653),
(209953, 'koKR', '뼈장장이여, 말드락서스로 돌아가 강령군주를 집결시켜라. 의회의 질서를 바로세워야 하니.', '', 39653),
(209952, 'koKR', '이를 해내면 새로운 인장을 벼려낼 수 있도다. 만일 우리 공격이 실패한다면... 조바알을 뒤쫓는 데 인장이 필요할 것이야.', '', 39653),
(209951, 'koKR', '성약의 단은 무척 강해졌지만, 아직 완전하진 않다. 저마다 사명을 떠올리고... 미래를 찾아야 한다.', '', 39653),
(209950, 'koKR', 'dnt', '', 39653),
(209949, 'koKR', '필멸자들이 조바알의 성소를 찾아가 그와 대면해야 한다. 하나 알다시피 지혜로운 전략이 있다면 만일의 사태를 대비할 수 있지.', '', 39653),
(209948, 'koKR', '함께하게 되어 영광이오, 시초자. 간수가 당신의 인장을 손에 넣은 지금, 우리는 무얼 해야 하오?', '', 39653),
(209947, 'koKR', '난 절대 무너지지 않는다! 나는 헬스크림이다!', '', 39653),
(209946, 'koKR', '가자. 나의 귀환을 성약의 단에 알려야 하노라.', '', 39653),
(209944, 'koKR', '', '사라져라, 나락의 하수인들아!', 39653),
(209943, 'koKR', '수송할 물건이라도 있으신가요?', '', 39653),
(209942, 'koKR', '망가지고... 사슬에 묶인 신세... 조바알은 모든 존재를 그렇게 만들 속셈이지.', '', 39653),
(209941, 'koKR', '룬조각사의 손길이 필요한 이들이 여전히 남아 있으니, 예전의 내 모습을 이곳에 남겨 그들을 도우리라.', '', 39653),
(209939, 'koKR', '', '염려 말아요, 로쉬르. 굳건히 견뎌냈으니.', 39653),
(209937, 'koKR', '꽉 붙들게!', '', 39653),
(209936, 'koKR', '방심은 금물이다, 나락 방랑자. 놈들은... 어디에도 있을 수 있다.', '', 39653),
(209935, 'koKR', '공포의 군주는 침투와 환영에 능통한 자들이다. 성약의 단 병사들도 경계를 늦춰서는 안 된다.', '', 39653),
(209933, 'koKR', '절단이 내 특기지!', '', 39653),
(209932, 'koKR', '고통받을 지어다!', '', 39653),
(209931, 'koKR', '파멸로 인도해 주마!', '', 39653),
(209930, 'koKR', '내 친히 학살해 주마!', '', 39653),
(209929, 'koKR', '불탄 살점 냄새는 참으로 황홀하지.', '', 39653),
(209927, 'koKR', '번뇌를 쏟아내라! 네 영혼에 깃든 모든 회한을 내보내는 거다, 헬스크림!', '', 39653),
(209926, 'koKR', '고문의 걸작을 목도해라!', '', 39653),
(209925, 'koKR', '너 따위가 고통을 안다고 생각하나?', '', 39653),
(209924, 'koKR', '네 머리통을 짓밟아 주마!', '', 39653),
(209923, 'koKR', '그 정도로는 날 무너뜨릴 수 없다!', '', 39653),
(209922, 'koKR', '너에게 최후를 안겨 주마!', '', 39653),
(209921, 'koKR', '네 고뇌는 나의 것이다!', '', 39653),
(209920, 'koKR', '고문에 이리 약해서야 원.', '', 39653),
(209919, 'koKR', '겨우 이 정도라니.', '', 39653),
(209918, 'koKR', '난 그리 쉽게 무너지지 않는다.', '', 39653),
(209917, 'koKR', '사소한 장애물이었군. 다시 네 영혼에서 고뇌를 뜯어내주마, 오크.', '', 39653);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(209916, 'koKR', '그렇게 해라. 두 사람 모두 행운을 비마.', '', 39653),
(209915, 'koKR', '', '나도 따라가겠소, 나락 방랑자. 룬조각사가 일을 제대로 해내도록 책임지리다.', 39653),
(209914, 'koKR', '앞으로 나아가는 길은 이것뿐이다. 시도해보는 수밖에 없어.', '', 39653),
(209913, 'koKR', '토르가스트?! 가당치도 않은 소리. 차라리 간수의 손에 그대로 갖다 바치지 그러오!', '', 39653),
(209912, 'koKR', '네가 토르가스트에 있는 룬조각사에게 돌려준 기억과 대단히 흡사하지 않느냐. 직접 가져가면 인장의 결속을 푸는 방법을 알려줄지도 모른다.', '', 39653),
(209911, 'koKR', '시초자의 인장에 결속된 이 마법... 낯익지 않나, 나락 방랑자?', '', 39653),
(209910, 'koKR', '타협하고 이해해야 합니다. 그 부분에서는 제가 도움이 될 지도 모릅니다.', '', 39653),
(209909, 'koKR', '아직도 많은 이탈자가 사원을 점유하고 있다. 어떻게 접근하면 좋겠는가?', '', 39653),
(209908, 'koKR', '충성의 용장이 없다면 새로운 인장을 벼려낼 수 없습니다.', '', 39653),
(209907, 'koKR', '내가 고통받는 모습을 보러 왔나, 영웅들이여? 안타깝군. 난 절대 무너지지 않으니까!', '', 39653),
(209905, 'koKR', '어떤 대가를 치르더라도 간수를 막아야 한다.', '', 39653),
(209904, 'koKR', '경사로구나! 이 방이 더 많은 비명으로 메아리칠 테니!', '', 39653),
(209903, 'koKR', '남은 전언은 이걸로 끝이오. 인장을 챙기시오, 나락 방랑자.', '', 39653),
(209902, 'koKR', '', '인장에 결속된 마법은 나도 처음 보는 것이오. 폴드라곤 대영주라면 알지도 모르겠군.', 39653),
(209901, 'koKR', '다른 마법의 형태로 결속해 두겠다. 제아무리 조바알이라고 해도 이 마법을--', '', 39653),
(209900, 'koKR', '...보호하기에 역부족일지도 모른다. 다른 안전책이 필요해.', '', 39653),
(209899, 'koKR', '여기 마지막 기록이 있구려. 보아하니 인장과 결속되어 있는 것 같군.', '', 39653),
(209898, 'koKR', '', '이 힘, 생생히 기억나네... 이 양날의 검.', 39653),
(209897, 'koKR', '', '나는 꿈에서 수많은 것을 보았다. 티란데 위스퍼윈드가 어떤 위험에 놓여 있는지, 또 자세한 경위는 모르겠으나 몽환숲의 생존에 중대한 역할을 하는 것도 똑똑히 보았지.\n\n이에 나이트 페이는 어둠땅의 여러 영역을 누비며 선대 밤 전사를 찾아다녔느니라. 한때 엘룬의 힘을 담았던 이들이라면 티란데가 지금 이고 있는 힘의 일부를 나눠 그녀를 필연적인 죽음으로부터 구해낼 수 있을 터. 바로 그런 인물 중 하나가 이곳에 머무르는 티르낙스였고, 우리에게 힘을 보태주고 있지.\n\n더불어 고대 아제로스의 용맹한 전사에서 야생 사냥단의 냉철한 추적자로 탈바꿈한 훌른 하이마운틴 역시 다른 선대 밤 전사를 찾아내는 데 도움을 주고 있다. 이번에 두 명의 행방을 더 알아냈다더군. 다만 네 도움이 필요해 말드락서스에서 기다리고 있다.\n\n서둘러다오. 티란데에게 남은 시간이 얼마 없는 것 같구나.', 39653),
(209896, 'koKR', '', '몽환숲에서... 전투가 끝난 뒤, 우리는 티란데 위스퍼윈드의 안위가 염려된다고 심정을 토로했었지. 난 그녀가 몽환숲의 생존에 중대한 역할을 하리라 믿는다. 그래서 불분명한 꿈을 뒤로하고 티란데의 목숨을 구할 방도를 백방으로 모색해왔다.\n\n그리고 그 과정에서 다른 세계의 밤 전사였다 장막을 넘어온 티르낙스의 협조를 구하는 데 성공했지. 그는 한때 엘룬의 힘을 담았던 이들이 모여 티란데의 짐을 나누면 도움이 될 것이라는 의견을 내놓았다.\n\n이에 야생 사냥단 최고의 추적자 중 하나인 훌른 하이마운틴이 나서서 어둠땅의 여러 영역을 누비며 다른 밤 전사들을 찾아다녔느니라. 지금 두 명에 대한 확실한 실마리를 확보해 말드락서스에서 기다리고 있다. 찾아가면 자세한 얘기를 들을 수 있을 터.\n\n부디 서둘러다오, $n. 티란데에게 남은 시간이 얼마 없는 것 같구나.', 39653),
(209894, 'koKR', '이렇게... 끝인 건가?', '', 39653),
(209893, 'koKR', '', '몸을 피하시오! 이 싸움은 우리가 맡겠소!', 39653),
(209892, 'koKR', '', '자제하는 걸 보니 현명하구나. 하지만 변하는 건 없다.', 39653),
(209891, 'koKR', '', '제가 처리할게요!', 39653),
(209890, 'koKR', '아니야! 내가... 더 강하단 말이다! 나의 패배는... 있을 수 없다!', '', 39653),
(209889, 'koKR', '아제로스를 위하여!', '', 39653),
(209888, 'koKR', '', '크렉서스를 위하여! 아카렉을 위하여!', 39653),
(209887, 'koKR', '결속으로 나눈 고통이 우릴 강하게 만드노니!', '', 39653),
(209886, 'koKR', '어디 해 봐라. 자, 살육을 시작하지!', '', 39653),
(209885, 'koKR', '비밀의 수호자인 내가... 쉽게 당할 줄 알았느냐!', '', 39653),
(209884, 'koKR', '아니지, 마술사여. 오만의 바다에 빠진 건 바로 너다!', '', 39653),
(209883, 'koKR', '', '네 시대는 까마득한 옛날에 끝났다, 힘없는 백치야. 기꺼이 익사시켜주마!', 39653),
(209882, 'koKR', '시초자는 이미 쓰러졌다! 이제 추방당한 자께서 그의 인장을 취할 것이야!', '', 39653),
(209881, 'koKR', '', '인장은 시초자님 것이다!', 39653),
(209880, 'koKR', '이 전리품은 간수님의 것이다. 주인님을 실망시킬 순 없지!', '', 39653),
(209879, 'koKR', '금고가 열리고 있소!', '', 39653),
(209878, 'koKR', '', '으아아악!', 39653),
(209877, 'koKR', '그만!', '', 39653),
(209876, 'koKR', '', '졸개?! 나 헬리아는 그 누구의 졸개도 아니다! 나는 침묵당하지도, 감금당하지도 않으리라! 나의 분노가 너희를 쫓...', 39653),
(209873, 'koKR', '그래, 간수에게서 졸개를 박탈할 때로구나.', '', 39653),
(209861, 'koKR', '', '저 죽음의 요새를 떨어뜨려라! 끌어내려!', 39653),
(209852, 'koKR', '나의 운명이... 곧 고통이로다. 하지만... 이 왕관을... 홀로 쓰진 않으리라!', '', 39653),
(209851, 'koKR', '보관소의 문이... 열렸거늘...', '', 39653),
(209850, 'koKR', '무수히 많은... 문을 열었지만, 그 끝에는... 고통 뿐.', '', 39653),
(209849, 'koKR', '내가... 실망시켰다더군. 결함 있는 사도라며... 내 자리를 빼앗겼지.', '', 39653),
(209848, 'koKR', '당신이... 보이지 않아. 눈을... 먹혔거든.', '', 39653),
(209847, 'koKR', '룰칸... 당신이오? 너무나... 오랜 시간이 흘렀군...', '', 39653),
(209845, 'koKR', '', '로쉬르가 보냈나 보군요. 바로 찾아가야겠습니다.', 39653),
(209844, 'koKR', '그 누구도 간수에게서 달아날 순 없다!', '', 39653),
(209843, 'koKR', '심연 속으로... 빠져들어라!', '', 39653),
(209842, 'koKR', '상처가... 아물지 않는다!', '', 39653),
(209841, 'koKR', '매 순간이 고문이로다!', '', 39653),
(209839, 'koKR', '고뇌에 굴복해라!', '', 39653),
(209838, 'koKR', '간수에게 가거라!', '', 39653),
(209837, 'koKR', '안식도... 탈출구도 없다. 오직... 고통뿐.', '', 39653),
(209836, 'koKR', '아아... 룰칸... 당신에게... 돌아가오...', '', 39653),
(209835, 'koKR', '내 고통이... 너희 것이 되리라!', '', 39653),
(209833, 'koKR', '방해하지 마라, 필멸자!', '', 39653),
(209827, 'koKR', '그, 그렇지. 인장이 우선이지. 다른 유물은 나중에.', '', 39653),
(209826, 'koKR', '', '금고를 여시오! 당장!', 39653),
(209825, 'koKR', '그렇지만 이 보물 중 몇 개쯤은 회수해도...', '', 39653),
(209823, 'koKR', '', '넋 놓고 있을 시간이 없소! 인장을 확보해야만 하오!', 39653),
(209822, 'koKR', '훼손되긴 했어도, 참 장엄하지 않소?', '', 39653),
(209821, 'koKR', '여긴 우리가 맡겠다! 가서 남쪽을 지원해라!', '여긴 우리가 맡겠다! 가서 남쪽을 지원해라!', 39653),
(209820, 'koKR', '당신... 저들과 한패가 아니군요? 제발 도와주십시오!', '', 39653),
(209818, 'koKR', '', '출발하시죠. 여긴 머무를 만한 곳이 아닙니다.', 39653),
(209817, 'koKR', '길이 열렸군! 오시오, 나락 방랑자.', '', 39653),
(209816, 'koKR', '친구들이여, 의식을 시작합세.', '', 39653),
(209814, 'koKR', '머잖아 코르시아의 비밀을 목도하게 될 거요.', '', 39653),
(209809, 'koKR', '', '이런... 큰일이로군.', 39653),
(209808, 'koKR', '', '지금이다! 메달을 확보하고 침입자들을 없애버려라!', 39653),
(209804, 'koKR', '네 하찮은 영혼의 꺼져가는 불씨는 내 피조물의 연료로 써주마!', '', 39653),
(209803, 'koKR', '불손하게 구는 건 끝이다! 내 하수인이 네 가련한 영혼을 끌고 올 것이야.', '', 39653),
(209802, 'koKR', '일어나라, 거대한 자여! 저 하찮은 필멸자의 뼈를 으깨버려라!', '', 39653),
(209801, 'koKR', '내 귀여운 하수인이 네 저항에 마침표를 찍을 것이다!', '', 39653),
(209800, 'koKR', '어리석구나... 필멸자여...', '', 39653),
(209799, 'koKR', '기회가 있을 때 도망쳤어야지.', '', 39653),
(209797, 'koKR', '', '지금 겨울 여왕님 닮은꼴을 만들고 있어요. 적들을 진짜 여왕님에게서 떨어뜨릴 거예요.\n\n이른바 미끼 작전인 셈이죠!\n\n문제는 만들어낼 수 있는 닮은꼴의 수에 한계가 있다는 거예요. 물론 위험한 임무인 건 우리들도 알아요. 하지만 몽환숲을 위해 모든 걸 희생할 각오는 되어 있다고요.', 39653),
(209795, 'koKR', '', '무슨 수를 써서라도 겨울 여왕님을 지켜야 해요!\n\n다행히도 제가 시간을 버는 데 쓸 만한 비법을 많이 알아요. 몽환숲에서 나락을 몰아내자고요!', 39653),
(209794, 'koKR', '', '하늘로 날아오르세요! 동맹이 우리를 믿고 있습니다!', 39653),
(209793, 'koKR', '자, 저들에게 레벤드레스의 힘을 보여 주자!', '', 39653),
(209792, 'koKR', '간수를 섬기지 않는 자, 영원토록 썩어 문드러지리라!', '', 39653),
(209791, 'koKR', '야생 사냥단, 돌격하라!', '', 39653),
(209790, 'koKR', '강령군주여, 진격하라! 이 배신자들을 잿더미로 만들어라!', '', 39653),
(209786, 'koKR', '네 영혼은 포식자의 배 속에서 서서히 녹으며... 끊임없는 고통을 받을 것이다!', '', 39653),
(209785, 'koKR', '', '나스레짐 버러지야. 눈의 의회를 속일 수 있을 줄 알았느냐?', 39653),
(209784, 'koKR', '', '용사여! 서둘러라. 더 늦기 전에 시초자님을 저지해야 한다.', 39653),
(209783, 'koKR', '', '이 정도면... 충분하다. 그만 본론으로 넘어가지.', 39653),
(209782, 'koKR', '', '아, 내 정신 좀 봐. 이게 더 낫겠네요!', 39653),
(209781, 'koKR', '', '굳이 번거롭게 안 그래도...', 39653),
(209780, 'koKR', '', '밤의 궁정에서 보내는 환영 선물을 받아주세요!', 39653),
(209778, 'koKR', '', '자, 이쪽이다.', 39653),
(209774, 'koKR', '', '말드락서스에 오면 잘 맞겠소, 수호자 양반!', 39653),
(209773, 'koKR', '', '전 이 순간을, 이 전쟁을 위해 한평생 훈련했습니다. 당신을 따르겠습니다, 나락 방랑자님!', 39653),
(209770, 'koKR', '', '지원군이라니! 딱 맞춰 오셨군요. 금고까지 진격할 작정이었습니다.', 39653),
(209766, 'koKR', '', '근처에 가죽뜯깃을 대기시켰소, 나락 방랑자. 그걸 타면 금고 밖의 전진 기지로 직행할 수 있소.', 39653),
(209765, 'koKR', '성약의 단 병력이 아직 나락살이에 맞서 금고를 사수하고 있지만, 서두르는 게 좋겠소.', '', 39653),
(209763, 'koKR', '영혼 포식자를 내보내라! 이 더러운 필멸자를 포식하게 두어라!', '', 39653),
(209762, 'koKR', '어서 날아라, 날개 달린 존재여. 필멸자의 영혼을 내게로 가지고 오너라!', '', 39653),
(209751, 'koKR', '', '메릴레트, 기다려요! 같이 이동해야 해요!', 39653),
(209750, 'koKR', '', '자랑할 만한 작업은 아니지만, 지장은 없을 거요. 탈갈란에게 돌아갑시다.', 39653),
(209749, 'koKR', '', '수리를 마칠 동안 저 포식자 좀 처리하시오!', 39653),
(209748, 'koKR', '', '흠. 곤란하게 됐구먼.', 39653),
(209747, 'koKR', '', '나락살이에, 포식자에... 다들 이 곳을 차지하지 못해 안달이구먼.', 39653),
(209745, 'koKR', '', '저놈의 포식자들 때문에 수리 작업이 고달파질 것 같소.\n\n당신이 준비됐다고 하기 전까진 손 하나 꿈쩍 안 할 거요, $n.', 39653),
(209743, 'koKR', '', '그렇게 하여라. 이는 그분의 말씀이니라.', 39653),
(209741, 'koKR', '우린 성약의 단 병력을 소집해 저항 전선을 펼치도록 하겠소.', '', 39653),
(209740, 'koKR', '벤티르도 함께 싸우겠다, 드라카.', '', 39653),
(209738, 'koKR', '', '강령군주가 몽환숲에서 침입자들을 몰아내겠습니다!', 39653),
(209737, 'koKR', '', '옳은 말이다. 이 순간에도 그의 악의가 내 숲을 잠식하려 한다.', 39653),
(209735, 'koKR', '하나 간수가 이 도시만을 노리진 않을 터.', '', 39653),
(209734, 'koKR', '칠흑의 기사단이 불멸의 도시 방어를 도울 것이오.', '', 39653),
(209731, 'koKR', '', '심판관님의 정수는 이곳에 있으니, 반드시 지켜내야 한다.', 39653),
(209730, 'koKR', '', '시초자님의 성소에 인장 같은 건 없었건만...', 39653),
(209729, 'koKR', '분명 데나트리우스 대영주는 추방당한 자에게 자기 인장을 흔쾌히 내놓았겠구려.', '', 39653),
(209728, 'koKR', '나락에 구속되고도 용케 자기 뜻을 따를 동맹을 포섭했군.', '', 39653),
(209727, 'koKR', '', '그리고 배반의 대가로 조바알은 영원히 추방되었다.', 39653),
(209726, 'koKR', '', '하지만 최후에는 시초자가 우리를 승리로 이끌었다.', 39653),
(209724, 'koKR', '', '우리가 조바알을 문책하자, 그는 무력으로 증표를 빼앗으려 했다.', 39653),
(209722, 'koKR', '', '하지만 조바알에게는 인장들이 금단의 지식에 다가갈 열쇠로 보였지.', 39653),
(209720, 'koKR', '', '아득히 먼 옛날, 무궁한 존재들은 저마다 성약의 단의 사명을 나타내는 증표를 받았다.', 39653),
(209719, 'koKR', '', '간수가 뭘 노린 겁니까?', 39653),
(209718, 'koKR', '', '아직. 하지만 도둑맞은 것에 비교하면 아무것도 아니오.', 39653),
(209716, 'koKR', '', '상처는 아물었소, 키레스티아?', 39653),
(209714, 'koKR', '', '승천의 보루를 대놓고 공격하다니 손 놓고 있을 수만은 없다.', 39653),
(209713, 'koKR', '', '심판관의 이름으로 무궁한 존재의 부름을 받드나이다.', 39653),
(209712, 'koKR', '', '고맙다, 돌장인이여. 티란데는 도움이 절실한 상황이다.', 39653),
(209708, 'koKR', '매장터는... 논할 대상이 아니오. 아군이라고 해도.', '', 39653),
(209707, 'koKR', '', '또 끊어졌군. 시초자께서 매장터를 전에도 언급하신 적이 있소. 그게 뭔지, 어디 있는지 아시오?', 39653),
(209705, 'koKR', '적이 진군한다! 놈들에게 자비를 보이지 마라!', '', 39653),
(209704, 'koKR', '실바나스와 싸워 몽환숲에서 몰아내기까지 했는데, 이제 와서 실패할 순 없다.', '', 39653),
(209703, 'koKR', '', '전장에서 아무도 안두인을 못 봤어요. 대체 어디에 있는 걸까요?', 39653),
(209702, 'koKR', '', '감히 조바알이 내 관할의 영혼들을 위협하다니. 그에 걸맞은 결과로 답해줬노라.', 39653),
(209701, 'koKR', '', '하지만 적은 방심할 수 없는 놈들이다. 가거라. 인장을 무사히 지켜내도록.', 39653),
(209700, 'koKR', '', '인장은 숲의 심장부에 숨겨두었다. 그 어떤 곳보다 안전하게 보호할 수 있다.', 39653),
(209698, 'koKR', '', '간수가 구원의 여지가 남아 있는 영혼들을 소멸시키겠노라고 협박하더군. 조화를 지키기 위해 싸우는 자연을 얕본 게지.', 39653),
(209692, 'koKR', '', '작살과 고정 지점을 만들 뼈를 구해오시오. 눈 깜짝할 사이에 건너가게 해드리지!', 39653),
(209690, 'koKR', '나락살이가 우리 거점을 공격하고 있다. 박멸하거라!', '', 39653),
(209686, 'koKR', '내 인장을 여기 이 먼 곳에 봉인하는 것으로는 이를--', '', 39653),
(209685, 'koKR', '...매장터에 당도하는 걸 막지 못할 터. 그런 일이 생겨선 안 된다.', '', 39653),
(209661, 'koKR', '', '위험을 무릅쓰고 그곳에 머물렀던 영혼들의 잔재를 가져와 주시면 좋겠군요.', 39653),
(209660, 'koKR', '', '영혼의 강으로 향하세요. 고르고아는 나락을 흐르면서 영혼을 저주받은 운명으로 휩쓸어 가죠.', 39653),
(209658, 'koKR', '', '용건만 말해라.', 39653),
(209656, 'koKR', '<이 고대 마법서는 고생 끝에 복원되어 잃어버린 단 한 쪽을 제외하고 다시 완성되었습니다. 책을 열자 한때는 차분하고 침착했던 목소리가 당신에게 분노에 찬 고함을 질러댑니다.>\n\n\"내 지시를 귓등으로 알아들은 건가? 마지막 진홍빛 책장은 어딨지?\n\n나를 이 감옥에서 풀어다오!\n\n그리고 경고해두겠는데... 무슨 일을 하든, 어떤 얘기를 듣든... 하늘빛 책장은 절대 손대지 말거라. 놈을 풀어주지 마! 입만 열었다 하면 새빨간 거짓말을 늘어놓는 놈팡이다!\"', '', 39653),
(209655, 'koKR', '', '계속해 봐라.', 39653),
(209654, 'koKR', '장막을 넘어온 밤 전사들을 찾고 있소.', '', 39653),
(209653, 'koKR', '', '몽환숲? 레벤드레스에는 왜 온 것이지?', 39653),
(209652, 'koKR', '', '속이려는 게 아니에요! 몽환숲을 대표해 온 거라고요!', 39653),
(209651, 'koKR', '', '네놈들 모두 없애주마!', 39653),
(209650, 'koKR', '', '더러운 패거리가 더 있었나?!', 39653),
(209649, 'koKR', '', '진정하세요! 심각한 오해가 있...', 39653),
(209648, 'koKR', '', '네 주인의 목적이 뭐냐, 공포의 군주?! 어서 대답해!', 39653),
(209647, 'koKR', '', '저기 훌른이 있어요!', 39653),
(209646, 'koKR', '', '감탄스러울 정도로 구체적인 질문이군요... 제가 드릴 수 있는 대답은 가설뿐이지만요.', 39653),
(209644, 'koKR', '으아아아!', '', 39653),
(209642, 'koKR', '잿불 지구의 빛 속에서 타올라라, 흉측한 야수야!', '', 39653),
(209639, 'koKR', '필멸자! 너는 나락으로 격노뿔피리를 가져가라. 뿔피리를 불어 장막을 꿰뚫고 나의 분노를 소환해라!', '', 39653),
(209638, 'koKR', '다니카, 네가 선봉에 서라. 오딘의 분노가 되어 내 노여움을 체현하거라. 나의 분노를 무기로 적에게 맞서라!', '', 39653),
(209637, 'koKR', '격노뿔피리의 목소리가 내 선택받은 발키르를 부르면, 내 눈이 응당 그들에게 주목하겠지.', '', 39653),
(209633, 'koKR', '나스레짐이... 간수를 섬긴다고? 본디 불타는 군단 소속이었잖나. 아니, 그렇게 믿도록 유도한 셈이겠군.', '', 39653),
(209606, 'koKR', '모두 들어라! 이것은 격노뿔피리다. 내 용광로의 불길 속에서 탄생했으며 영웅들의 분골이 스며들어있지.', '', 39653),
(209605, 'koKR', '너를 비롯한 모두가 나의 승리를 목도하게 될 거다.', '', 39653),
(209604, 'koKR', 'Anduin gives the Jailer the sigil.', 'Anduin gives the Jailer the sigil as he\'s talking.', 39653),
(209603, 'koKR', '한의 검!', '', 39653),
(209602, 'koKR', 'Anduin begins pulling the sigil out of the Primus.', 'Anduin begins pulling the sigil out of the Primus. Primus screams in pain.', 39653),
(209601, 'koKR', '난 최후의 순간까지 맞설 것이다, 조바알!', '', 39653),
(209600, 'koKR', 'Shot of Mawsworn surrounding the Primus. Anduin is walking up to him while the Jailer stands, watching.', 'Shot of Mawsworn surrounding the Primus. Anduin is walking up to him while the Jailer stands, watching.', 39653),
(209599, 'koKR', '', '적들이 하늘을 가득 메웠어요...', 39653),
(209591, 'koKR', '[DNT]Z', '', 39653),
(209590, 'koKR', 'DNT', 'DNT', 39653),
(209589, 'koKR', '[DNT] What... what have you done!', '', 39653),
(209588, 'koKR', '', 'DNT', 39653),
(209587, 'koKR', 'DNT', 'DNT', 39653),
(209586, 'koKR', '너희는... 익숙한 느낌이로군...', '', 39653),
(209585, 'koKR', 'DNT', 'DNT', 39653),
(209584, 'koKR', '이 얼마나 아름다운 영역인가! 한데 점액들은 다 어디 있담? 뭐 괜찮아. 그런 건 내가 해결해 주지!', '', 39653),
(209582, 'koKR', '', '좋은 소식입니다! 당신이 무찔러 줄 흉물들이 더 있습니다!', 39653),
(209526, 'koKR', '이젠 영원히 사라지게 생겼으니 유감이로군. 나스레짐! 저 여자의 송곳니를 가져와라.', '', 39653),
(209525, 'koKR', '분노의 수확자 아니신가. 네 완연한 확신이 얼마나 그리웠는지.', '', 39653),
(209524, 'koKR', '', '모습을 드러내라, 말가니스!', 39653),
(209523, 'koKR', '', '한가하게 이야기할 때가 아닙니다, 나락 방랑자님. 가시죠. 할 일이 산더미예요.', 39653),
(209514, 'koKR', '네 도착이 승리를 불러올 것이야. 선봉에 서서 요새로 진격해라!', '', 39653),
(209513, 'koKR', '내가 던져줄게, $p!', '', 39653),
(209512, 'koKR', '나락 방랑자님이 와주셔서 한숨 돌렸습니다. 레나탈 왕자님이 저 방벽 위에서 기다리십니다.', '', 39653),
(209481, 'koKR', '', '반갑다, $n|1이여;여;. 무엇을 도와주면 되겠는가?', 39653),
(209479, 'koKR', '어쨌든 나의 행동으로 자네는 큰 고통을 받았네. 두 번 다시 그런 일은 없을 걸세.', '', 39653),
(209464, 'koKR', '군단이 나의 명령을 따르노라. 간수를 거역한 죗값을 치르게 해 주마!', '', 39653),
(209463, 'koKR', '감히 이 땅에 숨어들려 하다니!', '감히 이 땅에 숨어들려 하다니!', 39653),
(209462, 'koKR', '썩 꺼져라, 이방인!', '썩 꺼져라, 이방인!', 39653),
(209461, 'koKR', '돌장인께 침입자를 들여보낼 순 없다!', '돌장인께 침입자를 들여보낼 순 없다!', 39653),
(209460, 'koKR', '당장 떠나라!', '당장 떠나라!', 39653),
(209459, 'koKR', '간수의 선택을 받은 존재가 네 하찮은 반항을 끝낼 것이다!', '', 39653),
(209458, 'koKR', '토르가스트의 관문을 열고 앞으로 나와라, 얼음심장의 나락살이여!', '', 39653),
(209456, 'koKR', '', '오늘, 두 가지 변화가 찾아오리라.', 39653),
(209455, 'koKR', '어떤 필멸자도 간수의 승리를 막을 순 없다! 조바알을 위하여! 켈투자드를 위하여!', '', 39653),
(209454, 'koKR', '저들의 육체를 수확해라! 영혼을 찢어버려라! 켈투자드의 이름으로!', '', 39653),
(209453, 'koKR', '일어나라, 하수인들이여! 필멸자의 시체를 내 앞에 대령해라!', '', 39653),
(209452, 'koKR', '한때 지배의 힘으로 날 구속했지. 하지만 이젠 내가 휘두르는 무기다.', '', 39653),
(209451, 'koKR', '오늘 네겐 승리란 없다, 형제여. 똑똑히 보아라.', '', 39653),
(209450, 'koKR', '나 켈투자드가 간수의 곁을 지킬 동안 너는 영겁의 시간을 불타오를 것이다!', '', 39653),
(209449, 'koKR', '나락살이여! 영혼 제련실의 불꽃을 침입자에게 끼얹어 주어라!', '', 39653),
(209447, 'koKR', '영혼 제련실의 불길이 널 삼키리라!', '', 39653),
(209446, 'koKR', '진격해라, 나락살이여! 이 필멸자를 위대한 켈투자드 앞으로 끌고 와라!', '', 39653),
(209443, 'koKR', '일어나라, 나락살이여! 부름에 따라 추방당한 자에게 봉사할지어다!', '', 39653),
(209431, 'koKR', '일어나라, 하수인들이여. 저들에게 간수의 분노를 선사해라!', '', 39653),
(209423, 'koKR', '다니카! 나의 분노를 표출하는 도구가 되어라! 이 필멸의 용사와 함께 싸워 내 이름 아래 승기를 꽂아라!', '', 39653),
(209422, 'koKR', '', '명을 따르겠습니다, 위대한 오딘이시여. 자매들의 복수를 이루겠습니다!', 39653),
(209421, 'koKR', '만물을 보는 나의 고결한 눈이 뒤틀려 어둠의 무기로 전락했도다. 이런 모욕을 좌시할 생각은 추호도 없다!', '', 39653),
(209420, 'koKR', '헬리아를 무찌른 후, 그 여자의 만행도 이제 끝인 줄 알았다. 하지만 그 표독스러운 언사와 만행이 끊임없이 내 심기를 거스르는군!', '', 39653),
(209386, 'koKR', '말씀만 하시지요, 나락 방랑자님.', '듣고 있습니다, 나락 방랑자님.', 39653),
(209385, 'koKR', '원하는 걸 이뤄드리죠.', '원하는 걸 이뤄드리죠.', 39653),
(209384, 'koKR', '모든 거래에 수익이 함께하길.', '모든 거래에 수익이 함께하길.', 39653),
(209383, 'koKR', '즐거웠습니다.', '즐거웠습니다.', 39653),
(209382, 'koKR', '', '우리가 협력하면 해낼 수 있어요. 분명 운명필경사님을 찾을 수 있을 거예요.', 39653),
(209381, 'koKR', '나락이라니? 그 양반을 구하려면 부리나케 뛰어야겠군요. 서둘러요!', '', 39653),
(209380, 'koKR', '녀석에게 나락으로 던져 버리겠다고 위협하셨지. 내가 아니라 다행이었어!', '녀석에게 나락으로 던져 버리겠다고 위협하셨지. 내가 아니라 다행이었어!', 39653),
(209375, 'koKR', '가까워진 것 같습니다. 거의 끝자락이라고요!', '', 39653),
(209368, 'koKR', '', '나락 방랑자여. 다시 연을 맺으니 진실로 기쁘구나.\n\n이 소박한 야유회를 즐기려고 열심히 노력하고 있어. 그리고 네... \"남다른\" 기질이 발현되는 광경을 보니 즐겁기 그지없더군.\n\n지금까지 그랬던 것처럼 과거와 미래를 막론하고 너와의 동맹 관계를 부인해도 사적인 감정은 품지 않길 바라. 모름지기 숙녀는 대외적인 체면을 관리해야 하는 법이니.', 39653),
(209366, 'koKR', '', '이제야 구한 시초자님을 다시 잃을 수는 없다! 말드락서스를 위하여!', 39653),
(209365, 'koKR', '나락살이, 처리해라.', '', 39653),
(209364, 'koKR', '넌... 또다시 실패할 것이다.', '', 39653),
(209363, 'koKR', '어림없지. 네놈에게 맞서 주마!', '', 39653),
(209362, 'koKR', '네 인장은 내 것이 되리라.', '', 39653),
(209361, 'koKR', '나갈 방법을 찾아 볼테니 놈의 군대를 막아 다오!', '', 39653),
(209360, 'koKR', '토르가스트에 휘몰아치는 령의 힘을 너에게 주입해 주마.', '', 39653),
(209358, 'koKR', '곧 조바알이 들이닥칠 거다. 단단히 준비해야 한다.', '', 39653),
(209355, 'koKR', '뭐죠?', '뭐죠?', 39653),
(209352, 'koKR', '재정립의 순간이 도래했다. 신성한 의식을 지킬 준비는 되었나?', '', 39653),
(209351, 'koKR', '고통과 적개심은... 그만 내려놓아야 합니다.\n\n이탈자는 목소리를 높일 자격이, 존중받을 자격이 있습니다. 그건 키리안도 마찬가지죠.', '', 39653),
(209332, 'koKR', '', '무의미한 저항을 하는구나. 난 이미 필요한 걸 가졌다!', 39653),
(209331, 'koKR', '', '오딘께서 용납하지 않으실 거다!', 39653),
(209330, 'koKR', '', '내 복수를 지체하지 않겠다. 지금 공격한다.', 39653),
(209329, 'koKR', '', '드디어! 도와줄 사람이 오리라 생각했다!', 39653),
(209328, 'koKR', '', '거기 누구냐? 날 고문하려는 자에겐 응보가 따를 것임을 명심해라!', 39653),
(209327, 'koKR', '수확자들은 날 따라오도록. 분노를 찾으려면 분노를 일으켜야 하는 법.', '', 39653),
(209326, 'koKR', '', '식은 죽 먹기죠. 아무도 우리를 보지 못할걸요!', 39653),
(209325, 'koKR', '문베리 대신, 요새로 진격할 동안 모습을 숨겨줄 수 있겠나?', '', 39653),
(209324, 'koKR', '', '봐요, 맞히기 쉬워졌죠?', 39653),
(209323, 'koKR', '물론, 이 정도로 덩치가 클 줄은 예상하지 못했지만...', '', 39653),
(209322, 'koKR', '레벤드레스와 몽환숲의 힘이 합쳐지면 제아무리 강력한 간수의 야수라도 당해낼 수 없을 테지!', '', 39653),
(209319, 'koKR', '', '겁쟁이 녀석! 어둠 속에서 나와라!', 39653),
(209318, 'koKR', '', '훨씬 더 위험한 적도 상대해봤지.', 39653),
(209317, 'koKR', '', '널... 너무 얕잡아 봤군...', 39653),
(209316, 'koKR', '넌... 힘에 대해... 아무 것도 모른다...', '', 39653),
(209315, 'koKR', '수색을 방해할 수는 없을 거다!', '', 39653),
(209312, 'koKR', '', '진정한... 고통이군...', 39653),
(209311, 'koKR', '', '네 피는 내 차지다, 나락 방랑자!', 39653),
(209307, 'koKR', '자이 중개단이 쏠쏠한 수익을 올리고 있군요. 이를 계기로 우리에게 협조해 주면 좋겠는데 말이죠.', '', 39653),
(209304, 'koKR', '', '입찰 시작가는 오천입니다! 오천 없습니까? 오천 나왔습니다! 육천은 없나요? 예! 육천 나왔네요!', 39653),
(209303, 'koKR', '', '여러분 모두가 고대하던 상품 차례입니다! 이른바 악마의 저주를 받은 망각의 서슬도끼입니다!', 39653);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(209302, 'koKR', '', '목적의 길을 따르시길, 기록관님.', 39653),
(209301, 'koKR', '최선을 다하겠습니다, 로세나라. 목적의 길이 함께하길.', '', 39653),
(209300, 'koKR', '', '유물을 회수하고 보관소를 복구하세요. 그리고 당신을 도우려는 필멸자를 믿으세요.', 39653),
(209299, 'koKR', '', '준비됐어요. 당신이 스스로 생각하는 것 이상으로요. 이제부터 당신이 코르시아의 기록관입니다.', 39653),
(209297, 'koKR', '다른 적임자가 있을 겁니다. 전 준비되지 않았어요.', '', 39653),
(209296, 'koKR', '', '학자 로쉬르, 제 메아리가 사그라드니... 보관소를 당신에게 맡기겠습니다.', 39653),
(209287, 'koKR', '', '정말 내가 눈치채지 못했을 줄 알았느냐?', 39653),
(209283, 'koKR', '', '흥미롭네요! 저기 저 반짝이는 물체는... 깃털인가요?', 39653),
(209281, 'koKR', '', '이동은 성공하셨죠?', 39653),
(209280, 'koKR', '', '인도의 성역 주변에서 다시 합류하겠습니다. 서두르시길!', 39653),
(209279, 'koKR', '', '흠... 인도를 받고자 기도를 올리러 간다고 이 문단에 적혀 있습니다.', 39653),
(209278, 'koKR', '', '광기 어린 헛소리에 편집증이라니. 공작원이 잠입했다고 의심하시는 군요. 터무니없는 소리입니다!', 39653),
(209277, 'koKR', '', '향이라. 이건 인도의 성역에 있던 겁니다. 분명 거기로 갔을 거예요.', 39653),
(209276, 'koKR', '', '이런! 더 살펴보다가 또다른 단서가 나와 주길.', 39653),
(209275, 'koKR', '', '폐허에서 뵙겠습니다. 수색을 도와주셔서 감사합니다.', 39653),
(209274, 'koKR', '운명필경사는 심판관님을 섬기는 따르는 자 중에서도 가장 중요한 위상을 차지합니다. 목적의 길을 따르는 책무를 수행하는 영예를 누리죠.', '운명필경사는 심판관님을 섬기는 따르는 자 중에서도 가장 중요한 위상을 차지합니다. 목적의 길을 따르는 책무를 수행하는 영예를 누리죠.', 39653),
(209271, 'koKR', '', '제 곁으로 오세요.', 39653),
(209249, 'koKR', '덕분에 보관소가 완성되었습니다.', '', 39653),
(209248, 'koKR', '아, 좋습니다. 기록 보관소가 완전해지고 있습니다!', '', 39653),
(209247, 'koKR', '수집품이 늘었군요. 당신이 없었으면 큰일날 뻔 했습니다.', '', 39653),
(209246, 'koKR', '뼈라니?! 맙소사!', '', 39653),
(209245, 'koKR', '', '당치도 않은 소리! 필요한 재료는 여기 다 있소. 튼튼한 뼈 몇 개만 있으면 된다오!', 39653),
(209244, 'koKR', '<세월의 풍파를 맞으며 수없이 많은 손을 거쳐서 그런지 부적의 표면이 닳아 반질거립니다. 로쉬르가 설명하길 최초의 따르는 자들이 코르시아에 도착한 이래로 기록관이 다음 기록관에게 대물림하며 끊임없이 계승해 왔다고 합니다.\n\n부적에 담긴 힘은 먼 옛날 소진되어 사라졌고 그저 감성적인 가치만이 남아 있습니다.\n\n하지만 그것만으로 충분할지도 모릅니다.>', '', 39653),
(209243, 'koKR', '계획이 엉망이 됐소! 무슨 수로 이 틈새를 건넌단 말이오?', '', 39653),
(209242, 'koKR', '알겠소.', '', 39653),
(209241, 'koKR', '', '한 번만 더 나불댔다간 당신이야말로 아무것도 안 남을 줄 아시오.', 39653),
(209240, 'koKR', '간수에게 맞섰다면 그대의 스승은 흔적조차 안 남았을 수도 있소.', '', 39653),
(209239, 'koKR', '', '시초자님이 종적을 감추신 이래로 말드락서스와 어둠땅 전체에... 암운이 드리웠소. 그분을 찾아야만 하오!', 39653),
(209238, 'koKR', '그런 것 같구려. 기록을 더 찾으면 해답을 찾을 수 있을지도 모르오.', '', 39653),
(209237, 'koKR', '', '그럼 시초자님은 말드락서스를 떠나 코르시아로 오신 게로군. 간수가 탈출을 꾀하는 걸 알아차리신 모양이오.', 39653),
(209236, 'koKR', '기록 관리자들은 안식처로 향하시오. 그곳은 안전하오.', '', 39653),
(209235, 'koKR', '또 다른 도전자가 영광을 찾아왔구나. 전투를 준비해라!', '', 39653),
(209234, 'koKR', '훈련이 부족하군. 날을 잘못 골랐어.', '', 39653),
(209233, 'koKR', '잘 싸웠다! 오딘 님의 분노를 섬길 자로 손색이 없도다. 그분께 가보도록.', '', 39653),
(209231, 'koKR', '', '죄악의 몰락지. 옛날의 위용은 찾아보기도 어려울 정도로구나. \n\n공포의 군주와 빛을 향한 놈들의 오만방자한 태도를 혐오할 이유가 하나 더 생긴 셈이로군.\n\n실은 대영주 데나트리우스가 내게 너와 왕자를 포함한 이곳을 완전히 파괴하란 명령을 내릴 거라 예상했었다. 실제론 그러지 않았지. \n\n아무래도 데나트리우스와 레나탈의 관계는 한낱 배신이나 패륜으로 쉬이 무시할 수 있는 건 아닌 모양이야.', 39653),
(209230, 'koKR', '', '흠. 한번은 레나탈이 메달을 사용해 자신에게 힘을 몰아달라며 우릴 설득하려 든 적 있다.\n\n주인이 진정한 속내를 드러내기 전에 있었던 일이지. 나락과 네 녀석이 우리 방황하는 왕자에게 출세 그 이상의 목표를 심어준 것 같구나.\n\n아주 잘했다.', 39653),
(209229, 'koKR', '', '운명필경사님을 드디어 찾았습니다!', 39653),
(209228, 'koKR', '', '환영? 정말 기이하군요.', 39653),
(209227, 'koKR', '', '령은 왜 필요하다는 걸까요? 정말 따분한 계획입니다!', 39653),
(209226, 'koKR', '모두 없애버릴 테다. 이 두 손으로 모두 없애버릴 테다!', '', 39653),
(209225, 'koKR', '무궁한 존재들이시여, 인도와 지혜를 내려 주소서.', '', 39653),
(209224, 'koKR', '목적의 길이 나를 지켜주길. 그리고 영원히 들키지 않기를.', '', 39653),
(209223, 'koKR', '환영이라... 그래, 그러면 되겠군. 자고로 등잔 밑이 어두운 법. 그들의 전략을 역이용하는 거야.', '', 39653),
(209222, 'koKR', '금고에 있는 두루마리, 그리고 마력을 공급할 령이 필요해...', '', 39653),
(209221, 'koKR', '그가 우릴 찾아냈어! 코르시아가 위험해!', '', 39653),
(209220, 'koKR', '용서하세요, 심판관님... 이 령이 필요합니다.', '', 39653),
(209219, 'koKR', '알겠다, 제이나. 당장 출발하지.', '', 39653),
(209218, 'koKR', '', '볼바르, 저도 몽환숲으로 가겠어요. 안두인을 구할 일말의 가능성이 있을지 모르니...', 39653),
(209217, 'koKR', '바인과 나는 기사단을 돕겠소. 간수는 심판관의 인장을 손에 넣지 못할 것이오.', '', 39653),
(209216, 'koKR', '맡겨만 주시오.', '', 39653),
(209215, 'koKR', '몽환숲과 오리보스 모두 다음 표적이 될 수 있다. 다리온, 칠흑의 기사단에 도시 방어를 맡기겠다.', '', 39653),
(209213, 'koKR', '', '내가 이곳에 모인 존귀한 분들께 말씀을 올리겠다.', 39653),
(209211, 'koKR', '간수의 병력이 돌파하기 전에 금고에 도달해야 하오.', '', 39653),
(209210, 'koKR', '우리가 가진 건 이게 다요. 기록을 더 찾아내면... 시초자의 전언을 보다 구체적으로 재구성할 수 있소.', '', 39653),
(209209, 'koKR', '', '무슨 목적지 말이오? 남은 전언을 보여주시오!', 39653),
(209208, 'koKR', '조바알이 다섯 인장을 모두 모으는 날에는, 그가 목적지인--', '', 39653),
(209207, 'koKR', '내 의심이 사실로 드러난다면 나의 인장이 위험해질 터. 너희 금고에 맡길 테니, 수단과 방법을 가리지 말고 보호하거라.', '', 39653),
(209206, 'koKR', '', '믿을 수 없군... 시초자님이잖아!', 39653),
(209205, 'koKR', '전언을 완성했소. 지금 시작하리다.', '', 39653),
(209201, 'koKR', '', '맙소사! 서둘러야 해요!', 39653),
(209200, 'koKR', '그럼 할 일이 태산이겠군. 돌장인께서 그토록 노하신 모습은 처음 봤으니.', '그럼 할 일이 태산이겠군. 돌장인께서 그토록 노하신 모습은 처음 봤으니.', 39653),
(209199, 'koKR', '그게... 저희는 뒷정리 담당이라서요! 침입자를 심문하고 나면 엉망진창이 되지 않습니까?', '', 39653),
(209198, 'koKR', '침입자? 그게 왜 궁금한 거지?', '침입자? 그게 왜 궁금한 거지?', 39653),
(209194, 'koKR', '', '그대와 대영주를 심판관님의 방으로 안내하겠다.', 39653),
(209193, 'koKR', '', '심판관님의 방에서 회합을 갖도록 하지. 다음 행보를 결정할 때가 왔다.', 39653),
(209191, 'koKR', '', '이래 봬도 그럭저럭 쓸만할 거요. 꼭대기에서 봅시다.', 39653),
(209190, 'koKR', '다음에도 행운이 따르진 않을 거다!', '', 39653),
(209189, 'koKR', '나락 방랑자를 해치우면 간수께서 보상을 내려주실 거다!', '', 39653),
(209188, 'koKR', '', '금방 고칠 수 있을 거요. 내가 나락살이에 죽지나 않도록 잘 지켜주시오.', 39653),
(209187, 'koKR', '', '그간 숨 돌릴 틈 없이 바쁘셨더군요, 나락 방랑자님.\n\n전 당신을 눈여겨보고 있었습니다. 물론 왕자님을 위해서죠.', 39653),
(209186, 'koKR', '', '가련한 필멸자여. 이미 늦었다.', 39653),
(209185, 'koKR', '', '내 가격이 그렇게 불만스러웠나? 하하하!', 39653),
(209183, 'koKR', '맙소사. 당신 동료가 덩치 큰 날개에게 끌려간 모양입니다.', '', 39653),
(209182, 'koKR', '', '무엇이 필요하지?', 39653),
(209181, 'koKR', '', '고마- 어흠, 고마워요.', 39653),
(209180, 'koKR', '성벽에서 뭔가 사고가 있긴 했는데, 돌숨결 근위병이 해결했지.', '성벽에서 뭔가 사고가 있긴 했는데, 돌숨결 근위병이 해결했지.', 39653),
(209176, 'koKR', '', '더 구체적으로 물어봐야 할 것 같아요.', 39653),
(209175, 'koKR', '', '돌장인께서 절 이곳에 파견하셨습니다. 나스레짐의 단검과 발톱을 염려하는 자가 휴식처를 관리하도록 안배해 두신 것이죠.\n\n같은 맥락에서 죄악의 몰락지에서 나스레짐이 발견되면 가차 없는 무력을 내세워 숙청하는 역할을 맡고 있기도 합니다.\n\n이참에 명확히 짚고 넘어가죠. 본인이 나스레짐임을 실토하러 오셨습니까?', 39653),
(209174, 'koKR', '그렇지! 다 잡아버려, 흠송곳니! 하하!', '', 39653),
(209173, 'koKR', '큰 거 한 마리 잡았다!', '', 39653),
(209164, 'koKR', '사랑해요, 흠송곳니!', '사랑해요, 흠송곳니!', 39653),
(209163, 'koKR', '이번에는 큰 녀석으로 잡아봐, 흠송곳니!', '', 39653),
(209162, 'koKR', '다 붙잡아, 흠송곳니!', '', 39653),
(209161, 'koKR', '나와서 놀자, 꼬맹이 염탐꾼들아!', '', 39653),
(209160, 'koKR', '여기엔 누가 숨어 있을까?', '', 39653),
(209159, 'koKR', '실리더스에서 참으로 멀리도 왔군.', '', 39653),
(209157, 'koKR', '그 어떤 적도 단결된 어둠땅에는 상대가 되지 않는다.', '', 39653),
(209156, 'koKR', '', '빛이시여... 아드레스테스, 어떻게 이런 일이!', 39653),
(209155, 'koKR', '어, 그럼요, 두말하면 잔소리죠! 처참하게! 수고하세요!', '', 39653),
(209154, 'koKR', '', '이런, 그 퀴퀴한 동굴에 자루를 두고 왔나 봅니다. 찾아오시는 대로 출발하죠.', 39653),
(209153, 'koKR', '', '아, 됐다! 물론 작동할 줄 알았답니다.', 39653),
(209152, 'koKR', '오, 저자는 뭔가 알고 있을 지도요.', '', 39653),
(209151, 'koKR', '', '반가워요, 돌숨결 친구! 질문 하나만 해도 될까요?', 39653),
(209150, 'koKR', '아니, 하지만 침입자가 보이기만 하면 처참히 도륙할 테다!', '아니, 하지만 침입자가 보이기만 하면 처참히 도륙할 테다!', 39653),
(209146, 'koKR', '아니, 아니, 여기서는 그런 거 안 해요.', '', 39653),
(209145, 'koKR', '', '알겠어요. 자연스럽게 하자. 자연스럽게 하자. 자연-', 39653),
(209144, 'koKR', '조심하세요. 저 녀석은 변장을 간파할 수 있습니다.', '', 39653),
(209138, 'koKR', '물론 당신 몫은 나눠드릴 겁니다. 명목상 수수료만 공제하고요...', '', 39653),
(209137, 'koKR', '그래도 고통을 견딘 덕에 수익은 좀 나오겠군요.', '', 39653),
(209136, 'koKR', '훌륭하군요. 아직 멀쩡히 남아 있습니다!', '', 39653),
(209133, 'koKR', '이 탑을 빈손으로 떠날 순 없습니다. 이해하시죠?', '', 39653),
(209132, 'koKR', '대체... 그분에게 뭘 원하는 걸까요?', '대체... 그분에게 뭘 원하는 걸까요?', 39653),
(209131, 'koKR', '끔찍한... 공포였습니다...', '끔찍한... 공포였습니다...', 39653),
(209130, 'koKR', '안전한... 장소를... 찾아야 해요...', '안전한... 장소를... 찾아야 해요...', 39653),
(209129, 'koKR', '너무... 고통스러워...', '너무... 고통스러워...', 39653),
(209128, 'koKR', '놈들에게... 아무것도 모른다고 말했어요...', '놈들에게... 아무것도 모른다고 말했어요...', 39653),
(209127, 'koKR', '그들이... 운명필경사님을 찾고 있어요... 전 아무 말도 못 했죠.', '그들이... 운명필경사님을 찾고 있어요...', 39653),
(209120, 'koKR', '눈썰미가 좋은 녀석들만 조심하세요. 곧바로 알아챌 겁니다.', '', 39653),
(209119, 'koKR', '', '훌른의 행방을 수소문할 거예요. 이런 곳에서 눈에 안 띌 수가 없을걸요!', 39653),
(209115, 'koKR', '', '자연스럽게 녹아들어야 하니, 현란한 연기력을 발휘해 주셔야겠어요!', 39653),
(209114, 'koKR', '', '당신은 싸우시오. 난 수리를 할 테니. 내 용광로로 돌아가고 싶어 좀이 쑤신다오!', 39653),
(209111, 'koKR', '이해하오, 뼈장장이. 금고를 여는 대로 그대는 떠나도 좋소.', '', 39653),
(209110, 'koKR', '', '왔구먼! 얼른 끝냅시다. 이 나락에 조금이라도 더 머무르고 싶은 마음은 추호도 없소!', 39653),
(209109, 'koKR', '검사 메빅스, 군대를 집결해라. 나락 방랑자가 탈갈란과 도착할 때까지 금고 외부를 확보하도록.', '', 39653),
(209108, 'koKR', '앞에 가서 친구와 합류하는 게 좋겠소, 나락 방랑자. 목적의 길이 우리를 인도하길.', '', 39653),
(209107, 'koKR', '', '자연스럽게 섞여야 해요. 그래서 당신과 제가 변장을 할 거랍니다.', 39653),
(209106, 'koKR', '', '쉿! 여기에요!', 39653),
(209103, 'koKR', '반갑다.', '', 39653),
(209089, 'koKR', '이 망설임이란 감정을 느껴보는 게 얼마 만인지 모르겠구나, $n.\n\n하나 옆으로 밀어놓고 키리안과 어둠땅의 미래를 위해 최선의 선택을 해야겠지.\n\n나와 함께하겠느냐?', '', 39653),
(209088, 'koKR', '이탈자는 전쟁을 원치 않았지만 동포들은 우릴 쫓아내고 듣지도 않았습니다.', '', 39653),
(209086, 'koKR', '', '네가 보내는 발키르는 모두 뒤틀어 버리겠다, 오딘. 먼 옛날, 나를 뒤틀었던 너처럼. 너의 눈이 저들을 배반하다니, 실로 달콤한 역설이구나.', 39653),
(209085, 'koKR', '', '이쪽입니다! 서두르십시오!', 39653),
(209084, 'koKR', '', '나락살이와 포식자... 이곳도 더러워졌습니다.', 39653),
(209073, 'koKR', '', '나락 방랑자, 따라와라. 나머지는 죄악의 몰락지로 향하도록. 메달은 물론이고 말가니스의 머리카락까지 가져와야 할 것이야.', 39653),
(209070, 'koKR', '말드락서스를 병들게 했던 종양은 적출됐네. 힘겨운 도전이었지만 우린 재건에 성공할 걸세. \n\n하지만 즉각적인 지원이 필요한 다른 지역들도 있어. 그런 문제를 백안시하는 것은 내 명예와 어긋나네.', '', 39653),
(209069, 'koKR', '', '시초자께서 자취를 감추신 이래로 단 한 명의 후작도 임명되지 않았었다네. 뜻밖의 영예를 받게 되었군.\n\n나는 크렉서스 님과 아카렉 님의 유지를 받들 걸세.', 39653),
(209067, 'koKR', '', '우린 군대를 이끌어 나락을 돌파하고 당당히 돌아왔네. 말드락서스 역사의 기념비적인 순간이야.\n\n나락 방랑자, 자네의 이름은 길이 전해질 걸세. 어떤 무용담이 그 이름을 뒤따를지 기대되는군.', 39653),
(209066, 'koKR', '일어나라, 드라카. 너의 의회를 승리로 이끌어라.', '', 39653),
(209065, 'koKR', '말드락시여! 이 전사는 몇 번이고 뛰어난 능력을 입증해 보였다. 이 순간부터 최후의 전투를 치를 때까지, 선택받은 자의 의회의 후작에 봉하노라!', '', 39653),
(209064, 'koKR', '선택받은 자의 의회의 드라카는 앞으로 나오라!', '', 39653),
(209063, 'koKR', '우리의 전열을 어지럽히던 배신자를 숙청했노라. 바야흐로 잃어버린 명예를 되찾을 때다.', '', 39653),
(209062, 'koKR', '말드락서스의 병사들에게 고하노니, 들어라.', '', 39653),
(209050, 'koKR', '공포의 군주와 전쟁을 벌이는 것도 오래간만이구나. 놈들이 얼마나 교활해질 수 있는지 잊고 있었다.\n\n그 백작조차 놈들이 타고난 양면성을 보면 혀를 내두를 것이야.', '', 39653),
(209035, 'koKR', '계속 적들의 발을 묶어라. 곧 계획이 완성된다.', '', 39653),
(209034, 'koKR', '', '아, 일리단의 잔챙이들 아닌가. 아네테론 님을 대신해 안부를 전하지.', 39653),
(209033, 'koKR', '', '앞에 놓인 길은 위험이 산적해 있지. 승리를 쟁취하려면 동료들에게 기대야 할 터. 네 앞에도 비슷한 길이 놓여 있을지도 모르겠구나, 아들아.', 39653),
(209032, 'koKR', '', '난 지도자 역할이 생소하지 않아. 이 또한 정복해야 할 또 하나의 도전일 뿐. 말드락서스에서는 당연한 이치다.', 39653),
(209031, 'koKR', '그만한 권력에 어떤 시련이 뒤따르는지 저도 겪어봐서 압니다. 무거운 짐이 될 수도 있죠.', '', 39653),
(209029, 'koKR', '후작이라. 권위와 기대가 뒤따르는 직책이로군요. 대족장과 여러모로 비슷합니다.', '', 39653),
(209025, 'koKR', '죽음이... 지배하리라...', '죽음이... 지배하리라...', 39653),
(209022, 'koKR', '그분께서... 찾아내리라...', '그분께서... 찾아내리라...', 39653),
(209000, 'koKR', '아, 망치의 울림에 이끌려 왔나 보군. 동료 대장장이를 만나니 좋구먼!', '', 39653),
(208999, 'koKR', '좋아 보이는구먼, 전투군주 $n|1이여;여;.', '', 39653),
(208998, 'koKR', '반갑다, $c|1이여;여;. 흥미로운 무기를 갖고 있군그래.', '', 39653),
(208996, 'koKR', '', '이렇게 인연을 맺게 되어 정말 기쁩니다, 나락 방랑자님.', 39653),
(208995, 'koKR', '', '보기 즐겁군요... 나락살이를 이렇게나 효율적으로 처리하시다니.', 39653),
(208994, 'koKR', '', '적을 무릎 꿇리는 당신의 능력에 가슴이 설렙니다.', 39653),
(208993, 'koKR', '', '굉장하십니다! 그 힘은 타고나신 건가요? 아니면 어딘가에서 배우신 건가요?', 39653),
(208982, 'koKR', '감히?! 내 맹세코 헬리아는 이 패악질의 대가를 치를 것이다!', '', 39653),
(208968, 'koKR', '', '다시 만나서 반가워요!', 39653),
(208967, 'koKR', '', '재미 볼 준비는 되셨나요, $n 님?', 39653),
(208966, 'koKR', '', '저와 자매들은 헬리아를 섬기는 나락살이에게 습격당했고, 저만 살아남았습니다. 그 저주받은 마녀가 전언을 보냈습니다.', 39653),
(208965, 'koKR', '반갑다, 전투군주여. 네가 이 전당을 찾는 것도 참으로 오랜만이구나. 다니카, 감히 내 발키르를 건드린 자는 누구더냐?', '', 39653),
(208964, 'koKR', '', '이런 공세에 참여할 기회를 얻는 것도 실로 오래간만이로군. 이 가슴이 벅차오르는 전율을 까맣게 잊고 있었어.\n\n시초자께서 돌아오셨으니 비슷한 일이 많아지겠지.', 39653),
(208963, 'koKR', '내 전당에 잘 왔다, 고결한 이여. 다니카, 오늘 거둔 승리와 감히 내 발키르를 감금한 적에 대해 고해 보거라.', '', 39653),
(208957, 'koKR', '', '전능하신 오딘 님! 전투군주를 데려왔습니다. 이자는 참혹한 포로 신세로 있던 절 구출함으로써 다시 한번 힘을 증명해 보였습니다.', 39653),
(208955, 'koKR', '', '오딘 님! 필멸자를 데려왔습니다. 이자는 나락 방랑자로, 참혹한 포로 신세로 있던 절 구해준 용감한 자입니다.', 39653),
(208947, 'koKR', '방해하지 마라, 필멸자.', '방해하지 마라, 필멸자.', 39653),
(208939, 'koKR', '', '영리한 건 변함이 없군. 다만... 나는 침입자가 아니다. 유인책일 뿐이지.', 39653),
(208938, 'koKR', '영원한 비밀은... 없다...', '영원한 비밀은... 없다...', 39653),
(208937, 'koKR', '결국엔... 찾아내리라...', '결국엔... 찾아내리라...', 39653),
(208935, 'koKR', '아무... 소용없는... 일이다...', '아무... 소용없는... 일이다...', 39653),
(208934, 'koKR', '그분을... 막을 수는... 없다...', '그분을... 막을 수는... 없다...', 39653),
(208930, 'koKR', '', '정체를 밝혀라, 침입자여.', 39653),
(208929, 'koKR', '', '대단하구나. 데나트리우스가 레나탈을 나락으로 추방한 후에 널 참형에 처한 걸 생각하면 말이지.', 39653),
(208928, 'koKR', '', '돌의 어머니시여, 절 걱정해 주시다니 영광입니다. 전 무탈합니다.', 39653),
(208927, 'koKR', '', '칼날벽 첼라여. 그간 잘 지냈느냐, 나의 아이야?', 39653),
(208926, 'koKR', '친애하는 돌장인이여, 분노의 수확자이자, 엘루...', '', 39653),
(208924, 'koKR', '', '몽환숲에서 다시 만나세, 나락 방랑자. 늑장부리지 말게.', 39653),
(208921, 'koKR', '', '우리 목표물이 어디 있는지는 알고 있겠지. 놈을 기다리게 하지 말자고.', 39653),
(208920, 'koKR', '', '켈투자드가 없는 지금도 그 하수인들이 주인의 음모를 이어가는 것 같네. 남은 한 놈까지 모두 쓸어 버려야 해.', 39653),
(208919, 'koKR', '', '아카렉 님을 배신하면 고통을 맛봐야지. 밤 전사로서든 아니든 마지막 적이 발 밑에 쓰러질 때까지 난 쉬지 않을 걸세.', 39653),
(208918, 'koKR', '', '켈투자드의 지휘 아래 리치들은 눈의 의회를 절멸하다시피 했네. 이건 뼈에 새겨도 모자랄 진실일세.', 39653),
(208917, 'koKR', '', '생전에 나는 우리 종족의 복수를 위해 밤 전사가 되었네. 지금과도 별반 다르지 않지.', 39653),
(208915, 'koKR', '', '영원한 고요가 널 기다린다.', 39653),
(208909, 'koKR', '', '조용한 은신처지만 여기에도 안 계십니다...', 39653),
(208908, 'koKR', '', '재앙이 닥쳐 모든 게 파괴됐어요. 운명필경사님의 흔적은 없군요. 어서 떠나는 게 좋겠습니다.', 39653),
(208907, 'koKR', '', '이곳은 한때 명상과 평온에 잠기는 곳이었습니다. 따르는 자들은 서로 교감을 나누곤 했지요.', 39653),
(208906, 'koKR', '', '그 유물은... 사실 어느 정도 가치가 있습니다. 비록 우리에겐 쓸모없지만요.', 39653),
(208905, 'koKR', '', '아, 이거예요! 우리에게 필요한 겁니다.', 39653),
(208904, 'koKR', '', '쓰레기보단 조금 낫습니다.', 39653),
(208903, 'koKR', '', '흠. 척 봐도 쓸모없는 물건이네요.', 39653),
(208897, 'koKR', '', '네 존재를 지워주마!', 39653),
(208889, 'koKR', '', '기록관의 말에 집중하세요, 로쉬르. 지팡이가 기능하려면 령과 지혜가 모두 필요합니다.', 39653),
(208880, 'koKR', '', '지당하신 말씀입니다, 남작님. 긍지를 품고 함께하겠습니다.', 39653),
(208879, 'koKR', '', '우리 의회에 등을 돌린 인물이 어떤 길을 걷든 우리와 무슨 상관이겠느냐. 나는 무자비함과 기지로 작위를 얻을 것이다. 지금 우리의 방식대로.', 39653),
(208878, 'koKR', '파멸을 맞이하라!', '파멸을 맞이하라!', 39653),
(208877, 'koKR', '', '드라카가 선택받은 자의 의회를 이끌지언정, 제 충심은 당신 것입니다. 분명 시초자께서 머잖아 눈의 의회를 복원하고 바쉬 님을 후작에 앉히실 겁니다!', 39653),
(208876, 'koKR', '무릎 꿇어라, 나락 방랑자!', '무릎 꿇어라, 나락 방랑자!', 39653),
(208875, 'koKR', '뼈를 산산조각 내주지!', '뼈를 산산조각 내주지!', 39653),
(208871, 'koKR', '여길 오다니 어리석구나!', '여길 오다니 어리석구나!', 39653),
(208868, 'koKR', '', '마음 같아서는 거들고 싶지만, 전투는 제 특기가 아니랍니다.', 39653),
(208866, 'koKR', '성공할 확률은 희박합니다. 살아남을 확률은 더더욱 미미하죠. 우리의 미래는 당신 손에 달렸습니다.', '', 39653),
(208864, 'koKR', '고맙단 말을 하고 싶소. 나락살이는 우리의 비밀을 노리고 있다오.', '', 39653),
(208863, 'koKR', '좋아, 그럼 인사치레는 넘어가도 되겠군. 우린 간수의 군대를 몰아내러 왔다.', '', 39653),
(208859, 'koKR', '', '차원석을 활성화하는 동안 모습을 감추는 편이 좋을 겁니다. 명심하세요, 나락 방랑자님. 우리의 거래는 아직 끝나지 않았답니다.', 39653),
(208855, 'koKR', '코르시아는 외부로부터 안전한 중계지 깊은 곳에 숨겨져 있었지만... 간수의 사슬에 발각당하고 말았소.', '', 39653),
(208850, 'koKR', '전성기 시절을 그대가 봤어야 하오, 중개자. 코르시아는... 본디... 비밀의 도시였소.', '', 39653),
(208849, 'koKR', '지식과 유물을 안전하게 지키는 것이 내 책무였소. 너무나 귀중해 악인의 손에 들어가서는 안 되는 것들 말이외다.', '', 39653),
(208848, 'koKR', '', '이곳이 코르시아군요. 이보단... 더 웅장할 줄 알았는데.', 39653),
(208846, 'koKR', '오시오. 의논할 일이 많소.', '', 39653),
(208845, 'koKR', '나락 방랑자라니? 흥미롭군! 예언을 연구하긴 했지만...', '', 39653),
(208844, 'koKR', '', '잠깐! 이자는 살아있는 필멸자, 나락 방랑자입니다! 간수의 수족이 아니고요!', 39653),
(208843, 'koKR', '간수의 수족이 더 있었나?! 당장 처치하시오!', '', 39653),
(208842, 'koKR', '순찰 인원을 늘리시오. 나락살이가 절대 그...', '', 39653),
(208841, 'koKR', '', '떨어뜨린 책장은 남아있지만, 운명필경사는 없군. 대체 어디로 사라진 걸까?', 39653),
(208830, 'koKR', '점액 하나 받으렴! 너도 하나 받거라!', '', 39653),
(208827, 'koKR', '아서스, 지옥에 너만을 위한 자리가 마련돼 있길 빌겠다.', '', 39653),
(208826, 'koKR', '', '나락 방랑자. 이번 임무에 캘타스를 동행시켜달라는 남작의 요청을 수용하려고 한다.\n\n대신 그 두 사람을 잘 감시하거라. 남작이 과연 캘타스에게 좋은 영향을 줄지 의문일뿐더러, 외려 그가 예전 모습으로 퇴행하는 계기가 될 수도 있겠단 생각이 드는구나. \n\n요새 가능성을 보여주곤 있다지만, 백 년이나 이백 년 정도 참회를 더 한 상태였으면 내 마음이 훨씬 편안했을 텐데 말이다.', 39653),
(208825, 'koKR', '볼바르 폴드라곤. 나락 방랑자의 령의 자취에서 그대를 보았소.', '', 39653),
(208824, 'koKR', '아주 잘했다, 나락 방랑자.', '', 39653),
(208823, 'koKR', '', '나락 방랑자가 돌아왔군. 두 번째 차원석을 찾아냈어.', 39653),
(208822, 'koKR', '데나트리우스는 나스레짐이 어떻게 됐는지 알려주지 않았다. 나중에서야 필멸자 영혼들이 그들을 다른 이름으로 부른다는 걸 알았지. 바로 공포의 군주였다.', '', 39653),
(208821, 'koKR', '그 분쟁에 마침표를 찍은 건 데나트리우스였다. 나스레짐을 어둠땅 너머의 세계로 추방하겠노라 공언했지.', '', 39653),
(208820, 'koKR', '나루를 패퇴시킨 후, 돌장인은 나스레짐에게로 분노의 방향을 틀었다. 무수히 많은 자식을 잃게 만든 원흉이라 비난했지.', '', 39653),
(208818, 'koKR', '말드락서스의 군대가 우릴 지켜주지 않았기에, 돌장인이 돌 군단을 조각해 빛에 대항할 수밖에 없었지.', '', 39653),
(208817, 'koKR', '은밀한 활동에도 불구하고, 그들의 침입이 발각당하는 일이 일어났다.', '', 39653),
(208816, 'koKR', '궁극의 침투원으로서 만들어진 그들은 죽음의 영향력을 경쟁 중인 다른 영역으로 전파했다... 산 자의 세계도 예외는 아니었지.', '', 39653),
(208815, 'koKR', '그 결과 빛의 완연한 진노가 레벤드레스에 쏟아져 내렸고, 본래 나스레짐이 머무르던 지구가 불길에 휩싸였다.', '', 39653),
(208814, 'koKR', '아득히 먼 옛날 최초의 벤티르가 탄생한 직후, 데나트리우스는 또 다른 피조물을 선보였다. 바로 나스레짐이었지.', '', 39653),
(208813, 'koKR', '인간에게 배웠습니다. 그는 검투사를 원했지만, 적을 길러냈지요.', '', 39653),
(208810, 'koKR', '', '이곳에 어떤 비밀이 잠들어 있을지 누가 알겠습니까? 알아낼 방법은 단 하나뿐이죠...', 39653),
(208809, 'koKR', '', '먼저 가시죠. 전 여기 있겠습니다. 적에게 꼬리를 밟혀선 안 되잖아요?', 39653),
(208808, 'koKR', '', '근처에 따르는 자들이 보입니다. 오리보스에 있는 자들과 비슷해요. 코르시아의 보물 관리인일 수도 있겠군요.', 39653),
(208807, 'koKR', '', '흠... 이거 꽤 흥미롭군요.', 39653),
(208806, 'koKR', '', '놈과 그 뒤를 따르는 자 모두 사멸할 것이다.', 39653),
(208805, 'koKR', '', '그 배신자 놈팡이도 대가를 치르게 될 거다.', 39653),
(208803, 'koKR', '켈투자드 님은 돌아올 것이다...', '', 39653),
(208801, 'koKR', '', '저들을 불러들인 게 나다, 폴징기. 이제 그만 죽어라.', 39653),
(208792, 'koKR', '이 무슨- 후작! 이 배반자들을 막아 주시오!', '', 39653),
(208786, 'koKR', '다 보이노라, 나락 방랑자여!', '', 39653),
(208785, 'koKR', '', '당신네를 내보낼 수만 있다면야 서명을 내어드리는 건 합리적인 거래죠.', 39653),
(208784, 'koKR', '', '레나탈 왕자님이 돌의 어머니를 뵈러 가신단 말이죠. 그렇다면 강인한 근위병을 대동하는 것이 현명한 처사입니다. 그분이 매력적인 성정의 보유자라서 분노의 수확자라는 호칭이 붙은 건 아니니 말입니다.', 39653),
(208780, 'koKR', '|TInterface\\ICONS\\INV_Pet_ReliquarySuffering.blp:20|t 도르마잔이 당신에게 |cFFFF0000|Hspell:350647|h[고문의 낙인]|h|r을 찍습니다!', '|TInterface\\ICONS\\INV_Pet_ReliquarySuffering.blp:20|t 도르마잔이 당신에게 |cFFFF0000|Hspell:350647|h[고문의 낙인]|h|r을 찍습니다!', 39653),
(208777, 'koKR', '감사합니다, 집정관님. 책무를 다하겠습니다.', '', 39653),
(208776, 'koKR', '', '우리의 신성한 책무를 향한 네 헌신은 한순간도 흔들리지 않았다.', 39653),
(208775, 'koKR', '', '저 말씀이십니까? 집정관님, 송구하오나 저는...', 39653),
(208773, 'koKR', '', '아드레스테스, 너를 헌신의 용장으로 임명한다.', 39653),
(208772, 'koKR', '', '우서를 본받아 배움의 거울로 삼겠노라.', 39653),
(208769, 'koKR', '', '데보스가 우리에게 등을 돌렸을 때, 나는 창을 들고 그녀를 마주했다.', 39653),
(208767, 'koKR', '', '어둠땅으로 데려오는 영혼들도 잊어서는 안됩니다.', 39653),
(208766, 'koKR', '어쩌면 우리에게 필요한 것은 충성이 아닌... 주어진 사명과 서로를 향한 헌신일지도 모릅니다.', '', 39653),
(208765, 'koKR', '집정관이시여... 연민 없는 충성심은 키리안을 분열시키고 말았습니다.', '', 39653),
(208764, 'koKR', '', '하여 바로 오늘, 새로운 충성의 용장을 임명할 것이다.', 39653),
(208763, 'koKR', '', '성약의 단의 인장을 다시 벼려내려면 다섯 용장이 모두 필요하노라.', 39653),
(208762, 'koKR', '아드레스테스 님. 아뢸 말씀이 있습니다.', '', 39653),
(208761, 'koKR', '선택지가 주어진다면...', '', 39653),
(208760, 'koKR', '아니. 교훈을 되새기는 경종으로 삼을 생각이네. 선택지가 주어진다면, 절대 잊지 않을 기억일세.', '', 39653),
(208759, 'koKR', '우서, 이 기억들이 너무 고통스럽다면 시간을 들여 없앨 수 있습니다.', '', 39653),
(208758, 'koKR', '그럴 겁니다. 아서스... 내가 구원의 손길을 내밀었더라면...', '', 39653);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(208756, 'koKR', '그럴지도 모르지. 하나, 이 기억을 마주함으로써 그 어떤 경전도 알려주지 못할 연민의 가치를 깨우치지 않았더냐?', '', 39653),
(208752, 'koKR', '저는 그토록 냉혹한 마음을 품어본 적이 없었습니다. 스승도, 친구도 아닌 원수로서 아서스를 마주했습니다.', '', 39653),
(208750, 'koKR', '이 순간... 저는 아서스를 저버렸습니다. 덕목을 받들지 않았습니다. 특히 연민을.', '', 39653),
(208749, 'koKR', '어째서 이 기억이지, 우서? 무슨 연유로 주저하는 것이냐?', '', 39653),
(208748, 'koKR', '영영 알 수 없을 거다, 우서. 난 영원히 살 테니까.', '', 39653),
(208747, 'koKR', '안 돼! 홧김에 내뱉은 말인데...', '', 39653),
(208745, 'koKR', '아서스는 유골함을 가지러 왔네... 자기 손으로 참살한 아비의 재가 들어 있었지.', '', 39653),
(208744, 'koKR', '', '이게 당신이 죽음을 맞이한 순간이로군요?', 39653),
(208743, 'koKR', '여긴 어디입니까?', '', 39653),
(208741, 'koKR', '우리 공연장에서 썩 나가!', '', 39653),
(208740, 'koKR', '마감 시간이다!', '', 39653),
(208739, 'koKR', '장난은 끝났어!', '', 39653),
(208738, 'koKR', '', '우리가 해냈습니다! 이곳에 잠들어 있을 경이들을 상상해 보세요! 아, 당연히 당신 차원석도 찾을 겁니다.', 39653),
(208737, 'koKR', '', '코르시아는 간수의 눈으로부터 보호받는 것 같습니다. 하지만 나락살이가 방어선을 돌파하고 있군요.', 39653),
(208736, 'koKR', '', '은폐막이 사라지기 전에 서둘러 목적지로 가야 합니다. 아, 그리고 조심히 움직이세요.', 39653),
(208735, 'koKR', '', '움직이죠!', 39653),
(208734, 'koKR', '', '한마디도. 하지. 마세요.', 39653),
(208733, 'koKR', '', '멈추세요!', 39653),
(208730, 'koKR', '소음 한번 지긋지긋하군!', '', 39653),
(208729, 'koKR', '', '연주법부터 배워라, 멍청이들아!', 39653),
(208728, 'koKR', '그것도 음악이라고?!', '', 39653),
(208727, 'koKR', '', '놈들의 악기를 압수해!', 39653),
(208726, 'koKR', '', '무대에서 내려와!', 39653),
(208725, 'koKR', '', '코르시아가 코앞인데... 하필 간수의 눈이 정면으로 길을 막고 있군요.', 39653),
(208724, 'koKR', '', '우주가... 온 우주가 느껴진다!', 39653),
(208723, 'koKR', '', '덤벼라. 산화시켜주마!', 39653),
(208722, 'koKR', '', '창조의 유물은 내 손에 있다!', 39653),
(208719, 'koKR', '', '태초의 존재의 권능을 내가 휘두른다!', 39653),
(208718, 'koKR', '', '보잘것없군!', 39653),
(208717, 'koKR', '', '감히 날 방해하다니!', 39653),
(208716, 'koKR', '', '엄청난 힘이구나...', 39653),
(208714, 'koKR', '', '눈이 접근하지 못할 정도라면 코르시아에 분명 강력한 마법이 존재할 겁니다. 전설이 사실일지도 모르겠군요...', 39653),
(208713, 'koKR', '', '상관없다. 추방당한 자께서 원하는 걸 손에 넣게 될 테니.', 39653),
(208712, 'koKR', '눈으로 코르시아를 엿보는 건 불가능한 모양이다. 아무래도 직접 수색해야겠군.', '', 39653),
(208711, 'koKR', '', '간수의 병력과 불편하리만치 근접하게 생겼네요. 잘 붙어 계시길.', 39653),
(208710, 'koKR', '', '붙어 계세요, 나락 방랑자님.', 39653),
(208709, 'koKR', '', '별들은 내 권속이다!', 39653),
(208706, 'koKR', '다신 이 동네에서 연주하지 못할 거다.', '', 39653),
(208702, 'koKR', '', '경비병, 저 해충들을 없애라!', 39653),
(208697, 'koKR', '', '내 중개단은... 사라지면... 안돼...', 39653),
(208696, 'koKR', '', '깨진 술잔 값은 외상으로 달아놓겠습니다.', 39653),
(208695, 'koKR', '', '영역 순회공연은 취소됐다고 봐야겠네요.', 39653),
(208691, 'koKR', '', '기억할 가치도 없군.', 39653),
(208690, 'koKR', '', '파멸해라!', 39653),
(208687, 'koKR', '', '소 중개단 앞에 고개를 숙여라!', 39653),
(208676, 'koKR', '이 골칫덩어리 물품은 놈들이 해를 끼치지 못할 곳에 보관해 두고 알 중개단이 연구할 생각입니다. 그럼 우리의 인연이 다시 닿는 날까지...', '', 39653),
(208675, 'koKR', '우리의 길이 교차해 감사한 마음뿐입니다, 나락 방랑자님.', '', 39653),
(208674, 'koKR', '태초의 존재가 유물을 숨긴 데에는 이유가 있어요. 우리가 손댈 물건이 아닙니다.', '', 39653),
(208672, 'koKR', '', '네 중개단은 먼지가 되어 사라졌지. 난 내 중개단을 영광으로 이끌겠다!', 39653),
(208665, 'koKR', '', '말라비틀어져 죽은 것이나 박물관에 가지... 네 중개단처럼.', 39653),
(208659, 'koKR', '당신은 이 힘을 제어하지 못해요. 그 유물은 박물관으로 가야 합니다!', '', 39653),
(208637, 'koKR', '', '가는 곳마다 따라다녀야 직성이 풀리나?!', 39653),
(208634, 'koKR', '쿨 티란이 이것저것 캐묻기 전에 떠나죠. 일일이 답해줄 시간 없습니다.', '', 39653),
(208633, 'koKR', '선장님이 용이었다고!', '선장님이 용이었다고!', 39653),
(208632, 'koKR', '선장님이 용이었다고?!', '선장님이 용이었다고?!', 39653),
(208631, 'koKR', '', '네놈들, 건드릴 해적을 잘못 골랐어!', 39653),
(208629, 'koKR', '', '미안, 선장. 불만 사항은 내 동료들에게 접수하길 바라.', 39653),
(208628, 'koKR', '', '보물을 알아보는 눈은 있는데, 낄 곳 안 낄 곳 가릴만큼 밝진 않군.', 39653),
(208627, 'koKR', '', '흥미로운 유물을 손에 넣는 재주 하나는 인정하지. 검은 제국의 폐허에서 찾아냈단 얘기지?', 39653),
(208625, 'koKR', '힘겨운 여정이지만, 우리 길에는 한 치의 어긋남도 없군요.', '', 39653),
(208624, 'koKR', '소레아의 오만은 몰락을 부를 겁니다.', '', 39653),
(208623, 'koKR', '', '과연 그 지혜가 티탄의 힘을 상대로 얼마나 선전할 수 있을까?', 39653),
(208622, 'koKR', '너는 유물을 가질 자격이 없다!', '', 39653),
(208621, 'koKR', '지혜 없는 힘의 말로는 파멸입니다, 소레아.', '', 39653),
(208620, 'koKR', '', '힘을 알아보질 못하는구나, 알달릴. 네 중개단이 다 그렇지.', 39653),
(208619, 'koKR', '소레아는 분명 근처에 있습니다. 내기를 한다고 치면 저 앞 폐허에 있다에 걸겠습니다.', '', 39653),
(208618, 'koKR', '미안합니다. 우주의 역류가 아주 격렬하네요. 이게 최대한 가까이 데려다 드린 겁니다.', '', 39653),
(208616, 'koKR', '소레아가 한발 앞섰지만 메아리는 남아 있습니다. 이걸 뒤따라가면 돼요.', '', 39653),
(208613, 'koKR', '', '고통과... 힘을 말이지. 난 이만 타자베쉬를 떠나야하지만... 너희의 여정은 여기서 끝이다.', 39653),
(208610, 'koKR', '잘 들어요, 소레아. 당신이 찾는 유물은 고통만을 안겨줄 거예요.', '', 39653),
(208604, 'koKR', '', '알달릴. 네 추잡함을 피할 곳은 없는건가?', 39653),
(208600, 'koKR', '방해해서 참 미안하게 됐습니다, 소레아. 불편할 때 찾아온 거면 좋겠는데 말이죠.', '', 39653),
(208599, 'koKR', '', '바짝 붙어서 제 지시만 따르세요. 간수의 눈에 한 줌의 저승석으로 화하기 싫다면.', 39653),
(208595, 'koKR', '기록관을 구해야만 합니다. 우리 미래가 달려있습니다.', '', 39653),
(208590, 'koKR', '', '예전처럼 우리의 모습을 감출 수단은 있습니다.', 39653),
(208589, 'koKR', '', '경계를 늦추지 마시길. 분명 간수의 눈이 이곳을 주시하고 있을 겁니다.', 39653),
(208588, 'koKR', '', '중개자 동료들 사이에서도 이곳에 관한 설화가 전해집니다. 보물로 가득 찬 장엄한 도시지만, 그 위치는 철저히 비밀에 부쳐진다고 말이죠.', 39653),
(208587, 'koKR', '', '나락살이에게서 가로챈 보고서에 따르면 간수는 코르시아라는 영역을 찾고 있었다고 합니다.', 39653),
(208585, 'koKR', '필요한 서명은 모두 모였습니다. 소레아를 기다리게 하지 말자고요.', '', 39653),
(208579, 'koKR', '영업 방해만 하는 놈들!', '', 39653),
(208575, 'koKR', '', '소 중개단의 비밀 사업에 관해서는 저도 알고 있었습니다. 서명을 내어드리죠... 대신 앞으로 다시는 제 오아시스를 부수러 오지 마세요.', 39653),
(208574, 'koKR', '죄송합니다, 아우마이자 님. 당신의 서명이 절실히 필요해서요.', '', 39653),
(208573, 'koKR', '', '이렇게나... 열정적인 공연은 오랜만이군요. 두 번 했다간 가게가 남아나지 못하겠지만.', 39653),
(208572, 'koKR', '', '공연을 멈추세요! 어차피 들을 사람도 없잖아요.', 39653),
(208571, 'koKR', '길이 절로 드러나는군요! 멋진 공연을 선보이면 아우마이자의 호의는 떼어 놓은 당상일 겁니다.', '', 39653),
(208570, 'koKR', '', '아. 다음 악단이 도착했군요. 무대 위로 올라오세요. 아시지요? 전 제 손님들의 여흥을 책임지는 이들에게 아주 관대하다는 걸.', 39653),
(208569, 'koKR', '빛이 날 용서하시길.', '', 39653),
(208568, 'koKR', '', '당신은 아서스를 정의의 길로 인도했어요. 탈선한 건 아서스 본인이었고요.', 39653),
(208567, 'koKR', '아우마이자 님! 영광입니다. 저와 친구들이 찾아온 이유는...', '', 39653),
(208566, 'koKR', '아서스가 학살한 죄 없는 이들에게 그리 말해 보십시오. 제가 그 길로 인도했습니다!', '', 39653),
(208565, 'koKR', '너는 갈등하는 제자를 돕고자 방법을 모색했지. 그 누구도 널 탓할 순 없다.', '', 39653),
(208558, 'koKR', '말드락시 병사의 과업에 끝은 없습니다!', '', 39653),
(208557, 'koKR', '', '이상으로 죄악석과 일탈자들의 음악 공연을 마치도록 하겠습니다.', 39653),
(208556, 'koKR', '괜찮습니다. 성공으로 통하는 문은 무수히 많으니. 이 근처에 도움이 될 친구들이 있어요.', '', 39653),
(208555, 'koKR', '길거리 쓰레기들은 꺼지시지.', '', 39653),
(208554, 'koKR', '조그론, 우리 사이에 그런 허례허식을 따져야겠어요?', '', 39653),
(208553, 'koKR', '초대장은요?', '', 39653),
(208550, 'koKR', '마이자의 오아시스. 타자베쉬에서 제일 매혹적인 가게죠. 주인의 호의를 얻으면 아우 중개단의 서명은 자연스레 딸려올 겁니다.', '', 39653),
(208549, 'koKR', '공격해라, 늑대의 제왕이여! 강령군주의 기상을 보여줘라!', '', 39653),
(208547, 'koKR', '', '별말씀을요! 아무튼 아제로스로 돌아가기 전에... 여기 일 처리를 좀 손봐줘야겠어요!', 39653),
(208546, 'koKR', '아... 네, 고맙습니다.', '', 39653),
(208545, 'koKR', '', '아, 이거 말씀이세요? 주변에 널려있지요. 하나 가져가세요!', 39653),
(208544, 'koKR', '아니야... 그 아이의 말을 들었어야 했어. 내가 왜 흘려 넘겼을까?', '', 39653),
(208543, 'koKR', '누구신지는 몰라도... 이 정도야 일도 아니지요. 그, 우린 조 중개단의 서명이 필요한데...', '', 39653),
(208542, 'koKR', '', '선물을 주마, 바이라즈. 수적 열세에 몰린 건 사실이니!', 39653),
(208541, 'koKR', '하. 늘 그렇지요.', '', 39653),
(208540, 'koKR', '일단은 대련을 해보게. 머리가 맑아질 게야.', '', 39653),
(208537, 'koKR', '', '바이라즈! 크렉서스 님께 저지른 만행의 죗값을 치러라!', 39653),
(208536, 'koKR', '자네를 향한 기대감이 크네. 그 모든 기대를 뛰어넘으리라 믿지.', '', 39653),
(208535, 'koKR', '스승님께 많은 걸 배웠지만... 때로는 이 길이 진정 제 길인지 의문이 들곤 합니다.', '', 39653),
(208534, 'koKR', '', '두렵느냐, 말드락시? 간수께서는 나약한 부하따윈 용납하지 않거늘!', 39653),
(208532, 'koKR', '적군이 다가옵니다, 헬리아 님. 지원군이 필요합니다!', '', 39653),
(208528, 'koKR', '솔직히... 예. 빛을 향한 스승님의 헌신을 보면 제 마음에 의심의 먹구름이 드리워집니다.', '', 39653),
(208527, 'koKR', '아서스가 성기사로 임명된 날이군. 생생히 기억하고 있지...', '', 39653),
(208526, 'koKR', '긴장되나, 아서스?', '', 39653),
(208525, 'koKR', '전 죽음의 요새로 가겠습니다. 부디 동포들을 구해 주십시오!', '', 39653),
(208524, 'koKR', '말드락시라고? 이곳에?', '', 39653),
(208522, 'koKR', '', '휴, 감사합니다! 이렇게 엉망인 우체국은 처음 봐요!', 39653),
(208521, 'koKR', '', '\"드레노어의 명예\"라. 가치 있는 무기에 어울리는 이름이로군.', 39653),
(208519, 'koKR', '드라고라. 이렇게 다시 손에 쥐니 좋군요.', '', 39653),
(208518, 'koKR', '', '제가 가진 장치를 사용하면 땅덩어리 주변에 있는 안전한 은신처로 갈 수 있습니다. 도착하면 반드시 제 옆에 붙어 계셔야 합니다.', 39653),
(208517, 'koKR', '', '함께 그곳으로 가보시죠. 나락 방랑자님이 차원석을 찾을 동안 전 그곳에서 어떤 이익을 거둘 수 있을지 살펴보겠습니다. 아, 제 말은 우리 둘 모두의 이익 말입니다.', 39653),
(208516, 'koKR', '', '간수는 엄청난 크기의 사슬로 부서진 영역을 나락으로 끌어왔습니다. 살짝 엿본 수준에 불과하지만 그게 뭔지 짚이는 구석은 있어요.', 39653),
(208513, 'koKR', '', '나락 방랑자님은 특유의 표정이 있으십니다.\n\n기색을 보아하니 심히 큰 부탁을 하시려나 본데...', 39653),
(208512, 'koKR', '', '아, 나락 방랑자님. 언제쯤 나타나실지 궁금하던 참이었습니다.', 39653),
(208510, 'koKR', '우린 간수의 군대로부터 오리보스를 사수하겠다. 서둘러라, 나락 방랑자. 적의 힘이 커지고 있으니.', '', 39653),
(208508, 'koKR', '탈이나라 님이 길을 열려면 우선 관문을 나락 그 자체와 연결해야 한다고 말씀하셨습니다.', '', 39653),
(208503, 'koKR', '', '이토록 명운이 어두운 나날을 보게 될 줄은 꿈에도 몰랐다.\n\n그대의 령이 목적의 길의 급진적인 뜻을 감내할 수 있을 만큼 강인한지 확인해 보아야겠다.', 39653),
(208502, 'koKR', '', '아무나 좀 도와주세요! 여긴 지옥이라구요!', 39653),
(208501, 'koKR', '잠깐, 저건 누구지? 바심은 어디 가고?', '', 39653),
(208500, 'koKR', '이곳 친구가 조 중개단의 서명 확보를 도와줄 거예요.', '', 39653),
(208498, 'koKR', '', '저곳을 통했다간 모두 나락에서 돌아오지 못한다. 하지만 다른 방법이 있을지도.', 39653),
(208495, 'koKR', '', '덕분에 사육장을 지켰습니다! 뭐, 그나마 남은 거라도요.', 39653),
(208494, 'koKR', '자이 중개단은 본 시연에서 발생한 사지 손상에 대해 책임을 지지 않습니다!', '', 39653),
(208493, 'koKR', '', '잠깐! 저 야수가 어떻게 탈출한 거지?!', 39653),
(208490, 'koKR', '나락살이가 공세를 재개하기 전에 반격에 나서야 한다.', '', 39653),
(208475, 'koKR', '', '싸움은 누구에게 배웠나, 스랄?', 39653),
(208474, 'koKR', '', '전투로 단련됐지. 듣기로는 그쪽도 마찬가지라던데?', 39653),
(208473, 'koKR', '탁월한 실력을 갖춘 전사셨군요, 드라카 님.', '', 39653),
(208471, 'koKR', '', '맞네. 그들의 유산을 난 영원토록 간직할 걸세.', 39653),
(208470, 'koKR', '생전에 서리늑대 출신이라 들었습니다. 맞습니까?', '', 39653),
(208466, 'koKR', '선물로 남겨주신 겁니다. 제게 주신 많은 선물 중 하나이지요.', '', 39653),
(208465, 'koKR', '', '오그림 둠해머의 갑옷을 입고 있군.', 39653),
(208464, 'koKR', '어쩔 수 없는 비극이었습니다. 안타깝게도 조 중개단의 분노를 사고 말았군요.', '', 39653),
(208458, 'koKR', '', '나락살이가 우리 힘 앞에 벌벌 떠는구나! 피바람을 불러일으키자!', 39653),
(208457, 'koKR', '', '일을 마치면 연옥의 요새로 오게.', 39653),
(208456, 'koKR', '합의는 없다. 살상을 허가한다!', '', 39653),
(208455, 'koKR', '다른 방식으로 합의를 보는 건 어떨까요?', '', 39653),
(208454, 'koKR', '멈춰라. 여긴 제한 구역이다. 무기를 버리고 따라와라.', '', 39653),
(208453, 'koKR', '소레아가 당신들 세계로 도망쳐 버리면 그 친구가 찾는 유물도 그 손에 넘어갈 거예요.', '', 39653),
(208452, 'koKR', '소레아에게 접근하려면 도시를 이끄는 중개단의 서명을 얻어야 합니다.', '', 39653),
(208451, 'koKR', '타자베쉬의 아름다움에 현혹되어 공동의 목적을 망각하진 마세요.', '', 39653),
(208450, 'koKR', '불타라, 침입자여!', '', 39653),
(208447, 'koKR', '죄를 씻어낼 수 있는 건 오직 불길뿐.', '', 39653),
(208446, 'koKR', '그 유물이... 너희 모두를... 파멸시키리라...', '', 39653),
(208445, 'koKR', '당신들 시체가 경종을 울리길.', '', 39653),
(208444, 'koKR', '죽음으로 정화되길.', '', 39653),
(208443, 'koKR', '육체의 저주는 소각되었다.', '', 39653),
(208442, 'koKR', '참회하지 않는 자, 정화되리라!', '', 39653),
(208439, 'koKR', '목적의 길을 믿으십시오.', '', 39653),
(208438, 'koKR', '지식과 함께 돌아오시길.', '', 39653),
(208436, 'koKR', '일어나게, 우서. 자네는 이제 로데론의 성기사이며, 은빛 성기사단의 첫 번째 일원일세.', '', 39653),
(208433, 'koKR', '매-맹세합니다.', '', 39653),
(208432, 'koKR', '악을 근절하고 약자와 무고한 이를 수호할 것을 맹세하는가?', '', 39653),
(208431, 'koKR', '넌 여전히 슬픔과 회한에 사로잡혀 있다. 아서스에게도.', '', 39653),
(208429, 'koKR', '빛 속에서 그 지혜를 퍼뜨릴 것을 맹세하는가?', '', 39653),
(208428, 'koKR', '이 기억들은... 제가 아는 기억과 다릅니다.', '', 39653),
(208427, 'koKR', '충격에 약한 폭발물입니다!', '', 39653),
(208422, 'koKR', '액체가 담긴 소포는 반드시 폐기해야 합니다.', '', 39653),
(208421, 'koKR', '특급 배송입니다!', '', 39653),
(208420, 'koKR', '우편환은 사진, 서명, 피로 신원을 증명해야 합니다.', '', 39653),
(208419, 'koKR', '배송료가... 잘못... 측정되었습니다...', '', 39653),
(208416, 'koKR', '', '역경은 목적의 길을 방해하지 못합니다.', 39653),
(208415, 'koKR', '남아도는 스팸 우편을 소각 대상으로 지정합니다.', '', 39653),
(208414, 'koKR', '', '고통은 찰나일 뿐, 경험은 영원합니다.', 39653),
(208410, 'koKR', '배송료가 미납되었습니다.', '', 39653),
(208408, 'koKR', '불량품.', '', 39653),
(208407, 'koKR', '', '상실감을 뒤로하고, 남은 것에 집중하세요.', 39653),
(208406, 'koKR', '', '힘은 언제나 지혜로 다스려야 해요.', 39653),
(208403, 'koKR', '넌... 복종할... 것이다...', '', 39653),
(208401, 'koKR', '기억은 사라지지만... 기록 보관소는 영원합니다.', '', 39653),
(208400, 'koKR', '어딜 가든 지식을 탐구하시길.', '', 39653),
(208394, 'koKR', '기록 보관소를 복원하고, 목적의 길을 이루십시오.', '', 39653),
(208393, 'koKR', '언제나 목적의 길을 따르십시오.', '', 39653),
(208389, 'koKR', '지식과 지혜는 보존되어야만 합니다.', '', 39653),
(208388, 'koKR', '기록 보관소의... 잔재에 오신 걸 환영합니다.', '', 39653),
(208387, 'koKR', '호드를 위하여!!!', '', 39653),
(208386, 'koKR', '난 누구에게도 복종하지 않아! 네 녀석이든, 간수든, 하물며 그 겁쟁이 스랄에게도!', '', 39653),
(208385, 'koKR', '참된 학자는 모든 걸 탐구합니다.', '', 39653),
(208383, 'koKR', '저는... 우리는... 엄숙한 책임을 지고 있습니다.', '', 39653),
(208382, 'koKR', '하지만 내가 했던 모든 선택은 언제든 당당하게 거듭할 거다.', '', 39653),
(208381, 'koKR', '놈들은 말했지. 난 죗값을 치러야 한다고... \"죄악\"을 뉘우치라고...', '', 39653),
(208378, 'koKR', '', '자네가 스랄이로군, 맞나? 얘기는 많이 들었네. 그럼 따라오게.', 39653),
(208375, 'koKR', '드라카 님. 용사여. 저도 임무에 참여하겠습니다.', '', 39653),
(208373, 'koKR', '', '바이라즈는 데스모테론에 숨었네. 우린 지역을 확보하고 제레크리스를 소환할 걸세.', 39653),
(208368, 'koKR', '반역이라고? 자네 미쳤나, 아서스?', '', 39653),
(208367, 'koKR', '명을 따르지 않는다면 반역으로 받아들이겠소.', '', 39653),
(208366, 'koKR', '자넨 아직 내 왕이 아닐세! 설령 왕이었다 한들 그런 명령은 따를 수 없네!', '', 39653),
(208365, 'koKR', '닥치시오, 우서! 미래의 왕인 내 명에 따라, 이 도시를 정화하시오!', '', 39653),
(208363, 'koKR', '비인가 입하물을 분류합니다!', '', 39653),
(208361, 'koKR', '범접할 수 없는 곳에서 공격하라.', '', 39653),
(208360, 'koKR', '적수가 없는 곳을 선점하라.', '', 39653),
(208355, 'koKR', '', '끌림의 지팡이를 회수하세요. 안전한 장소에서 기다리겠습니다.', 39653),
(208354, 'koKR', '모든 원에는 그 중심이 있다.', '', 39653),
(208353, 'koKR', '해일은 잔물결에서 시작하나니.', '', 39653),
(208351, 'koKR', '무사하셔서 정말 다행입니다! 심문관에게는...', '', 39653),
(208350, 'koKR', '', '이걸 사용해 나스레짐의 변장을 꿰뚫어 보도록.', 39653),
(208349, 'koKR', '', '여왕님께 보고드려야겠어요. 남은 야생씨앗을 구해내셨길 빌어요!', 39653),
(208348, 'koKR', '', '우서의 기억들이 뒤얽히고 있어. 우리가 도와줘야 해!', 39653),
(208347, 'koKR', '어떻게... 어떻게 그런 말을 할 수 있나?', '', 39653),
(208346, 'koKR', '', '편히 쉬어라, 친구여. 꿈이 없는 잠 속으로.', 39653),
(208345, 'koKR', '도시 전체를 쓸어버려야 합니다.', '', 39653),
(208342, 'koKR', '지역 내에서 토르가스트의 강력한 생명체가 목격되었습니다.', '', 39653),
(208341, 'koKR', '', '나락도 우리 앞에선 고개를 조아린다! 록타르, 형제자매들이여!', 39653),
(208336, 'koKR', '움직이지 않는 건 패배의 지름길이지.', '', 39653),
(208335, 'koKR', '숫자로 밀리면 적을 나눠야 하는 법.', '', 39653),
(208334, 'koKR', '우리 중개단이... 이 치욕을... 이고 가겠구나...', '', 39653),
(208333, 'koKR', '애송이에게 할애할 시간은 없다.', '', 39653),
(208332, 'koKR', '솜씨가 형편없군.', '', 39653),
(208331, 'koKR', '결함투성이 기술이로군.', '', 39653),
(208329, 'koKR', '잠깐... 저 구석에... 저건 뭐죠?', '', 39653),
(208328, 'koKR', '연민입니다. 서로의 다름을 뒤로 하고 공통점을 이해하려 하며 괴로워하는 이들의 고통에 공감하는 것입니다. 설령...', '', 39653),
(208327, 'koKR', '', '그리고 뭐죠?', 39653),
(208326, 'koKR', '세 가지 덕목입니다. 존중과 끈기... 그리고...', '', 39653),
(208325, 'koKR', '어떤 덕목을 말하는 거지?', '', 39653),
(208324, 'koKR', '맹세합니다.', '', 39653),
(208323, 'koKR', '우서, 성스러운 빛의 교리를 따르기로 맹세하겠는가?', '', 39653),
(208322, 'koKR', '빛 속에서 함께하세. 우리의 형제가 그 은총으로 새롭게 태어나네.', '', 39653),
(208321, 'koKR', '', '마음에 용기를 품어라. 어떤 어둠 앞에서도 흔들리지 않을 것이다.', 39653),
(208320, 'koKR', '', '잘도 백성들을 희생하더구나... 한데 네 보살핌을 받는 영혼들이라면 어떨까?', 39653),
(208319, 'koKR', '소 중개단의 적에겐 죽음뿐이다.', '', 39653),
(208317, 'koKR', '대포 꺼냈습니다, 선장님!', '대포 꺼냈습니다, 선장님!', 39653),
(208316, 'koKR', '알겠습니다, 선장님!', '알겠습니다, 선장님!', 39653),
(208315, 'koKR', '예, 선장님!', '예, 선장님!', 39653),
(208314, 'koKR', '', '어디 너희 죽음을 앞당겨 볼까?', 39653),
(208313, 'koKR', '', '시간은 우리 편이다!', 39653),
(208311, 'koKR', '이리 오게, 우서. 자리를 잡으면 시작하겠네.', '', 39653),
(208310, 'koKR', '여긴... 스트라솔름의 알론서스 교회로군. 내가 최초의 성기사로 임명된 날이야.', '', 39653),
(208308, 'koKR', '', '포병! 저놈들을 산산조각 내버려라!', 39653),
(208307, 'koKR', '', '대포! 발사!', 39653),
(208305, 'koKR', '', '네놈들은 날 쓰러뜨릴 수 없다.', 39653),
(208304, 'koKR', '', '네 물건은 이제 내 거다!', 39653),
(208303, 'koKR', '', '이제 널 벗겨먹어주지!', 39653),
(208302, 'koKR', '', '놈들의 혓바닥을 뽑아오는 자에겐 금화 상자를 주겠다!', 39653),
(208301, 'koKR', '', '전 구도자의 성원 공격에서 살아남은 생존자 중 하나예요. 운명필경사님을 찾고 있죠.', 39653),
(208291, 'koKR', '', '말씀 따르겠습니다.', 39653),
(208287, 'koKR', '', '좀처럼 쉽게 죽어주지 않는 인물이란 건 알지. 임무에 집중해라, 칼리크.', 39653),
(208275, 'koKR', '', '남작님, 생전에 \"티란데 위스퍼윈드\"라는 자를 아셨습니까?', 39653),
(208266, 'koKR', '어이쿠, 이런. 점액이 다 떨어졌네. 다음번에는 잊지 말고 더 챙겨와야겠구나!', '', 39653),
(208265, 'koKR', '또 보는구나! 저 위에 있는 우리 친구들에게 나눠주려고 점액을 잔뜩 가져왔단다!', '', 39653);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(208264, 'koKR', '', '알겠습니다, 남작님.', 39653),
(208262, 'koKR', '', '칼리크. 의식의 의회에 남아 있는 켈투자드 충성파들을 숙청해라. 그런 다음에는 밤 전사를 도와도 좋다.', 39653),
(208260, 'koKR', '', '나락 방랑자. 용케도 왕림해 주셨군그래.', 39653),
(208259, 'koKR', '', '잘 돌아왔다, 나락 방랑자. 충성심이 투철하군그래.', 39653),
(208256, 'koKR', '쫓아라!', '', 39653),
