(208245, 'koKR', '무엇이 필요하십니까?', '무엇이 필요하십니까?', 39653),
(208244, 'koKR', '코르시아에는 많은 물품들이 있죠.', '코르시아에는 많은 물품들이 있죠.', 39653),
(208243, 'koKR', '뭘 도와드릴까요?', '뭘 도와드릴까요?', 39653),
(208242, 'koKR', '진실은... 저 너머에 있습니다.', '진실은... 저 너머에 있습니다.', 39653),
