(208240, 'koKR', '너무나 많은 이들을 잃었어요...', '너무나 많은 이들을 잃었어요...', 39653),
(208239, 'koKR', '이런 시련은 전혀 예상치 못했어요.', '이런 시련은 전혀 예상치 못했어요.', 39653),
(208238, 'koKR', '나락살이가 코르시아를 차지해선 안 됩니다.', '나락살이가 코르시아를 차지해선 안 됩니다.', 39653),
(208237, 'koKR', '간수가 어떻게 우릴 찾아낸 걸까요?', '간수가 어떻게 우릴 찾아낸 걸까요?', 39653),
(208236, 'koKR', '목적의 길이 우리를 이곳으로 이끌었어요.', '목적의 길이 우리를 이곳으로 이끌었어요.', 39653),
(208235, 'koKR', '지혜를 찾고 계시나요? 아니면 힘?', '지혜를 찾고 계시나요? 아니면 힘?', 39653),
(208234, 'koKR', '지식은 짐이자 저주이기도 하죠.', '지식은 짐이자 저주이기도 하죠.', 39653),
