(208229, 'koKR', '어떤 비밀은 입에 담지 않는 게 상책이예요.', '어떤 비밀은 입에 담지 않는 게 상책이에요.', 39653),
(208228, 'koKR', '비밀의 도시에 오신 것을 환영합니다.', '비밀의 도시에 오신 것을 환영합니다.', 39653),
(208227, 'koKR', '우린 그 어떤 대비도 안 되어 있었습니다. 나락살이 침략자들이 수 세기 동안 쌓아 올린 성과와 평화를 산산이 조각내 버렸어요.', '', 39653),
(208210, 'koKR', '다시 만나길.', '다시 만나길.', 39653),
(208209, 'koKR', '통통이가 $p 네 안부를 물어보더라고. 잿불 지구 아래쪽에서 말야.', '', 39653),
(208208, 'koKR', '간수는 죗값을 치르게 될 겁니다.', '간수는 죗값을 치르게 될 겁니다.', 39653),
(208206, 'koKR', '목적의 길을 섬기십시오.', '목적의 길을 섬기십시오.', 39653),
(208204, 'koKR', '지혜는 검이자, 방패입니다.', '지혜는 검이자, 방패입니다.', 39653),
(208203, 'koKR', '당신에게 신세를 졌습니다.', '당신에게 신세를 졌습니다.', 39653),
(208202, 'koKR', '제가 도울 수 있을 것 같군요.', '제가 도울 수 있을 것 같군요.', 39653),
