(208200, 'koKR', '보급품이 필요하십니까?', '보급품이 필요하십니까?', 39653),
(208199, 'koKR', '이곳은 신성한 땅입니다.', '이곳은 신성한 땅입니다.', 39653),
(208198, 'koKR', '길에서 벗어나지 마시길.', '길에서 벗어나지 마시길.', 39653),
(208197, 'koKR', '남은 것을 지켜야 합니다.', '남은 것을 지켜야 합니다.', 39653),
(208196, 'koKR', '비밀을 안전히 잘 간직하시길.', '비밀을 안전히 잘 간직하시길.', 39653),
(208195, 'koKR', '나락살이에게 승리란 없습니다.', '나락살이에게 승리란 없습니다.', 39653),
(208194, 'koKR', '목적의 길을 따르십시오.', '목적의 길을 따르십시오.', 39653),
(208192, 'koKR', '', '날아올라라! 심장부를 공격한다!', 39653),
(208191, 'koKR', '', '신세를 졌습니다.', 39653),
(208190, 'koKR', '', '당신이 정말 적이 아닌 아군이라면... 심문관 젠크가 감옥 열쇠를 갖고 있을 거예요.', 39653),
(208179, 'koKR', '', '아무것도 모르는 건 페이 네 녀석이다. 다가오는 미래를 막을 순 없다.', 39653),
(208178, 'koKR', '넌 충성심에 대해 아무것도 모른다, 밴시.', '', 39653),
(208177, 'koKR', '', '환영이라. 그래, 겨울 여왕 폐하께서 자기 대신 충성스런 백성을 사지로 내몰고 있단 말이지.', 39653),
(208176, 'koKR', '여긴 필멸자가 봐선 안 될 곳입니다.', '여긴 필멸자가 봐선 안 될 곳입니다.', 39653),
(208175, 'koKR', '여기서 본 건 모두 잊으십시오.', '여기서 본 건 모두 잊으십시오.', 39653),
(208174, 'koKR', '우리의 의무는 신성하고, 결의는 영원합니다.', '우리의 의무는 신성하고, 결의는 영원합니다.', 39653),
(208173, 'koKR', '침입자들이 엄습해오고 있습니다.', '침입자들이 엄습해오고 있습니다.', 39653),
(208172, 'koKR', '코르시아가 위태롭습니다.', '코르시아가 위태롭습니다.', 39653),
(208171, 'koKR', '심판관님의 적들이여, 각오해라.', '심판관님의 적들이여, 각오해라.', 39653),
(208170, 'koKR', '목적의 길이 우리를 인도합니다.', '목적의 길이 우리를 인도합니다.', 39653),
(208169, 'koKR', '우리는 지식을 수호합니다.', '우리는 지식을 수호합니다.', 39653),
(208168, 'koKR', '금고가 뚫려선 안 됩니다.', '금고가 뚫려선 안 됩니다.', 39653),
(208167, 'koKR', '실바나스가 폭포 주변에서 포착되었소! 그녀를 처단할 수 있는 기회요!', '', 39653),
(208163, 'koKR', '', '간수를 섬기는 부정한 생물들. 모조리 먼지로 만들어 버리세.', 39653),
(208123, 'koKR', '', '시초자의 권좌에서 만나지.', 39653),
(208121, 'koKR', '토르가스트의 관문이 열리자 켈투자드가 파견한 고문관들이 나락의 구렁로 향합니다!', '', 39653),
(208119, 'koKR', '', '말드락서스의 군대여, 전장으로 나아가라! 승리를 쟁취해라!', 39653),
(208118, 'koKR', '', '계속 전진해야 해! 나락 방랑자, 진격 신호를 보내게!', 39653),
(208116, 'koKR', '난 이제 레벤드레스로 가야 하네. 즐거운 사냥이 되길 빌지.\n', '', 39653),
(208115, 'koKR', '', '우린 동맹이니 도와주겠네. 단, 진행 중인 내 임무를 먼저 마친 뒤에 말이지.', 39653),
(208112, 'koKR', '', '참혹한 죽음에서 구하려는 거겠지.', 39653),
