(208110, 'koKR', '', '네 고통을 마셔주마!', 39653),
(208109, 'koKR', '나락 방랑자가 티란데를 도울 밤 전사를 찾는 일을 부탁했네.', '', 39653),
(208108, 'koKR', '내 세계의 밤 전사, 티란데 위스퍼윈드가 곤경에 처했네.', '', 39653),
(208107, 'koKR', '', '으으음. 훌륭한 시체로구나.', 39653),
(208102, 'koKR', '그렇다면 덤벼라. 우리 실력이 대등하단 걸 보여주지.', '', 39653),
(208101, 'koKR', '죽음의 악취가 풍기는군, 인간이여. 내게 접근한 걸 후회하게 될 거다.', '', 39653),
(208100, 'koKR', '정말 그것 때문인가, 악마사냥꾼이여? 그 의지가 자신에게서 나왔다고 확신하는가?', '', 39653),
(208099, 'koKR', '만 년이 지나 마침내 자유로워졌다. 하지만 우리 친형조차 날 문제아로 생각하지! 형에게 내 진정한 힘을 보여주겠다! 악마들이 날 막을 순 없다는 걸 보여주겠다!', '', 39653),
(208098, 'koKR', '<고통에 겨워 힘겹게 숨을 몰아쉬는 우서>', '', 39653),
(208097, 'koKR', '내 영혼 깊숙이 똬리를 튼 이 고통에... 이젠 마침표를 찍어야 해.', '', 39653),
(208096, 'koKR', '제 영혼이 아물 수 있다면, 이탈자들과의 갈등도 해소할 수 있을 것입니다...', '', 39653),
(208082, 'koKR', '', '전 병력, 진격하라! 겨울 여왕을 찾아라. 내 직접 인장을 손에 넣겠다!', 39653),
(208081, 'koKR', '야생 사냥단, 전진하라!', '', 39653),
(208080, 'koKR', '', '진짜 겨울 여왕님은 숲의 심장부를 지키고 계세요. 이젠 우리가 침략자들을 막아야 해요!', 39653),
(208079, 'koKR', '시간을 버는 전략도 한계가 있소. 속전속결로 끝내야 하오.', '', 39653),
(208077, 'koKR', '', '마지막이군. 제발 문제 없어야 할텐데!', 39653),
(208072, 'koKR', '', '그렇네. 왜 날 뒤쫓았는지 말하게.', 39653),
