(208060, 'koKR', '우리는... 이미... 이겼다...', '우리는... 이미... 이겼다...', 39653),
(208051, 'koKR', '', '제 조수가 승천의 보루 백인대장을 가동해 극한의 파괴를 선보일 예정이니 주목해 주시기 바랍니다!', 39653),
