(208003, 'koKR', '내 도움이 필요하면 말만 하게, $g형제여:자매여;. 내 칼은 준비되어 있으니. 언제든 부름에 응하겠네.', '', 39653),
(208002, 'koKR', '', '축하한다, 나의 사랑스러운 $p|1이여;여;. 네 궁정은 아주 훌륭해. 그리고 너 역시도.', 39653),
(208001, 'koKR', '앉으시오, 편하게, 서두르지 말고. 가장 친한 친구에게 내어줄 시간은 언제든 있다오, $p.', '', 39653),
(207999, 'koKR', '', '여기 계속 잡아두고 싶진 않구나, 나의 작은 $p|1이여;여;.', 39653),
(207998, 'koKR', '', '아, 캘타스. 규탄자가 널 우리에서 내보내 주었나 보구나.', 39653),
(207997, 'koKR', '', '내가 거둔 수많은 승리 역시 가볍지 않았으니까. 너도 그렇다고 할 수 있나?', 39653),
(207992, 'koKR', '$p, 안 그래도 어디 갔나 찾고 있었단다! \n\n부끄러워 할 필요 없단다. 요사이 학문을 소홀히 한 것쯤은 알고 있으니. 그래도 이렇게 오지 않았느냐? 지금부터라도 공부를 다시 시작하자꾸나!', '', 39653),
(207991, 'koKR', '', '우린 공포의 군주를 사냥하고 말살하기 위해 여기 온 거다. 이번엔 놈들과 손잡을 생각은 말기를.', 39653),
(207989, 'koKR', '', '레벤드레스에 당도한 지 불과 5분도 안 됐는데 규탄자가 \"속죄\"를 하라며 달라붙은 것만 벌써 세 번째다.\n\n이곳에서 그 여자가 얼마나 위험한지 시초자께서 미리 언질을 주지 않으셨으면 내 아주 곤혹스러운 꼴을 봤을 것이야. 하다 하다 캘타스가 측은해지려고 하는군.', 39653),
(207982, 'koKR', '', '넌 한때 내게 충성하지 않았더냐. 날 방해하는 건 어리석은 처사라는 걸 잘 알 텐데?', 39653),
(207981, 'koKR', '', '그래, 아제로스의 영웅께서 놀러 나오셨군. 이번에도 실패를 면치 못할 거다.', 39653),
(207974, 'koKR', '', '드디어 용기를 내 그 여자를 만나러 가시는군요. 우수한 호위대를 편성하겠습니다.', 39653),
(207972, 'koKR', '', '우리의 동맹은 물론이고, 이곳 병력도 점점 강성해지고 있네.\n\n나락 방랑자 자네 덕분일세.', 39653),
(207971, 'koKR', '내 도시에 그냥 걸어 들어갈 수 있을 줄 알았나?', '', 39653),
(207970, 'koKR', '보기보다 성가신 녀석들이군.', '', 39653),
(207969, 'koKR', '무기를 버리지 않으면 압수하겠다.', '', 39653),
(207968, 'koKR', '밀수품은 모두 압류 대상이다.', '', 39653),
(207967, 'koKR', '내게로 집결하라!', '', 39653),
(207966, 'koKR', '내게 돌아와라!', '', 39653),
(207965, 'koKR', '애초에 타자베쉬에 오지 말았어야지, 이방인.', '', 39653),
(207964, 'koKR', '누가 됐든 보안 규정을 준수해야 한다.', '', 39653),
(207963, 'koKR', '얼마나 크게 비명을 지르나 확인해 볼까?', '', 39653),
(207962, 'koKR', '심문받을 준비나 해라.', '', 39653),
(207961, 'koKR', '더러운 범죄자 놈.', '', 39653),
(207960, 'koKR', '무단 침입은 금지다.', '', 39653),
(207959, 'koKR', '서류를... 확인해야...', '', 39653),
(207958, 'koKR', '타자베쉬의 법을 준수해라.', '', 39653),
(207957, 'koKR', '침입자? 감히 내 도시에? 오래 머무르진 못할 거다.', '', 39653),
(207956, 'koKR', '', '병사들의 공격 준비가 끝날 때까지 물러나지 마라!', 39653),
(207925, 'koKR', '이런다고... 변하는 건... 없다...', '', 39653),
(207849, 'koKR', '그 필멸의 육체는 휴식이 필요하지 않나요, 그렇죠?', '그 필멸의 육체는 휴식이 필요하지 않나요, 그렇죠?', 39653),
(207848, 'koKR', '반갑습니다. 전 차원석 관리인입니다. 재앙이 닥치기 전부터 차원석을 사용할 이를 기다리며 지켜보는 것이 제 경건한 책무였지요.', '반갑습니다. 전 차원석 관리인입니다. 재앙이 닥치기 전부터 차원석을 사용할 이를 기다리며 지켜보는 것이 제 경건한 책무였지요.', 39653),
(207847, 'koKR', '전 망가진 것을 고치고 질서를 되돌려 놓는 방식으로 목적의 길을 섬깁니다. 제가 도와드리겠습니다.', '전 망가진 것을 고치고 질서를 되돌려 놓는 방식으로 목적의 길을 섬깁니다. 제가 도와드리겠습니다.', 39653),
(207846, 'koKR', '그 힘은 내가 가져가겠다!', '', 39653),
(207845, 'koKR', '네놈들의 령은 내 뜻을 따르리라!', '', 39653),
(207844, 'koKR', '공허한 승리로군. 결국 필연 앞에 굴복하게 될 거다.', '', 39653),
(207843, 'koKR', '이 탑에서 영원한 고문을 받게 되리라.', '', 39653),
(207837, 'koKR', '나락 방랑자. 아드레스테스 군정관이 승천의 보루에서 불길한 소식을 가져왔다. 속히 오리보스로 오길 바란다.', '', 39653),
(207836, 'koKR', '속수무책으로 당해버렸다. 간수의 힘이 우리의 상상을 완전히 초월할 정도로 강력해졌어.', '', 39653),
(207820, 'koKR', '', '강령군주가 지배의 제단으로 진격하고 있네. 선봉에 서서 우리를 이끌어 주게!', 39653),
(207635, 'koKR', '', '온 세상이 피에 잠기리라!', 39653),
(207631, 'koKR', '', '됐다! 엄마 품으로 오렴.', 39653),
(207630, 'koKR', '', '변화하는 차원 보관통에 넣으면 내가 못 가져갈 줄 알고? 천만에.', 39653),
(207609, 'koKR', '', '지금이 기회다! 저 도끼는 내 거야!', 39653),
