(207485, 'koKR', '', '수도사님들과 같이 훈련하라며 부모님이 절 여기 두고 가셨어요. 근데 전 애완동물 대전만 하고 싶어요! 혹시 애완동물 있으세요?', 39653),
(207484, 'koKR', '', '드디어 활약할 차례가 왔군요!', 39653),
(207483, 'koKR', '', '이겼다! 역시 제 생각대로네요.', 39653),
(207482, 'koKR', '', '당신이 이기긴 했지만, 그래도 최고는 저예요!', 39653),
