(207480, 'koKR', '', '에이, 불공평하잖아요!', 39653),
(207479, 'koKR', '', '그렇지! 좋았어!', 39653),
(207478, 'koKR', '', '안녕하세요, 신화 쐐기돌 던전 인비테이셔널에 오신 것을 환영합니다!\n\n당신을 어둠땅 던전 어디로든 바로 순간이동시켜 드릴게요.\n\n순간이동하기 전에 던전 난이도를 신화로 설정하셨는지 꼭 확인해 주세요.', 39653),
(207477, 'koKR', '핏빛 심연 던전으로 순간이동하고 싶습니다.', '핏빛 심연 던전으로 순간이동하고 싶습니다.', 39653),
