(207392, 'koKR', '무엇을 바라십니까?', '', 39653),
(207387, 'koKR', '뿌리는 중', '뿌리는 중', 39653),
(207374, 'koKR', '|TInterface\\Icons\\SPELL_NATURE_EARTHQUAKE:20|t진흙주먹이 |cFFFF0000|Hspell:332318|h[파괴적인 발구르기]|h|r를 준비합니다!', '|TInterface\\Icons\\SPELL_NATURE_EARTHQUAKE:20|t진흙주먹이 |cFFFF0000|Hspell:332318|h[파괴적인 발구르기]|h|r를 준비합니다!', 39653),
(207346, 'koKR', '', '고맙네... 내 마지막 노력이 헛된 일이 아니었다니 기쁘군그래.', 39653),
(207341, 'koKR', '', '후작님이 떠나셨다고 해서 우리가 쌓아온 공마저 무너진 것은 아니지. 때가 오면 복수를 이룰 것이네.\n\n잠깐, 자네... 자네는 아제로스에서 왔군. 말해 주게, 내 전갈이 무관의 연맹에 전해졌던가?', 39653),
(207317, 'koKR', '|TInterface\\Icons\\inv_misc_steelweaponchain:20|t진흙주먹이 당신을 |cFFFF0000|Hspell:335300|h[결속의 사슬]|h|r로 속박할 준비를 합니다!', '|TInterface\\Icons\\inv_misc_steelweaponchain:20|t진흙주먹이 당신을 |cFFFF0000|Hspell:335300|h[결속의 사슬]|h|r로 속박할 준비를 합니다!', 39653),
(207258, 'koKR', '묻고 있지 않습니까, 대체 생전에 무슨 일을 했기에 레벤드레스로 오신 거냐고요?', '묻고 있지 않습니까, 대체 생전에 무슨 일을 했기에 레벤드레스로 오신 거냐고요?', 39653),
(207243, 'koKR', '|TInterface\\ICONS\\spell_Mage_Flameorb.blp:20|t |cFFFF0404|Hspell:346947|h 우편 차원문을 통해 [불안정한 상품]|h|r이 날아듭니다!', '', 39653),
(207242, 'koKR', '|TInterface\\ICONS\\Ability_Racial_PackHobgoblin.blp:20|t 곧 |cFFFF0000$n|r에게 |cFFFF0404|Hspell:346962|h[우편환]|h|r이 전달됩니다!', '', 39653),
(207240, 'koKR', '몽환숲 우편 차원문 활성화!', '', 39653),
(207239, 'koKR', '말드락서스 우편 차원문 활성화!', '', 39653),
(207238, 'koKR', '레벤드레스 우편 차원문 활성화!', '', 39653),
(207237, 'koKR', '승천의 보루 우편 차원문 활성화!', '', 39653),
(207227, 'koKR', '', '네 왕국과 부족은 이곳에서 아무 힘도 쓰지 못한다. 옛 충성을 거두고 과거로부터 자유로워져라!', 39653),
(207213, 'koKR', '', '가히지는 물건... 잃어버린 물건... 잊힌 물건을 훔쳤다...\n\n누구도 찾지 않을... 한데...\n\n가히지가 너무 멀리 가고 만 게지... 잊어선 안 될 규칙을 잊어버린 거야...\n\n가히지는 실수를 범하고 말았어...', 39653),
(207212, 'koKR', '', '가히지도 필멸자처럼 자유로워지고 싶구나...\n\n이곳에서 달아나... 과거에서 달아나고 싶군.', 39653),
(207166, 'koKR', '스타니코스가 당신을 독려합니다!', '스타니코스가 당신을 독려합니다!', 39653),
