(207016, 'koKR', '토르가스트: 뒤틀린 회랑 잠금 해제', '토르가스트: 뒤틀린 회랑 잠금 해제', 39653),
(206987, 'koKR', '확실합니까? 이 선택은 돌이킬 수 없습니다.', '확실합니까? 이 선택은 돌이킬 수 없습니다.', 39653),
(206986, 'koKR', '성소에 관한 내용은 저도 잘 압니다. |cFFFF0000<첫 영혼결속자를 만나는 대장정 장으로 건너뜁니다.>|r', '성소에 관한 내용은 저도 잘 압니다. |cFFFF0000<첫 영혼결속자를 만나는 대장정 장으로 건너뜁니다.>|r', 39653),
(206973, 'koKR', '|TInterface\\Icons\\ability_warlock_soullink:20|t스타브로스 경이 당신에게 |cFFFF0000|Hspell:331634|h[암흑의 발표회]|h|r를 시전합니다!', '|TInterface\\Icons\\ability_warlock_soullink:20|t스타브로스 경이 당신에게 |cFFFF0000|Hspell:331634|h[암흑의 발표회]|h|r를 시전합니다!', 39653),
(206972, 'koKR', '정말 속죄의 전당을 떠나시겠습니까?', '정말 속죄의 전당을 떠나시겠습니까?', 39653),
(206966, 'koKR', '리치서리의 약병. 거리를 유지하는 데 특효약이죠!\n\n적의 물량이 너무 압도적이다? 후퇴가 필요한 상황이다?\n\n두려워할 필요 없답니다! 병을 바닥에 던져 깨뜨리면 적이 얼어붙으니 말이죠. 그런 다음 도망가는 거예요!', '', 39653),
(206946, 'koKR', '유행의 선도자이신가요? 그렇다면 차원술사 타오렌이나 다른 형상변환사를 통해 멋의 대제전에 참여해 보세요!', '유행의 선도자이신가요? 그렇다면 차원술사 타오렌이나 다른 형상변환사를 통해 멋의 대제전에 참여해 보세요!', 39653),
(206907, 'koKR', '분쟁의 대가', '분쟁의 대가', 39653),
(206906, 'koKR', '떠들 시간이 있다는 건 곧 수련에 정진할 시간이 있다는 의미가 아니더냐? 농땡이는 금물이거늘!', '', 39653),
(206905, 'koKR', '걸출한 병사로서 동지들을 전장으로 이끄는 건 너의 의무다. 힘의 참된 의미를 보여줘라!', '', 39653),
(206904, 'koKR', '$p 너 같은 존재와 함께 싸웠다면 시초자께서도 영예롭게 생각하셨을 거다.', '', 39653),
(206903, 'koKR', '$n|1이여;여;, 전투에서 쓰러지더라도 그 희생이 승리의 발판이 되게 하거라!', '', 39653),
(206902, 'koKR', '$p|1이여;여;, 전투에서 쓰러지더라도 그 희생이 승리의 발판이 되게 하거라!', '', 39653),
(206900, 'koKR', '|cfff2e699영혼 $1i명 해방|r', '|cfff2e699영혼 $1i명 해방|r', 39653),
(206888, 'koKR', '', '나락에서 벗어날 순 없다!', 39653),
(206713, 'koKR', '죄악질주마 블랑쉬가 고통스러운 비명을 내지르더니 시야에서 사라져 버립니다.', '', 39653),
(206671, 'koKR', '제 장비를 수리해 주실 수 있겠습니까?', '제 장비를 수리해 주실 수 있겠습니까?', 39653),
(206637, 'koKR', '이번 도전을 포기하고 토르가스트로 돌아가시겠습니까?', '이번 도전을 포기하고 토르가스트로 돌아가시겠습니까?', 39653),
(206633, 'koKR', '토르가스트를 떠나 나락으로 돌아가시겠습니까?', '토르가스트를 떠나 나락으로 돌아가시겠습니까?', 39653),
(206602, 'koKR', '오우거 폐허로 돌아갑니다!', '오우거 폐허로 돌아갑니다!', 39653),
(206592, 'koKR', '대영주의 시대는 끝났다. 레벤드레스는 이제 주인이 아닌... 궁정을 섬길 것이다.', '', 39653),
(206573, 'koKR', '|cffb27fe5저승석 -$1i|r', '|cffb27fe5저승석 -$1i|r', 39653),
(206533, 'koKR', '', '이제 그만 가 봐.', 39653),
(206531, 'koKR', '', '공주와 대면 중임을 명심하도록!', 39653),
(206529, 'koKR', '어둠땅의 오리보스', '어둠땅의 오리보스', 39653),
(206506, 'koKR', '|TINTERFACE\\ICONS\\Ability_Rogue_BloodyEye.blp:20|t 스티치플레시가 |cFFFF0404|Hspell:343555|h[병독의 집착]|h|r으로 당신에게 시선을 고정합니다!', '|TINTERFACE\\ICONS\\Ability_Rogue_BloodyEye.blp:20|t 스티치플레시가 |cFFFF0404|Hspell:343555|h[병독의 집착]|h|r으로 당신에게 시선을 고정합니다!', 39653),
(206495, 'koKR', '메빅스에게 반항의 죄를 물을 테다!', '메빅스에게 반항의 죄를 물을 테다!', 39653),
(206485, 'koKR', '|TINTERFACE\\ICONS\\Spell_Necro_DeathlyEcho.blp:20|t 아마스가 |cFFFF0404|Hspell:321247|h[마지막 수확]|h|r으로 하수인을 흡수합니다!', '|TINTERFACE\\ICONS\\Spell_Necro_DeathlyEcho.blp:20|t 아마스가 |cFFFF0404|Hspell:321247|h[마지막 수확]|h|r으로 하수인을 흡수합니다!', 39653),
(206423, 'koKR', '$p. 자네와 만날 때마다 아제로스에서의 옛 삶이 떠오르는군.\n\n모든 일이 마무리되고 승리를 자축하는 연회를 열 때가 오면 할 질문이 있네.\n\n하지만 지금은 당장의 임무에 집중해야 하네.\n\n한순간이라도 적을 간과하기에는 너무 많은 것이 걸려 있으니 말일세.', '', 39653);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(206413, 'koKR', '', '항상 서두르는구나, 귀여운 $p야.\n\n불평하는 게 아니다. 난 사실 우리 관계의 모든 면을 즐기고 있다.\n\n넌 내 시간을 낭비하지 않고, 난 너의 노력을 헛되이 하지 않는다.\n\n그래서 지금 이 상황에는 뭘 부탁하려는 거지?\n\n정찰? 암살? 궁정 계획 조언?\n\n첩자의 여제가 네 말을 기다리고 있다.', 39653),
(206361, 'koKR', '<진행하던 작업을 중단하고 한껏 집중하는 미카니코스>\n\n$p, 그 누구보다 아끼는 방문객이 납셨구려.\n\n언제나 새로운 발상을 선사하는 좋은 친구가 찾아왔단 말이외다.\n\n작업은 미뤄두면 그만이니, 얼른 말해보시오. 영원의 제련소에는 어쩐 일이오?\n\n나를 보러 왔나? 무언가가 필요해서 왔을지도 모르지. 곧 궁정이 개방된다는 소식을 전하러 온 거라면 좋겠는데.', '', 39653),
(206347, 'koKR', '|TINTERFACE\\ICONS\\Ability_Creature_Cursed_05.blp:20|t 절규날개가 당신을 |cFFFF0404|Hspell:342074|h[반향정위]|h|r로 감지합니다!', '|TINTERFACE\\ICONS\\Ability_Creature_Cursed_05.blp:20|t 절규날개가 당신을 |cFFFF0404|Hspell:342074|h[반향정위]|h|r로 감지합니다!', 39653),
(206342, 'koKR', '교감하는 중', '교감하는 중', 39653),
(206162, 'koKR', '', '$n 님이 어떤 업적을 세워 저희 관문에 당도하게 되었는지 빨리 알아보고 싶습니다.', 39653),
(206138, 'koKR', '', '<온화하게 포옹하는 백작>\n\n나의 아름다운 $p|1이여;여;, 죄악의 몰락지에서 무슨 소식을 가지고 왔느냐? 모두 무탈하길 비마.\n\n다음에 테오타르와 왕자님을 만나거든 안부를 전해다오.\n\n아니지, 다시 한번 잿불 궁정에 참석할 영예를 얻으면 내가 직접 말할 수도 있겠구나.\n\n좌우간 그 이야기는 이쯤에서 끊도록 하지. 너는 잘 지냈느냐? 지난 방문 이후로 보고 싶었다.', 39653),
(206123, 'koKR', '', '시초자는 말드락서스의 질서를 유지하고, 이 협곡에서 자신의 자리를 빼앗으려던 자들을 말살했네. 시초자의 힘을 기리세.', 39653),
(206121, 'koKR', '', '말드락서스에서 야망은 귀중한 덕목이지. 그 야망이 갈등으로 이어지는 때가 있네.', 39653),
(206099, 'koKR', '', '당연히 잿불 궁정을 말하는 거요...', 39653),
(206098, 'koKR', '', '알겠소. 그럼 궁정에서 봅시다.', 39653),
(206091, 'koKR', '아, 뿌리 저장고로군! 성한 걸 보니 기쁘구먼. 들어보게, 자네 요새 밤낮으로 고생이 많지 않았나. 가서 푹 쉬게. 요양을 제대로 즐긴 다음 돌아오도록 해!', '', 39653),
(206015, 'koKR', '벌써 떠나는 건가?', '', 39653),
(206009, 'koKR', '피와 영광! 투기장에서 전투를 펼칠 준비는 됐습니까?', '', 39653),
(205945, 'koKR', '규율에 따라 대가의 경지에 이를 때까지 시련을 거듭하도록 해라.', '규율에 따라 대가의 경지에 이를 때까지 시련을 거듭하도록 해라.', 39653),
(205922, 'koKR', '|TInterface\\ICONS\\Creatureportrait_portal_eyeofthestormhorde.blp:20|t|cFFFF0000|Hspell:328437|h [차원 균열]|h|r의 대상으로 지정되었습니다!', '|TInterface\\ICONS\\Creatureportrait_portal_eyeofthestormhorde.blp:20|t|cFFFF0000|Hspell:328437|h [차원 균열]|h|r의 대상으로 지정되었습니다!', 39653),
(205856, 'koKR', '오오, 한 잔 더 하자면 거절 못 하쥐요. 달고 부드뤄운 걸로. 령 칵테일 마셔본 적 있어요? 마크는 이 연회에서 최고의 술을 만들어요.', '', 39653),
(205855, 'koKR', '안 그래도 난장판인데 한 잔 더 꺾는 것도 좋죠. 센 술을 찾아줄 수 있나 보자고요. 나방 털이면 정쉰 좀 차리고 기억을 찾는 데 도움이 될 거예요.', '', 39653),
(205854, 'koKR', '정말요? 한 잔 사겠다고요? 최고의 친구를 새로 사귀었군요. 그냥 알려주고 싶었어요.$b$B 전 스프리건주가 좋아요. 톡 쏘는 시큼한 맛에 입술이 얼마나 일그러지는지 뺨이 아플 지경이라니까! 하!', '', 39653),
(205853, 'koKR', '사양하겠어요. 이미 너무 뫄니 마셨어요. 술 좀 <딸꾹!> 깨야 해!', '', 39653),
(205850, 'koKR', '이봐요... <딸꾹!> 저 좀 도와주시겠어요?$b$B저는 환영의 달인인 시머소드라고 해요! 적어도 제 생각엔 그래요. 분명 제가 너무 많이 마쉬긴 했지만, 어... <딸꾹!>$b$b이제 어느 쪽이 쥔짜 저인지도 모르겠어요. 이게 바로 <딸꾹!> 존재의 위기라는 거로군요. 이런 세상에.', '', 39653),
(205846, 'koKR', '오 하나된 나이트 페이여, 하나된 나이트 페이여, 오오!', '', 39653),
(205845, 'koKR', '사냥꾼에게 령을 던져주오,', '', 39653),
(205844, 'koKR', '다음 모험이 시작될 때까지!', '', 39653),
(205843, 'koKR', '그에게 환호를 보내다오,', '', 39653),
(205842, 'koKR', '영웅은 시험을 통과했네,', '', 39653),
(205841, 'koKR', '남은 이야기는 잘 알겠지,', '', 39653),
(205840, 'koKR', '여전히 숲속 빈터에 울려 퍼지네.', '', 39653),
(205839, 'koKR', '승리의 일격...', '', 39653),
(205838, 'koKR', '늑대가 칼을 빼 들었네!', '', 39653),
(205837, 'koKR', '치명적인 망령의 공격을 받고,', '', 39653),
(205836, 'koKR', '세 개의 입이 기다리네!', '', 39653),
(205835, 'koKR', '저기 사냥감이 보이네,', '', 39653),
(205834, 'koKR', '안개를 꿰뚫었네...', '', 39653),
(205833, 'koKR', '우린 늪지를 헤치고...', '', 39653),
(205832, 'koKR', '세상에, 훌륭해요! 정말로 전생에 음유시인이 아니었나요?$b$B<잠시 직접 작곡을 하는 다포딜>좋아, 준비가 된 것 같아요. 들을 준비 되셨나요?', '', 39653),
(205831, 'koKR', '인류란 무엇이죠? 당신인가요? 당신이 인류인가요? 이 노래는당신을 위한 것이 아니에요. 몽환숲 전역, 특히 이곳에 있는 나이트 페이를 고무하려는 거예요. 우리는 칭찬, 극찬, 보상을 받을 만한 영웅들이니까요!', '', 39653),
(205830, 'koKR', '중독성은 있지만, 예측하기 좀 쉽네요. 그리고 재미있는 사실 하나! 몽환숲에는 그렇게 계곡이 많지 않아요.', '', 39653),
(205829, 'koKR', '좋아요! 행동을 개시해야겠군요. 모두가 우리를 보고 평화를 지켜야 한다는 사실을 떠올리겠죠. 한번 시험해볼까요? 자, 화려한 마무리를 위하여!$B$B사냥꾼에게 령을 던져주오... 오....', '', 39653),
(205828, 'koKR', '아주 재미난 그림이긴 하지만, 누구나 손은 제자리에 있는 걸 좋아할 거예요. 감사 인사는 됐어요.', '', 39653),
(205826, 'koKR', '이보세요, 소원이란 좋은 거지만 전 조금 더... 물질적인 걸 원한다고요. 당신도 아시겠지만 영웅 노릇은 힘든 일이에요. 그리고 힘든 일에는 보상이 따라야 하는 법이고요. 아시겠어요?', '', 39653),
(205817, 'koKR', '오오, 좋은 단어예요. 청자를 교육하는 건 때로는 음유시인의 의무가 되고, 어휘는 아주 좋은 시작점이죠!$b$B잠깐, 그게 입이 세 개 달렸다는 건 어떻게 아셨죠?$b$B아무튼 다음 절을 읊어볼게요.\n남은 이야기는 잘 알겠지\n영웅이 시험을 통과했네\n그에게 환호를 보내다오\n...흠, 그에게 환호를 보내다오...?', '', 39653),
(205816, 'koKR', '음, 아주 극적이지는 않죠? 용감한 다포딜, 잠시 눈을 붙이고 있는 야수를 찌르다! 아니, 아니, 이건 별로야. 흐음...', '', 39653),
(205815, 'koKR', '운율에 헌신하는 태도는 고맙지만, 저흰 유령과 싸우고 있었어요. 그리고 전 내 노래에서 종종 사실을 과장하지만, 그건 좀 지나친 비약이 아닐까 싶어요. 아시겠어요?$b$B<티가 나게 눈을 찡긋하는 다포딜>', '', 39653),
(205814, 'koKR', '훌륭해요! 첫 번째 절은 이래요.\n우린 늪지를 헤치고\n안개를 꿰뚫었네\n저기 사냥감이 보이네\n... 여기서 어떻게 이어야 할지 모르겠어요. 혹시 아이디어 있나요?', '', 39653),
(205809, 'koKR', '또 만났군요! 우린 분명 만난 적이 있죠...$B$B아무튼 때마침 잘 오셨어요. 안타깝게도 창작의 고통에 시달리고 있는데, 가사 몇 개 쓰는 일을 좀 도와주셨으면 해요. 저쪽에 있는 고결한 친구, 그리고 아주 최근 무서운 생물과 치른 전투에 관한 노래예요.', '', 39653),
(205808, 'koKR', '', '<용기에 액체를 붓고 힘차게 흔드는 마크>\n마시면 죽는 거 아니냐고요? 그건 왜 묻죠? 뭐, 살아 계시기라도 한 건가요? 하!$b$B아, 진담이군요. 아뇨, 게걸충 즙은 문제없어요. 마지막에 그윽한 달콤함을 더하죠. \n<유리잔을 건네는 마크>\n맛있게 드세요!', 39653),
(205807, 'koKR', '', '<당신을 훑어보는 마크>$b$b그래요, 당신이 할 만한 일이 있죠. 게걸충 즙이 필요한데, 방금 다 떨어졌습니다. 저기 스퀴줌스에게 가서 즙을 구해주실 수 있을까요? 해칠 걱정은 하지 마세요. 관심받는 걸 좋아하니까요.', 39653),
(205785, 'koKR', '', '대단하군요! \n\n섬의 중심지로 돌아가실 수 있도록 두루마리를 하나 드리겠습니다. 이곳은 인적이 꽤 드무니까 말입니다.', 39653),
(205783, 'koKR', '', '이런! $r 아니십니까? 당신과 같은 분은 오랜만에 뵙는군요. \n\n요즘 사방에 난무하는 강령술을 피해 숨으러 오셨습니까? $r들이 물속에서 제대로 호흡할 수 있는지 모르겠네요.\n\n저희는 다시 이동하기 전에 이 소동이 잠잠해지길 기다리는 중입니다. 5년, 아니 10년은 걸리겠지요. 제겐 그다지 긴 시간이 아닙니다.\n\n당신에겐 꽤 길겠지만...', 39653),
(205781, 'koKR', '', '물론 알고 있죠. 진짜 그윈체르를! 그리고 믿음직한 동료인 다포딜을 누가 잊겠어요?$b$b부디 문제를 일으키지 마세요. 지난번에 싸움거리를 찾아다니는 스프리건 무리가 시비를 걸러 왔어요. 청소에 한 세월이 걸리더군요. 어떻게 내장이 지붕에 올라갔을까요!? 그 많은 피는 또 어떻고요?!', 39653),
(205779, 'koKR', '', '그럼요, 망가뜨리지만 마세요. 마라스미우스는 항상 하프에 걸린다고 불평해요. 어떻게 된 일인지는 묻지 마세요.', 39653),
(205778, 'koKR', '', '아, 시머소드? 괜찮을 거예요. 시머소드는 환영을 좋아하지만, 때때로 술에 취해 어느 쪽이 진짜인지 깜빡하죠.$b$b그래도 진짜가 나머지를 몰아낼 수 있지만요. 그가 좋아하는 술은 령 칵테일입니다. 그게 몽환숲에서 가장 부드럽고 달콤한 음료라고 하더군요. $b$b시머소드의 주량을 생각하면 자부심이 드는 칭찬이에요. 한번 드셔보시겠습니까?', 39653),
(205774, 'koKR', '<잠시 머무르며 이야기를 듣습니다.>', '<잠시 머무르며 이야기를 듣습니다.>', 39653),
(205675, 'koKR', '훼방꾼들을 멸해라!', '', 39653),
