(205508, 'koKR', '<티르너 노흐 이야기를 듣습니다.>', '<티르너 노흐 이야기를 듣습니다.>', 39653),
(205495, 'koKR', '으으윽. 스프리건 녀석들. 추잡하고 시끄러운데 쥐방울처럼 잽싸게 돌아다닐 줄만 아는 종자들 같으니. 하여간 꽃이 알아서 뽑히지는 않네. 챙길 건 챙기고, 저 고얀 녀석들은 처리하게나.', '', 39653),
(205439, 'koKR', '입기', '입기', 39653),
(205438, 'koKR', '에메니 투영', '에메니 투영', 39653),
(205346, 'koKR', '아아악! 타론자는 더 빼앗을 테다!', '', 39653),
(205344, 'koKR', '으으... 이럴 수가! 타론자는 불멸이란 말이다! 타론자는...', '', 39653),
(205342, 'koKR', '주인님... 제 임무는 이제... 끝입니까?', '', 39653),
(205340, 'koKR', '샤드 아크 케리쉬... 샤칵칵칵칵!', '', 39653),
(205337, 'koKR', '이제 그만 놀아?', '', 39653),
(205336, 'koKR', '나... 어떻게...아아아...', '', 39653),
(205333, 'koKR', '하시 타크 히이 타아아!', '', 39653),
(205332, 'koKR', '고마워할 자격 따위... 잃은 지... 오래다...', '', 39653),
(205331, 'koKR', '좀 이따 슥슥 해서 꿀꺽!', '', 39653),
(205329, 'koKR', '아아아아아악!', '', 39653),
(205327, 'koKR', '이래 봤자... 아무 소용없다.', '', 39653),
(205326, 'koKR', '그냥 단념하고 목숨을 바쳐라!', '', 39653),
(205324, 'koKR', '로데론 전투를 경험하고 싶습니다.', '로데론 전투를 경험하고 싶습니다.', 39653),
(205298, 'koKR', '감사합니다. 오늘 그대가 보여준 친절의 요소를 깊이 숙고해 보도록 하겠습니다. 당분간은 안녕히 계시길.', '', 39653),
(205297, 'koKR', '<소환장을 받고 비행선을 떠납니다.>', '<소환장을 받고 비행선을 떠납니다.>', 39653),
(205296, 'koKR', '세상 만물사는 결국 때가 있기 마련입니다. 그 순간 내 바람이 어떠한지는 상관없죠. 이를 아는 것이 인내심입니다.', '', 39653),
(205295, 'koKR', '나에게 잘못을 저지른 자에게 생각과 분개를 토로하는 것이 용서로 향하는 걸음이라 할 수 있습니다.', '', 39653),
(205293, 'koKR', '나라는 영역의 바깥으로 나아가, 타인의 고통을 진정으로 이해하는 것. 연민이란 이러한 자세를 의미합니다.', '', 39653),
(205292, 'koKR', '저를 만나고자 바스러지는 현실의 끝자락까지 찾아오다니, 친절한 분이시군요. 흠. 이참에 친절의 본질을 탐구해보는 건 어떻겠습니까? 제 집중 장치를 찾아주실 수 있을는지요? 이 근처 어딘가에 있을 텐데...', '', 39653),
(205286, 'koKR', '그래, 이 정도는 되어야 \'변방\'이지. 한데 저 오도 가도 못 하는 가엾은 영혼을 보게! 도움의 손길이 필요하지는 않은지 알아보게나.', '', 39653),
(205271, 'koKR', '다른 필요한 거라도 있느냐, 제자야? 가르침이 부족한가? 아니면, 새로운 실험체가 필요한가? 뭐든지 말만 하려무나!', '', 39653),
(205268, 'koKR', '나락 방랑자, 손님들이 집으로 가져갈 물건을 구해와라. 길조를 떠올리게 만들 녀석이면 좋겠구나.', '', 39653),
(205267, 'koKR', '우리 궁정에 길조가 드리우는구나! 상공에서 령이 응축되다니!', '', 39653),
(205266, 'koKR', '|cfff2e699+추가 만족도 (모든 손님)|r', '|cfff2e699+추가 만족도 (모든 손님)|r', 39653),
