(205264, 'koKR', '|TInterface\\ICONS\\Ability_Rhyolith_MagmaFlow_Wave.blp:20|t캘타스의 망령의 시선을 아군의 반대쪽으로 돌려 아군이 |cFFFF0000|Hspell:329509|h[타오르는 쇄도]|h|r에 적중당하지 않게 해야 합니다!', '|TInterface\\ICONS\\Ability_Rhyolith_MagmaFlow_Wave.blp:20|t캘타스의 망령의 시선을 아군의 반대쪽으로 돌려 아군이 |cFFFF0000|Hspell:329509|h[타오르는 쇄도]|h|r에 적중당하지 않게 해야 합니다!', 39653),
(205263, 'koKR', '|TInterface\\ICONS\\Spell_Fire_Immolation.blp:20|t|cFFFF0000|Hspell:326456|h[타오르는 잔재]|h|r가 너무 많이 중첩되지 않게 해야 합니다!', '|TInterface\\ICONS\\Spell_Fire_Immolation.blp:20|t|cFFFF0000|Hspell:326456|h[타오르는 잔재]|h|r가 너무 많이 중첩되지 않게 해야 합니다!', 39653),
(205262, 'koKR', '|TInterface\\ICONS\\Spell_AnimaRevendreth_Beam.BLP:20|t캘타스의 망령이 살아있는 동안에는 캘타스를 치유할 수 없습니다!', '|TInterface\\ICONS\\Spell_AnimaRevendreth_Beam.BLP:20|t캘타스의 망령이 살아있는 동안에는 캘타스를 치유할 수 없습니다!', 39653),
