(205260, 'koKR', '|TInterface\\ICONS\\Spell_AnimaRevendreth_Nova.BLP:20|t추악한 사술사의 |cFFFF0000|Hspell:333002|h[저속의 낙인]|h|r을 방해해야 합니다!', '|TInterface\\ICONS\\Spell_AnimaRevendreth_Nova.BLP:20|t추악한 사술사의 |cFFFF0000|Hspell:333002|h[저속의 낙인]|h|r을 방해해야 합니다!', 39653),
(205259, 'koKR', '|TInterface\\ICONS\\Spell_AnimaRevendreth_Wave.BLP:20|t |cFFFF0000|Hspell:328885|h[상급 책망]|h|r의 대상이 되었습니다!', '|TInterface\\ICONS\\Spell_AnimaRevendreth_Wave.BLP:20|t|cFFFF0000|Hspell:328885|h[상급 책망]|h|r의 대상이 되면 아군에게서 멀리 떨어져야 합니다!', 39653),
(205258, 'koKR', '|TInterface\\ICONS\\Spell_AnimaRevendreth_Buff.BLP:20|t주입사의 보주를 획득해 |cFFFF0000|Hspell:326078|h[주입사의 은혜]|h|r를 얻어야 합니다!', '|TInterface\\ICONS\\Spell_AnimaRevendreth_Buff.BLP:20|t주입사의 보주를 획득해 |cFFFF0000|Hspell:326078|h[주입사의 은혜]|h|r를 얻어야 합니다!', 39653),
(205257, 'koKR', '|TInterface\\ICONS\\ability_warlock_SoulLink.blp:20|t영혼 주입사가 캘타스에게 피해를 입힙니다!', '|TInterface\\ICONS\\ability_warlock_SoulLink.blp:20|t영혼 주입사가 캘타스에게 피해를 입힙니다!', 39653),
(205256, 'koKR', '|TInterface\\ICONS\\Spell_Fire_SelfDestruct.blp:20|t|cFFFF0000|Hspell:325873|h[불꽃 폭발]|h|r의 대상이 되면 아군 주위로 이동해 피해를 나눠 받아야 합니다!', '|TInterface\\ICONS\\Spell_Fire_SelfDestruct.blp:20|t|cFFFF0000|Hspell:325873|h[불꽃 폭발]|h|r의 대상이 되면 아군 주위로 이동해 피해를 나눠 받아야 합니다!', 39653),
(205255, 'koKR', '|TInterface\\ICONS\\Ability_Revendreth_Rogue.BLP:20|t|cFFFF0000|Hspell:341473|h[진홍빛 질풍]|h|r의 대상이 되었습니다!', '|TInterface\\ICONS\\Ability_Revendreth_Rogue.BLP:20|t|cFFFF0000|Hspell:326583|h[진홍빛 질풍]|h|r의 대상이 되면 아군에게서 멀리 떨어져야 합니다!', 39653),
(205254, 'koKR', '|TInterface\\ICONS\\Ability_Revendreth_Rogue.BLP:20|t|cFFFF0000|Hspell:326583|h[진홍빛 질풍]|h|r의 대상이 되었습니다!', '|TInterface\\ICONS\\Ability_Revendreth_Rogue.BLP:20|t|cFFFF0000|Hspell:326583|h[진홍빛 질풍]|h|r의 대상이 되면 아군에게서 멀리 떨어져야 합니다!', 39653),
(205224, 'koKR', '어둠땅으로 통하는 길', '어둠땅으로 통하는 길', 39653),
(205223, 'koKR', '생으로 돌아가기', '생으로 돌아가기', 39653),
(205211, 'koKR', '도움이 될만한 물품이 있네. 내 가방을 확인하게. ', '', 39653),
(205208, 'koKR', '', '정말 찾았단 말이에요? \n이야, 잘됐네요. \n\n이렇게 합시다. 그냥 보내기도 뭣한 노릇이니...\n\n<과도하게 느릿한 동작으로 딱 한 번 손뼉을 쳐주는 타비티아>\n\n자, 됐습니다. 그만 가보세요! 집이 난장판이 된 지라... 좀 바빠서요.', 39653),
(205207, 'koKR', '', '예, 덩치가 어찌나 크던지! 가구 바로 밑에 땅을 뚫고 올라오는 게 아니겠습니까. 게걸충이 다른 건 다 무시하고 알만 챙겨 삼킨 걸 보면 알이 무슨 냄새 같은 걸 풍기나 봅니다.\n\n후각이 극도로 발달한 분이시면 또 모를까, 아니면 행운이 따라줘야 찾아내실 수 있을걸요. 차라리 중개자더러 그 양반 소중한 물건이 사라졌다고 이실직고하는 게 나을 수도 있습니다.\n\n그럼 실례하겠습니다. 다시 비탄에 젖어 청승이나 떨어야겠네요.', 39653),
(205206, 'koKR', '', '그 중개자 대신 물건을 가지러 오셨나 보군요?\n\n너무 늦으셨습니다. 저주받을 게걸충이 먹어버렸거든요.', 39653),
(205118, 'koKR', '<잠시 머무르며 이야기를 듣습니다.>', '<잠시 머무르며 이야기를 듣습니다.>', 39653),
(204758, 'koKR', '이것이 바로 강령군주의 무기이니라.', '', 39653),
(204757, 'koKR', '죽음의 영역을 수호할지어다.', '', 39653),
(204756, 'koKR', '굳건히 버텨라.', '', 39653),
(204755, 'koKR', '언제나 이 영역의 안위를 위해 싸워라.', '', 39653),
(204754, 'koKR', '압도하라.', '', 39653),
(204753, 'koKR', '집중하라.', '', 39653),
(204715, 'koKR', '켈투자드에게 데려다주십시오.', '켈투자드에게 데려다주십시오.', 39653),
(204714, 'koKR', '명령만 하게, 나락 방랑자.', '', 39653),
(204639, 'koKR', '오늘 죄악의 몰락지에 길이길이 남을 물건이 만들어지는 광경을 보게 될 것이다!', '', 39653),
(204638, 'koKR', '아, 다행이군. 조각사가 당도했으니, 손님들에게 특별한 대접을 할 수 있겠어.', '', 39653),
(204626, 'koKR', '어떤 조각상을 만들어주면 되는데?', '', 39653),
(204605, 'koKR', '', '검을 높이 들게! 말드락서스를 위하여!', 39653),
(204604, 'koKR', '', '지팡이를 시초자의 권좌로 돌려놓으세나. 우리의 승리를 돌아볼 기념품이 되어줄 걸세.', 39653),
(204590, 'koKR', '움직임이 대단한데, 나락 방랑자! 다음에는 당신을 따돌리고 말겠어!', '', 39653),
(204588, 'koKR', '진흙에서 태어나, 진흙으로 돌아간다는 말도 있는데...', '', 39653),
(204587, 'koKR', '다들 언젠가는 진흙 웅덩이에서 끝장날 운명이야. 누구나 그렇다니까.', '', 39653),
(204583, 'koKR', '%s|1이;가; 착한 아이답게 구석에서 볼일을 봅니다.', '%s|1이;가; 착한 아이답게 구석에서 볼일을 봅니다.', 39653),
(204581, 'koKR', '%s|1이;가; 킁킁대며 주변의 냄새를 맡습니다.', '%s|1이;가; 킁킁대며 주변의 냄새를 맡습니다.', 39653),
(204548, 'koKR', '', '산출의 촉매는 회복을 마친 영혼이 내어줄 보상의 수량을 증가시키는 효과가 있어요. \n\n여유만 있다면 산출의 촉매 여러 개를 사용할 수도 있죠', 39653),
(204547, 'koKR', '', '품질의 촉매는 회복을 마친 영혼이 내어줄 보상의 유형과 품질을 증진시키는 효과가 있어요. \n\n여유만 있다면 품질의 촉매 여러 개를 사용할 수도 있죠.', 39653),
(204545, 'koKR', '', '촉매를 활용하면 야생씨앗의 성장 방향성에 영향을 줄 수 있어요.\n\n다시 말하자면 정원의 촉매 밭에 촉매를 심으실 수 있게 됐단 얘기죠. 촉매를 심을 때 령의 맥이 어떻게 흘러가는지 보면 영향을 받을 야생씨앗을 분간하는 게 가능해요. \n\n단, 촉매를 놓더라도 이미 성장 중인 야생씨앗에게는 영향을 주지 못해요. \n\n촉매는 여러 종류가 존재하는데, 제각기 야생씨앗에 다른 영향을 준답니다.', 39653),
(204525, 'koKR', '이리 온, 야옹아. 이리 온.', '', 39653),
(204524, 'koKR', '모두 계획대로 되어가고 있어.', '', 39653),
(204523, 'koKR', '죽음의 승리가 임박했다.', '', 39653),
(204522, 'koKR', '켈투자드의 의지에 복종하라!', '', 39653),
(204521, 'koKR', '내 시간을 낭비하지 마라!', '', 39653),
(204520, 'koKR', '음? 무슨 일인가?', '', 39653),
(204519, 'koKR', '주인님께 입을 여는 걸 윤허하마.', '', 39653),
(204493, 'koKR', '당신의 이야기를 들려주십시오.', '당신의 이야기를 들려주십시오.', 39653),
(204489, 'koKR', '스콜더스의 전당', '스콜더스의 전당', 39653),
(204471, 'koKR', '썩은내장. 잔반. 남은 조각. 너 싸운다.', '', 39653),
(204403, 'koKR', '', '따라와라, 리치여. 추방당한 자께서 부르신다.', 39653),
(204402, 'koKR', '녀석의 운명은 자네 몫이 아니네.', '', 39653),
(204401, 'koKR', '뭐?! 켈투자드 놈의 숨이 붙어있는데 그냥 떠날 순 없지! 실버문의 복수를 이루고 말 테다!', '', 39653),
(204400, 'koKR', '메달을 확보했네. 이만 레벤드레스로 돌아가세나.', '', 39653),
(204399, 'koKR', '어리석은 후작 같으니. 이건 껍데기뿐인 승리라는 걸 모르겠느냐.', '', 39653),
(204398, 'koKR', '', '이제 말드락서스에 저지른 만행과... 내게 저지른 짓의 죗값을 치러라.', 39653),
(204397, 'koKR', '', '네 계획은 실패다, 찬탈자여!', 39653),
(204396, 'koKR', '네놈이 두려워할 존재는 우리가 아니다, 켈투자드!', '', 39653),
(204395, 'koKR', '이 침입자 놈들! 너희 운명을 거스르진 못할 것이다!', '', 39653),
(204394, 'koKR', '옳소, 남작. 레벤드레스도 함께하리다!', '', 39653),
(204391, 'koKR', '', '강령군주여, 물러서지 마라! 말드락서스의 존속이 우리 손에 달렸다!', 39653),
(204389, 'koKR', '놈이 우리 병력을 불태우고 있네! 이러다 밀리겠어!', '', 39653),
(204386, 'koKR', '너무 늦었어! 길은 이미 열렸다!', '', 39653),
(204356, 'koKR', '', '괴수는 노출 상태일세! 나락 방랑자, 어서 쓰러뜨리게! 우리가 엄호하겠네!', 39653),
(204353, 'koKR', '', '말드락서스를 위하여.', 39653),
(204352, 'koKR', '', '어떤 대가를 치르든 승리를 쟁취해라.', 39653),
(204351, 'koKR', '', '어떤 지식을 찾고 있나?', 39653),
(204350, 'koKR', '', '말해라, 필멸자여.', 39653),
(204349, 'koKR', '쳇, 재미없어.', '', 39653),
(204346, 'koKR', '나락 방랑자, 허드레꾼잡기 한 판 어때?\n\n뒤쫓고 싶은 마음도 들지 않게 온몸에 기름까지 발라뒀어!\n\n그 허약한 뼈마디가 문제거든, 진흙 웅덩이에 뛰어들기라도 해보지 그래?', '', 39653),
(204345, 'koKR', '이런, 거의 따돌릴 뻔했는데!', '', 39653),
(204233, 'koKR', '', '정원을 추가로 복원하면서 더 많은 야생씨앗과 그로 이어지는 촉매 밭을 활용할 수 있게 됐어요.\n\n촉매 밭은 야생씨앗에 영혼을 뉘기 전에 추가적인 은혜를 부여하는 데 쓰인답니다.\n\n촉매를 심으면 어떤 야생씨앗이 연결되었는지 한눈에 보일 거예요.', 39653),
(204210, 'koKR', '<위아래로 훑어보는 재봉사 로가나>\n\n연회욕 복장이라고 하기에는 좀... 색다른 선택이군요.\n\n제 상자에 더 잘 어울리는 게 있을 것 같은데요.', '<위아래로 훑어보는 재봉사 로가나>\n\n연회욕 복장이라고 하기에는 좀... 색다른 선택이군요.\n\n제 상자에 더 잘 어울리는 게 있을 것 같은데요.', 39653),
(204176, 'koKR', '하늘을 날고 싶으신가요? 예?', '하늘을 날고 싶으신가요? 예?', 39653),
(204170, 'koKR', '<석재 벽돌 네개를 건넵니다.>', '<석재 벽돌 네개를 건넵니다.>', 39653),
(204169, 'koKR', '석재 벽돌을 손에 넣었군. 어떤 걸 만드는 게 좋으려나?', '', 39653),
(204160, 'koKR', '정문에 새로운 조각상을 놓아둘 생각인데.\n\n어떤 조각상을 만드는 게 좋을까?', '', 39653),
(204152, 'koKR', '좋습니다. 그래도 조심하긴 하세요.', '좋습니다. 그래도 조심하긴 하세요.', 39653),
(204135, 'koKR', '', '<환영 너머로 새어나오는 대신 문베리의 킬킬거리는 웃음소리>\n\n제가 비밀로 감춰뒀던 환영을 찾아냈군요?\n\n그렇다고 해서 화나진 않았어요! 오히려 감명을 받았죠!', 39653),
(204130, 'koKR', '', '도전을 받아들이죠.', 39653),
(204129, 'koKR', '', '앞으로 당신에게 장난을 칠 경우에는 더 신중하게 계획을 짜야겠는데요.', 39653),
(204113, 'koKR', '그 매혹적인 모습을 다시 볼 수 있다면 좋으련만...', '그 매혹적인 모습을 다시 볼 수 있다면 좋으련만...', 39653),
(204111, 'koKR', '<거울 속의 모습을 바라보고는 길게 안도의 한숨을 내뱉는 모저>\n\n이렇게 멋진 모습이라면 온종일 볼 수도 있는데...', '<거울 속의 모습을 바라보고는 길게 안도의 한숨을 내뱉는 모저>\n\n이렇게 멋진 모습이라면 온종일 볼 수도 있는데...', 39653),
(204080, 'koKR', '이걸 신데인 후작께 가져다 드리면 켈투자드에게 맞설 수 있을지도 모른다.', '', 39653),
(204079, 'koKR', '잠깐... 시초자님의 지팡이 아닌가! 아직 온전하군!', '', 39653),
(203954, 'koKR', '', '볼일은 끝이다.', 39653),
(203953, 'koKR', '', '실패는 용납할 수 없다.', 39653),
(203952, 'koKR', '', '우린 기필코 말드락서스를 지배하리라.', 39653),
(203951, 'koKR', '', '내 인내심을 시험하지 마라.', 39653),
(203950, 'koKR', '', '얼간이에게 내어줄 시간은 없다.', 39653),
(203949, 'koKR', '', '무슨 용건이지?', 39653),
(203915, 'koKR', '좋다. 무기를 손에 넣었으니, 그 칼날을 갈아낼 때로다.', '', 39653),
(203913, 'koKR', '', '놈은 내게 맡겨라. 신념에 도취했을 때 놈이 어떤 능력을 발휘할 수 있는지 똑똑히 보지 않았나. 인내심을 갖고 기다리면... 탁월한 결과로 이어질 터.', 39653),
(203912, 'koKR', '...중요한 건 필요한 도구가 우리 수중에 들어왔다는 것이지. 준비를 시작해야 한다.', '', 39653),
(203907, 'koKR', '가세요!', '가세요!', 39653),
(203906, 'koKR', '1...', '1...', 39653),
(203905, 'koKR', '2...', '2...', 39653),
(203904, 'koKR', '3...', '3...', 39653),
(203890, 'koKR', '메필레스! 이 무능한 얼간이 녀석!', '', 39653),
(203852, 'koKR', '', '그대의 행동 덕분에 온 어둠땅이 우러러볼 본보기를 널리 알렸다. 수고 많았다.', 39653),
(203851, 'koKR', '', '그대를 부르노라, 필멸자여. 친절을 베풀어 주었으면 한다. 부름에 응하겠나?', 39653),
(203846, 'koKR', '', '그대는 다른 영역의 야수를 굳건히 마주하였다. 놈들을 격퇴하는 데 늦지 않았을지도. 고맙다.', 39653),
(203845, 'koKR', '', '그대의 용기가 필요하다. 이 괴물들은 모든 걸 닥치는 대로 먹어 치우지. 이 위협에 끝을 내 주거라!', 39653),
(203824, 'koKR', '', '백인대장! 전진! 침입자를 처단하라!', 39653),
(203811, 'koKR', '목적의 길을 믿으세요.', '', 39653),
(203810, 'koKR', '그분의 목소리에 축복을.', '', 39653),
(203809, 'koKR', '운명이 우리 모두를 이끌기를.', '', 39653),
(203808, 'koKR', '회랑을 어지럽히지 말아 주세요.', '', 39653),
(203807, 'koKR', '불멸의 도시를 보호해야만 합니다.', '', 39653),
(203806, 'koKR', '목적의 길을 따라야 합니다.', '', 39653),
(203804, 'koKR', '무엇을 찾으십니까, 필멸자여?', '', 39653),
(203803, 'koKR', '심판관님은 모두를 지켜보십니다.', '', 39653),
(203802, 'koKR', '당신을 도우라고 지시받았습니다.', '', 39653),
(203801, 'koKR', '오리보스에 오신 걸 환영합니다.', '', 39653),
(203800, 'koKR', '제발 저를 좀 내버려 두세요... 밤에는 혼자 있고 싶습니다.', '', 39653),
(203779, 'koKR', '백번 옳은 말이다. 난 그런 힘을 담아낼 수 없다. 하나 우리라면 가능하지.', '', 39653),
(203778, 'koKR', '', '그래, 레나탈 왕자. 당신은 놈을 잘 알지. 힘을 탐하다 어떻게 변해버렸는지도.', 39653),
(203777, 'koKR', '내 힘을 알지 않느냐? 받아들여라. 나와 다시... 하나가 되자.', '', 39653),
(203776, 'koKR', '레나탈...', '', 39653),
(203775, 'koKR', '', '그걸로 충분한가? 아직 메달을 전부 모은 것도 아니거늘.', 39653),
(203774, 'koKR', '아직이다. 여기서 물러나면 단순히 이 성채를 잃는 걸로 끝나지 않을 것이다.', '', 39653),
(203773, 'koKR', '', '켈투자드의 꼭두각시들이 곧 외벽을 돌파해올 거다. 이제 퇴각을 고려해야 한다.', 39653),
(203766, 'koKR', '|TInterface\\ICONS\\Ability_Fixated_State_Green.blp:20|t 찰나의 영혼이 당신에게 시선을 고정합니다!', '|TInterface\\ICONS\\Ability_Fixated_State_Green.blp:20|t 찰나의 영혼이 당신에게 시선을 고정합니다!', 39653),
(203716, 'koKR', '놈들을... 절대 그냥... 아아아아악!', '놈들을... 절대 그냥... 아아아아악!', 39653),
(203714, 'koKR', '', '놈들을 궁지로 몰았네! 발사!', 39653),
(203713, 'koKR', '너희 후작을 지키란 말이다!', '너희 후작을 지키란 말이다!', 39653),
(203712, 'koKR', '무능한 머저리들! 의회를 사수해라!', '무능한 머저리들! 의회를 사수해라!', 39653),
(203711, 'koKR', '으으으윽!', '으으으윽!', 39653),
(203654, 'koKR', '드라카 남작이 공격을 시작했네. 명령만 내리게. 자네를 전장으로 데려다 줄 테니.', '', 39653),
(203653, 'koKR', '잘 싸웠네, 나락 방랑자. 이제 켈투자드 차례로군.', '', 39653),
(203652, 'koKR', '리치가 보호막을 펼쳤네! 무기로는 방벽을 뚫지 못해!', '', 39653),
(203649, 'koKR', '방금 작렬로 완전히 절멸해 버렸군!', '', 39653),
(203648, 'koKR', '', '더... 가져야만... 한다고!', 39653),
(203647, 'koKR', '', '안 돼! 나는 약속받은 걸 받아낼 것이다! 어떻게 쟁취했는데!', 39653),
(203646, 'koKR', '', '드디어... 내게 걸맞은 힘을 손에 넣었구나!', 39653),
(203645, 'koKR', '', '난 네놈 따위에게 쓰러지지 않아!', 39653),
(203638, 'koKR', '아직도 침입자와 놀고 있나, 니나다르? 얼른 소멸시키지 못해!', '', 39653),
(203637, 'koKR', '', '알겠습니다, 주인님. 섬기는 것이 제 소명입니다.', 39653),
(203633, 'koKR', '', '준비는 됐겠지, 나락 방랑자? 저 리치들을 박살 내버려!', 39653),
(203629, 'koKR', '', '놈은 외세와 결탁해 시초자님의 뜻을 더럽히고 있다! 그리고 바로 오늘, 그 죗값을 치르게 될 것이다!', 39653),
(203628, 'koKR', '', '말드락서스의 수호자들이여! 켈투자드는 기만과 배반으로 우리의 위대한 의회들이 서로를 적대하게 만들었다.', 39653),
(203508, 'koKR', '말드락서스를 위하여!', '', 39653),
(203507, 'koKR', '승리란 하나의 의회가 차지하는 것이 아닌, 우리 성약의 단의 힘으로 쟁취하는 것이다.', '', 39653),
(203501, 'koKR', '책무란 섬기는 이들이 걸치는 어깨덧옷과 같다.', '', 39653),
(203498, 'koKR', '절제가 없는 힘은 낭비될 뿐이니.', '', 39653),
(203497, 'koKR', '적은 밖에서도, 안으로부터도 나타나는 법.', '', 39653);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(203496, 'koKR', '집중과 전략, 그리고 불굴.', '', 39653),
(203495, 'koKR', '지배의... 그릇을 말이다.', '', 39653),
(203494, 'koKR', '...저주받은 자의 왕에게 걸맞은 왕관.', '', 39653),
(203493, 'koKR', '그래. 네 걸작 한의 검과...', '', 39653),
(203492, 'koKR', '태초의 존재들이 숨기려 한 비밀을 말이지.', '', 39653),
(203491, 'koKR', '네놈의 가장 위대한 설계로... 최후의 전리품을 거머쥐리라.', '', 39653),
(203490, 'koKR', '<고통스러운 비명>', '', 39653),
(203489, 'koKR', '하지만 아직... 부족하다.', '', 39653),
(203488, 'koKR', '얼마나 많은 비밀을 뽑아냈던가. 그 사악한 설계로 내 군대를 위한 무기를 벼려냈지.', '', 39653),
(203487, 'koKR', '하나 망가진 물건이라도 쓰임새는 있기 마련이지.', '', 39653),
(203486, 'koKR', '어리석긴. 네 정신은 망가진 지 오래다.', '', 39653),
(203485, 'koKR', '난 무너지지 않는다... 무너지지... 않아...', '', 39653),
(203484, 'koKR', '네 꼴을 봐라. 한심한 것. 줄에 매달린 꼭두각시가 따로 없구나.', '', 39653),
(203483, 'koKR', '<신음>', '', 39653),
(203458, 'koKR', '', '음... 지금은 우리가 함께 지저귀어야 할 때예요.', 39653),
(203457, 'koKR', '', '제가 당신 목소리는 새 한 마리의 지저귐에 불과할 거라 했었죠.', 39653),
(203405, 'koKR', '찌르기', '찌르기', 39653),
(203399, 'koKR', '내키는 대로 궁정을 즐겨주세요.', '내키는 대로 궁정을 즐겨주세요.', 39653),
(203393, 'koKR', '바인! 안 돼!', '', 39653),
(203356, 'koKR', '보잘것없다.', '', 39653),
(203355, 'koKR', '한심한 필멸자여. 네 영혼은...', '', 39653),
(203352, 'koKR', '', '얼음 장애물 뒤로 엄폐하게!', 39653),
(203324, 'koKR', '누구나 주어진 의무를 다해야 하는 법.', '', 39653),
(203309, 'koKR', '해야 할 일이 많다.', '', 39653),
(203307, 'koKR', '우린 하나 되어 어둠에 맞설 것이다.', '', 39653),
(203306, 'koKR', '힘 닿는 데까지 돕겠다.', '', 39653),
(203305, 'koKR', '무슨 일인가?', '', 39653),
(203304, 'koKR', '어떤 일이 닥치든 우린 맞서리라.', '', 39653),
(203303, 'koKR', '과거의 사슬이 여전히 우리를 옥죄는구나.', '', 39653),
(203302, 'koKR', '더 암울한 날이 올 것 같아 염려되는군.', '', 39653),
(203301, 'koKR', '누구나 짊어져야 하는 짐이 있다.', '', 39653),
(203300, 'koKR', '지금까지 많은 일을 해왔지. 앞으로도 정진해야 할 것이다.', '', 39653),
(203299, 'koKR', '아제로스를 위해 싸워라.', '', 39653),
(203297, 'koKR', '', '토말린 아줌마의 품에서 지친 뼈를 쉬게 해보려무나!', 39653),
(203296, 'koKR', '', '내 요리는 말드락서스 최고의 진미지. 얼른 먹어보렴!', 39653),
(203295, 'koKR', '', '편히 쉬며 음료와 음식을 즐기렴. 여기선 우린 모두 친구니까.', 39653),
(203294, 'koKR', '', '토말린 아줌마는 언제나 여기 있을 거야!', 39653),
(203261, 'koKR', '균형은 반드시 회복되어야 한다.', '', 39653),
(203191, 'koKR', '', '소문은 화폐일 뿐, 그 이상도 이하도 아니에요.', 39653),
(203190, 'koKR', '', '일을 쓸데없이 복잡하게 만드시는군요, 레나탈 왕자님.', 39653),
(203189, 'koKR', '소문은 허드레꾼 웅덩이와 비슷하다. 빠르게 퍼져나가면서 모두를 더럽히고 말지.', '', 39653),
(203188, 'koKR', '왕자 레나탈이 망설임 없이 종이를 찢어발깁니다.', '', 39653),
(203171, 'koKR', '기억하거라, 내 가르침을.', '', 39653),
(203169, 'koKR', '내가... 곧... 레벤드레스다!', '', 39653),
(203168, 'koKR', '내가 너희 주인이다!', '', 39653),
(203167, 'koKR', '나는 영원하다!', '', 39653),
(203166, 'koKR', '날 여기 묶어둘 수는 없다!', '', 39653),
(203164, 'koKR', '', '시작해 볼까?', 39653),
(203163, 'koKR', '이제 네 녀석이 레벤드레스의 고결한 사명을 깨달아야 할 때다.', '', 39653),
(203160, 'koKR', '네가 입버릇처럼 하던 말이 있지. 벤티르는 파괴하는 대신 가르침을 줄 뿐이라고.', '', 39653),
(203157, 'koKR', '남은 병력은 전장을 샅샅이 훑도록. 신체 저장고를 채울 재료를 가져오너라!', '남은 병력은 전장을 샅샅이 훑도록. 신체 저장고를 채울 재료를 가져오너라!', 39653),
(203156, 'koKR', '저 백치를 잡아라!', '저 백치를 잡아라!', 39653),
(203154, 'koKR', '덤벼라, 배신자들아! 피조물의 의회는 몰락할 것이다!', '', 39653),
(203153, 'koKR', '출발해. 내가 이목을 끌어 주지.', '', 39653),
(203151, 'koKR', '죽은 척해라. 시체인 줄 알면 신체를 재활용하러 수집해갈 거다.', '', 39653),
(203140, 'koKR', '이렇게 된 이상 전략을 바꾸지.', '', 39653),
(203139, 'koKR', '놈들 수가 너무 많아. 무력으로 돌파하는 건 무리야.', '', 39653),
(203135, 'koKR', '필연 앞에 굴복해라!', '', 39653),
(203126, 'koKR', '근사한 장식들이 모조리 망가지기 전에, 저 너저분한 것을 치워야 하는데!', '', 39653),
(203120, 'koKR', '', '고맙다, 나락 방랑자. 영혼들은 보살핌을 받게 될 거다.', 39653),
(203119, 'koKR', '', '공포추적자의 희망파괴자들이 영혼들을 내버렸다. 영혼들을 고난에서 구해주거라.', 39653),
(203116, 'koKR', '신입 안내에 대해 더 말씀해 주십시오.', '신입 안내에 대해 더 말씀해 주십시오.', 39653),
(203046, 'koKR', '', '부탁인데 말 좀 그만 걸어주십시오. 전 주절거릴 마음이 없습니다.', 39653),
(203044, 'koKR', '', '오리보스에 오신 것을 환영합니다.', 39653),
(203043, 'koKR', '', '모든 영혼은 제 자리가 있습니다.', 39653),
(203042, 'koKR', '', '심판관님은 모든 걸 보십니다.', 39653),
(203041, 'koKR', '', '무엇을 도와드릴까요, 필멸자여?', 39653),
(203040, 'koKR', '', '목적의 길이 당신을 데려왔군요.', 39653),
