(203002, 'koKR', '', '정말로 대단한 발견을 했군. 끝수렁 만개꽃에는 포식자를 진정시키는 효과가 있어. 그럼 녀석들을 길들일 수도 있지.\n\n하지만 그 효과는 일시적이야. 그 짐승을 고분고분하게 만들려면, 계속 만개꽃을 먹여야 해.\n\n그렇게 할 준비는 되어 있겠지?', 39653),
(203000, 'koKR', '', '내게 뭘 가져왔나?', 39653),
(202999, 'koKR', '', '포식자는 정말로 흥미로운 생명체라니까.', 39653),
(202914, 'koKR', '사용 능력인 장비와 달리 부적은 영혼결속자를 지속적으로 강화한다. 한 번 사용하면 안에 담긴 힘이 소진해 버리니, 반드시 여러 개를 만들어 둬야 하느니라!\n\n부적은 제각기 하나씩만 착용할 수 있으나, 유형에 얽매이지 않고 원하는 만큼 쓸 수 있다. 마음 가는 대로 혼합하고 맞춰서 사용해 보도록.', '', 39653),
