(202496, 'koKR', '', '그대의 노력을 치하하노라. 승천의 보루의 은총을 받아 마땅하리. 헤라클로는 건재하다!', 39653),
(202495, 'koKR', '', '이탈자가 우리의 가장 강력한 수호자중 하나를 없애려 하고 있다. 헤라클로라는 백인대장 거신을 찾아 무슨 수를 써서라도 수호하거라!', 39653),
