(202415, 'koKR', '', '과찬이세요.', 39653),
(202414, 'koKR', '다들 주목해주게! 승천의 보루에서 찾아와서 자애롭게 힘을 보태줬던 클레이아와 펠라고스를 위해 건배할 터이니!', '', 39653),
