(202304, 'koKR', '|cfff2e699+추가 만족도|r', '|cfff2e699+추가 만족도|r', 39653),
(202303, 'koKR', '|cff34cceb+추가 시간|r', '|cff34cceb+추가 시간|r', 39653),
(202301, 'koKR', '%s|1이;가; 군중 제어 효과에 면역이 되고 있습니다! ', '%s|1이;가; 군중 제어 효과에 면역이 되고 있습니다! ', 39653),
(202233, 'koKR', '', '친구가 시카를 도와줬으니, 시카도 친구 데려왔어요.\n\n지저분한 거 치우는 친구예요. 근데 나락 방랑자님도 친구잖아요?\n\n나락 방랑자님도... 지저분한 걸 치워야 하나?\n\n<주변의 다른 사람을 보곤 정신이 팔려버린 시카>\n\n재밌게 놀래요! 궁정 재밌어요!', 39653),
(202227, 'koKR', '나락 방랑자님의 왕자가 의도한 목표를 달성하지 못하더라도 이번 궁정은 이미 성공을 거둔 셈입니다.\n\n한번 주변을 둘러보세요.\n\n제각기 다른 영역에 뿌리를 둔 주민들이 어깨를 나란히하고 공통점을 찾아가고 있지 않습니까.\n\n희망을 고취하는 광경이죠.\n\n이 희망이 단결로, 단결에서 평화로 이어지면 좋겠습니다.', '', 39653),
(202226, 'koKR', '', '염치 불고하고 펠라고스와 같이 다른 두 열망자를 초대했습니다.\n\n훌륭한 잠재력이 돋보이는 사람들이에요. 집정관님께서도 이번 여정이 견문을 크게 넓힐 기회라는 데 동의하셨습니다.\n\n우리 모두 서로를 보고 배울 점이 많이 남아있으니 말이죠.', 39653),
(202224, 'koKR', '', '궁금한 게 있습니다, 나락 방랑자님. 레벤드레스를 진정한 고향으로 여기십니까?\n\n왕자 레나탈을 주군으로 모시는 게 맞는지요?\n\n<당신 너머를 바라보는 수풀사령관>\n\n제가 필멸자 시절 몸담았던 고향은 이제 없습니다. 파괴됐죠.\n\n하지만 겨울 여왕님의 몽환숲이 고향처럼 느껴집니다.\n\n<깊은 한숨을 내쉬는 수풀사령관>\n\n방랑자님의 왕자가 고려해 달라고 한 말은... 쉬이 결론을 낼 수 있는 문제가 아니랍니다.', 39653),
(202222, 'koKR', '허드레꾼이 시중을 들게 하니 신선하면서도 참 좋습니다.\n\n<뿌듯한 미소를 지으며 가슴에 힘을 잔뜩 주는 렌들>\n\n진흙같이 더러운 세상에서 이 렌들에게도 볕들 날이 오긴 오는군요.', '', 39653),
(202219, 'koKR', '저도 궁정에 와본 경험은 많습니다. 연회랍시고 근사하게 빼입은 양반들을 몇 번이고 내려다 줬죠!\n\n한데 이번에는 제가 근사하게 빼입고 참석하는 입장이 됐네요. 하!', '', 39653),
(202112, 'koKR', '|TInterface\\Icons\\ABILITY_HUNTER_ASSASSINATE2.BLP:20|t |cFFFF0000|Hspell:335114|h[죄악의 추적자]|h|r의 대상으로 지정되었습니다!', '|TInterface\\Icons\\ABILITY_HUNTER_ASSASSINATE2.BLP:20|t |cFFFF0000|Hspell:335114|h[죄악의 추적자]|h|r의 대상으로 지정되었습니다!', 39653),
