(201901, 'koKR', '', '주인은 대체 어디까지 타락할 셈이던가!', 39653),
(201900, 'koKR', '주인이 영혼을 타락시켜서 무기로 만들었구나!', '', 39653),
(201859, 'koKR', '', '드러스트 이 성가시기 짝이 없는 녀석들! 숲과 야생씨앗을 지켜내지 못하면 지금까지의 노력이 모두 물거품이 되고 말 거예요!', 39653),
(201739, 'koKR', '', '껍데기는 썩게 두어라!', 39653),
(201738, 'koKR', '', '놈들의 령은 우리 승리의 자양분이 될 것이다.', 39653),
(201699, 'koKR', '토르가스트 잠금 해제', '토르가스트 잠금 해제', 39653),
(201698, 'koKR', '간수의 눈 잠금 해제', '간수의 눈 잠금 해제', 39653),
(201690, 'koKR', '물론 보시다시피... 제나에게 다가가려면 아직 갈 길이 멀지만요.', '', 39653),
(201532, 'koKR', '최선을 다하겠습니다. 무엇을 잃어버리셨나요?', '최선을 다하겠습니다. 무엇을 잃어버리셨나요?', 39653),
(201517, 'koKR', '', '우리의 책무는 필멸자의 영혼을 어둠땅으로 인도하는 것이니라. 그러니 영원히 밖으로 내보내는 것쯤은... 일도 아니다.', 39653),
(201516, 'koKR', '', '조심해라. 승천의 보루에는 성가신 필멸자들을 떨어뜨릴 높은 곳이 아주 많다.', 39653),
(201515, 'koKR', '', '감히 나를 성가시게 하다니 용감한 건지 어리석은 건지 모르겠구나. 나는 어리석은 행동이라 판단한다.', 39653),
(201514, 'koKR', '다시 한번 달의 시야를 부여해줄 수 있겠습니까?', '다시 한번 달의 시야를 부여해줄 수 있겠습니까?', 39653),
(201501, 'koKR', '', '도와주세요! 심장나무 터가 공격받고 있어요!', 39653),
(201466, 'koKR', '마법 인장 깨뜨리기', '마법 인장 깨뜨리기', 39653),
(201465, 'koKR', '도구를 찾아드리겠습니다.', '도구를 찾아드리겠습니다.', 39653),
(201463, 'koKR', '괜찮으세요?', '괜찮으세요?', 39653),
(201413, 'koKR', '은빛십자군과 함께하겠습니다.', '은빛십자군과 함께하겠습니다.', 39653),
(201405, 'koKR', '오늘 우린 이오아나를 기립니다!\n\n이오아나는 때로 슬퍼합니다. 하지만 이오아나는 우리 중에 제일 똑똑합니다. \n\n청지기의 쉼터에서 찾을 수 있습니다.\n\n잘 익은 퓨리안 열매를 전해 주시겠어요?', '', 39653),
(201386, 'koKR', '', '우리의 길을 존중하라, 필멸자여.', 39653),
(201385, 'koKR', '', '길을 믿어라.', 39653),
(201384, 'koKR', '', '책무를 다해라.', 39653),
(201379, 'koKR', '', '과거는 서막일 뿐이다.', 39653),
(201378, 'koKR', '', '인내하고, 감내하라.', 39653),
(201370, 'koKR', '', '길을 따라 나아가라.', 39653),
(201369, 'koKR', '', '책무를 끝까지 수행하리라.', 39653),
(201368, 'koKR', '', '너에게 큰 기대를 걸고 있다.', 39653),
(201367, 'koKR', '', '넌 승천자와 함께하고 있노라.', 39653),
(201365, 'koKR', '', '책무와 헌신.', 39653),
(201364, 'koKR', '', '가까이 다가오거라.', 39653),
(201363, 'koKR', '', '말하라, 필멸자여.', 39653),
(201362, 'koKR', '', '길이 널 우리에게로 인도한 것이니라.', 39653),
(201361, 'koKR', '', '네 말을 들어 보겠노라.', 39653),
(201357, 'koKR', '그게 무슨 뜻이죠?', '그게 무슨 뜻이죠?', 39653),
(201253, 'koKR', '', '구할 만큼 구했으니, 이걸로 충분할 거예요.', 39653),
(201245, 'koKR', '', '마음껏 헤엄치렴, 꼬마야.', 39653),
(201229, 'koKR', '', '아카렉 님을 위하여!', 39653),
(201228, 'koKR', '가증스러운 첩자 같으니! 너와 네 몰락한 의회를 저주한다!', '', 39653),
(201227, 'koKR', '', '그 어리석음이 네 죽음을 자초했구나.', 39653),
(201226, 'koKR', '', '얼간이 녀석은 바로 너다, 모르비탄.', 39653),
(201225, 'koKR', '안 돼! 의식이... 엉망이 됐잖아!', '', 39653),
(201224, 'koKR', '드디어! 새 남작께서 친히 약속하신 힘이 비로소--', '', 39653),
(201223, 'koKR', '주인님, 준비는 모두 끝났습니다. 도착하실 때까지 기다리겠습니다.', '', 39653),
(201222, 'koKR', '', '덫은 준비됐다. 이제 모르비탄을 유인해 파멸을 맞게 하는 거다.', 39653),
(201218, 'koKR', '', '우리에 마법을 부여해서 게걸충이 다시는 달아나지 못하게 해야겠어요.', 39653),
(201217, 'koKR', '', '나락 방랑자님은 대체 무슨 재주로 해내신 건지...', 39653),
(201198, 'koKR', '|TINTERFACE\\ICONS\\Spell_Necro_InevitableEnd.blp:20|t 해골송곳니가 숨을 깊게 들이쉬고 |cFFFF0404|Hspell:333493|h[괴저 숨결]|h|r을 준비합니다!', '|TINTERFACE\\ICONS\\Spell_Necro_InevitableEnd.blp:20|t 해골송곳니가 숨을 깊게 들이쉬고 |cFFFF0404|Hspell:333493|h[괴저 숨결]|h|r을 준비합니다!', 39653),
(201185, 'koKR', '버섯전사는 부패 속에서만 성장합니다! 돌아가야 합니다!', '버섯전사는 부패 속에서만 성장합니다! 돌아가야 합니다!', 39653),
(201170, 'koKR', '이럴 순 없는데!', '', 39653),
(201089, 'koKR', '밤의 포용이 함께하길.', '', 39653),
(201088, 'koKR', '도와주셔서 정말 감사합니다!', '', 39653),
(201087, 'koKR', '실례지만 혹시... 필멸자이십니까?', '', 39653),
(201086, 'koKR', '페더라이트의 친구는 제 친구이기도 하지요.', '', 39653),
(201073, 'koKR', '친애하는 제나, 그 동작이 제 특기랍니다.', '', 39653),
(201072, 'koKR', '', '제나가 이벤에게 윙크를 합니다.', 39653),
(201071, 'koKR', '', '중심을 잃고 빙글빙글 도는 게 특히 재밌어 보이더군요.', 39653),
(201070, 'koKR', '', '아까 보여준 동작 몇 가지는 제가 배워야 할 정도던데요.', 39653),
(201069, 'koKR', '물론입니다, 제나 아가씨. 당신과 함께 춤추는 건 오늘 밤 최고의 영예가 될 거예요.', '', 39653),
(201068, 'koKR', '이벤이 얼굴을 붉히더니 말을 더듬으며 대답합니다.', '', 39653),
(201067, 'koKR', '', '신사분께 춤 상대를 청해도 괜찮을까요?', 39653),
(201066, 'koKR', '', '방해해서 죄송해요. 멀리서도 열정적으로 춤추는 모습이 눈에 띄어서 말이죠.', 39653),
(201065, 'koKR', '이 춤에 숙달하면 제나의 마음을 사로잡을 무기로 삼을 겁니다!', '', 39653),
(201064, 'koKR', '춤 연습을 도와주셔서 감사합니다, 나락 방랑자님.', '', 39653),
(200990, 'koKR', '물러날 줄 아는 것도 지혜입니다. 멀리... 더 멀리.', '', 39653),
(200989, 'koKR', '의무 역시 지혜의 한 종류라 할 수 있습니다.', '', 39653),
(200988, 'koKR', '슬픔의 길은 미련으로 만들어진 것입니다.', '', 39653),
(200986, 'koKR', '여정을 계속하시길.', '', 39653),
(200985, 'koKR', '지혜를 찾으십니까?', '', 39653),
(200984, 'koKR', '당신을 도울 준비가 되었습니다.', '', 39653),
(200983, 'koKR', '어떻게 인도되길 원하십니까?', '', 39653),
(200982, 'koKR', '앞으로 나와 얘기해 보시지요.', '', 39653),
(200981, 'koKR', '', '내 숙적이 왔군. 날 속일 순 없다. 어떤 껍질을 쓰고 있더라도 말이다. 아, 그대였군. 잊어주게.', 39653),
(200980, 'koKR', '', '길은 자명하다.', 39653),
(200979, 'koKR', '', '집정관님과 승천의 보루를 위하여.', 39653),
(200978, 'koKR', '', '언제나 전진하라.', 39653);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(200976, 'koKR', '', '집정관님을 위하여.', 39653),
(200975, 'koKR', '', '듣고 있다.', 39653),
(200974, 'koKR', '', '두려워 말고 말해 보거라.', 39653),
(200973, 'koKR', '', '환영한다, 용감한 영혼이여.', 39653),
(200972, 'koKR', '', '쉽게 벗어날 수 없는 고뇌도 있기 마련입니다.', 39653),
(200971, 'koKR', '', '잘 가십시오. ', 39653),
(200969, 'koKR', '', '가서 책무를 다하세요.', 39653),
(200968, 'koKR', '', '그대의 고뇌는 두고 가십시오.', 39653),
(200967, 'koKR', '', '고뇌를 내려놓으십시오.', 39653),
(200966, 'koKR', '', '고민이 있으십니까?', 39653),
(200965, 'koKR', '', '듣고 있습니다.', 39653),
(200964, 'koKR', '', '제가 도와드리겠습니다.', 39653),
(200950, 'koKR', '|TInterface\\ICONS\\ABILITY_CREATURE_DISEASE_03.BLP:20|t |cFFF00000|Hspell:332748|h[감염됨] 상태가 되었습니다!|h|r', '|TInterface\\ICONS\\ABILITY_CREATURE_DISEASE_03.BLP:20|t |cFFF00000|Hspell:332748|h[감염됨] 상태가 되었습니다!|h|r', 39653),
(200947, 'koKR', '새 모습에 적응을 마치시는 대로 춤을 시작하지요.', '', 39653),
(200946, 'koKR', '저랑 한 곡 추실까요?', '저랑 한 곡 추실까요?', 39653),
(200945, 'koKR', '재치를 발휘해 제나와 머리 색깔은 다르게 바꿨습니다. 아무도 의심 안 할 거예요!', '재치를 발휘해 제나와 머리 색깔은 다르게 바꿨습니다. 아무도 의심 안 할 거예요!', 39653),
(200944, 'koKR', '이런 청도 받아주시고, 아량이 바다처럼 넓으십니다.', '', 39653),
(200937, 'koKR', '정말이십니까? 아, 마음에 한결 놓이네요.\n\n나락 방랑자님과 연습을 좀 하고 나면 자신감이 붙을 것 같습니다.\n\n<어수선하게 발을 동동 구르는 이벤>\n\n문득 든 생각인데, 제나하고 닮은 사람과 춤추면 훨씬 더 도움이 될 것 같습니다...\n\n제나의 몸놀림은 $pr|1과;와; 사뭇 다르거든요.\n\n혹시... 나락 방랑자님만 괜찮으시다면...\n\n<희망에 찬 눈빛으로 고개를 드는 이벤>\n\n당신을 다른 모습... 제나를 닮은 모습으로 변신시켜도 괜찮을까요? 당연히 영구적인 건 아닙니다.', '', 39653),
(200935, 'koKR', '아. 실례했습니다, 나락 방랑자님.\n\n제가 길을 막았나 보군요. 죄송합니다...\n\n<우아한 무용수들을 처량한 눈빛으로 바라보는 이벤>\n\n하필이면 영 좋지 않은 시기에 절 찾아오셨습니다.\n\n사실... 전 얼마 전에야 벤티르가 된 몸인지라, 저들의... 아니, 우리의 무용에 대해 그야말로 문외한이나 다름없거든요.\n\n실력이 없을 뿐이지 배우고 싶은 마음만큼은 충만합니다. 훗날 저의 연인이 되어줄 제나와 직접 춤추려면 반드시 배워야 하거든요!', '', 39653),
(200905, 'koKR', '', '구원의 여지도 없었다. 잘 싸웠다.', 39653),
(200904, 'koKR', '', '마귀들이 내 사원을 이 이상 헤집고 다니지 못하게 하겠다. 전부 쫓아내거라.', 39653),
(200901, 'koKR', '|TInterface\\ICONS\\Ability_DemonHunter_VengefulRetreat.blp:20|t 도미나가 당신을 |cFFFF0000|Hspell:331818|h[그림자 매복]|h|r의 대상으로 지정합니다!', '|TInterface\\ICONS\\Ability_DemonHunter_VengefulRetreat.blp:20|t 도미나가 당신을 |cFFFF0000|Hspell:331818|h[그림자 매복]|h|r의 대상으로 지정합니다!', 39653),
(200898, 'koKR', '분리', '분리', 39653),
(200866, 'koKR', '|TInterface\\Icons\\Sha_Ability_Rogue_BloodyEye_nightmare.blp:20|t 데나트리우스가 당신을 |cFFFF0000|Hspell:332797|h[치명적인 기교]|h|r로 베어버릴 준비를 합니다!', '|TInterface\\Icons\\Sha_Ability_Rogue_BloodyEye_nightmare.blp:20|t 데나트리우스가 당신을 |cFFFF0000|Hspell:332797|h[치명적인 기교]|h|r로 베어버릴 준비를 합니다!', 39653),
(200776, 'koKR', '하하! 이게 진짜 재미지!', '', 39653),
(200730, 'koKR', '', '우린 하나 되어 이 영역의 평화와 질서를 되찾을 것이다. 승천의 보루에 영광을!', 39653),
(200729, 'koKR', '', '바로 오늘, 우리는 이들을 신성한 성약의 일원으로 맞이하노라.', 39653),
(200727, 'koKR', '', '이들은 우리의 대의를 받들며 침략에 맞서 우리의 사원을 지켜냈다.', 39653),
(200725, 'koKR', '', '이 필멸자는 우리의 길에 오른 지 얼마 되지 않았으나, 승천자의 전당에 널리 울려 퍼질 족적을 남겼노라.', 39653),
(200658, 'koKR', '', '반가워요, $n 님!\n\n시간여행에 대해 물어보러 오신 건가요? 그런데 과거로 가기 전에, 먼저 현재에 더 익숙해지실 필요가 있을 것 같아요.\n\n도시 관광을 마치고 국왕님을 만나뵙고 오시면 그때 과거로 보내 드릴게요!', 39653),
(200630, 'koKR', '', '하지만 나락을 탈출하는 방법을 찾은 거라면... 우리에게 도움이 될 수도 있어요.', 39653),
(200612, 'koKR', '파내는 중', '파내는 중', 39653),
(200578, 'koKR', '바치기', '바치기', 39653),
(200540, 'koKR', '마음껏 드세요, 나락 방랑자님.\n\n손님들도 승천의 보루 요리를 좋아하더라고요.\n\n허드레꾼도 마찬가지였어요. 요리법 쓰는 걸 도와줬어요. 제 요리책 좀 보세요!', '', 39653),
(200539, 'koKR', '긴수염 감자전\n\n스튜어트의 메모: 다른 열망자님이 알려주신 조리법이에요. 필멸자 시절 롱비어드 가문에서 배웠다고 하더라고요. 당사자에게 듣기론 수 세대에 걸쳐 다듬은 조리법이라고 해요. 전 토씨 하나도 안 바꿨어요.\n\n재료:\n알감자 5개\n밀가루 1컵, 필요하면 추가\n달걀 1개\n가염 버터 2큰술\n드워프 스타우트 맥주 1통 (목 축이기용)\n\n준비:\n<이 부분에 허드레꾼들이 알아보기 어려운 낙서를 해놨습니다.>', '', 39653),
(200538, 'koKR', '긴수염 스튜\n\n스튜어트의 메모: 승천의 보루 열망자님이 알려주신 조리법이에요. 생전에 위대한 드워프 주방장이셨다고 해요. 시련을 통과하실 때 알려주셨답니다. 과거를 놓아주는 의미에서요. 가장 좋아하는 조리법이라고 하셨어요.\n\n재료:\n소고기 덩어리 1.5근\n다진 베이컨 6온스\n거품이 풍부한 드워프 스타우트 맥주 16온스\n소고기 육수 1컵\n걸쭉한 토마토 1/4컵\n우스터 가문 특제 양념 2큰술\n하얀 밀가루 3큰술\n다진 부추 2개\n다진 당근 3개\n다진 파스닙 1개\n백리향 1작은술\n로즈메리 1작은술\n소금 1.5작은술\n후추 1/4작은술\n메네실 만 잎사귀 2개\n\n준비:\n<이 부분은 아직 허드레꾼들이 옮겨놓지 않았습니다.>', '', 39653),
(200533, 'koKR', '스튜어트의 조리법 모음\n\n(옮긴 이: 여러 명의 반쪽짜리 문맹 허드레꾼)\n\n목차:', '', 39653),
(200504, 'koKR', '[DEPRECATED] Hibernal Hollow... my grove was sacrificed so groves like this could survive.', '', 39653),
(200503, 'koKR', '여왕님께서는 가장 많은 짐을 지고 계십니다. 우리라도 도와드려야 해요.', '', 39653),
(200502, 'koKR', '', '겨울 여왕님도 그렇지요...', 39653),
(200501, 'koKR', '죄송합니다, 니야. 야생 사냥단이 그 곳에 있었더라면... 비록 우리는 넓고 얕게 흩어져 있지만요.', '', 39653),
(200500, 'koKR', '', '저도 제 숲을 잃어버렸죠... 가뭄 때문은 아니었어요. 가면 쓴 페이에게 당했죠. 심지어 제 친구들까지...', 39653),
(200499, 'koKR', '항상 용맹한 건 아니었죠. 전 최근에 야생 사냥단에 들어왔습니다... 다른 이들을 살리기 위해 제 숲을 잃게 되면서요.', '', 39653),
(200498, 'koKR', '', '[DEPRECATED] I only hope... that the hollow survives where my own grove did not.', 39653),
(200497, 'koKR', '', '[DEPRECATED] Dreamweaver instructed us to bring it to Hibernal Hollow in the hopes that it may be saved.', 39653),
(200494, 'koKR', '', '우릴 호위해줘서 고마워요, 아라론. 용맹한 사냥꾼이 우릴 지켜준다는 사실에 한시름 놓게 되네요.', 39653),
