(199235, 'koKR', '엄연히 한 구성원이시니 언제든지 가문 금고를 이용하실 수 있지요.', '', 39653),
(199234, 'koKR', '그린친 가문의 존귀한 일원을 만나 뵈어 영광입니다.', '', 39653),
(199232, 'koKR', '거 참, 그린친 가문 소속이 아닌 사람이나 할 법한 질문을 콕 짚어서 하시는군요!\n\n<미소를 지어 보이는 돌 마귀>\n\n헤, 어차피 전 신경 안 씁니다...\n\n제가 받은 명령은 명확합니다. 영원히 이 보물 상자에 앉아 그린친 가문 반지를 가진 사람에게만 열어줄 것.\n\n해괴망측하게 생긴 이방인 질문에 답하지 말란 내용은 없었다, 이 말이죠.\n\n<아주 느릿하게 윙크를 하는 돌 마귀>\n\n이곳을 뒤지다 보면 그린친 가문 반지를 찾을 수 있을 겁니다요. 그럼 우리 둘 다 일과에 살짝 흥미를 더할 수 있겠죠?', '', 39653),
(199230, 'koKR', '그린친 가문이십니까?\n\n그린친 가문 구성원만이 가문 보물 상자를 사용할 수 있습니다.', '', 39653),
(199214, 'koKR', '기대 이상의 성과로군.', '', 39653),
(199213, 'koKR', '포식자는 탐욕스러운 생물이지. 하나 그 끝을 모르는 갈망을 유리하게 이용할 수 있다. 끝수렁에서 한 마리를 길들인 후 적을 쓸어버리도록.', '', 39653),
(199199, 'koKR', '', '불안정한 고통은 지속 피해를 입히는 강력한 주문입니다. 적에게 시전하는 다른 모든 주문의 공격력도 증가시키죠.', 39653),
