(196962, 'koKR', '', '호드와 함께하면 심심할 겨를이 없죠.', 39653),
(196961, 'koKR', '', '이 섬이 제 목숨을 앗아갈지 궁금하네요. 또 말이죠.', 39653),
(196960, 'koKR', '실험을 멈추지 말게나!', '', 39653),
(196959, 'koKR', '다음에 또 봅세!', '', 39653),
(196958, 'koKR', '적당히 조심하게나!', '', 39653),
(196956, 'koKR', '강령술이라니! 정신이 나갔군!', '', 39653),
(196955, 'koKR', '금지된 마법의 힘이 필요한가?', '', 39653),
(196954, 'koKR', '실험에 참여할 생각은 없나?', '', 39653),
(196952, 'koKR', '', '평화를 찾으시길.', 39653),
(196951, 'koKR', '', '안쉬가 그대를 인도하길.', 39653),
(196950, 'koKR', '', '대지모신의 가호를 빕니다.', 39653),
(196949, 'koKR', '', '반가워요.', 39653),
(196948, 'koKR', '', '이 병든 땅을 치유해야 해요.', 39653),
(196947, 'koKR', '', '이 섬이 고통으로 울부짖고 있어요.', 39653),
(196946, 'koKR', '', '힘과 명예를.', 39653),
(196945, 'koKR', '', '경계를 늦추지 말게.', 39653),
(196944, 'koKR', '', '정령이 그대를 인도하길.', 39653),
(196943, 'koKR', '', '신병이 번개를 맞으면 어떻게 되는지 알고 있나? 한번 보여줄까?', 39653),
(196942, 'koKR', '', '이러려고 지원한 건 아니었는데.', 39653),
(196941, 'koKR', '', '자네 같은 신병은 조심하라고들 하더군.', 39653),
(196940, 'koKR', '', '승리는 호드의 것일세.', 39653),
(196939, 'koKR', '', '어떻게든 해내고 말 걸세.', 39653),
(196938, 'koKR', '', '다른 이들을 구해야 하네.', 39653),
(196937, 'koKR', '', '기개를 잃지 말게!', 39653),
(196936, 'koKR', '', '수련을 멈추지 말게.', 39653),
(196935, 'koKR', '', '다시 보니 반갑군.', 39653),
(196934, 'koKR', '', '록타르!', 39653),
(196933, 'koKR', '', '이 오우거 놈들, 호드 앞에 벌벌 떨게 될 걸세!', 39653),
(196932, 'koKR', '', '힘을 합쳐 이 의식에 종지부를 찍읍세.', 39653),
(196931, 'koKR', '', '호드는 이보다 더한 역경도 이겨냈어.', 39653),
(196930, 'koKR', '', '호드를 위하여!', 39653),
(196929, 'koKR', '', '한시라도 방심은 금물일세.', 39653),
(196928, 'koKR', '', '도처에 위험이 깔렸으니 정신 바짝 차리게.', 39653),
(196927, 'koKR', '', '나도 자네 같은 시절이 있었지. 매가 약이라는 걸 모르던 시절 말이야.', 39653),
(196926, 'koKR', '', '손가락 하나쯤은 없어도 되는 모양이지, 신병?', 39653),
(196925, 'koKR', '', '계속 그렇게 나오면 도끼를 휘두르는 수밖에 없네.', 39653),
(196924, 'koKR', '', '우리 임무에 집중하게.', 39653),
(196923, 'koKR', '', '호드는 그 누구도 버리지 않네.', 39653),
(196922, 'koKR', '', '원정대를 찾기 전까진 멈추지 않을 걸세.', 39653);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(196912, 'koKR', '잘 붙어 다니세요. 영웅 노릇엔 당신이 빠삭할지 몰라도, 레벤드레스는 제가 꿰고 있다고요.', '', 39653),
(196911, 'koKR', '주변에 당신에 대해 좋게 말해둘게요.', '', 39653),
(196910, 'koKR', '조심하세요. 가뭄이 든 이후로 이곳이 훨씬 더 위험해졌습니다.', '', 39653),
(196909, 'koKR', '부탁이니 윗선에는 농땡이 부린다고 이르지 말아 주세요.', '', 39653),
(196908, 'koKR', '뭐든 날개나 송곳니 달린 건 믿지 마세요.', '', 39653),
(196907, 'koKR', '미행은 없었겠죠?', '', 39653),
(196906, 'koKR', '어떤 윗사람이 보낸 겁니까?', '', 39653),
(196905, 'koKR', '당신이 다녀본 영역을 볼 수만 있다면 다른 사람 눈도 바칠 텐데 말이죠.', '', 39653),
(196904, 'koKR', '나락이 점점 커지더군요. 당신 소행입니까?', '', 39653),
(196903, 'koKR', '당신이 잡아먹히면 그 멋진 신발은 제 겁니다.', '', 39653),
(196898, 'koKR', '당신은 만드는 쪽인가요, 부수는 쪽인가요?', '', 39653),
(196897, 'koKR', '언제까지고 이딴 시궁창에 머물진 않을 겁니다. 두고 보세요. 영역에서 알아주는 도둑이 될 테니까!', '', 39653),
(196896, 'koKR', '전 불신 가득한 진짜배기 악당이 될 겁니다. 영향력, 돈, 추종자를 잔뜩 거느린 악인 말이죠!', '', 39653),
(196895, 'koKR', '봐가면서 건드리시죠. 전 위대한 운명을 타고났단 말입니다.', '', 39653),
(196894, 'koKR', '영웅이라. 쯧. 그런 양반들이 하루살이 인생을 알기나 할런지.', '', 39653),
(196893, 'koKR', '여어!', '', 39653),
(196892, 'koKR', '이번 가뭄으로 우리 모두 파국을 맞을 겁니다.', '', 39653),
(196888, 'koKR', '|TInterface\\Icons\\Sha_Ability_Rogue_BloodyEye_nightmare.blp:20|t 데나트리우스가 당신을 |cFFFF0000|Hspell:327039|h[식사 시간]|h|r의 대상으로 지정합니다!', '|TInterface\\Icons\\Sha_Ability_Rogue_BloodyEye_nightmare.blp:20|t 데나트리우스가 당신을 |cFFFF0000|Hspell:327039|h[식사 시간]|h|r의 대상으로 지정합니다!', 39653),
(196833, 'koKR', '땀 좀 흘리러 오셨습니까? ...아니면 주먹질 좀 하러?', '', 39653),
(196832, 'koKR', '건수 좀 가져오셨나요?', '', 39653),
(196809, 'koKR', '당신, 레벤드레스에 올 사람이 맞긴 해요?', '', 39653),
(196765, 'koKR', '당신 같은 사람이 여긴 무슨 일이죠?', '', 39653),
(196763, 'koKR', '하늘을 조심하세요. 당신을 지켜보고 있으니.', '', 39653),
(196762, 'koKR', '', '폭풍의 일격을 최대한 자주 사용하십시오.', 39653),
(196760, 'koKR', '송곳니를 믿지 마세요. 실수로 이곳에 보내진 사람은 없습니다.', '', 39653),
(196759, 'koKR', '폭풍의 일격을 최대한 자주 사용하십시오.', '', 39653),
(196757, 'koKR', '여어!', '', 39653),
(196756, 'koKR', '아주 생기발랄하시네요.', '', 39653),
(196739, 'koKR', '나로 인해 완벽해졌으니, 내 적들에게 맞서 싸워라!', '', 39653),
(196738, 'koKR', '예... 주인님...', '', 39653),
(196732, 'koKR', '아니야! 안 돼! 안 돼!', '', 39653),
(196731, 'koKR', '대체 내게... 무슨 짓을...! ', '', 39653),
(196729, 'koKR', '', '타니코스!', 39653),
(196727, 'koKR', '아, 딱 내가 찾던 것이군. ', '', 39653),
(196726, 'koKR', '집정관님과 승천의 보루를 위하여!', '', 39653),
(196725, 'koKR', '용장님! 혼자가 아니십니다!', '', 39653),
(196724, 'koKR', '', '네놈에게 승산은 없다, 강령술사! 우리의 용기는 조금도 흔들리지 않으리!', 39653),
(196723, 'koKR', '', '양손의 무기로 강력한 공격을 날리는 폭풍의 일격은 축적된 강력한 전기를 방출합니다. 또한, 능력이 일정 확률로 폭풍인도자를 발동시켜 즉시 강화된 폭풍의 일격 충전을 부여하죠.', 39653),
(196722, 'koKR', '', '당신의 가장 강력한 무기 능력은 폭풍의 일격입니다.', 39653),
(196715, 'koKR', '양손의 무기로 강력한 공격을 날리는 폭풍의 일격은 축적된 강력한 전기를 방출합니다. 또한, 능력이 일정 확률로 폭풍인도자를 발동시켜 즉시 강화된 폭풍의 일격 충전을 부여하죠.', '', 39653),
(196669, 'koKR', '당신의 가장 강력한 무기 능력은 폭풍의 일격입니다.', '', 39653),
(196648, 'koKR', '', '용암 채찍은 보조 무기를 사용하니, 잊지 말고 무기에 불꽃혓바닥을 부여해 힘을 한층 끌어올리십시오.', 39653),
(196646, 'koKR', '', '다음으로 용암 채찍을 사용해 용암의 원초적인 힘으로 대상을 강타해 보십시오.', 39653),
(196645, 'koKR', '다음으로 용암 채찍을 사용해 용암의 원초적인 힘으로 대상을 강타해 보십시오.', '', 39653),
(196588, 'koKR', '', '우선 무기에 바람과 불의 힘부터 주입해 보도록 하겠습니다.', 39653),
(196587, 'koKR', '우선 무기에 바람과 불의 힘부터 주입해 보도록 하겠습니다.', '', 39653),
(196578, 'koKR', '', '무기에 불꽃혓바닥과 질풍을 시전하십시오.', 39653),
(196577, 'koKR', '무기에 불꽃혓바닥과 질풍을 시전하십시오.', '', 39653),
(196560, 'koKR', '너는 소모품일뿐이다.', '', 39653),
(196559, 'koKR', '참을성이 뭐냐? 난 그런 말을 모른다.', '', 39653),
(196557, 'koKR', '모그레인 가문은 참을성이 없기로 유명하지.', '', 39653),
(196556, 'koKR', '세상에 귀찮은 녀석이 어찌나 많은지.', '', 39653),
(196555, 'koKR', '해산.', '', 39653),
(196554, 'koKR', '우리는... 희생이 뭔지 잘 안다.', '', 39653),
(196553, 'koKR', '증오를 불태워라. 그것이 너의 힘이다.', '', 39653),
(196552, 'koKR', '전부 잃지는 않았다. 아직은.', '', 39653),
(196551, 'koKR', '우리에게 평화란 없다. 안식은 없다.', '', 39653),
(196550, 'koKR', '우리의 목적은 단 하나, 복수뿐이다.', '', 39653),
(196549, 'koKR', '우리는 강하다. 우리는 불멸이다.', '', 39653),
(196548, 'koKR', '한 조각 희망이 남아 있다.', '', 39653),
(196546, 'koKR', '우리의 운명을 개척해야 한다.', '', 39653),
(196544, 'koKR', '우리는... 끝을 보고 말리라.', '', 39653),
(196542, 'koKR', '칠흑의 기사단은 멈추지 않을 것이다.', '', 39653),
(196488, 'koKR', '울부짖는 바람이 겨울 공기를 타고 매섭고 날카로운 소리를 냅니다.', '울부짖는 바람이 겨울 공기를 타고 매섭고 날카로운 소리를 냅니다.', 39653),
(196485, 'koKR', '|TInterface\\ICONS\\SPELL_FROST_RING OF FROST.BLP:20|t |cFFF00000|Hspell:326787|h[차디찬 바람]|h|r이 공기를 가득 메웁니다! 따듯한 |TInterface\\ICONS\\SPELL_FIRE_FIRE.BLP:20|t |cFFF00000|Hspell:326774|h[장작불]|h|r을 찾아야 합니다.', '|TInterface\\ICONS\\SPELL_FROST_RING OF FROST.BLP:20|t |cFFF00000|Hspell:326787|h[차디찬 바람]|h|r이 공기를 가득 메웁니다! 따듯한 |TInterface\\ICONS\\SPELL_FIRE_FIRE.BLP:20|t |cFFF00000|Hspell:326774|h[장작불]|h|r을 찾아야 합니다.', 39653),
(196471, 'koKR', '', '생존자를 구하고 거미를 잡느라 수고하셨습니다.', 39653),
(196470, 'koKR', '', '살아나왔군요. 다행입니다.', 39653),
(196469, 'koKR', '', '암흑 마법이 이곳을 타락시켰어요.', 39653),
(196468, 'koKR', '', '안쉬께서 우릴 안전하게 보살펴 주시리!', 39653),
(196439, 'koKR', '', '동의하네. 다만 일단은 시초자의 지팡이를 성소로 가져가 승리를 음미하도록 하세나. 나락 방랑자, 오늘 자네가 보여준 활약은 영원토록 기억될 걸세.', 39653),
(196438, 'koKR', '그래도 할 일이 산더미처럼 쌓여있네. 바이라즈도 배신의 대가를 치러야 해. 켈투자드도 마찬가지로.', '', 39653),
(196437, 'koKR', '', '솔직히 처음에는 나락 방랑자 널 의심했었다. 그러나 우리 성약의 단의 소중한 용사임을 증명해 보였지.', 39653),
(196436, 'koKR', '', '켈투자드가 심판을 피하긴 했지만, 말드락서스에 퍼졌던 놈의 그림자는 사라졌네. 불편하긴 하나 신데인 후작과 동맹을 맺기도 했지.', 39653),
(196431, 'koKR', '|TINTERFACE\\ICONS\\inv_misc_hook_01.blp:20|t 스티치플레시의 피조물이 당신을 |cFFFF0404|Hspell:322681|h[고기 갈고리]|h|r의 대상으로 지정합니다!', '|TINTERFACE\\ICONS\\spell_warlock_soulburn.blp:20|t 스티치플레시의 피조물이 당신을 |cFFFF0404|Hspell:308044|h[저승 파멸]|h|r의 대상으로 지정합니다!', 39653),
(196395, 'koKR', '', '오우거가 의식을 끝마치기 전에 막아내는 거다. 록타르 오가르!', 39653),
(196394, 'koKR', '', '그렇다면 우리도 움직여야겠군. 기억해라. 힘을 합치면 호드가 이겨내지 못할 고난은 없다는 것을.', 39653),
(196393, 'koKR', '', '이미 시작됐군요. 지금껏 모은 생명력으로 용을 되살릴 겁니다!', 39653),
(196392, 'koKR', '', '놈들의 암흑 마법에 우리 같은 제물이 필요한 모양입니다. 곧 의식을 거행해서--', 39653),
(196391, 'koKR', '', '알겠습니다. 오우거 놈들이 강령술을 사용해 죽은 용을 부활시키고 있습니다.', 39653),
(196381, 'koKR', '그래... 속박이 약해지고 있네...', '', 39653),
(196367, 'koKR', '누구나 원하는 게 있기 마련이지.', '', 39653),
(196366, 'koKR', '사회적 영향력의 힘을 무시하지 마라.', '', 39653),
(196365, 'koKR', '네 발밑의 기틀을 누가 다졌는지 잊지 말도록.', '', 39653),
(196364, 'koKR', '원하는 게 뭔가, 천민?', '', 39653),
(196363, 'koKR', '참 독특한 장비로군... 얼마면 돼?', '', 39653),
(196362, 'koKR', '헌금을 바치러 왔나?', '', 39653),
(196360, 'koKR', '', '넌 뒤쫓을 가치도 없군. ', 39653),
(196359, 'koKR', '', '이제 오히려 네 녀석이 날 추적하는 것 같은 느낌이군. ', 39653),
(196358, 'koKR', '', '내게서 숨을 순 없어.', 39653),
(196357, 'koKR', '', '등 뒤를 조심해라. 당하기 싫으면.', 39653),
(196356, 'koKR', '', '내가 너였어도 도망쳤을 거다.', 39653),
(196355, 'koKR', '', '다음에는 내가 널 찾을 것이다.', 39653),
(196354, 'koKR', '', '죄악의 악취가 나는군... 넌 추적하기 쉽겠어.', 39653),
(196353, 'koKR', '', '먼저 달아날 기회를 주지.', 39653),
(196352, 'koKR', '', '도망칠 수 있을 때 도망쳐라.', 39653),
(196351, 'koKR', '', '최상위 포식자에겐 모든 것이 사냥감일 뿐.', 39653),
(196350, 'koKR', '', '나를 모르더라도 두려울 것이다. ', 39653),
(196349, 'koKR', '', '취약함을 드러내기 위한 약점은 하나로 충분해.', 39653),
(196346, 'koKR', '', '공포 그 자체로도... 충분하지.', 39653),
(196345, 'koKR', '', '두려울 게 많겠구나, 하찮은 존재여.', 39653),
(196344, 'koKR', '', '두려움을 숨기지 못하는군.', 39653),
(196343, 'koKR', '', '진정으로 겸손해진 적이 있느냐?', 39653),
(196332, 'koKR', '실망시키지 않겠습니다, 후작이시여.', '', 39653),
(196331, 'koKR', '', '그랬단 말이지. 그렇다면 경솔한 행동에 대한 속죄를 해야 마땅하겠군... 내 남작으로서 말이다. 오늘을 기점으로 우리의 연락책이 되어 나와 드라카 남작을 이어주도록.', 39653),
(196330, 'koKR', '켈투자드의 배반을 폭로하고 당신의 정당한 권위를 바로잡기 위함이었습니다.', '', 39653),
(196327, 'koKR', '', '발메다르. 넌 이방인들과 공조해 네가 몸담은 의회와... 네 주군인 후작에 맞서려 했다.', 39653),
(196322, 'koKR', '', '켈투자드는 사라졌지만 네 병력은 남아 있구나. 내가 의심이 많은 성정이었다면 날 후작에서 실각시키려는 음모라 생각했을 거다.', 39653),
(196314, 'koKR', '보호막의 안정화 수정을 파괴해야 놈을 잡을 수 있을 거다.', '', 39653),
(196313, 'koKR', '너와의 볼일은 끝났다. 일단은.', '', 39653),
(196310, 'koKR', '금은보화? 내가 왜 그걸 탐내겠어?', '', 39653),
(196309, 'koKR', '더 이상 괴롭게 하지 마!', '', 39653),
(196308, 'koKR', '내가... 리치 왕을 섬긴다고? 그건... 말도 안 돼.', '', 39653),
(196307, 'koKR', '이 고통은 뭐지?', '', 39653),
(196299, 'koKR', '', '이 비겁한 놈들! 곧 호드 전력이 너희를 처단할 거다!', 39653),
(196291, 'koKR', '어둠땅이 위기에 처한 마당에 속박된 영혼을 붙잡고 시간을 허비하는 것이야말로 진정한 오만함이 아닌가!', '', 39653),
(196289, 'koKR', '보다시피, 마법학자의 정원은 잠시 머무르는 곳이었을 뿐이다.', '', 39653),
(196288, 'koKR', '킬제덴과의 거래로 신도레이를 구할 수 있으리라 생각했다. 하지만... 상황이 계속해서 악화되기만 하더군.', '', 39653),
(196284, 'koKR', '네가 아니더라도 벤티르에게 충분히 고통받고 있다.', '', 39653),
(196283, 'koKR', '난 그저 신도레이를 위해 행했을 뿐.', '', 39653),
(196282, 'koKR', '또 내 도움이 필요하면 찾아오도록.', '', 39653),
(196281, 'koKR', '내 죄악을... 곱씹어 보도록 하지.', '', 39653),
(196276, 'koKR', '멋대로 나를 판단하지 마라.', '', 39653),
(196274, 'koKR', '들어줄 시간은 있을 것 같군.', '', 39653),
(196273, 'koKR', '내게 어떤 부탁을 하러 왔지?', '', 39653),
(196269, 'koKR', '겸손해질 수는 있어도, 온순해질 수는 없다.', '', 39653),
(196256, 'koKR', '태양샘을 기억하라.', '', 39653),
(196255, 'koKR', '그게 다인가?', '', 39653),
(196254, 'koKR', '그럼.', '', 39653),
(196251, 'koKR', '할 말이 있거든 어서 말해라.', '', 39653),
(196248, 'koKR', '내 힘은 응당 내 것이다!', '', 39653),
(196245, 'koKR', '생존을 위해 싸운 게 죄악인가?', '', 39653),
(196244, 'koKR', '태양왕에게 무슨 일이냐.', '', 39653),
(196228, 'koKR', '아, 시간을 내서 이 몸을 보러 왔구나!', '', 39653),
(196227, 'koKR', '오늘은 또 어떤 거래를 해보실까.', '', 39653),
(196226, 'koKR', '허. 아직... 숨이 붙어있구먼.', '', 39653),
(196222, 'koKR', '아... 이 몸이 그립더냐?', '', 39653),
(196221, 'koKR', '또 보자! 조만간 말이야.', '', 39653),
(196219, 'koKR', '로아가 지켜보고 있다는 걸 명심하거라.', '', 39653),
(196217, 'koKR', '난 여기 오랫동안 머무를 생각이다.', '', 39653),
(196216, 'koKR', '걱정 붙들어 매. 늘 근처에 있을 테니.', '', 39653),
(196161, 'koKR', '', '별빛쇄도는 천공의 힘을 소모하므로, 천벌을 사용하여 자원을 모으십시오.', 39653),
(196160, 'koKR', '별빛쇄도는 천공의 힘을 소모하므로, 천벌을 사용하여 자원을 모으십시오.', '', 39653),
(196159, 'koKR', '', '천벌을 허수아비에 사용하다가, 천공의 힘이 모이면 별빛쇄도를 사용하십시오.', 39653),
(196158, 'koKR', '천벌을 허수아비에 사용하다가, 천공의 힘이 모이면 별빛쇄도를 사용하십시오.', '', 39653),
(196067, 'koKR', '전... 괜찮습니다. 다들 무사해서 다행이군요.', '', 39653),
(196066, 'koKR', '', '안두인! 다친 데는 없나요?', 39653),
(196062, 'koKR', '힘으로 끊기엔 속박이 너무 강하오. 다른 방법을 찾아야 하네.', '', 39653),
(196057, 'koKR', '', '상관없다. 우린 원하는 것을 찾아낼 테니까... 또 다른 필멸자에게서.', 39653),
(196056, 'koKR', '', '그저 코앞의 일만 보는 꼴이라니. 날 실망시키는구나.', 39653),
(196055, 'koKR', '네 뜻대론... 안 될거다...', '', 39653),
(196045, 'koKR', '계속해보게. 전설과 작별하고 쓰레기 같은 상인 물품이나 쓰고 싶으면 말이지!', '', 39653),
(196044, 'koKR', '작작 좀 치근거리게! 차라리 혼자 갇혀있을 때가 나았어!', '', 39653),
(196043, 'koKR', '이곳에서 셀 수 없이 많은 전설이 탄생했지.', '', 39653),
(196042, 'koKR', '그를 막아야 하네.', '', 39653),
(196041, 'koKR', '운명이 우리의 길을 하나로 엮어 주었군.', '', 39653),
(196040, 'koKR', '기억이... 영 떠오르질 않네.', '', 39653),
(196039, 'koKR', '자네가... 기억나는구먼.', '', 39653),
(196038, 'koKR', '뭘 좀 찾았나?', '', 39653),
(196037, 'koKR', '내 힘닿는 데까지 돕겠네.', '', 39653),
(196036, 'koKR', '어둠 속으로 향할 땐 조심해야 하네.', '', 39653),
(196035, 'koKR', '영혼을 잘 지키게, 필멸자여.', '', 39653),
(196034, 'koKR', '이 전당에는 상상을 뛰어넘는 공포가 도사리고 있네.', '', 39653),
(196033, 'koKR', '세심하게 제거 중', '', 39653),
(195976, 'koKR', '$n|1이;가; 굶주린 사람들을 위해 누더기 깜짝 케이크를 차립니다.', '$n|1이;가; 굶주린 사람들을 위해 누더기 깜짝 케이크를 차립니다.', 39653),
(195973, 'koKR', '장비 수리를 부탁합니다.', '장비 수리를 부탁합니다.', 39653),
(195923, 'koKR', '간수의 눈을 조심하게.', '', 39653),
(195922, 'koKR', '우린 기억의 편린 사이를 거닐고 있네.', '', 39653),
(195921, 'koKR', '절망에 자신을 잃지 말게나.', '', 39653),
(195911, 'koKR', '과거는 산산이 조각난 거울일세.', '', 39653),
(195890, 'koKR', '제가 만들어 드리겠습니다.', '제가 만들어 드리겠습니다.', 39653),
(195850, 'koKR', '', '필멸자에 대한 내 고정관념을 한층 더 확고하게 만드는군.', 39653),
(195849, 'koKR', '', '계속 그런 식으로 행동할 건가?', 39653),
(195848, 'koKR', '', '행실이 추잡하기 짝이 없군.', 39653),
(195847, 'koKR', '', '이런 몰염치한 종자를 다 봤나.', 39653),
(195846, 'koKR', '', '예의범절도 모르나?', 39653),
(195845, 'koKR', '', '얘기는 이걸로 끝내지.', 39653),
(195843, 'koKR', '', '또 오거라.', 39653),
(195842, 'koKR', '', '나중에 다시 만나지.', 39653),
(195841, 'koKR', '', '몸조심해라.', 39653),
(195840, 'koKR', '', '말해보거라.', 39653),
(195839, 'koKR', '', '무슨 비밀을 흘리러 왔나?', 39653),
(195838, 'koKR', '', '참 남다른... 복장이군.', 39653),
(195837, 'koKR', '', '대화를 나눠볼까?', 39653),
(195828, 'koKR', '', '추가로, 대상이 모든 주문으로부터 받는 피해가 증가합니다. 다만 고통, 부패와 달리 불안정한 고통은 한 번에 적 하나에만 적용이 됩니다. ', 39653),
(195826, 'koKR', '불안정한 고통은 지속 피해를 입히는 강력한 주문입니다. 적에게 시전하는 다른 모든 주문의 공격력도 증가시키죠.', '', 39653),
(195781, 'koKR', '', '내 말을 잘 받아들이기만 하면 환대를 즐길 수 있을 터.', 39653),
(195741, 'koKR', '시련 통과. 참가자 승리.', '', 39653),
(195740, 'koKR', '진정한 용기는 눈앞에 패배가 닥쳐왔을 때 드러나는 법.', '', 39653),
(195738, 'koKR', '령 재충전. 시련 재개.', '', 39653),
(195735, 'koKR', '', '이탈자여, 날아올라라! 놈들이 상처 입은 지금이 공격할 때다!', 39653),
(195733, 'koKR', '시련 중지. 령 소진.', '', 39653),
(195732, 'koKR', '살아남지 못하는 자는 승천할 수 없다.', '', 39653),
(195731, 'koKR', '너는 시험을 받아야 한다.', '', 39653),
(195730, 'koKR', '길에는 위험이 도사리노라.', '', 39653),
(195729, 'koKR', '용기의 시련 시작.', '', 39653),
(195728, 'koKR', '심판의 길을 걸으려는 자는 누구인가?', '', 39653),
(195727, 'koKR', '', '너무 늦었다. 이자는 이미 진실을 마주했으며, 각성하여 눈을 똑바로 뜨게 되었도다!', 39653),
(195726, 'koKR', '', '최후를 재촉하다니 어리석구나.', 39653),
(195723, 'koKR', '', '이탈자여, 방해꾼 놈들에게 참된 길을 보여줘라!', 39653),
(195722, 'koKR', '', '누가 감히 이 불신자의 교화를 방해하느냐?', 39653),
(195689, 'koKR', '', '봐봐! 리치가 더 있어! 같이 놀자고 하자!', 39653),
(195685, 'koKR', '...일부는 반항기까지 드러냈지.', '', 39653),
(195684, 'koKR', '...굶주린 데다...', '', 39653),
(195683, 'koKR', '한데 폭력적인 반란이 일어난 통에 왔으니 안타깝군. 이곳 자원이 위험할 정도로 빠듯한 상황이라 말이다.', '', 39653),
(195682, 'koKR', '나락 방랑자, 령을 시급하게 요청한 건 안다. 여느 때와 같았으면 내 흔쾌히 수락했을 것이야.', '', 39653),
(195681, 'koKR', '소개해 드립니다... 나락 방랑자입니다.', '', 39653),
(195680, 'koKR', '애석하게도 다가올 영광을 살아서 보진 못하겠구나.', '', 39653),
(195679, 'koKR', '...좀 귀찮게 하는 면이 있다만.', '', 39653),
(195678, 'koKR', '앞으로는 불청객 경계를 더 철저히 해야겠구나, 귀부인이여.', '', 39653),
(195677, 'koKR', '마무리해라, 이네르바.', '', 39653),
(195676, 'koKR', '', '령 수확은 기교가 따르는 일입니다.', 39653),
(195523, 'koKR', '이게 대체 무슨 일이지?', '', 39653),
(195379, 'koKR', '이런 걸 받아줄 나이는 지났다네.  ', '', 39653),
(195378, 'koKR', '나의 운명은 아직 정해지지 않았다.', '', 39653),
(195377, 'koKR', '이탈자를 막아야 한다.', '', 39653),
(195376, 'koKR', '정의와 복수는... 한 끗 차이군...\n', '', 39653),
(195375, 'koKR', '자비를 베풀어 줘서 고맙다.', '', 39653),
(195374, 'koKR', '모두 부질없었단 말인가? ', '', 39653),
(195373, 'koKR', '답을 찾아 헤맸지만... 얻은 건 분노뿐이었다.', '', 39653),
(195372, 'koKR', '고민이 끊이지 않는군.', '', 39653),
(195371, 'koKR', '기억이 잊히지 않는구나, 영웅이여. ', '', 39653),
(195356, 'koKR', '', '이봐, 한여름 밤의 악몽을 꾸게 해줄게.', 39653),
(195355, 'koKR', '', '티르너 노흐고 나발이고 계속 이러면 티르너 훅을 맛보게 될 거예요!', 39653),
(195354, 'koKR', '', '스프리건만 끔찍하다 생각하셨죠? 한 번만 더 절 건드려보시죠. 어떻게 되는지.', 39653),
(195353, 'koKR', '', '곧 엄청나게 재밌어질걸요!', 39653),
(195352, 'koKR', '', '당신이 다음엔 뭘 할지 빨리 보고 싶군요.', 39653),
(195350, 'koKR', '', '당신하고 있으면 심심할 틈이 없다니까요.', 39653),
(195349, 'koKR', '', '참 재치 넘치시네요.', 39653),
(195348, 'koKR', '', '그만 가 보시나요?', 39653),
(195347, 'koKR', '', '언제든 찾아오셔요.', 39653),
(195346, 'koKR', '', '다시 만나요.', 39653),
(195345, 'koKR', '', '당신은 남다른 사람이군요?', 39653),
(195344, 'koKR', '', '만나서 정말 반가워요.', 39653),
(195343, 'koKR', '', '뭘 도와드릴까요?', 39653),
(195342, 'koKR', '', '도움의 손길이 필요해 보이네요. 맞죠?', 39653),
(195341, 'koKR', '', '미안한데, 뭐가 필요하다고 했죠?', 39653),
(195339, 'koKR', '', '이런, 이런. 여기 이건 뭔가요?', 39653),
(195338, 'koKR', '', '아, 이거 재밌겠는데요.', 39653),
(195330, 'koKR', '', '간수 대신 여왕이 자리하게 되겠지. 겨울처럼 냉혹하고 아름다운 여왕으로 말이다. 모두가 나를 사랑하고 절망할 것이다!', 39653),
(195323, 'koKR', '', '너에게도 동생이 있느냐, 필멸자여? 성가시게 구는 것이 내 여동생이랑 똑같구나.', 39653),
(195322, 'koKR', '', '난 영원히 존재하나, 내 인내심은 영원하지 않다.', 39653),
(195321, 'koKR', '', '연민을 베풀 때와... 결의를 다질 때가 있기 마련이지.', 39653),
(195320, 'koKR', '', '하늘이 무너지더라도 우리는 의무를 다해야 한다.', 39653),
(195319, 'koKR', '', '몽환숲이 주시할 것이다.', 39653),
(195318, 'koKR', '', '즐거운 사냥이 되길, 나락 방랑자여.', 39653),
(195317, 'koKR', '', '밤의 궁정이 너와 함께한다.', 39653),
(195316, 'koKR', '', '너의 노력이 열매를 맺기를.', 39653),
(195315, 'koKR', '', '야생의 축복이 너와 함께하리라.', 39653),
(195314, 'koKR', '', '우리는 어려운 결단을 계속 내려왔다.', 39653),
(195313, 'koKR', '', '가뭄이 우리 모두를 곤경에 시달리게 한다.', 39653);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(195311, 'koKR', '', '몽환숲이 너의 부탁을 들어보겠노라.', 39653),
(195310, 'koKR', '', '알현을 윤허한다, 필멸자여.', 39653),
(195308, 'koKR', '', '우리의 신성한 책무는 변하지 않는다.', 39653),
(195307, 'koKR', '', '별은 돌고, 순환은 계속되리.', 39653),
(195306, 'koKR', '', '말하거라. 숲이 귀를 기울일 것이다.', 39653),
(195305, 'koKR', '소리지르다뇨! 소리는 당신이... 앗, 잠깐. 제가 지르는 게 맞네요. 그게 제 일이니까!', '', 39653),
(195304, 'koKR', '이게 장난인 줄 아십니까? 여긴 \"말드락서스\"입니다!', '', 39653),
(195302, 'koKR', '가치를 증명하십시오.', '', 39653),
(195300, 'koKR', '용사는 타고나는 게 아닙니다. 벼려지는 거죠.', '', 39653),
(195298, 'koKR', '항복 따윈 없습니다.', '', 39653),
(195291, 'koKR', '무운을 빕니다, 검투사여.', '', 39653),
