(195192, 'koKR', '', '이쪽으로, 필멸자여. 결정의 순간이 왔노라.', 39653),
(195191, 'koKR', '이보게, 내가 대족장이었던 시절을 함께 돌이켜 보세. <3초 동안 침묵하는 볼진> 다 됐나? <한숨> 그래, 나도 다 돌아봤네.', '', 39653),
(195190, 'koKR', '', '실행하는 걸 지켜보겠노라, 무궁한 존재여. 그분의 말씀을 전하였나이다.', 39653),
(195189, 'koKR', '', '우리 영역이 힘을 회복하면 함께 어둠에 맞서도록 하지.', 39653),
(195188, 'koKR', '이 늙은 볼진의 신경을 더 긁는다면 영혼도 못 추리게 될 거네!', '', 39653),
(195187, 'koKR', '', '알겠소. 어둠땅을 위해 필멸자에게 성약의 단을 선택하도록 하겠소.', 39653),
(195186, 'koKR', '', '내 숲을 돕기도 했지. 큰 잠재력을 품고 있는 종족이다. 집중하면 판도를 바꿀 수 있을지도.', 39653),
(195185, 'koKR', '조심하게. 그렇게 쿡쿡 찔러대다 내 사술에 걸린 자도 있었다네!', '', 39653),
(195184, 'koKR', '희망은 있소. 이 필멸자가 나를 나락에서 구하고 대영주의 배신을 만천하에 밝혀냈다오.', '', 39653),
(195183, 'koKR', '', '시초자는 사라지고, 데나트리우스가 배반한 지금, 우리 세계는 엉망진창이 되었고... 파멸이 어둠땅에 찾아왔구나.', 39653),
(195182, 'koKR', '', '먼 옛날, 우리는 하나가 되어... 그 괴물을 가뒀건만...', 39653),
(195181, 'koKR', '거짓이 들통 나자 데나트리우스는 방대하게 모아뒀던 령을 나락으로 방출해... 자신의 진정한 주인에게 힘을 불어넣었소.', '', 39653),
(195180, 'koKR', '가뭄은 그의 작품이오. 우리 영역의 생명선을 훔치고, 백성을 굶주리게 하고... 그대들도 그에게 당한 거요.', '', 39653),
(195179, 'koKR', '대영주는... 우리 모두를 배신했소.', '', 39653),
(195178, 'koKR', '', '레벤드레스를 대변하는 게 너냐? 네가 섬기는 대영주, 우리 형제 데나트리우스는 어딨느냐?', 39653),
(195177, 'koKR', '', '시초자는 진실을 깨달았지만 경고가 늦었다. 그가 극심한 대가를 치르진 않았는지 걱정되는군.', 39653),
(195176, 'koKR', '', '영원히 속박된 줄 알았던 악이 우리를 방해하고 갈라놓기 위한 음모를 꾸몄다. ', 39653),
(195175, 'koKR', '', '나락이 힘을 흡수하며 강대해지고 있다! 어쩌다 이 사달이 벌어진 거냐?!', 39653),
(195174, 'koKR', '', '심판관의 목소리를 대변해 무궁한 존재의 부름을 받드나이다. 어떻게 섬기면 되겠습니까?', 39653),
(195138, 'koKR', '', '저들의 영혼에서도 나락의 기운이 느껴집니다.', 39653),
(195137, 'koKR', '진정해라. 나는 볼바르 폴드라곤이다. 여기 기사단과 함께 도우러 왔다.', '', 39653),
(195136, 'koKR', '이방인이 또! 무슨 짓을 한 겁니까, 필멸자여?', '', 39653),
(195119, 'koKR', '', '카델렌! 카셰르! 목적의 길을 찬미하라! 드디어 심판관께서 반응을 보이셨다!', 39653),
(195118, 'koKR', '', '필멸자의 탈출은 곧 감옥이 약해졌다는 의미일 수도 있습니다. 사실이라면, 추방당한 자가...', 39653),
(195117, 'koKR', '오리보스의 따르는 자 모두 나락은 극악무도한 영혼을 영원히 봉인하기 위한 곳이며, 돌파할 수 없다고 가르침을 받습니다. ', '', 39653),
(195092, 'koKR', '듣고 있네.', '', 39653),
