(194923, 'koKR', '', '십자군을 위하여.', 39653),
(194849, 'koKR', '령을 전환하고 싶습니다.', '령을 전환하고 싶습니다.', 39653),
(194723, 'koKR', '사라진 원정대원을 찾아 이들을 고향으로 데려와야 합니다. 호드를 위하여!', '', 39653),
(194722, 'koKR', '빌지워터 무역회사 소속인 당신은 호드에 가담했습니다. 모험과... 수익 두 마리 토끼를 모두 잡기 위해 말입니다.', '', 39653),
(194721, 'koKR', '비극과 배반으로 고향을 잃을 뻔 했던 블러드 엘프의 일원인 당신은 동포들과 함께 천부의 권리를 되찾았고, 밝은 미래를 꿈꾸고 있습니다.', '', 39653),
(194720, 'koKR', '여타 트롤 부족과 달리 잔혹함을 내려놓은 검은창 부족의 일원인 당신은 기민한 흉포함을 무기로 동료를 지킵니다.', '', 39653),
(194718, 'koKR', '현명하고도 평화로운 타우렌의 일원인 당신은 육체적인 힘과 영적인 결의를 통해 선조들의 유산을 기립니다.', '', 39653),
(194717, 'koKR', '언데드 포세이큰의 일원인 당신은 비록 산 자에게 멸시받는 신세지만, 황폐한 과거를 딛고 새로운 미래를 벼려내기 위해 부단히 노력하고 있습니다.', '', 39653),
(194716, 'koKR', '당신의 동족인 오크는 본디 정복을 위해 아제로스에 왔지만, 지금은 최고의 용사들과 함께 어깨를 당당히 펴고 있습니다.', '', 39653),
(194714, 'koKR', '당신은 용감한 신병으로서 구출 임무를 수행하기 위해 오그리마에서 출항했습니다.', '', 39653),
(194713, 'koKR', '미지의 섬을 탐험하기 위해 파견되었던 호드 원정대가 최근 실종됐습니다.', '', 39653),
(194712, 'koKR', '당신은 강대한 호드의 병사입니다. 이들은 각지에 뿌리를 둔 여러 종족의 연합으로, 자유, 명예, 영광이라는 기치 아래 단결했습니다.', '', 39653),
(194699, 'koKR', '', '저항은 현명치 못합니다.', 39653),
(194656, 'koKR', '', '많은 감투 중... 투구를 쓰고 상대해드릴 때군요!', 39653),
(194599, 'koKR', '', '가열로는 오래됐을지언정 여기서 만들어진 칼날은 그 무엇보다도 날카롭다오. 잘해 주었소.', 39653),
(194420, 'koKR', '영혼이 함께하길.', '', 39653),
(194418, 'koKR', '이 볼진이 어떻게 도와주면 되겠나?', '', 39653),
(194370, 'koKR', '', '힘이 비롯되는 곳은 충성과, 명예와... 작작 좀 찔러!', 39653),
(194369, 'koKR', '', '난 어둠 속의 칼날이자, 네 코 앞의 칼날이지.', 39653),
