(194303, 'koKR', '이게 누구신가?', '', 39653),
(194302, 'koKR', '', '하지만, 주인님--', 39653),
(194301, 'koKR', '우리 친우가... 인내심의 한계를 느끼고 있다.', '', 39653),
(194300, 'koKR', '', '대영주님, 일전에 설명해드렸지만 섬세한 과정을 급히 진행할 순 없습니다.', 39653),
(194152, 'koKR', '', '시간이 흘러도 숲은 그자리에 있지.', 39653),
(194151, 'koKR', '', '성장하는 영혼은 잘 일구어진 밭과도 같으니.', 39653),
(194150, 'koKR', '', '마치 덩굴처럼 우리의 길도 엮이게 될 것이다.', 39653),
(194149, 'koKR', '', '몰아치는 바람도 결국엔 잔잔해져야 하나니. ', 39653),
(194148, 'koKR', '', '개울을 타고 흐르는 나뭇잎처럼 평화를 찾아라.', 39653),
(194147, 'koKR', '', '매 순간이 성장할 기회로다.', 39653),
(194146, 'koKR', '', '가지에 지혜의 열매가 익어가는구나.', 39653),
(194145, 'koKR', '', '배우고 성장하기를.', 39653),
(194144, 'koKR', '', '고요한 정원에 별빛이 내리는구나.', 39653),
(194143, 'koKR', '', '산들바람엔 행운이 깃들어 있지.', 39653),
(194142, 'koKR', '', '위기의 터. 잠든 영혼.', 39653),
(194141, 'koKR', '', '죽어가는 잔디에 다시 비가 내리누나.', 39653),
(194138, 'koKR', '', '솟구치는 바람이 나무에 닿는구나.', 39653),
(194136, 'koKR', '', '순환이 다시 시작되리니.', 39653),
(193985, 'koKR', '', '미행이 붙진 않았겠지? 뼈장장이 에어미르 님께서 전적으로 비밀리에 처리해야 한다고 하셨다.', 39653),
(193976, 'koKR', '', '그만 좀 괴롭혀요!', 39653),
(193975, 'koKR', '', '그럼 다음에 봐요.', 39653),
(193974, 'koKR', '', '곧 다시 봐요.', 39653),
(193973, 'koKR', '', '잘 가요, 친구!', 39653),
(193972, 'koKR', '', '친구를 볼 시간은 언제나 있죠.', 39653),
(193969, 'koKR', '', '오늘은 무엇을 할까요?', 39653),
(193968, 'koKR', '', '안녕 친구!', 39653),
(193967, 'koKR', '', '이게 참된 우정을 나누는 행동이라 생각하나?', 39653),
(193841, 'koKR', '', '선택받은 자의 주조소가 없으니 우리는 무기를 언제 어디서든 벼려내야만 한다오. 나락 방랑자 당신이 경비 임무를 맡아 주시오!', 39653),
(193713, 'koKR', '그럼 우리 함께 되갚아 주는 건 어떤가, 흠? 나락에서 고대의 영혼을 구출하고... 겨울 여왕에게 무사히 데려다 주는 거지.', '', 39653),
(193712, 'koKR', '비록 내가 실바나스를 대족장으로 임명했지만... 이게 무에젤라와 간수가... 뒤에서 꾸미고 있던 계략이었다니.', '', 39653),
(193700, 'koKR', '뛰어난 사냥 솜씨가 기대되네.', '', 39653),
(193699, 'koKR', '반갑네, 여행자여.', '', 39653),
(193696, 'koKR', '난 야생 사냥단을 섬기네.', '', 39653),
(193690, 'koKR', '얘기해 보시게.', '', 39653),
(193687, 'koKR', '몽환숲은 이겨낼 걸세.', '', 39653),
(193686, 'koKR', '여왕님과 숲을 위하여.', '', 39653),
(193684, 'koKR', '긍지를 품고 사냥하게.', '', 39653),
(193682, 'koKR', '세나리우스는 내게 사슴뿔이란 축복을 내려주었지만... 인내심은 주지 않았네.', '', 39653),
(193680, 'koKR', '우리는 함께할 때 강하다네.', '', 39653),
(193679, 'koKR', '', '비밀을 잘 간직하시길.', 39653),
(193678, 'koKR', '풀어낼 수 있을 것 같나, 무에젤라? 흥.', '', 39653),
(193677, 'koKR', '지금부터 무에젤라의 속박을 느슨히 만들거다. 내 추종자들이 이놈에게 당하지 않도록 막아주거라.', '', 39653),
(193667, 'koKR', '', '우리 의회의 복수를 하겠습니다.', 39653),
(193665, 'koKR', '', '침묵 속에서 안전히 나아가시길.', 39653),
(193664, 'koKR', '', '눈은 언제나 지켜보고 있습니다.', 39653),
(193663, 'koKR', '', '당신 이름을 속삭이더군요.', 39653),
(193662, 'koKR', '', '어둠 속을 걸으시길.', 39653),
(193661, 'koKR', '', '비밀을 가져오셨나요?', 39653),
(193659, 'koKR', '', '무엇을 보셨습니까?', 39653),
(193579, 'koKR', '바로 네 오랜 친구였던 브원삼디지!', '', 39653),
(193578, 'koKR', '그래도 걱정은 붙들어 매거라! 새로운 주인이 생기지 않았느냐...', '', 39653),
(193576, 'koKR', '하품이 절로 나오는구나, 무에젤라! 이제 저편으로 돌아갈 시간이다.', '', 39653),
(193573, 'koKR', '내 귓속말이 마음에 들었느냐? 내 직접 너를 나락에 보내려 했지만... 이 세계와의 결속이 너무 강하더군. ', '', 39653),
(193571, 'koKR', '이 목소리는... 내 몸속에 독이 퍼지고 있을 때 속삭였던... 윈드러너...', '', 39653),
(193570, 'koKR', '세계에 파멸이 왔으니... 그 원흉은... 멍청한 트롤에게 속삭인... 한마디 귓속말이라.', '', 39653),
(193569, 'koKR', '간수를 막을 수는 없다! 그의 계획은 오랫동안 진행되어왔다. 아주 오래. ', '', 39653),
(193567, 'koKR', '뭐라고? 다행히 나와 거래를 한 필멸자가 있지. 끔찍한 곳에 뛰어드려 하는... 물론 다시 빠져나올 수도 있는 자라네!', '', 39653),
(193564, 'koKR', '아악! 너는 너무 늦었다! 고대 영혼에게 나와 함께할 기회를 주었지만, 잘못된 선택을 하고 나락에 갇혀있지! ', '', 39653),
(193563, 'koKR', '', '별빛섬광을 사용하여 적 무리를 해치우십시오.', 39653),
(193560, 'koKR', '쳇. 불만이 많은 로아로군! 나한테... 어서... 말해!', '', 39653),
(193559, 'koKR', '별빛섬광을 사용하여 적 무리를 해치우십시오.', '', 39653),
(193558, 'koKR', '하! 네놈의 얕은수에 속지 않겠다! ', '', 39653),
(193557, 'koKR', '', '별빛섬광은 대상에 직접 피해를 입히고, 주위의 적에게도 피해를 입힙니다.', 39653),
(193556, 'koKR', '별빛섬광은 대상에 직접 피해를 입히고, 주위의 적에게도 피해를 입힙니다.', '', 39653),
(193555, 'koKR', '하! 칼자루를 쥔 건 이 몸이다! 몽환숲에 무슨 수작질을 부렸는지 낱낱이 말하는 게 좋을 거다.', '', 39653),
(193545, 'koKR', '', '천벌을 허수아비에 사용하십시오.', 39653),
(193544, 'koKR', '천벌을 허수아비에 사용하십시오.', '', 39653),
(193543, 'koKR', '', '천벌은 원거리 공격 능력으로 천공의 힘을 생성합니다. 천공의 힘은 더 강력한 공격에 사용되는 자원입니다.', 39653),
(193541, 'koKR', '천벌은 원거리 공격 능력으로 천공의 힘을 생성합니다. 천공의 힘은 더 강력한 공격에 사용되는 자원입니다.', '', 39653),
(193538, 'koKR', '', '적이 다른 공격으로 피해를 받기 시작할 때가 바로 천벌을 사용할 순간입니다.', 39653),
(193537, 'koKR', '적이 다른 공격으로 피해를 받기 시작할 때가 바로 천벌을 사용할 순간입니다.', '', 39653),
(193496, 'koKR', '영원해야 하는 건 레벤드레스지, 내가 아닐세.', '', 39653),
(193495, 'koKR', '다음 목표는 뭔가?', '', 39653),
(193494, 'koKR', '난 여러 세상을 불태웠네. 생명체란 생명체는 모조리 짓밟아 파멸시켰지. 죽음과 빛의 군대 양쪽을 모두 상대해봤고 말이네. 한데 그런 내가 이제는 극성스러운 필멸자에게 쿡쿡 찔리는 신세가 됐군.', '', 39653),
(193493, 'koKR', '현실의 가능성이란 헤아릴 수 없이 광대하지. 내 인내심은 그렇지 않네.', '', 39653),
(193492, 'koKR', '우리가 손을 잡은 것은 공동의 적과 관심사가 존재하기 때문일세. 괜한 행동 말게나.', '', 39653),
(193491, 'koKR', '우리 종족은 평화가 아닌 목적이 필요하네.', '', 39653),
(193490, 'koKR', '여전히 주인을 따르는 자들에게 더 나은 선택지를 줘야 하네.', '', 39653),
(193487, 'koKR', '레벤드레스를 재건해야 하네.', '', 39653),
(193486, 'koKR', '반갑네, 나락 방랑자여.', '', 39653),
(193484, 'koKR', '레이타.', '', 39653),
(193453, 'koKR', '아둔한 로아 같으니. 날 막을 수는 없다. 네 신도를 먹어 치운 다음엔... 너다! ', '', 39653),
(193442, 'koKR', '', '시간은 소중해요.', 39653),
(193440, 'koKR', '', '일정을 맞춰야 해요!', 39653),
(193439, 'koKR', '', '흠... 부엉해도 되겠네요. 뭐가 필요하신가요?', 39653),
(193438, 'koKR', '', '뭘 하면 되나요?', 39653),
(193437, 'koKR', '', '도와드릴게요.', 39653),
(193430, 'koKR', '', '모자람 없이 섬기게.', 39653),
(193429, 'koKR', '', '스스로를 자애롭게 감싸게나.', 39653),
(193428, 'koKR', '', '책무를 다한 삶은 보람찬 삶이라네.', 39653),
(193427, 'koKR', '', '자네를 돕겠네.', 39653),
(193426, 'koKR', '', '내 손길이 필요한가?', 39653),
(193425, 'koKR', '', '도움을 주겠네.', 39653),
(193424, 'koKR', '훌훌 털고 일어나 다시 도전하면 된다는 걸 항상 명심하게.', '', 39653),
(193423, 'koKR', '누구나 넘어지기 마련이네.', '', 39653),
(193422, 'koKR', '주변 사람을 도우면 그들도 자네를 도울 걸세.', '', 39653),
(193421, 'koKR', '아무리 사사로운 문제라도 내가 도와줄 수 있네.', '', 39653),
(193419, 'koKR', '이 한몸을 책무에 바치리.', '', 39653);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(193418, 'koKR', '', '용맹히 나아가십시오.', 39653),
(193417, 'koKR', '', '굳건히 맞서십시오.', 39653),
(193416, 'koKR', '', '흔들리지 마십시오.', 39653),
(193415, 'koKR', '', '무엇을 도와드릴까요?', 39653),
(193414, 'koKR', '', '제 도끼는 당신 것입니다.', 39653),
(193413, 'koKR', '', '대련을 원하십니까?', 39653),
(193412, 'koKR', '', '숙고해 보겠습니다.', 39653),
(193411, 'koKR', '', '배움의 여지는 무한합니다.', 39653),
(193410, 'koKR', '', '우린 길을 따릅니다.', 39653),
(193409, 'koKR', '', '무엇을 찾으십니까?', 39653),
(193408, 'koKR', '', '말씀하세요.', 39653),
(193407, 'koKR', '', '무슨 일이시죠?', 39653),
(193406, 'koKR', '굳건히 버티세요.', '', 39653),
(193405, 'koKR', '충성이 당신의 길을 인도하길.', '', 39653),
(193404, 'koKR', '우린 승천의 보루를 섬깁니다.', '', 39653),
(193403, 'koKR', '당신을 돕겠습니다.', '', 39653),
(193402, 'koKR', '어떤 시련에 봉착하셨습니까?', '', 39653),
(193401, 'koKR', '우리의 길은 분명합니다.', '', 39653),
(193400, 'koKR', '', '고마워요, 여보!', 39653),
(193399, 'koKR', '', '사랑해요!', 39653),
(193398, 'koKR', '', '이따 봐요.', 39653),
(193397, 'koKR', '', '오늘 하루 어떤가요?', 39653),
(193396, 'koKR', '', '마침 찾고 있었어요!', 39653),
(193395, 'koKR', '', '잘 잤어요?', 39653),
(193394, 'koKR', '우리 가족을 다시 보고싶습니다.', '', 39653),
(193393, 'koKR', '전 준비가 안 됐습니다.', '', 39653),
(193392, 'koKR', '절 돌려보내 주십시오!', '', 39653),
(193391, 'koKR', '이게 대체 무슨 일입니까?', '', 39653),
(193390, 'koKR', '당신은 이해 못합니다...', '', 39653),
(193389, 'koKR', '부탁입니다... 이렇게 갈 순 없습니다!', '', 39653),
(193388, 'koKR', '', '키리안은 중압감 속에도 뛰어난 인내심과 평정심을 발휘한다고 알려져 있습니다. 지금 제 한계를 시험하는 건가요.', 39653),
(193386, 'koKR', '', '날개를 얻기 전까지 예상도 못한 점은 앉는 게 너무 어렵다는 거예요. 의자에 앉은 승천자를 본 적 있으십니까? 그럴 리 없죠.', 39653),
(193384, 'koKR', '', '때론 제가 승천할 준비를 마친 시기에 가뭄이 시작되었다는 걸 돌이켜봐요. 얼마나 절묘한지! 난 지금쯤 날 수 있었을 텐데 여기 땅 위에 묶여있다니. 두 날개로! 날 수 있었을 텐데! 내가 바랬던 것이라고는--<깊은 심호흡> 진정해 클레이아, 괜찮아질 거야. 우리가 해결할 거예요.', 39653),
(193381, 'koKR', '', '청지기에게 당신을 돕지 말라고 해본 적 있나요? 제가 그랬더니 울어버리더군요! 그냥... 서로 맘 상하지 않게 좋게 좋게 끝내시죠?', 39653),
(193379, 'koKR', '', '전 모두의 믿음을 위해 싸울 겁니다.', 39653),
(193378, 'koKR', '', '승천자가 되다니... 평생의 숙원을 이뤘네요.', 39653),
(193377, 'koKR', '', '집정관님의 지혜는 승리합니다.', 39653),
(193376, 'koKR', '', '어떤 시련이 닥쳐와도 우린 극복해낼 겁니다!', 39653),
(193374, 'koKR', '', '섬기는 것이 우리의 사명입니다.', 39653),
(193373, 'koKR', '', '평정심을 잃지 마시길.', 39653),
(193372, 'koKR', '', '저는 승천할 겁니다.', 39653),
(193371, 'koKR', '', '우린 이 가뭄을 해결할 겁니다. 그래야만 해요.', 39653),
(193370, 'koKR', '', '숨을 깊이 들이키고.', 39653),
(193369, 'koKR', '', '나의 무기와 나의 날개는 당신 것입니다.', 39653),
(193368, 'koKR', '', '찾아오는 변화에 우리도 함께 변화해야 해요.', 39653),
(193367, 'koKR', '', '무엇이 필요하십니까?', 39653),
(193366, 'koKR', '', '전 승천의 보루만이 아닌 어둠땅 전체를 섬깁니다.', 39653),
(193365, 'koKR', '', '무슨 생각을 하십니까?', 39653),
(193364, 'koKR', '', '가뭄이 나날이 심해지고 있습니다. 방법을 찾아야 해요.', 39653),
(193362, 'koKR', '', '당신이 바로 변화의 바람이 불기 시작했단 증거입니다.', 39653),
(193361, 'koKR', '', '제가 길을 보여드리겠습니다.', 39653),
(193360, 'koKR', '', '승천의 보루의 미래가 우리 손에 달렸습니다.', 39653),
(193359, 'koKR', '반갑습니다, 친구여.', '', 39653),
(193358, 'koKR', '마지막 세 번째! 잘 익은 퓨리안 한 바구니오! 초록빛이 없는 것으로 말이오! 이를 갖춰주면 일하리다.', '', 39653),
(193357, 'koKR', '두 번째! 제련일꾼이오. 세 명. 기민한 손재주에 지시를 잘 따르고 말대꾸 하지 않을 녀석들로 말이오!', '', 39653),
(193356, 'koKR', '첫 번째! 용광로가 필요하오. 불 온도는 정확히 1534.32도여야 하오.', '', 39653),
