(191904, 'koKR', '경고하겠네. 난 속임수를 용납하지 않네... 내가 낄 수 없는 속임수 말일세.', '', 39653),
(191902, 'koKR', '인생관을 뒤흔드는 대화였네. 언제나 가슴 깊이 새기도록 하지!', '', 39653),
(191899, 'koKR', '차 한잔하겠나?', '', 39653),
(191897, 'koKR', '강력한 적을 만나거든... 쓰러트리게!', '', 39653),
(191892, 'koKR', '아, 그냥 가버리는 겐가? 그래, 나도 이렇게 대화를 끝낼 수 있어 참으로 기쁘다네. 아무렴.', '', 39653),
(191891, 'koKR', '다들 미쳐버린 게 틀림없어... 불쌍한 자들...', '', 39653),
(191890, 'koKR', '나는 갈피를 종잡을 수 없는 부류인 것 같네. 신사 숙녀분들께서 나 같은 사람을 어떻게 참고 견디는지 모르겠다니까.', '', 39653),
(191889, 'koKR', '조언이라도 해주려고 그러나? 나 자신이 누군지 알아보는 중이었는데...', '', 39653),
(191888, 'koKR', '내 양산을 찾거든... 잘 지켜내게!', '', 39653),
(191887, 'koKR', '내 찻주전자를 찾거든... 쭉 들이켜게!', '', 39653),
(191886, 'koKR', '자네도 잘 살펴 가게나.', '', 39653),
(191885, 'koKR', '내 셔츠를 찾거든... 묻어버리게!', '', 39653),
(191884, 'koKR', '자신이 어떤 사람인지 알게 되었다니... 축하하네. 쉽지 않은 일이었을 텐데.', '', 39653),
(191883, 'koKR', '미치광이라고 해도 무례한 게 용서되진 않네!', '', 39653),
(191882, 'koKR', '같이 산책이나 하겠나?', '', 39653),
(191881, 'koKR', '다음 잿불 궁정은 끝내줄 거야! 오래도록 사람들 입에 오르내리게 될 거다 이 말씀!', '', 39653),
(191880, 'koKR', '연회의 전령만 믿어.', '', 39653),
(191879, 'koKR', '또 보자고, 나락 방랑자.', '', 39653),
(191878, 'koKR', '네 비밀은 누구에게도 말 안 할게.', '', 39653),
(191877, 'koKR', '어디 가서 나한테 들었다고 하면 안 돼!', '', 39653),
(191876, 'koKR', '무슨 얘기 들으면 알려줘.', '', 39653),
(191875, 'koKR', '어떻게 해야 지난 번 잿불 궁정보다 재밌을까?', '', 39653),
(191874, 'koKR', '연회의 주인공이 납셨다!', '', 39653),
(191873, 'koKR', '혹시 최근 들리는 소문이 있어? 주인에 대해서라든지...', '', 39653),
(191872, 'koKR', '혹시 최근 들리는 소문이 있어? 규탄자에 대해서라든지...', '', 39653),
(191871, 'koKR', '혹시 최근 들리는 소문이 있어? 왕자에 대해서라든지...', '', 39653),
(191870, 'koKR', '살아있지만 않았더라면, 지금 당장 네 죄가 뭔지 읊어줬을 텐데...', '', 39653),
(191869, 'koKR', '미리 알려주지! 바로 너야!!!', '', 39653),
(191868, 'koKR', '힌트 줄게. 그 죄악석의 반절은 무고한 돌 마귀를 온종일 성가시게 했단 내용으로 채워져 있어.', '', 39653),
(191867, 'koKR', '여기서 수수께끼! 레벤드레스 역사상 가장 커다란 죄악석을 가진 사람은 누구게?', '', 39653),
(191866, 'koKR', '언젠가는 그쪽 죄악석을 찾고 말 거야...', '', 39653),
(191865, 'koKR', '얘깃거리라도 있어?', '', 39653),
(191864, 'koKR', '혹시 죄악석 좀 있어?', '', 39653),
(191863, 'koKR', '', '자꾸 툭툭... 발모가지 뚝뚝... 눈물 뚝뚝...', 39653),
(191861, 'koKR', '', '눈물 뚝, 동료! 북을 쳐, 둥둥!', 39653),
(191859, 'koKR', '', '화내면, 쾅쾅. 쫓겨나, 바깥. 눈앞이, 깜깜.', 39653),
(191857, 'koKR', '', '쉬운 묵시, 어려운 묶기.', 39653),
(191856, 'koKR', '', '붙잡자, 보물. 실수는 금물.', 39653),
(191853, 'koKR', '', '영리. 도리. 매우 빨리!', 39653),
(191852, 'koKR', '', '깨지기 쉬운 인사말, 깨어나고 싶은 거짓말.', 39653),
(191850, 'koKR', '저리 비켜라.', '', 39653),
(191849, 'koKR', '움직여라.', '', 39653),
(191848, 'koKR', '집중해서 들어라. 거듭 말해줄 생각은 없으니.', '', 39653),
(191847, 'koKR', '하, 이제서야.', '', 39653),
(191845, 'koKR', '늦었군.', '', 39653),
(191844, 'koKR', '흠, 네놈이 나락 방랑자인가?', '', 39653),
(191778, 'koKR', '어쩌면 네가 있을 곳이 여기일지도 모르지. 영원히.', '어쩌면 네가 있을 곳이 여기일지도 모르지. 영원히.', 39653),
(191742, 'koKR', '', '뭔가 찾으셨나요, 나락 방랑자님? 진귀한... 물건인가요?', 39653),
(191738, 'koKR', '', '풀어야 할 수수께끼가 있습니다. 당신이라면 실망시키지 않을 것 같군요.', 39653),
(191732, 'koKR', '모든 영혼은 나의 것이다.', '', 39653),
(191730, 'koKR', '모든 영혼은 제 자리가 있거늘.', '', 39653),
(191722, 'koKR', '', '잘 들으세요... 제 예전 동업자 중에는 간수가 아닌 다른 자의 손에 임종한 이들도 있답니다.', 39653),
(191721, 'koKR', '', '제게 시간은 무한하지만, 인내심도 무한한 것은 아닙니다.', 39653),
(191720, 'koKR', '', '전 나락살이의 고문 현장을 오랫동안 지켜봤습니다. 어디 한번 시범을 보여드릴까요?', 39653),
(191719, 'koKR', '', '진귀한 물건을 입수하시길.', 39653),
(191718, 'koKR', '', '용무는 끝인가요, 나락 방랑자님?', 39653);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(191717, 'koKR', '', '더 붙잡지 않겠습니다.', 39653),
(191716, 'koKR', '', '비밀을 더 알아 오시죠. 얘기는 그때 합시다.', 39653),
(191715, 'koKR', '', '꼭 필요할 때만 다시 오시길.', 39653),
(191714, 'koKR', '', '나락에선 보이는 대로 믿어서는 안 됩니다.', 39653),
(191713, 'koKR', '', '간수의 눈길을 끌지 마시길.', 39653),
(191712, 'koKR', '', '아, 새 동업자님이시군요. 얼마나 버티실지 지켜보겠습니다.', 39653),
(191711, 'koKR', '', '거래를 하러 오셨습니까? 아니면 시간을 낭비하러 오신 겁니까?', 39653),
(191710, 'koKR', '', '모든 수수께끼는 드러나기 마련입니다.', 39653),
(191709, 'koKR', '', '제게 시간은 무한합니다. 당신에게는 아니겠지만요.', 39653),
(191708, 'koKR', '', '나락에 정신이 찢겨 나가는 게 느껴지십니까?', 39653),
(191707, 'koKR', '', '흥미로운 걸 찾으셨습니까, 나락 방랑자님?', 39653),
(191706, 'koKR', '', '미행을 당하지는 않으셨겠죠.', 39653),
(191699, 'koKR', '벌써 가시나요?', '벌써 가시나요?', 39653),
(191698, 'koKR', '필요한 게 있으시면 또 오세요.', '필요한 게 있으시면 또 오세요.', 39653),
(191697, 'koKR', '더 필요하신 건 없나요?', '더 필요하신 건 없나요?', 39653),
(191696, 'koKR', '다시 돌아오시길 기다리겠습니다.', '다시 돌아오시길 기다리겠습니다.', 39653),
(191695, 'koKR', '무엇을 원하십니까?', '무엇을 원하십니까?', 39653),
(191694, 'koKR', '마음껏 살펴보시지요. 죄가 하나 느는 게 대수겠습니까?', '마음껏 살펴보시지요. 죄가 하나 느는 게 대수겠습니까?', 39653),
(191688, 'koKR', '', '오늘 그대의 용기가 찬란하게 빛나는구나. 승천의 보루는 굳건하리!', 39653),
(191686, 'koKR', '', '이탈자가 우리 거신을 공격하기 시작했다. 안 그래도 수적으로 열세인 상황에 말이야. 수단과 방법을 가리지 말고 지켜내라.', 39653),
(191685, 'koKR', '조만간 공격할 것이니 병력을 모으도록. 내게 방도가 있다. 하나 데나트리우스가 내 탈출을 알아차리기 전에 빨리 움직여야 한다.', '', 39653),
(191684, 'koKR', '지난 전투를 치를 때보다 인원이 크게 줄어들었습니다.', '', 39653),
(191683, 'koKR', '테오타르의 요청에 따라 남은 병력을 이곳 죄악의 몰락지로 옮겼습니다.', '', 39653),
(191682, 'koKR', '드레이븐! 이보다 좋을 수 있을까. 보고하라.', '', 39653),
(191680, 'koKR', '', '거래가 끝났습니다.', 39653),
(191678, 'koKR', '', '인내심에도, 상품에도 한도가 있죠.', 39653),
(191676, 'koKR', '', '돌아오시길 기다리고 있겠습니다.', 39653),
(191675, 'koKR', '', '빠르게 나아가, 안전하게 돌아오기를.', 39653),
(191674, 'koKR', '', '주인님의 눈은 어디에나 있습니다.', 39653),
(191673, 'koKR', '', '주인님의 명령대로.', 39653),
(191672, 'koKR', '필요한 건 챙겼나 보군.', '', 39653),
(191671, 'koKR', '그럼 돌아가시오.', '', 39653),
(191670, 'koKR', '물건은 어디 가지 않을 것이오.', '', 39653),
(191669, 'koKR', '필요할 때 다시 오시오.', '', 39653),
(191667, 'koKR', '주군이시여.', '', 39653),
(191641, 'koKR', '무엇이 필요하십니까?', '', 39653),
(191640, 'koKR', '명예와 돌이 곧 제 힘입니다.', '', 39653),
(191639, 'koKR', '명예를 안고 떠나, 돈을 안고 돌아오시길.', '', 39653),
(191638, 'koKR', '필요한 게 있으면 다시 오십시오.', '', 39653),
(191637, 'koKR', '그럼 다음에 뵙겠습니다.', '', 39653),
(191636, 'koKR', '무엇을 도와드릴까요?', '', 39653),
(191635, 'koKR', '이 또한 주인님의 뜻을 따르는 일입니까?', '', 39653),
(191630, 'koKR', '주인님의 뜻대로.', '', 39653),
(191623, 'koKR', '', '전 괜찮아요. 괜찮을 거예요.', 39653),
(191622, 'koKR', '', '영지 관리인...', 39653),
(191621, 'koKR', '규탄자여. 나락 방랑자를 우리에게 보내줘서 고맙다.', '', 39653),
(191620, 'koKR', '', '레나탈.', 39653),
(191598, 'koKR', '뭐? 용건이 뭔데?', '뭐? 용건이 뭔데?', 39653),
(191579, 'koKR', '', '내게로 모이게! 켈투자드는 어디있지?', 39653),
(191578, 'koKR', '놈이 시초의 영소를 차지했어! 우리가 가장 강력한 의식을 거행하는 곳이라고.', '', 39653),
(191559, 'koKR', '우리가 잠자코 당하지만 않을 거라는 걸 돌 군단에게 똑똑히 보여줬군!', '', 39653),
(191558, 'koKR', '데나트리우스가 우리 연락망을 교란시킬 요량으로 레델라브 구역에 돌 군단을 급파했다. 돌 마귀 파괴공작원을 처치하고 아군 측 서신을 무사히 전달해라.', '', 39653),
(191555, 'koKR', '이번 조리법은 완벽할 거예요!\n\n제가 늘 그래왔듯이 말이죠.', '', 39653),
(191532, 'koKR', '', '어디 보자, 무덤용 덫을 어떤 순서로 설치했더라?', 39653),
(191528, 'koKR', '방해하지 마라, 나락 방랑자.\n\n친필 서명은 공연이 끝난 다음에 해 주지.', '', 39653),
(191525, 'koKR', '', '나락 전까진 괜찮았어요. 지금은 모든 게... 흐릿하네요.', 39653),
(191523, 'koKR', '', '아, 반가워요. 고문받으려면 순서를 기다리셔야 해요.', 39653),
(191521, 'koKR', '', '만나서 반가워요. 가만, 우리 구면이던가요?', 39653),
(191505, 'koKR', '', '모두 전진! 앞으로!', 39653),
(191504, 'koKR', '니나다르! 그 정도의 령을 제어하는 건 무리야!', '', 39653),
(191503, 'koKR', '저런 어리석은 녀석! 놈을 막지 못하면 우릴 모두 파멸시킬 거야!', '', 39653),
(191502, 'koKR', '', 'Patience Mograine, he cannot hide forever.', 39653),
(191501, 'koKR', '[DEPRECATED] KEL\'THUZAD! YOU COWARD!', '', 39653),
(191475, 'koKR', '살펴 가세요.', '', 39653),
(191474, 'koKR', '조심히 가세요.', '', 39653),
(191473, 'koKR', '아, 숲의 아름다움이란...', '', 39653),
(191472, 'koKR', '참 좋은 밤이죠?', '', 39653),
(191471, 'koKR', '이제 날개를 좀 풀어야겠군요.', '', 39653),
(191470, 'koKR', '이만 가볼게요!', '', 39653),
(191469, 'koKR', '모험이라고요?', '', 39653),
(191468, 'koKR', '어떤 얘길 들으셨나요?', '', 39653),
(191467, 'koKR', '이제 그만 가십시오.', '', 39653),
(191466, 'koKR', '낮잠 좀 자야겠습니다.', '', 39653),
(191465, 'koKR', '으. 안녕하십니까.', '', 39653),
(191464, 'koKR', '이번엔 또 뭡니까?', '', 39653),
(191461, 'koKR', '생존자들을 모두 불러들였습니다. 제법 많은 수가 모이더군요.', '', 39653),
(191460, 'koKR', '남 말 할 처지는 아니십니다. 그런 갈비뼈라면 당근도 갈겠어요.', '', 39653),
(191459, 'koKR', '테오타르! 내 친우여. 이렇게 보게 되어 진정 기쁘군. 한데 옷은 다 어디로 갔나.', '', 39653),
(191458, 'koKR', '왕자님!', '', 39653),
(191443, 'koKR', '아! 갈 때가 됐군요.', '', 39653),
(191442, 'koKR', '잘 가세요!', '', 39653),
(191441, 'koKR', '나무를 위하여!', '', 39653),
(191440, 'koKR', '반갑습니다!', '', 39653),
(191439, 'koKR', '안녕하세요!', '', 39653),
(191438, 'koKR', '저건 뭐죠?', '', 39653),
(191404, 'koKR', '내부로 진입하면 우선 령 저장소를 장악해서 놈들이 사용하지 못 하도록 해야 해.', '', 39653),
(191403, 'koKR', '', '쓸모 없는 짓일 뿐! 내 피조물들은 놈들이 만든 어떤 폭풍도 견뎌낼 테니!', 39653),
(191399, 'koKR', '측면 경로에는 방어벽이 세워져 있네. 놈들이 고지를 점했으니 파괴적인 공격을 퍼부을 걸세.', '', 39653),
(191373, 'koKR', '관심 끌지 말고 얌전히 나가.', '', 39653),
(191372, 'koKR', '용건이 생기면 또 와라.', '', 39653),
(191371, 'koKR', '용건이 더 없다면야.', '', 39653),
(191370, 'koKR', '또 보는군 그래?', '', 39653),
(191369, 'koKR', '돌처럼 회색으로, 돌처럼 저렴하게.', '', 39653),
(191368, 'koKR', '가 봐라.', '', 39653),
(191366, 'koKR', '그럼 가서 볼일 봐.', '', 39653),
(191365, 'koKR', '난 항상 여기 있다고. 내가 없을 때만 빼고.', '', 39653),
(191364, 'koKR', '어쩔 수 없지.', '', 39653),
(191363, 'koKR', '볼일이 더 없다면야.', '', 39653),
(191359, 'koKR', '망가지지 않았으면... 내가 사들이지.', '', 39653),
(191357, 'koKR', '최고만을 갖춰뒀지.', '', 39653),
