(188543, 'koKR', '뭐든 흥정은 가능하답니다.', '뭐든 흥정은 가능하답니다.', 39653),
(188542, 'koKR', '당신을 위해 최고의 물건만을 엄선했답니다.', '당신을 위해 최고의 물건만을 엄선했답니다.', 39653),
(188541, 'koKR', '물건을 소개해 드려도 될까요?', '물건을 소개해 드려도 될까요?', 39653),
(188540, 'koKR', '온갖 물건과 용역을 판매합니다.', '온갖 물건과 용역을 판매합니다.', 39653),
(188521, 'koKR', '우리의 노력이 큰 이익을 가져다줄 거예요.', '우리의 노력이 큰 이익을 가져다줄 거예요.', 39653),
(188519, 'koKR', '부와 행운이 함께하시길.', '부와 행운이 함께하시길.', 39653),
(188517, 'koKR', '필요한 게 있으시면 또 오시길.', '필요한 게 있으시면 또 오시길.', 39653),
(188515, 'koKR', '죽음이야말로 궁극의 거래랍니다.', '죽음이야말로 궁극의 거래랍니다.', 39653),
(188514, 'koKR', '이곳은 기회가 넘쳐나는 곳이죠.', '이곳은 기회가 넘쳐나는 곳이죠.', 39653),
(188513, 'koKR', '언제든 찾아오세요.', '언제든 찾아오세요.', 39653),
(188512, 'koKR', '부디, 다시 찾아 주세요.', '부디, 다시 찾아 주세요.', 39653),
(188511, 'koKR', '절 찾아주시다니 영광이군요.', '절 찾아주시다니 영광이군요.', 39653),
(188510, 'koKR', '당신에겐 당연히 최고의 물건만 드리죠.', '당신에겐 당연히 최고의 물건만 드리죠.', 39653),
(188509, 'koKR', '집중해서 듣고 있어요.', '집중해서 듣고 있어요.', 39653),
(188508, 'koKR', '당신을 도울 수 있어 기쁘군요.', '당신을 도울 수 있어 기쁘군요.', 39653),
(188507, 'koKR', '저는 섬기기 위해 존재한답니다, 나락 방랑자님.', '저는 섬기기 위해 존재한답니다, 나락 방랑자님.', 39653),
(188506, 'koKR', '필요한 게 있으시면 말하세요, 친구여.', '필요한 게 있으시면 말하세요, 친구여.', 39653),
(188505, 'koKR', '어떻게 도와드릴까요?', '어떻게 도와드릴까요?', 39653),
(188266, 'koKR', '막다른 길이잖아! 뭐, 아뮬렛이 제대로 작동하는지 확인해봅시다.', '', 39653),
(188262, 'koKR', '뛰어요!!!', '', 39653),
(188077, 'koKR', '', '격전이 벌어지고 있네, $n. 자네의 실력이 절실히 필요해.', 39653),
(187942, 'koKR', '', '<팔레사가 먼 산을 우두커니 바라보며 당신을 본체만체합니다.\n\n멍하게 뜬 그녀의 눈빛에서 공허감이 느껴집니다.>', 39653),
(187632, 'koKR', '', '나락 방랑자, 보호막을 파괴하게! 나머지는 산개하도록! 각자 놈들의 지원군을 상대해라!', 39653),
(187557, 'koKR', '윌로우... 고마워. 승천의 보루는 네 은혜를 영원히 기억할 거야. 내가 장담해.', '', 39653),
(187556, 'koKR', '', '그리 슬퍼하지 마, 펠라고스. 난 숲을 섬기는 데 내 인생을 바쳤어. 지금이 내가 어둠땅을 도울 기회야.', 39653),
(187555, 'koKR', '안 돼! 분명 다른 방법이 있을 거야!', '', 39653),
(187554, 'koKR', '윌로우, 너... 네가 그릇이었어?!', '', 39653),
(187553, 'koKR', '', '몽환숲의 그릇만이 숲의 힘을 담아낼 수 있다.', 39653),
(187552, 'koKR', '떠나기 전에? 대체 무슨 소리야?', '', 39653),
(187550, 'koKR', '', '굼벵아, 그래도 떠나기 전에 얼굴은 보고 가서 정말 다행이야. 안녕, 내 멋쟁이 친구.', 39653),
(187548, 'koKR', '', '네놈의 더러운 계략은 여기서 끝이다, 리치!', 39653),
(187344, 'koKR', '', '이제 우리 앞에 놓인 진정한 위협이 보이는구나. 좋다, 의식의 의회가 너희와 함께하겠다. 내 선의에 대한 징표로서 한때 시초자께서 손수 휘두르셨던 이 지팡이를 선사하마.', 39653),
(187342, 'koKR', '', '우리 대의에 함께해 준다면 그럴 일은 없을 겁니다, 신데인. 간수를 막으려면 그대의 힘이 필요합니다.', 39653),
(187341, 'koKR', '참으로 볼품없고 하찮은 오합지졸을 군대랍시고 모아뒀구나. 최선을 다한 게 고작 그 수준이더냐?', '', 39653),
(187330, 'koKR', '이건 미친 짓이야! 한 걸음 내딛을 때마다 리치들이 마법을 퍼부어 댈 거라고!', '', 39653),
(187329, 'koKR', '', '장벽을 돌파한 다음부터는 발메다르의 지시를 따르기로 하지.', 39653),
(187327, 'koKR', '하! 네놈들은 다가오는 운명을 막지 못한다! 그래도 정 덤비겠다면 어디 마음껏 해보아라.', '', 39653),
(186838, 'koKR', '산산조각!', '산산조각!', 39653),
(186503, 'koKR', '다시 만났군. 애석하게도.', '', 39653),
(186141, 'koKR', '변명은 집어치워라. 주인님께 바칠 령 헌금을 채우지 못하면 이 하찮은 마을의 주민들을 모조리 잿불 지구로 추방할 테다.', '', 39653),
(185843, 'koKR', '', '왕자가... 진짜... 배신자다...', 39653),
(184896, 'koKR', '오류: 겸손 절차가 종료됐습니다.', '', 39653),
(184548, 'koKR', '하! 그 따위는 우리 용이 박살 낼 거다!', '', 39653),
(184516, 'koKR', '그래, 자네가 이겼네. 어디 질릴 때까지 찔러 보게나.', '', 39653),
(184515, 'koKR', '계속 그러는 이유가 뭔가?', '', 39653),
(184514, 'koKR', '오늘 편히 보내긴 글렀구먼.', '', 39653),
(184513, 'koKR', '자네를 위해 한 잔 남겨두겠네.', '', 39653),
(184512, 'koKR', '몸조심하게.', '', 39653),
(184511, 'koKR', '몸 성히 돌아오게나.', '', 39653),
(184510, 'koKR', '그냥 본토로 돌아가고 싶은 마음뿐이네.', '', 39653),
(184509, 'koKR', '다 끝나면 한잔 걸쳐야겠구먼.', '', 39653),
(184508, 'koKR', '아이언포지를 떠나는 게 아니었는데!', '', 39653),
(184507, 'koKR', '전 당신의 현재 행동을 자동화할 수 있어요. 한번 보실래요?', '', 39653),
(184506, 'koKR', '필요하신 거라도 있나요? 구상 좀 하려니까 원!', '', 39653),
(184505, 'koKR', '지금 저 놀리시는 거예요?', '', 39653);
INSERT INTO `broadcast_text_locale` (`ID`, `locale`, `Text_lang`, `Text1_lang`, `VerifiedBuild`) VALUES
(184504, 'koKR', '어떻게 됐는지 알려주세요!', '', 39653),
(184503, 'koKR', '재밌는 물건들 기대할께요! ', '', 39653),
(184502, 'koKR', '쉬엄쉬엄 하세요. 표본은 항상 채취하시고요!', '', 39653),
(184501, 'koKR', '오우거들에게 과학의 힘을 보여주죠!', '', 39653),
(184500, 'koKR', '강령술은 과학에 비하면 아무것도 아니지요!', '', 39653),
(184499, 'koKR', '기계공학으로 해결 못 할 문제는 없어요!', '', 39653),
(184498, 'koKR', '오우거 녀석들과 있을 걸 그랬습니다.', '', 39653),
(184497, 'koKR', '어머니께서 당신 같은 신병을 조심하라고 하셨죠.', '', 39653),
(184495, 'koKR', '이런 장난을 치려고 그 먼 길을 오신 겁니까?', '', 39653),
(184491, 'koKR', '암흑 마법을 멀리하십시오.', '', 39653),
(184487, 'koKR', '오우거를 조심하십시오.', '', 39653),
(184485, 'koKR', '몸조심하십시오.', '', 39653),
(184484, 'koKR', '당신은 진정한 영웅입니다.', '', 39653),
(184483, 'koKR', '최선을 다해 돕겠습니다.', '', 39653),
(184482, 'koKR', '동료들을 구해야 합니다.', '', 39653),
(184481, 'koKR', '다음 대련 때 두고 보시지요.', '', 39653),
(184480, 'koKR', '쿡쿡 찌르기 연습은 그쯤이면 충분히 하신 것 같습니다. 이제 좀 쉬시는 게 어떨지요?', '', 39653),
(184479, 'koKR', '상급 장교는 온종일 이런 짓만 하는 겁니까?', '', 39653),
(184478, 'koKR', '얼라이언스를 위하여!', '', 39653),
(184477, 'koKR', '우린 함께 강해질 겁니다.', '', 39653),
(184476, 'koKR', '계속 활약해 주십시오!', '', 39653),
(184473, 'koKR', '머지않아 원정대를 구할 수 있을 겁니다!', '', 39653),
(184472, 'koKR', '무엇이든 돕겠습니다.', '', 39653),
(184471, 'koKR', '병사 콜, 임무 보고합니다!', '', 39653),
(184469, 'koKR', '', '함께라면 극복해낼 수 있네.', 39653),
(184465, 'koKR', '', '의식을 멈추기 전까지 쉴 순 없네.', 39653),
(184463, 'koKR', '', '오우거와 강령술이라니. 위험한 조합이군.', 39653),
(184462, 'koKR', '', '풋내기 신병 시절이 떠오르는군. 자네와 똑같았지... 지금은 철이 들었지만.', 39653),
(184461, 'koKR', '', '필요한 게 있나, 신병? 거대한 망치맛을 보고 싶은 건가?', 39653),
(184460, 'koKR', '', '잘했네. 내 심기를 거스르는 법을 알아냈군.', 39653),
(184459, 'koKR', '', '경계를 늦추지 말게.', 39653),
(184458, 'koKR', '', '멋대로 자리를 이탈하진 말게.', 39653),
(184455, 'koKR', '', '조심하게. 모두의 목숨이 달려 있네.', 39653),
(184454, 'koKR', '', '우리에겐 완수할 임무가 있네.', 39653),
(184453, 'koKR', '', '얼라이언스는 누구도 버리지 않네.', 39653),
(184452, 'koKR', '', '실종된 원정대를 찾아낼 걸세.', 39653),
(184451, 'koKR', '', '일어나라, 아제로스의 용사여. 야생 사냥단의 사냥꾼으로서, 밤의 궁정의 용사로서, 몽환숲의 수호자로서. ', 39653),
(184450, 'koKR', '', '[DNT] By oath, we stand beside you.', 39653),
(184449, 'koKR', '', '령의 힘으로 우리의 축복을 내리노라. 영혼으로 포용하고, 서약으로 함께할지니.', 39653),
(184448, 'koKR', '', '넌 필멸자의 생에 많은 업적을 세웠다. 그대를 아군으로 부를 수 있다니 행운이 아닐 수 없구나.', 39653),
(184430, 'koKR', '이 필멸자마저 주인의 꼭두각시로 전락하게 둘 순 없지.', '', 39653),
(184166, 'koKR', '주인님의 앞길을 막지 마!', '주인님의 앞길을 막지 마!', 39653),
(184159, 'koKR', '', '한때는 침입자를 막아주는 수호자였는데. 그런 녀석들도 쓰러뜨려야 한다니... 애석할 따름이야.', 39653),
(184144, 'koKR', '', '우리 의회가 쓰러지고난 뒤 주변 동물들이 흉포하게 변해버렸다. 야수들을 처치하고 눈의 의회를 도와다오.', 39653),
(184011, 'koKR', '잘했네, 사람들을 구하고 거미까지 처리하느라 수고 많았네.', '', 39653),
(184010, 'koKR', '', '빛이여! 오셨군요!', 39653),
(184009, 'koKR', '', '불쌍한 생명들... 도와줄 수가 없다니...', 39653),
(183971, 'koKR', '', '비켜라, 작은 거미들아!', 39653),
(183927, 'koKR', '피조물들이여! 물러서지 마라! 승리가 목전으로 다가왔다!', '피조물들이여! 물러서지 마라! 승리가 목전으로 다가왔다!', 39653),
(183793, 'koKR', '', 'UNUSED', 39653),
(182903, 'koKR', '', '경계할 필요는 없다. 보다시피 너에게 손님으로서 예우를 다하라고 경비대에 일러뒀으니 말이야.', 39653),
(182902, 'koKR', '', '따라오거라. 편히 얘기할 수 있는 곳으로 가자꾸나.', 39653),
(182901, 'koKR', '', '기다리고 있었다.', 39653),
(182496, 'koKR', '그럼 다음에 만나지. 네가 살아 있는다면.', '', 39653),
(182495, 'koKR', '아직 목숨이 붙어 있다니. 놀랍군.', '', 39653),
(180725, 'koKR', '무엇에 매달릴지 신중히 선택하게. 단, 그다음에는 전력을 쏟아 매달리고 절대로 놓쳐선 아니 되네. 아무리 고난이 닥치더라도 말이지.', '', 39653),
(180243, 'koKR', '내게 뭘 해줄 수 있나?', '', 39653),
(179772, 'koKR', '소원대로 해주마, 시종장.', '', 39653),
(179770, 'koKR', '그분은 네 주인이시기도 하다, 이 배신자 녀석! 당장 놓아라!', '', 39653),
(179769, 'koKR', '으아아아!', '', 39653),
(179768, 'koKR', '으아아아아!', '', 39653),
(179767, 'koKR', '으아아아!', '', 39653),
(179766, 'koKR', '반란군이군. 밟고 지나가든 통과하든 마음대로 해라. 놈들은 감히- 으악!', '', 39653),
(179765, 'koKR', '시종장님! 전방이 소란스럽습니다. 싸움 같습니다만.', '', 39653),
(179764, 'koKR', '반란과 관련된 소문은 심하게 부풀려져 있다. 전부 통제 하에 있어.', '', 39653),
(179763, 'koKR', '주인님께서 에테르를 착복하신다는 소리를 지껄이더군. 한정된 자원을 배급해야 하니 그런 것이거늘.', '', 39653),
(179761, 'koKR', '[DEPRECATED] My Master, the supreme Sire Denathrius, has a plan to see us through these dark times.', '', 39653),
(179758, 'koKR', '[DEPRECATED] You two, dredgers, leave that mortal alone. They are under the protection of the Master.', '', 39653),
(179519, 'koKR', '내 존재 이유는 이곳을 해하려는 자들로부터 수호하는 것일세. 그게 설령 주인일지라도.', '', 39653),
(179518, 'koKR', '내가 섬기는 건 주인이 아니라 레벤드레스일세.', '', 39653),
(179517, 'koKR', '해야 할 일을 할 뿐.', '', 39653),
(179516, 'koKR', '확실한 죽음도 영원한 고통도, 임무를 포기할 이유는 되지 않는다네.', '', 39653),
(179515, 'koKR', '반란군에 온 것을 환영하네.', '', 39653),
(179514, 'koKR', '희망이 있어야만 책무를 다할 수 있는 건 아닐세.', '', 39653),
(179513, 'koKR', '주인을 막아야 하네.', '', 39653),
(179512, 'koKR', '', '하늘은 내 군대가 지배한다. 우리가 장악했지.', 39653),
(179511, 'koKR', '', '넌 주인님의 영지를 밟고 있다. 신중히 행동하도록.', 39653),
(179510, 'koKR', '', '흠. 나락 방랑자로군.', 39653),
(179509, 'koKR', '', '명심해라. 우리가 늘 지켜보고 있다.', 39653),
(179508, 'koKR', '', '명령 집행에 의심 따윈 필요없다.', 39653),
(179507, 'koKR', '', '내 충성심에는 흔들림이 없다.', 39653),
(179506, 'koKR', '', '나는 주인님을 섬긴다.', 39653),
(179292, 'koKR', '사라진 원정대원을 찾아 이들을 고향으로 데려와야 합니다. 얼라이언스를 위하여!', '', 39653),
(179290, 'koKR', '늑대인간의 저주가 고향 왕국 길니아스를 황폐하게 만들었지만, 당신은 그 야성적인 분노를 적을 향한 무기로 사용하는 법을 익혔습니다.', '', 39653),
(179289, 'koKR', '여느 판다렌이 그렇듯, 당신은 유랑도 셴진 수의 등에서 화합을 이룬 삶을 살아왔습니다. 하지만 담대한 정신을 가진 당신은 모험을 갈망했습니다.', '', 39653),
(179288, 'koKR', '악마의 타락에 잠식된 먼 세계를 빠져나온 당신의 동족 드레나이는 굳건한 동맹 사이에서 새로운 고향을 찾았습니다.', '', 39653),
(179287, 'koKR', '노움의 일원인 당신은 비록 키는 작지만 비할 데 없는 천재성과 확고한 신념으로 다른 동맹과 어깨를 나란히 할 만한 실력을 갖췄습니다.', '', 39653),
(179286, 'koKR', '장대한 역사를 자랑하며 신출귀몰한 나이트 엘프의 일원인 당신은 동맹을 돕고 자연을 지키기 위해 신성한 숲을 떠나 여정에 올랐습니다.', '', 39653),
(179285, 'koKR', '아이언포지의 강인하고 의연한 드워프를 대표하는 당신은 산에서 나와 어떤 고난이든 극복할 준비를 마쳤습니다.', '', 39653),
(179282, 'koKR', '가장 강한 인간 왕국 중 하나인 스톰윈드는 용맹한 기사와 전설적인 영웅이 남긴 오랜 전통을 따르고 있습니다.', '', 39653),
(178922, 'koKR', '', '엘룬이시여, 우리를 보호하소서!', 39653),
(178905, 'koKR', '약탈자와 도적 놈들이군. 몇 안 남은 령 저장소를 습격하기 전에 막아라.', '', 39653),
(178904, 'koKR', '외람되오나 아뢸 말씀이 있습니다.', '', 39653),
(178902, 'koKR', '그렇지만 네가 우릴 도와 대의에 동참한다면 기쁜 마음으로 지원을 해주겠다.', '', 39653),
(178901, 'koKR', '이 가뭄이 내 백성을 절망의 나락에 빠뜨렸다.', '', 39653),
(178899, 'koKR', '아! 난공불락의 감옥에서 탈출한 필멸자로군. 살아있는 영혼이 불멸의 영역에 희망을 돌려놓는 형국 아닌가.', '', 39653),
(178898, 'koKR', '안타깝게도 레벤드레스가 이 위기에서 살아남으려면 더욱 많은 희생이 따를 것이다.', '', 39653),
(178897, 'koKR', '령이 부족해지고 새로운 영혼의 유입이 끊기면서 우리 모두 끔찍한 고난에 봉착했지.', '', 39653),
(178896, 'koKR', '나의 아이들아. 지금껏 어떤 고통을 감내해왔는지 안다.', '', 39653),
(178796, 'koKR', '의식이 시작됐군요... 녀석들이 모아둔 생명력으로 용을 부활시키려 합니다!', '', 39653),
(178794, 'koKR', '놈들의 암흑 마법에 우리 같은 제물이 필요한 모양입니다. 곧 의식을 거행해서--', '', 39653),
(178793, 'koKR', '알겠습니다, 어머-- 아니, 개릭 대장님! 오우거들이 강령술로 용을 부활시키고 있습니다.', '', 39653),
(178668, 'koKR', '어서 준비하시죠. 시종장님이 오셨습니다.', '', 39653),
(178667, 'koKR', '멈춰라, 미물들아. 죄인이 아니라 손님이니라.', '', 39653),
(178652, 'koKR', '최종 판결은 주인님께서 담당하십니다. 이곳을 다스리는 분이자, 영혼을 포용하여 고문관이자 죄악의 포식자인 벤티르로 거듭날 수 있게 해주시는 분이죠.', '', 39653),
(178651, 'koKR', '저 죄악석 하나하나가 이곳에 와서 죄를 씻어내고 종국에는 다른 곳으로 떠났거나 벤티르로서의 역할을 받아들인 영혼들을 상징합니다.', '', 39653),
(178645, 'koKR', '염려하실 건 없습니다. 이 수많은 죄악석을 보면 아시겠지만, 구원의 길은 분명 열려있죠.', '', 39653),
(178644, 'koKR', '새로 들어온 영혼이시니 설명해드리자면 이곳은 고통과 속죄의 장소입니다.', '', 39653),
(178545, 'koKR', '얼라이언스의 막강한 힘이 네놈들을 쓸어버릴 것이다!', '', 39653),
(178544, 'koKR', '네 영혼을 취하고 용을 되살릴 거다!', '', 39653),
(178111, 'koKR', '도와주세요. 잡아먹히고 싶지 않습니다.', '', 39653),
(176877, 'koKR', '', '', 39653),
(176876, 'koKR', '', '', 39653),
(176727, 'koKR', '', '', 39653),
(176725, 'koKR', '좀 더 버텨보게!', '', 39653),
(176724, 'koKR', '', '', 39653),
(176723, 'koKR', '', '', 39653),
(176722, 'koKR', '', '', 39653),
(176721, 'koKR', '', '', 39653),
(176720, 'koKR', '', '', 39653),
(176719, 'koKR', '', '', 39653),
(176256, 'koKR', '', '', 39653),
(176255, 'koKR', '', '', 39653),
(175796, 'koKR', '', '', 39653),
(175226, 'koKR', '', '조심해라. 느린 녀석이긴 해도 어물쩍거렸다간 그대로 붙잡히게 될 테니.', 39653),
(175225, 'koKR', '', '대지공포? 녀석이 냄새를 맡기 전에 나락 깊숙한 곳으로 들어가야 한다.', 39653),
(174800, 'koKR', '', '', 39653),
(174799, 'koKR', '', '', 39653),
(174783, 'koKR', '조심하십시오. 느린 녀석이긴 해도, 어물쩍거렸다간 그대로 붙잡히게 될 테니.', '', 39653),
(174781, 'koKR', '대지공포? 녀석이 냄새를 맡기 전에 나락 깊숙한 곳으로 들어가야 합니다.', '', 39653),
(174778, 'koKR', '', '', 39653),
(170512, 'koKR', '당신은 용감한 신병으로서 구출 임무를 수행하기 위해 스톰윈드에서 출항했습니다.', '', 39653),
(170509, 'koKR', '미지의 섬을 탐험하기 위해 파견되었던 얼라이언스 원정대가 최근 실종됐습니다.', '', 39653),
(170508, 'koKR', '당신은 아제로스 전역에서 용기와 정의를 추구하는 왕국들의 연합인 고결한 얼라이언스의 병사입니다.', '', 39653);
